he Caldari Navy, and only factions or persons in very good standing with the Caldari State can acquire one. The Moa was designed as an all-out combat ship, and its heavy armament allows the Moa to tackle almost anything that floats in space. Threat level: Deadly',1785,199.86,10100000,101000,250,1,1,0,0,NULL,0.07),(15322,668,'Amarr Navy Maller','The Maller is the largest cruiser class used by the Amarrians. It is mainly used for military duty, although a few can be found in the private sector acting as escort ships for very important dispatches. In the Amarr Imperial Navy, the Maller is commonly used as the spearhead for large military operations. Threat level: Deadly',1729,134.43,12750000,118000,280,1,4,0,0,NULL,0.07),(15323,668,'Ammatar Navy Maller','The Maller is the largest cruiser class used by the Amarrians. It is mainly used for military duty, although a few can be found in the private sector acting as escort ships for very important dispatches. In the Amarr Imperial Navy, the Maller is commonly used as the spearhead for large military operations. Threat level: Deadly',1739,134.43,12750000,118000,280,1,4,0,0,NULL,0.07),(15324,705,'Republic Fleet Rupture','The Rupture is slow for a Minmatar ship, but it more than makes up for it in power. The Rupture has superior firepower and is used by the Minmatar Republic both to defend space stations and other stationary objects and as part of massive attack formations. Threat level: Deadly',1885,109,11500000,96000,300,1,2,0,0,NULL,0.07),(15325,678,'Gallente Navy Thorax','The Thorax-class cruisers are the latest combat ships commissioned by the Federation. In the few times it has seen action since its christening, it has performed admirably. The hordes of combat drones it carries allow it to strike against unwary opponents far away and to easily fight many opponents at the same time. Threat level: Deadly',1804,167.24,12000000,112000,265,1,8,0,0,NULL,0),(15326,674,'Caldari Navy Scorpion','The first Scorpion-class battleship was launched only a couple of years ago, and those that have been built are considered to be prototypes. Little is known of its capabilities, but what has been garnered suggests that the Scorpion is crammed to the brink with sophisticated hi-tech equipment that few can match. Threat level: Deadly',50,250,115000000,1040000,550,1,1,0,0,NULL,0.07),(15327,706,'Republic Fleet Typhoon','The Typhoon class battleship has an unusually strong structural integrity for a Minmatar ship. Threat level: Deadly',2160,500,100000000,920000,625,1,2,0,0,NULL,0.07),(15328,667,'Amarr Navy Armageddon','The mighty Armageddon class is the main warship of the Amarr Empire. Its heavy armaments and strong front are specially designed to crash into any battle like a juggernaut and deliver swift justice in the name of the Emperor. Threat level: Deadly',2240,250,110000000,1100000,600,1,4,0,0,NULL,0.07),(15329,667,'Ammatar Navy Armageddon','The mighty Armageddon class is the main warship of the Amarr Empire. Its heavy armaments and strong front are specially designed to crash into any battle like a juggernaut and deliver swift justice in the name of the Emperor. Threat level: Deadly',297,250,110000000,1100000,600,1,4,0,0,NULL,0.07),(15330,680,'Gallente Navy Dominix','The Dominix is one of the old warhorses that dates backs to the Gallente-Caldari War. The Dominix is no longer regarded as the top-of-the-line battleship, but this by no means makes it obsolete. Its formidable hulk and powerful weapon batteries means that anyone not in the largest and latest battleships will regret that they ever locked into combat with it. Threat level: Deadly',2138,250,105000000,1010000,600,1,8,0,0,NULL,0),(15331,526,'Metal Scraps','This mechanical hardware has obviously outlived its use, and is now ready to be recycled. Many station maintenance departments use the material gained from recycling these scraps to manufacture steel plates which replace worn out existing plates in the station hull. Most station managers