 honor to command, let alone own, one of these majestic and powerful battleships. These metallic monstrosities see to it that the word of the Emperor is carried out among the denizens of the Empire and beyond. Threat Level: Deadly',2239,400,107500000,1150000,675,1,4,0,0,NULL,0.07),(15337,680,'Gallente Navy Fleet Commander','The Megathron has established itself as one of the most feared and respected battleships around. Since its first appearance almost two decades ago it has seen considerable service in the troublesome regions on the outskirts of the Federation, helping to expand and defend Gallentean influence there.\n\nThe Federal Issue is a unique ship, commissioned by Gallentean president Foiritan as an honorary award for given to those individuals whose outstanding achivements benefit the entire Federation.  Threat level:  Deadly',2354,250,102500000,1140000,675,1,8,0,0,NULL,0.07),(15338,674,'Caldari Navy Fleet Commander','The Raven is the powerhouse of the Caldari Navy. With its myriad launcher slots and powerful shields, few ships can rival it in strength or majesty. Threat level: Deadly',43,250,110000000,1080000,665,1,1,0,0,NULL,0.07),(15341,706,'Republic Fleet Command Ship','The Tempest battleship can become a real behemoth when fully equipped.\nThreat level: Deadly',2161,250,102500000,850000,600,1,2,0,0,NULL,0.07),(15342,683,'Republic Fleet Squad Leader','A Squad Leader controls a small unit of ships during battle. Seldom are they found without a few escorts with them. Threat level: Deadly.',1891,37.07,1100000,27289,130,1,2,0,0,NULL,0),(15343,705,'Republic Fleet Raid Leader','Raid Leaders are high ranking commanding officers within the Fleet.',1886,131,10250000,89000,440,1,2,0,0,NULL,0),(15344,665,'Amarr Navy Squad Leader','A Squad Leader controls a small unit of ships during battle. Seldom are they found without a few escorts with them. Threat level: Deadly.',1734,40,1425000,28600,135,1,4,0,0,NULL,0),(15345,677,'Gallente Navy Squad Leader','A Squad Leader 