o was for a time the 6th most wanted man within the Gallente Federations. Garuzzo was a ruthless murderer and vagabond, who had terrorized over a dozen systems with random attacks and lootings of unwary travelers. Hari was hired by the family of one of the victims, and eventually caught up with Garuzzo and his gang, who were no match for the talented Caldari pilot.\n\nToday Hari is best known for his dealings with wealthy businessmen who pay him well to do their dirty work.  Threat level: Deadly',49,199.86,10100000,101000,250,1,1,0,0,NULL,0.07),(15391,817,'Pierre Turon','Pierre used to be an infamous pirate within the Gallente Federation, but was eventually captured by the authorities and sentenced to 20 years in prison. He served half of his sentence before he was released due to good behavior. Afterwards he vowed to behave himself, and stay away from the dark life of the pirate which he had once led, mainly for the sake of his wife and children.\n\nToday Pierre is best known as a bounty hunter who specializes in assassinating pirates.  He works only for trustworthy Gallenteans who have no obvious connections to the underworld, and prides himself with his current good relationship with the Gallentean authorities.  \n\n\n Threat level: Deadly',63,167.24,12000000,112000,265,1,8,0,0,NULL,0),(15392,818,'Zack Mead','Zack Mead is a small time criminal turned bounty hunter. He used to work as an agent for the Serpentis but eventually switched to the job as a freelancer once he had the funds to purchase his own frigate. Many wealthy Gallenteans turn to men such as Zack when they feel the law is not adequate in dealing with their problem. Threat level: Very high',315,44,1680000,17400,90,1,1,0,0,NULL,0.07),(15393,816,'Jared Kalem','Jared is a former member of the Angel Cartel who turned freelance bounty hunter. Today he is known to work for anyone, anywhere, if the price is right. Concord advice utmost caution when approaching this outlaw. Threat level: Deadly',335,500,19000000,19000000,120,1,2,0,0,NULL,0.07),(15394,816,'Taisu Magdesh','Taisu comes from a powerful family of mercenaries within the Mordus Legion. Famous for their \"no questions asked\" approach, the Magdesh family is prized as first class fighter pilots, who normally lead a fleet of warships. Only powerful leaders or extremely wealthy individuals can afford the likes of Taisu, who commands a deadly Raven battleship. Threat level: Deadly',43,250,110000000,1080000,665,1,1,0,0,NULL,0.07),(15395,337,'Construction Freight','Convoys are a common sight in the universe of EVE, ferrying goods from one place to another. Convoys usually have armed escorts, so attacking them is risky.',328,553,110500000,1105000,4000,1,8,0,0,NULL,0),(15396,821,'General Luther Veron','This is General Luther Veron\'s personal battleship, fitted with the very finest modules available in the Gallente Federation. ',2354,250,102500000,1140000,675,1,8,0,0,NULL,0.07),(15397,205,'Luther Veron\'s Modified Heat Sink','Dissipates energy weapon damage efficiently, thus allowing them to be fired more rapidly. Penalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',1046,1,1,5,0,1,NULL,24960,0,NULL,0.07),(15399,53,'Luther Veron\'s Modified Dual Heavy Beam Laser','This heavy beam laser uses two separate laser focusing systems to reduce the cool down period between shots. A great weapon for medium to long range encounters.\n\nRequires frequency crystal ammo types: Gamma, Infrared, Microwave, Multifrequency, Radio, Standard, Ultraviolet, Xray.',361,0,1,20,1,1,NULL,600000,0,NULL,0.07),(15401,53,'Luther Veron\'s Modified Mega Beam Laser','A super-heavy beam laser designed for medium to long range engagements.\n\nRequires frequency crystal ammo types: Gamma, Infrared, Microwave, Multifrequency, Radio, Standard, Ultraviolet, Xray.',363,0,1,20,1,1,NULL,1200000,0,NULL,0.07),(15403,53,'Luther Veron\'s Modified Tachyon Beam Laser','An ultra-heavy beam laser designed for medium to long range engagements.\n\nRequires frequency crystal ammo types: Gamma, Infrared, Microwave, Multifrequency, Radio, Standard, Ultraviolet, Xray.',364,0,1,20,1,1,NULL,1500000,0,NULL,0.07),(15405,72,'Luther Veron\'s Modified Large EMP Smartbomb','Radiates an omnidirectional pulse from the ship that causes EM damage to surrounding vessels.',2032,1000,100,50,0,1,NULL,312496,0,NULL,0.07),(15407,77,'Luther Veron\'s Modified Invulnerability Field','Boosts shield resistance against all damage types. Penalty: Using more than one type of this module, or similar modules that affect the same resistance type, will result in a penalty to the boost you get on that type of resistance.',1045,0,10000,5,0,1,1,63062,0,NULL,0.07),(15408,38,'Luther Veron\'s Modified Shield Extender','Increases the maximum strength of the shield.',1044,0,0,20,0,1,NULL,167344,0,NULL,0.06),(15410,314,'Neophite','This priceless mineral was discovered by a band of Gallente explorers during the Caldari-Gallente war over a century ago. Closely related to morphite, its composition is only slightly different yet enough so that it has not been able to serve the same function. Only a few samples of it are known to remain intact, in the possession of some of the most wealthy collectors in the known universe. ',2103,0,1,0.1,0,1,NULL,0,1,492,0),(15411,667,'Amarr Luxury Yacht','The Opux Luxury Yacht cruisers are developed and produced by the Gallente, for the wealthy citizens and entertainment industry within the Federation. Some Amarrian nobels have taken up buying these luxury yachts for their personal pleasure, and have given them slight modifications to bring an Amarrian \"feel\" to them.',330,287,13075000,115000,1750,1,8,0,0,NULL,0),(15412,818,'Andres Sikvatsen','Andres Sikvatsen is a small time criminal turned bounty hunter. He used to work as an agent for the Angel Cartel but eventually switched to the job of a freelancer once he had the funds to purchase his own frigate. Many wealthy individuals turn to men such as Andres when they feel the law is not adequate in dealing with their problem. Threat level: Very high',339,43.6,1200000,19100,110,1,2,0,0,NULL,0.07),(15413,821,'Commander Terachi TashMurkon','Commander Terachi TashMurkon is one of the highest ranking officers within the Tash-Murkon militia. He received this magnificent battleship as a personal gift from the Emperor himself, fitted with the very finest modules the Imperial Armaments had to offer. Few pilots in the galaxy would ever dare face this monstrosity in combat.',2239,400,107500000,1150000,675,1,4,0,0,NULL,0.07),(15414,821,'Warlord Shaqil Dragat','Shaqil Dragat is one of the most prominent Warlords within the Brutor Tribe of the Minmatar Republic. Known for his enormous size, even for a Brutor, Shaqil is feared not only for the fleet of warships he commands, but also in person. He also commands one of the most devastating battleships in the entire Minmatar fleet.',48,250,102500000,850000,600,1,2,0,0,NULL,0.07),(15415,821,'Fleet Commander Naiyon Tai','Fleet Commander Naiyon Tai is one of the highest ranking officers within the Caldari Navy. Operating one of the finest and most well equipped battleships the Caldari Navy has to offer, Naiyon is not to be taken lightly. ',43,250,110000000,1080000,665,1,1,0,0,NULL,0.07),(15416,302,'Naiyon\'s Modified Magnetic Field Stabilizer','Grants a bonus to the firing rate and damage of hybrid turrets. Penalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',1046,0,0,5,0,1,NULL,24994,0,NULL,0.07),(15418,77,'Naiyon\'s Modified Invulnerability Field','Boosts shield resistance against all damage types. Penalty: Using more than one type of this module, or similar modules that affect the same resistance type, will result in a penalty to the boost you get on that type of resistance.',1045,0,10000,5,0,1,1,63062,0,NULL,0.07),(15419,65,'Naiyon\'s Modified Stasis Webifier','Reduces the maximum speed of a ship by employing micro energy streams which effectively entangle the target temporarily, thereby slowing it down.',1284,500,0,5,0,1,NULL,22488,0,NULL,0.07),(15421,74,'Naiyon\'s Modified 425mm Railgun','This large battleship-sized weapon packs quite a punch. Railguns use magnetic rails to fire solid chunks of matter at hypersonic speed. The accurate range of railguns is very good, but due to technical limitations it cannot use onboard guidance. This results in a fairly rapid drop in accuracy at extreme ranges.\n\nRequires hybrid ammo types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',366,1000,750,20,2,1,NULL,1500000,0,NULL,0.07),(15423,74,'Naiyon\'s Modified 350mm Railgun','The 350mm railgun works much the same as its big brother except that it is considerably faster but also less powerful. The accurate range of railguns is very good, but due to technical limitations it cannot use onboard guidance. This results in a fairly rapid drop in accuracy at extreme ranges.\n\nRequires hybrid ammo types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',2267,10,50,20,4,1,NULL,1000000,0,NULL,0.07),(15425,285,'Naiyon\'s Modified Co-Processor','Increases CPU output.',1405,0,0,5,0,1,NULL,14996,1,NULL,0.07),(15427,53,'Makur\'s Modified Dual Heavy Beam Laser','This heavy beam laser uses two separate laser focusing systems to reduce the cool down period between shots. A great weapon for medium to long range encounters.\n\nRequires frequency crystal ammo types: Gamma, Infrared, Microwave, Multifrequency, Radio, Standard, Ultraviolet, Xray.',361,0,1,20,1,1,NULL,600000,0,NULL,0.07),(15429,53,'Makur\'s Modified Mega Beam Laser','A super-heavy beam laser designed for medium to long range engagements.\n\nRequires frequency crystal ammo types: Gamma, Infrared, Microwave, Multifrequency, Radio, Standard, Ultraviolet, Xray.',363,0,1,20,1,1,NULL,1200000,0,NULL,0.07),(15431,52,'Makur\'s Modified Warp Disruptor','Disrupts the target ship\'s navigation computer which prevents it from warping.',111,0,0,5,0,1,NULL,39424,0,NULL,0.07),(15433,52,'Makur\'s Modified Warp Scrambler','Disrupts the target ship\'s navigation computer which prevents it from warping or using a microwarpdrive.',3433,0,0,5,0,1,NULL,39424,0,NULL,0.07),(15435,205,'Makur\'s Modified Heat Sink','Dissipates energy weapon damage efficiently, thus allowing them to be fired more rapidly. Penalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',1046,1,1,5,0,1,NULL,24960,0,NULL,0.07),(15437,767,'Makur\'s Modified Capacitor Power Relay','Increases capacitor recharge rate at the expense of shield boosting.',1032,500,20,5,0,1,NULL,9744,0,NULL,0.06),(15439,766,'Makur\'s Modified Power Diagnostic System','Monitors and optimizes the power grid. Gives a slight boost to power core output and a minor increase in shield and capacitor recharge rate.',70,500,20,5,0,1,NULL,9920,0,NULL,0.06),(15443,55,'Shaqil\'s Modified 1200mm Artillery Cannon','One of the most powerful projectile cannons a battleship can equip.\n\nMust be loaded with any of the following projectile ammo types: Carbonized Lead, Depleted Uranium, EMP, Fusion, Nuclear, Phased Plasma, Proton, or Titanium Sabot.',380,2000,750,20,1,1,NULL,1200000,0,NULL,0.07),(15445,55,'Shaqil\'s Modified 1400mm Howitzer Artillery','The ultimate artillery cannon. It hurls death and destruction over incredible distances.\n\nMust be loaded with any of the following projectile ammo types: Carbonized Lead, Depleted Uranium, EMP, Fusion, Nuclear, Phased Plasma, Proton, or Titanium Sabot.',379,2000,1500,20,0.5,1,NULL,1500000,0,NULL,0.07),(15447,59,'Shaqil\'s Modified Gyrostabilizer','Gives a bonus to the speed and damage of projectile turrets. Penalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',1046,0,0,5,0,1,NULL,24320,1,NULL,0.07),(15449,506,'Shaqil\'s Modified Cruise Missile Launcher','A battleship mounted launcher used for long range standoffs with other battleships, but less suitable for bombardment of deployed structures. Contains a huge missile capacity, but has a slow firing rate and trouble targeting small, fast ships.\n\nCan only be fitted with cruise missiles: Cataclysm, Devastator, Paradise, Wrath, and their F.O.F. counterparts.',2530,0,0,20,1.65,1,NULL,99996,0,NULL,0.07),(15451,68,'Shaqil\'s Modified Heavy Nosferatu','Drains energy from the target ship and adds it to your own. This huge unit is designed for battleship class ships',1029,0,1000,5,0,1,NULL,987600,1,NULL,0.07),(15453,326,'Shaqil\'s Modified Energized Thermic Membrane','A enhanced version of the standard Thermic armor plating. Uses advanced magnetic Field generators to strengthen the Nanobot Plating integrity. Penalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',2066,10,1,5,0,1,NULL,75000,1,NULL,0.07),(15455,326,'Shaqil\'s Modified Energized Adaptive Nano Membrane','A enhanced version of the standard Adaptive Nano armor plating. Uses advanced magnetic Field generators to strengthen the Nanobot Plating integrity. Penalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',2066,10,1,5,0,1,NULL,100000,1,NULL,0.07),(15457,303,'Standard X-Instinct Booster','This energizing booster grants its user a vastly improved economy of effort when parsing the data streams needed to sustain space flight. The main benefit of this lie not in improved performance but less waste of transmission and extraneous micromaneuvers, making the pilot\'s ship sleeker in performance and harder to detect. The booster\'s only major drawback is the crazed notion that the pilot\'s inventory would look so much better if merely rearranged ONE MORE TIME.',3217,1,1,1,1,1,NULL,32768,1,977,0),(15458,303,'Improved X-Instinct Booster','This energizing booster grants its user a vastly improved economy of effort when parsing the data streams needed to sustain space flight. The main benefit of this lie not in improved performance but less waste of transmission and extraneous micromaneuvers, making the pilot\'s ship sleeker in performance and harder to detect. The booster\'s only major drawback is the crazed notion that the pilot\'s inventory would be look so much better if merely rearranged ONE MORE TIME.',3217,1,1,1,1,1,NULL,32768,1,977,0),(15459,303,'Strong X-Instinct Booster','This energizing booster grants its user a vastly improved economy of effort when parsing the data streams needed to sustain space flight. The main benefit of this lie not in improved performance but less waste of transmission and extraneous micromaneuvers, making the pilot\'s ship sleeker in performance and harder to detect. The booster\'s only major drawback is the crazed notion that the pilot\'s inventory would be look so much better if merely rearranged ONE MORE TIME.',3217,1,1,1,1,1,NULL,32768,1,977,0),(15460,303,'Standard Frentix Booster','This strong concoction of painkillers helps the pilot block out all inessential thought processes (along with the occasional needed one) and to focus his attention completely on the task at hand. When that task is to hit a target, it certainly makes for better aim, though it does tend to make one\'s extremities go numb for short periods.',3213,1,1,1,1,1,NULL,32768,1,977,0),(15461,303,'Improved Frentix Booster','This strong concoction of painkillers helps the pilot block out all inessential thought processes (along with the occasional needed one) and to focus his attention completely on the task at hand. When that task is to hit a target, it certainly makes for better aim, though it does tend to make one\'s extremities go numb for short periods.',3213,1,1,1,1,1,NULL,32768,1,977,0),(15462,303,'Strong Frentix Booster','This strong concoction of painkillers helps the pilot block ou