 this ancient bounty hunter.',335,500,19000000,19000000,120,1,2,0,0,NULL,0.07),(16203,816,'Kyokan','Master Bounty Hunter Kyokan is a former special ops pilot of the Mordus Legion that turned freelance bounty hunter. When his wealthy father died, he inherited a vast sum of credits, which he used to purchase a magnificent Tyrent battleship off the black market. With his valuable experience from serving as a special ops pilot, and his well fitted battleship, Kyokan is a force to be reckoned with.\n\nThe Universal League of Bounty Hunters (ULBH) awarded Kyokan the title of Master Bounty Hunter not long ago, after over a decade of service to various factions throughout the Eve universe.\n\nKyokan is most famous for his use of the \'Doom\' torpedo, which is an enhanced version of the Inferno torpedo.  He has never revealed his supplier of the famous but extremely rare torpedo, which is mainly used to rip through large structures such as outposts or battleships, but some expect them to be of Jovian origin.  The claim has never been proven though.',335,500,19000000,19000000,120,1,2,0,0,NULL,0.07),(16206,100,'Hellhound I','Heavy Attack Drone',1114,35,12000,25,1200,1,8,70000,0,NULL,0.07),(16208,818,'Ex-Secret Agent','An ex-secret agent who has turned to blackmailing his former corporation for money.',344,64,2250000,22500,75,1,2,0,0,NULL,0),(16209,817,'Ex-Elite Secret Agent','This is a recently laid off elite secret agent.',337,187,10900000,109000,120,1,2,0,0,NULL,0),(16210,805,'Spider Drone I','A popular drone amongst bounty hunters, the rare Spider drone has been sold in the thousands on the black market since it began being manufactured by CreoDron corporation. The conceptual design of it was created by the multi-awarded scientist, Yeeti Mourir. Built on the old Wasp drone model, the Spider drone sacrifices its damaging capabilities for a more powerfull force-shield and stasis webifying ability, as well as ultra fast speed.\n\nUnfortunately it is not currently available on the public market.  CreoDron and Yeeti Mourir have waged a long and ugly battle in Gallente courtrooms to try and aquire the sole manufacturing rights on the Spider drone, which has kept it off of public markets for legal reasons.  Yet that did not keep the drone from being built for the Gallente military, nor has it kept the Serpentis from aquiring hundreds of batches of the drone and smuggling it out of Gallente space for the lucrative black market.\n',2825,35,3500,250,235,1,NULL,0,0,NULL,0.07),(16211,805,'Spider Drone II','A popular drone amongst bounty hunters, the rare Spider drone has been sold in the thousands on the black market since it began being manufactured by CreoDron corporation. The conceptual design of it was created by the multi-awarded scientist, Yeeti Mourir. Built on the old Wasp drone model, the Spider drone sacrifices its damaging capabilities for a more powerfull force-shield and stasis webifying ability, as well as ultra fast speed.\n\nUnfortunately it is not currently available on the public market.  CreoDron and Yeeti Mourir have waged a long and ugly battle in Gallente courtrooms to try and aquire the sole manufacturing rights on the Spider drone, which has kept it off of public markets for legal reasons.  Yet that did not keep the drone from being built for the Gallente military, nor has it kept the Serpentis from aquiring hundreds of batches of the drone and smuggling it out of Gallente space for the lucrative black market.\n',2825,35,3500,250,235,1,NULL,0,0,NULL,0.07),(16212,687,'Khanid Wingman','This is a support ship for the Khanid Navy. Threat level: Very high',1860,40,1425000,28600,120,1,4,0,0,NULL,0.07),(16213,365,'Caldari Control Tower','At first the Caldari Control Towers were manufactured by Kaalakiota, but since they focused their efforts mostly on other, more profitable installations, they soon lost the contract and the Sukuuvestaa corporation took over the Control Towers\' development and production.\n\nRacial Bonuses:\n25% 