or storage) or a reactor (for chemically molding the materials into something else).',2602,1289,1,4000,1,1,NULL,5000000,1,488,0),(16222,417,'Light Missile Battery','A launcher array designed to fit light missiles. Fires at those the Control Tower deems its enemies.\n',2379,366,1000000,1150,5000,1,NULL,128,0,NULL,0),(16223,418,'Shield Generation Array','Aids control tower shield in some way.',2380,1263,1,1,0,1,NULL,0,0,NULL,0),(16226,816,'Kurzon Destroyer','The Kurzon Destroyer is a rare sight indeed. Purchased from the black market for a hefty price, the Kurzon Mercenary Network uses them occasionally when the stakes are very high. Zerim Kurzon himself fitted the Destroyers with hand-picked modules, making them tougher than most mercenary battleships.',335,500,100000000,980000,120,1,2,0,0,NULL,0.07),(16227,419,'Ferox','Designed as much to look like a killing machine as to be one, the Ferox will strike fear into the heart of anyone unlucky enough to get caught in its crosshairs. With the potential for sizable armament as well as tremendous electronic warfare capability, this versatile gunboat is at home in a great number of scenarios.\n\nBattlecruiser Skill Bonus: 10% bonus to Medium Hybrid Turret optimal range and 5% bonus to all Shield resistances per level\n\n99% reduction in the CPU need of Warfare Link modules.',2382,363,14010000,252000,345,1,1,24000000,1,471,0.07),(16228,489,'Ferox Blueprint','',1748,0,0,0.01,0,1,NULL,240000000,1,590,0),(16229,419,'Brutix','One of the most ferocious war vessels to ever spring from Gallente starship design, the Brutix is a behemoth in every sense of the word. When this hard-hitting monster appears, the battlefield takes notice.\n\nBattlecruiser Skill Bonus:  5% bonus to Medium Hybrid Turret damage and 7.5% bonus to Armor Repairer effectiveness per level\n\n99% reduction in the CPU need of Warfare Link modules.',2383,266,13250000,270000,400,1,8,27000000,1,472,0.07),(16230,489,'Brutix Blueprint','',1748,0,0,0.01,0,1,NULL,270000000