rade module power needs.',2224,1,0,1,0,1,NULL,0,1,1158,0.05),(16246,749,'Hardwiring - Zainou \'Gnome\' KVA2000','Improved skill at regulating shield capacity. 5% Bonus to shield capacity.',2224,1,0,1,0,1,NULL,0,1,1167,0.05),(16247,749,'Hardwiring - Zainou \'Gnome\' KXA2000','A neural Interface upgrade that reduces the capacitor need for shield emission system modules.',2224,1,0,1,0,1,NULL,0,1,1175,0.05),(16248,749,'Hardwiring - Zainou \'Gnome\' KYA2000','A neural Interface upgrade that boosts the recharge rate of the shields of the pilots ship.',2224,1,0,1,0,1,NULL,0,1,1184,0.05),(16249,742,'Hardwiring - Zainou \'Gnome\' KZA2000','A neural Interface upgrade that lowers turret CPU needs.',2224,1,0,1,0,1,NULL,0,1,1186,0.05),(16250,817,'Maylan Falek','A shroud of secrecy surrounds Maylans identity. All that is known is he is a top secret agent working for the Minmatar Republic military, with close ties to certain high ranking officials of the Minmatar Republic. His ethniticity is most likely that of the Krusual tribe. ',1885,109,11500000,96000,300,1,2,0,0,NULL,0.07),(16251,817,'Freedom Patriot','The Freedom Patriot is a Bellicose class cruiser used by the Minmatar Freedom Fighter network. Threat level: Deadly',303,131,10750000,85000,420,1,2,0,0,NULL,0.07),(16252,816,'Freedom Liberty','The Liberty battleship is one of the biggest assets of the Minmatar Freedom Fighter network. After it had aquired massive support within the Minmatar Republic, it could finally afford these gigantic Typhoon class battleships, which were nicknamed \'Liberty\'. Threat level: Deadly',301,250,100000000,920000,625,1,2,0,0,NULL,0.07),(16253,283,'Minmatar Emissary','This is an emissary from the Minmatar Republic.',2536,0,70,0.1,0,1,NULL,0,1,NULL,0),(16254,817,'Kuzak Obliterator','The Kuzak Obliterator is a deadly cruiser class ship, designed as a lightly armored vessel that can pack a serious punch. Threat level: Extreme',336,101,12155000,99000,450,1,2,0,0,NULL,0.07),(16256,817,'Nugoeihuvi Agent','A Nugoeihuvi secret agent. Threat level: Deadly',41,221.9,13000000,107000,305,1,1,0,0,NULL,0.07),(16258,422,'Argon Gas','A colorless and odorless inert gas; one of the six inert gases.',NULL,0,0,0.1,0,1,NULL,0,0,NULL,0),(16259,422,'Xenon','Xenon is a member of the zero-valence elements that are called noble or inert gases, however, \"inert\" is not a completely accurate description of this chemical series since some noble gas compounds have been synthesized. In a gas filled tube, xenon emits a blue glow when the gas is excited by electrical discharge. Using tens of gigapascals of pressure, xenon has been forced into a metallic phase.[3] Xenon can also form clathrates with water when atoms of it are trapped in a lattice of the water molecules.',NULL,0,0,0.1,0,1,NULL,0,0,NULL,0),(16260,422,'Gaseous Neon Isotopes','Neon is the second-lightest noble gas, glows reddish-orange in a vacuum discharge tube and has over 40 times the refrigerating capacity of liquid helium and three times that of liquid hydrogen (on a per unit volume basis). In most applications it is a less expensive refrigerant than helium. Neon has the most intense discharge at normal voltages and currents of all the rare gases.',NULL,0,0,0.1,0,1,NULL,0,0,NULL,0),(16261,422,'Gaseous Krypton Isotopes','A colorless, odorless, tasteless noble gas, krypton occurs in trace amounts in the atmosphere, is isolated by fractionating liquefied air, and is often used with other rare gases in fluorescent lamps. Krypton is inert for most practical purposes but it is known to form compounds with fluorine. Krypton can also form clathrates with water when atoms of it are trapped in a lattice of the water molecules.',NULL,0,0,0.1,0,1,NULL,0,0,NULL,0),(16262,465,'Clear Icicle','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. These crystalline formations can be found scattered around many an ice field, and are known as the universe\'s primary source of helium isotopes.',2556,1,1000,1000,0,1,NULL,376000,1,493,0),(16263,465,'Glacial Mass','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. Glacial masses are known to contain hydrogen isotopes in abundance, in addition to smatterings of heavy water and liquid ozone.',2555,1,1000,1000,0,1,NULL,76000,1,493,0),(16264,465,'Blue Ice','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. Due to its unique chemical composition and the circumstances under which it forms, blue ice contains more oxygen isotopes than any other ice asteroid.',2554,1,1000,1000,0,1,NULL,76000,1,493,0),(16265,465,'White Glaze','When star fusion processes occur near high concentrations of silicate dust, such as those found in interstellar ice fields, the substance known as White Glaze is formed. White Glaze is extremely high in nitrogen-14 and other stable nitrogen isotopes, and is thus a necessity for the sustained operation of certain kinds of control tower.',2561,1,1000,1000,0,1,NULL,76000,1,493,0),(16266,465,'Glare crust','In areas with high concentrations of electromagnetic activity, ice formations such as this one, containing large amounts of heavy water and liquid ozone, are spontaneously formed during times of great electric flux. Glare crust also contains a small amount of strontium clathrates.',2559,1,1000,1000,0,1,NULL,1525000,1,493,0),(16267,465,'Dark Glitter','Dark glitter is one of the rarest of the interstellar ices, formed only in areas with large amounts of residual electrical current. Little is known about the exact way in which it comes into being; the staggering amount of liquid ozone to be found inside one of these rocks makes it an intriguing mystery for stellar physicists and chemists alike. In addition, it contains large amounts of heavy water and a decent measure of strontium clathrates.',2557,1,1000,1000,0,1,NULL,1550000,1,493,0),(16268,465,'Gelidus','Fairly rare and very valuable, Gelidus-type ice formations are a large-scale source of strontium clathrates, one of the rarest ice solids found in the universe, in addition to which they contain unusually large concentrations of heavy water and liquid ozone.',2558,1,1000,1000,0,1,NULL,825000,1,493,0),(16269,465,'Krystallos','The universe\'s richest known source of strontium clathrates, Krystallos ice formations are formed only in areas where a very particular combination of environmental factors are at play. Krystallos compounds also include quite a bit of liquid ozone.',2560,1,1000,1000,0,1,NULL,450000,1,493,0),(16272,423,'Heavy Water','Dideuterium oxide. Water with significant nuclear properties which make it extremely effective as a neutron moderator in various types of power reactors. One of the materials required to keep Control Towers online.',2698,0,0,0.4,0,1,NULL,1000,1,476,0),(16273,423,'Liquid Ozone','Liquid Ozone is used as a cleaning and disinfectant substance, and plays a vital role in ensuring the smooth day-to-day operation of a starbase. One of the materials required to keep Control Towers online.',2697,0,0,0.4,0,1,NULL,1000,1,476,0),(16274,423,'Helium Isotopes','The Helium-3 isotope is extremely sought-after for use in fusion processes, and also has various applications in the fields of cryogenics and machine cooling. One of the materials required to keep Amarr Control Towers online.',2699,0,0,0.15,0,1,NULL,1000,1,476,0),(16275,423,'Strontium Clathrates','An unstable compound of strontium molecules encased in the crystal structure of water. When fed to a Control Tower\'s force field generator, these clathrates bond with the molecules already in place in the field to create a nigh-invulnerable barrier of energy. A necessary ingredient for Control Towers to go into reinforced mode.',2696,0,0,3,0,1,NULL,1000,1,476,0),(16278,464,'Ice Harvester I','A unit used to extract valuable materials from ice asteroids.\n\nNote: 99.5% less CPU usage when fitted on a Mining Barge.',2526,25,0,100,0,1,NULL,2932662,1,1038,0.07),(16279,490,'Ice Harv