ve at fairly close ranges, but extremely deadly in terms of sheer damage output. ',2752,400,1000000,5000,2400,1,NULL,10000000,1,595,0),(17403,449,'Medium Blaster Battery','Fires a barrage of large hybrid slugs at those the Control Tower deems its enemies. Only effective at fairly close ranges, but very deadly in terms of sheer damage output. ',1215,400,1000000,1000,960,1,8,2000000,1,595,0),(17404,449,'Small Blaster Battery','Fires a barrage of medium hybrid slugs at those the Control Tower deems its enemies. Only effective at fairly close ranges, but deadly in terms of sheer damage output. ',1215,400,1000000,500,720,1,8,400000,1,595,0),(17406,430,'Large Pulse Laser Battery','Fires a pulsed energy beam using extra large sized frequency crystals at those the Control Tower deems its enemies. Effective at fairly long ranges, tracks moderately fast and has a higher rate of fire than its beam laser counterpart.Note: Placing a new type of crystal into the crystal compartment will result in the destruction of the crystal being replaced.',2751,400,1000000,5000,2,1,NULL,10000000,1,596,0),(17407,430,'Medium Pulse Laser Battery','Fires a pulsed energy beam using large sized frequency crystals at those the Control Tower deems its enemies. Effective at fairly long ranges, tracks fast and has a higher rate of fire than its beam laser counterpart.Note: Placing a new type of crystal into the crystal compartment will result in the destruction of the crystal being replaced.',1006,400,1000000,1000,4,1,4,2000000,1,596,0),(17408,430,'Small Pulse Laser Battery','Fires a pulsed energy beam using medium sized frequency crystals at those the Control Tower deems its enemies. Effective only at relatively short range, but tracks very fast and has a higher rate of fire than any other laser battery.Note: Placing a new type of crystal into the crystal compartment will result in the destruction of the crystal being replaced.',1006,400,1000000,500,6,1,4,400000,1,596,0),(17409,283,'Former Slaves','These former slaves have been cleanched of their Vitoc dependancy.',1204,0,400,1,0,1,NULL,0,0,NULL,0),(17411,438,'Ultra Fast Reactor Array','A relic of the past',2299,659,1000000,4000,1,1,NULL,819200,0,NULL,0),(17412,821,'Phi-Operation Protector','This ominous battleship has been modified somewhat. It is at the approximate center of this Deadspace Pocket.',2157,350,17500000,1140000,480,1,8,0,0,NULL,0),(17413,821,'Captain Rouge','If Angel\'s Red Light District really is the den of carnal pleasures, then this would be the head pimp.',335,350,19000000,19000000,120,1,2,0,0,NULL,0.07),(17422,494,'Angels Retirement Home','This is where elderly Angel Cartel members are supposed to enjoy the last few years of existence. It is popular amongst them to bring with them memorabilia from past conquests and even work on some projects in the quiet and solitude of the Deadspace Complexes.',2515,379,100000,100000000,10000,1,NULL,0,0,NULL,0),(17423,314,'Gallente 106 Election Holoreel','This holoreel contains most of the advertisements used in the Gallente propoganda machine for each of the candidates vying for the presidency, as well as a detailed biography of each person.',1177,0,100,0.5,0,1,NULL,0,1,492,0),(17424,314,'Amarrian Wheat','Cereal grasses have been localized on hundreds of worlds. The grains of the wheat plant make a solid foundation for the production of foodstuffs within empire space. Amarrian Wheat is known for it\'s purety, and has reputedly never been tampered with by genetic engineering.',1182,0,1000,1.15,0,1,NULL,10000,1,492,0),(17425,450,'Crimson Arkonor','While fairly invisible to all but the most experienced miners, there are significant molecular differences between Arkonor and its crimson counterpart, so-named because of the blood-red veins running through it.\n\nThe rarest and most sought-after ore in the known universe. A sizable nugget of this can sweep anyone from rags to riches in no time. Arkonor has the largest amount of megacyte of any ore, and also contains some zydrine and tritanium. The portion size for refining is 200 ore units.',1277,1,1e+35,16,0,200,NULL,3224182,1,512,0),(17426,450,'Prime Arkonor','Prime Arkonor is the rarest of the rare; the king of ores. Giving a 10% greater mineral yield than regular ark, this is the stuff that makes billionaires out of people lucky enough to stumble upon a vein.\n\nThe rarest and most sought-after ore in the known universe. A sizable nugget of this can sweep anyone from rags to riches in no time. Arkonor has the largest amount of megacyte of any ore, and also contains some zydrine and tritanium. The portion size for refining is 200 ore units.',1277,1,1e+35,16,0,200,NULL,3373716,1,512,0),(17428,451,'Triclinic Bistot','Bistot with a triclinic crystal system occurs very rarely under natural conditions, but is highly popular with miners due to its extra-high concentrations of the zydrine and megacyte minerals.\n\nBistot is a very valuable ore as it holds large portions of two of the rarest minerals in the universe, megacyte and zydrine. The portion size for refining is 200 ore units.',1273,1,1e+35,16,0,200,NULL,2200984,1,514,0),(17429,451,'Monoclinic Bistot','Monoclinic bistot is a variant of bistot with a slightly different crystal structure. It is highly sought-after, as it gives a slightly higher yield than its straightforward counterpart.\n\nBistot is a very valuable ore as it holds large portions of two of the rarest minerals in the universe, megacyte and zydrine. The portion size for refining is 200 ore units.',1273,1,1e+35,16,0,200,NULL,2301400,1,514,0),(17432,452,'Sharp Crokite','In certain belts, environmental conditions will carve sharp, jagged edges into crokite rocks, resulting in the formation of sharp crokite.\n\nCrokite is a very heavy ore that is always in high demand because it has the largest ratio of zydrine for any ore in the world. It requires 250 ore units to refine. ',1272,1,1e+35,16,0,250,NULL,1604280,1,521,0),(17433,452,'Crystalline Crokite','Crystalline crokite is the stuff of legend in 0.0 space. Not only does it give a 10% greater yield than regular crokite, but chunks of the rock glitter beautifully in just the right light, making crystalline crokite popular as raw material for jewelry.\n\nCrokite is a very heavy ore that is always in high demand because it has the largest ratio of zydrine for any ore in the world. It requires 250 ore units to refine. ',1272,1,1e+35,16,0,250,NULL,1680088,1,521,0),(17436,453,'Onyx Ochre','Shiny black nuggets of Onyx Ochre look very nice and are occasionally used in ornaments. But the great amount of nocxium is what miners are really after. Like in all else, good looks are only an added bonus.\n\nDark Ochre was for years ignored as a worthwhile ore to mine until improved refining techniques managed to extract the huge amount of nocxium inside it, the highest ratio of nocxium found in any ore in the universe. 400 ore units of Dark Ochre are needed to refine it.',1275,1,1e+35,8,0,400,NULL,807950,1,522,0),(17437,453,'Obsidian Ochre','Obsidian Ochre, the most valuable member of the Dark Ochre family, was only first discovered a decade ago. The sleek black surface of this mineral managed to reflect scanning waves, making Obsidian Ochre asteroids almost invisible. Advances in scanning technology revealed these beauties at last.\n\nDark Ochre was for years ignored as a worthwhile ore to mine until improved refining techniques managed to extract the huge amount of nocxium inside it, the highest ratio of nocxium found in any ore in the universe. 400 ore units of Dark Ochre are needed to refine it.',1275,1,1e+35,8,0,400,NULL,845350,1,522,0),(17440,454,'Vitric Hedbergite','When asteroids containing Hedbergite pass close to suns or other sources of intense heat can cause the Hedbergite to glassify. The result is called Vitric Hedbergite and has 5% better yield than normal Hedbergite.\n\nHedbergite is sought after for its high concentration of isogen, although the high portion size needed for refining makes it a bit less attractive.  Hedbergite also yields some Nocxium and a small amount of Zydrine. 500 ore units are needed to refine it.',1269,1,1e+35,3,0,500,NULL,355200,1,527,0),(17441,454,'Glazed Hedbergite','Asteroids containing this shiny ore were formed in intense heat, such as might result from a supernova. The result, known as Glazed Hedbergite, is a more concentrated form of Hedbergite that has 10% higher yield.\n\nHedbergite is sought after for its high concentration of isogen, although the high portion size needed for refining makes it a bit less attractive.  Hedbergite also yields some Nocxium and a small amount of Zydrine. 500 ore units are needed to refine it.',1269,1,1e+35,3,0,500,NULL,370560,1,527,0),(17444,455,'Vivid Hemorphite','Hemorphite exists in many different color variations. Interestingly, the more colorful it becomes, the better yield it has. Vivid Hemorphite has 5% better yield than its more bland brother.\n\nWith a large portion of nocxium the Hemorphite is always a good find. It is common enough that even novice miners can expect to run into it. Hemorphite also has a bit of tritanium and isogen as well as trace amounts of Zydrine. It requires 500 ore units to refine.',1282,1,1e+35,3,0,500,NULL,316222,1,528,0),(17445,455,'Radiant Hemorphite','Hemorphite exists in many different color variations. Interestingly, the more colorful it becomes, the better yield it has. Radiant Hemorphite has 10% better yield than its more bland brother.\n\nWith a large portion of nocxium the Hemorphite is always a good find. It is common enough that even novice miners can expect to run into it. Hemorphite also has a bit of tritanium and isogen as well as trace amounts of Zydrine. It requires 500 ore units to refine.',1282,1,1e+35,3,0,500,NULL,332370,1,528,0),(17448,456,'Pure Jaspet','Pure Jaspet is popular amongst corporate miners who are looking for various minerals for manufacturing, rather than mining purely for profit.\n\nJaspet has many mineral types, making it easy to sell. It has a large portion of mexallon plus some tritanium, pyerite and nocxium. It has a portion size of 500 ore units for refining.',1279,1,1e+35,2,0,500,NULL,175776,1,529,0),(17449,456,'Pristine Jaspet','Pristine Jaspet is very rare, which is not so surprising when one considers that it is formed when asteroids collide with comets or ice moons. It has 10% better yield than normal Jaspet.\n\nJaspet has many mineral types, making it easy to sell. It has a large portion of mexallon plus some tritanium, pyerite and nocxium. It has a portion size of 500 ore units for refining.',1279,1,1e+35,2,0,500,NULL,185442,1,529,0),(17452,457,'Luminous Kernite','Prophets tell of the mystical nature endowed in Luminous Kernite. To the rest of us, it\'s an average looking ore that has 5% more yield than normal Kernite and can make you rich if you mine it 24/7 and live to be very old.\n\nKernite is a fairly common ore type that yields the largest amount of mexallon of any ore types in the universe. Besides mexallon the Kernite also has a bit of tritanium and isogen. 400 units of ore are needed for refining.',1270,1,1e+35,1.2,0,400,NULL,78634,1,523,0),(17453,457,'Fiery Kernite','Known as Rage Stone to veteran miners after a discovery of a particularly rich vein of it caused a bar brawl of epic proportions in the Intaki Syndicate. It has a 10% higher yield than basic Kernite.\n\nKernite is a fairly common ore type that yields the largest amount of mexallon of any ore types in the universe. Besides mexallon the Kernite also has a bit of tritanium and isogen. 400 units of ore are needed for refining.',1270,1,1e+35,1.2,0,400,NULL,82450,1,523,0),(17455,458,'Azure Plagioclase','Azure Plagioclase was made infamous in the melancholic song prose Miner Blues by the Gallentean folk singer Jaroud Dertier three decades ago.\n\nPlagioclase is not amongst the most valuable ore types around, but it has the largest amount of pyerite of any ore and is thus always in constant demand. It also yields some tritanium and mexallon. It requires 333 ore units to refine.',230,1,1e+35,0.35,0,333,NULL,13450,1,516,0),(17456,458,'Rich Plagioclase','With Rich Plagioclase, having 10% better yield than the normal one, miners can finally regard Plagioclase as a mineral that provides a noteworthy profit.\n\nPlagioclase is not amongst the most valuable ore types around, but it has the largest amount of pyerite of any ore and is thus always in constant demand. It also yields some tritanium and mexallon. It requires 333 ore units to refine.',230,1,1e+35,0.35,0,333,NULL,14092,1,516,0),(17459,459,'Solid Pyroxeres','Solid Pyroxeres, sometimes called the Flame of Dam\'Torsad, is a relative of normal Pyroxeres. The Flame has 5% higher yield than its more common cousin.\n\nPyroxeres is an interesting ore type, as it is very plain in most respects except one - deep core refining yields a little bit of nocxium, increasing its value considerably. It also has a large portion of tritanium and some pyerite and mexallon. 333 ore units are needed to refine.',231,1,1e+35,0.3,0,333,NULL,12444,1,515,0),(17460,459,'Viscous Pyroxeres','Viscous Pyroxeres is the secret behind the success of ORE in the early days. ORE has since then moved into more profitable minerals, but Viscous Pyroxeres still holds a special place in the hearts of all miners dreaming of becoming the next mining moguls of EVE.\n\nPyroxeres is an interesting ore type, as it is very plain in most respects except one - deep core refining yields a little bit of nocxium, increasing its value considerbly. It also has a large portion of tritanium and some pyerite and mexallon. 333 ore units are needed to refine.',231,1,1e+35,0.3,0,333,NULL,12744,1,515,0),(17463,460,'Condensed Scordite','Condensed Scordite is a close cousin of normal Scordite, but with 5% better yield. The increase may seem insignificant, but matters greatly to new miners where every ISK counts.\n\nScordite is amongst the most common ore types in the known universe. It has a large portion of tritanium plus a fair bit of pyerite. Good choice for those starting their mining careers. 333 ore units are needed for refining.',1356,1,1e+35,0.15,0,333,NULL,5246,1,519,0),(17464,460,'Massive Scordite','Massive Scordite was the stuff of legend in the early days of space exploration. Though it has long since been taken over in value by other ores it still has a special place in the hearts of veteran miners.\n\nScordite is amongst the most common ore types in the known universe. It has a large portion of tritanium plus a fair bit of pyerite. Good choice for those starting their mining careers. 333 ore units are needed for refining.',1356,1,1e+35,0.15,0,333,NULL,5496,1,519,0),(17466,461,'Bright Spodumain','Spodumain is occasionaly found with crystaline traces in its outer surface. Known as Bright Spodumain, the crystal adds considerable value to an already valuable mineral.\n\nSpodumain is amongst the most valuable ore types around, as it is one of only three ore types that yields the ultra-rare megacyte. Otherwise very plain, with a bit of tritanium and pyerite. 250 ore units are needed to refine. ',1274,1,1e+35,16,0,250,NULL,1206870,1,517,0),(17467,461,'Gleaming Spodumain','Once in a while Spoudumain is found with crystaline veins running through it. The increased value this yields puts the gleam in the eye of any miner lucky enough to find it.\n\nSpodumain is amongst the most valuable ore types around, as it is one of only three ore types that yields the ultra-rare megacyte. Otherwise very plain, with a bit of tritanium and pyerite. 250 ore units are needed to refine. ',1274,1,1e+35,16,0,250,NULL,1264340,1,517,0),(17470,462,'Concentrated Veldspar','Clusters of Veldspar, called Concentrated Veldspar, are sometimes found in areas where normal Veldspar is already in abundance.\n\nThe most common ore type in the known universe, Veldspar can be found almost everywhere. It is still in constant demand as it holds a large portion of the much-used tritanium mineral. It requires 333 ore units to refine.',232,1,4000,0.1,0,333,NULL,2100,1,518,0),(17471,462,'Dense Veldspar','In asteroids above average size, the intense pressure can weld normal Veldspar into what is known as Dense Veldspar, increasing the yield by 10%.\n\nThe most common ore type in the known universe, Veldspar can be found almost everywhere. It is still in constant demand as it holds a large portion of the much-used tritanium mineral. It requires 333 ore units to refine.',232,1,4000,0.1,0,333,NULL,2200,1,518,0),(17475,282,'Radioactive Waste','This radioactively contaminated material is normally recycled or processed into fuel. It can be highly dangerous to any lifeforms that come into contact with it.',29,0,2000,1,0,1,NULL,0,0,NULL,0),(17476,463,'Covetor','The Covetor is the largest craft in a ship class designed by the ORE Syndicate to facilitate the advancement of the mining profession to a new level. Mining barges are equipped with electronic subsystems specifically designed to accommodate Strip Mining modules. Coupled with a sizable cargo hold and a goodly drone bay, this makes them extremely efficient ore extraction vessels.\n\nSpecial Ability:  Able to equip Strip Miner and Ice Harvester turrets. 3% better yield for Strip Miners per level.',2522,330,40000000,200000,4000,1,8,20000000,1,495,0.07),(17477,477,'Covetor Blueprint','',46,0,0,0.01,0,1,NULL,2000000000,1,497,0),(17478,463,'Retriever','The Retriever is the medium-sized version of a ship class designed by the ORE Syndicate to facilitate the advancement of the mining profession to a new level. Mining barges are equipped with electronic subsystems specifically designed to accommodate Strip Mining modules. Coupled with a sizable cargo hold and a goodly drone bay, this makes them extremely efficient ore extraction vessels.\n\nSpecial Ability:  Able to equip Strip Miner and Ice Harvester turrets. 3% better yield for Strip Miners per level.',2523,235,20000000,150000,2000,1,8,5000000,1,495,0.07),(17479,477,'Retriever Blueprint','',46,0,0,0.01,0,1,NULL,1000000000,1,497,0),(17480,463,'Procurer','The Procurer is the smallest of a ship class designed by the ORE Syndicate to facilitate the advancement of the mining profession to a new level. Mining barges are equipped with electronic subsystems specifically designed to accommodate Strip Mining modules. Coupled with a sizable cargo hold and a goodly drone bay, this makes them extremely efficient ore extraction vessels.\n\nSpecial Ability:  Able to equip Strip Miner and Ice Harvester turrets. 3% better yield for Strip Miners per level.',2524,177,10000000,100000,1000,1,8,1000000,1,495,0.07),(17481,477,'Procurer Blueprint','',46,0,0,0.01,0,1,NULL,500000000,1,497,0),(17482,464,'Strip Miner I','A bulk ore extractor designed for use on Mining Barges.\n\nNote: 99.5% less CPU usage when fitted on a Mining Barge.',2527,25,0,100,0,1,NULL,2979234,1,1040,0.06),(17483,490,'Strip Miner I Blueprint','',1061,0,0,0.01,0,1,NULL,16130080,1,338,0),(17484,511,'Republic Fleet Assault Missile Launcher','Launcher for cruisers intended to counter fast frigates, can only be fitted with regular light missiles: Bloodclaw, Flameburst, Piranha and Sabretooth and their F.O.F. counterparts; Exterminator, Firefly, Seeker and Serpent.',1345,0,0,10,1.215,1,2,4224,1,NULL,0.07),(17485,506,'Republic Fleet Cruise Missile Launcher','A battleship mounted launcher used for long range standoffs with other battleships, but less suitable for bombardment of deployed structures. Contains a huge missile capacity, but has a slow firing rate and trouble targeting small, fast ships.\n\nCan only be fitted with cruise missiles: Cataclysm, Devastator, Paradise, Wrath, and their F.O.F. counterparts.',2530,0,0,20,1.35,1,NULL,99996,1,NULL,0.07),(17486,136,'Republic Fleet Cruise Missile Launcher Blueprint','',170,0,0,0.01,0,1,NULL,0,0,NULL,0),(17487,510,'Republic Fleet Heavy Missile Launcher','Designed for long engagements between medium sized ships. Slow firing rate, but makes up for it with a large missile capacity.\n\nMust fit heavy missiles: Havoc, Scourge, Thunderbolt, Widowmaker or their F.O.F. variants: Eradicator, Hellhound, Hydra, Stalker.',169,0,0,10,1.23,1,2,14996,1,NULL,0.07),(17488,507,'Republic Fleet Rocket Launcher','A tiny launcher that can carry a very limited supply of rockets. Not really intended as a primary weapon but rather as a cheap supplementary weapon system.\n\nMust be loaded with rockets: Foxfire, Gremlin, Phalanx, Thorn.',1345,0,0,5,0.2025,1,NULL,3000,1,NULL,0.07),(17489,136,'Republic Fleet Rocket Launcher Blueprint','',1345,0,0,0.01,0,1,NULL,0,0,NULL,0),(17490,508,'Republic Fleet Siege Missile Launcher','A massive launcher designed for extended bombardments of hard targets like battleships and stations. Contains a huge missile capacity, but has a slow firing rate and trouble targeting small, fast ships.\n\nMust be loaded with torpedoes: Bane, Inferno, Juggernaut, Mjolnir.',170,0,0,20,2,1,2,20580,1,NULL,0.07),(17491,509,'Republic Fleet Standard Missile Launcher','Favored by many for its average capacity and firing rate. Useful in both fast attack raids and longer battles.\n\nMust be loaded with light missiles: Bloodclaw, Flameburst, Piranha, Sabretooth, or their F.O.F variants; Exterminator, Firefly, Seeker, Serpent.\n',168,0,0,5,0.81,1,2,3000,1,NULL,0.07),(17492,62,'Republic Fleet Large Armor Repairer','This module uses nano-assemblers to repair damage done to the armor of the ship.',80,0,500,50,0,1,4,39996,1,NULL,0.07),(17493,62,'Republic Fleet Medium Armor Repairer','This module uses nano-assemblers to repair damage done to the armor of the ship.',80,0,500,10,0,1,4,19916,1,NULL,0.07),(17494,62,'Republic Fleet Small Armor Repairer','This module uses nano-assemblers to repair damage done to the armor of the ship.',80,0,500,5,0,1,4,9996,1,NULL,0.07),(17495,77,'Caldari Navy Ballistic Deflection Field','Boosts shield resistance against kinetic damage. Penalty: Using more than o