nal that packs quite a bit more firepower. Being as new as it is on the battlefield, the Fleet Issue Stabber hasn\'t seen many large engagements yet, but its engineers as well as Fleet command are very optimistic about its performance.\n\nSpecial Ability: 5% bonus to Medium Projectile Turret firing speed and 10% bonus to Medium Projectile Turret tracking speed per level.\n',2639,123.03,9810000,101000,375,1,2,8000000,1,NULL,0.07),(17714,106,'Stabber Fleet Issue Blueprint','',49,0,0,0.01,0,1,NULL,0,1,NULL,0),(17715,26,'Gila','Taking what he had learned from his days in the Caldari Navy, Korako The Rabbit\' Kosakami, Gurista leader, decided that he would rub salt in the State\'s wounds by souping up their designs and making strikes against his former masters in ships whose layout was obviously stolen from them. To this end the Gila, bastard twin of the Moa, has served him well.\n\nSpecial Ability: 50% bonus to Heavy, Heavy Assault and light Missile velocity\n\nCaldari Cruiser Skill Bonus: 5% bonus to Missile Kinetic damage per level\nGallente Cruiser Skill Bonus: 5% bonus to Medium Hybrid damage per level',1824,199.86,9600000,101000,250,1,1,8000000,1,NULL,0.07),(17716,106,'Gila Blueprint','',49,0,0,0.01,0,1,NULL,0,1,NULL,0),(17718,26,'Phantasm','As with other Sansha ships, not much is known about the origin of this design. Its form -- while harshly alien in shape -- bears the mark of extremely advanced physics research, lines and corners coalescing to form a shape whose resilience and structural integrity are hard to match. Coupled with advanced hardpoint technology and an extremely efficient powercore, the Phantasm\'s legendary status is well-deserved.\n\nSpecial Ability: 100% bonus to Medium Energy Turret damage\n\nAmarr Cruiser Skill Bonus: 5% bonus to Medium Energy Turret tracking per level\nCaldari Cruiser Skill Bonus: 5% bonus to Medium Energy Turret damage per level\n',2643,174,9600000,101000,250,1,4,8000000,1,NULL,0.07),(17719,106,'Phantasm Blueprint','',49,0,0,0.01,0,1,NULL,0,1,NULL,0),(17720,26,'Cynabal','The Cynabal was one of the earliest designs put forth by the Angel Cartel, and to this day it remains their most-used. The ship\'s origins are unknown, but as with most Cartel ships persistent rumors of Jovian influence continue to linger. Whether these tales have basis in reality or not, the facts are on the table: the Cynabal is one of the fastest, most powerful cruisers to be found anywhere.\n\nSpecial Ability: 25% bonus to Medium Projectile Turret rate of fire\n\nMinmatar Cruiser Skill Bonus: 5% bonus to Medium Projectile Turret damage per level\nGallente Cruiser Skill Bonus: 7.5% bonus to Medium Projectile Turret tracking speed per level',337,187,11730000,101000,250,1,2,8000000,1,NULL,0.07),(17721,106,'Cynabal Blueprint','',49,0,0,0.01,0,1,NULL,0,1,NULL,0),(17722,26,'Vigilant','The Vigilant was the first Gallente design the Guardian Angels would steal and make their own, but it wouldn\'t be the last. Building on the Thorax\'s natural strengths, it is a deadly vessel both by itself and in fleet tandem. A group of these sluggers is a sight to fear.\n\nSpecial Ability: 25% bonus to Medium Hybrid Turret damage\n\nGallente Cruiser Skill Bonus: 7.5% bonus to Medium Hybrid Turret tracking speed per level\nMinmatar Cruiser Skill Bonus: 5% increase to MicroWarpdrive capacitor bonus per level',1815,167.24,9830000,101000,250,1,8,8000000,1,NULL,0.07),(17723,106,'Vigilant Blueprint','',49,0,0,0.01,0,1,NULL,0,1,NULL,0),(17724,26,'Mordus Cruiser','Navy Cruiser.\n',49,199.86,13000000,101000,250,1,1,8000000,0,NULL,0.07),(17725,106,'Mordus Cruiser Blueprint','',49,0,0,0.01,0,1,NULL,0,0,NULL,0),(17726,27,'Apocalypse Navy Issue','The Empire\'s inner circle of armaments manufacturers has long been proud of the expert methods utilized to harden the Navy Issue Apocalypse\'s armor plating and structural framework to such an amazing degree. Its shield systems are also state-of-the-art, rivalling even Caldari Prime\'s best. Fearsome by reputation, this is the flagship vessel of the Imperial Navy\'s elite wing. Not many are unfortunate enough to have ever actually met one on the field of battle, and those who do usually do not live to tell the tale.\n\nSpecial Ability: 10% bonus to Large Energy Turret capacitor use and 7.5% bonus to Large Energy Turret optimal range per level.',2239,400,99300000,486000,675,1,4,108750000,1,NULL,0.07),(17727,107,'Apocalypse Navy Issue Blueprint','',43,0,0,0.01,0,1,NULL,0,1,NULL,0),(17728,27,'Megathron Navy Issue','The powerful Navy Megathron has seen the end of many a threat to the Federation\'s security, and it\'s only getting better. Recent improvements in the original design have paved the way for its use in a wider field of tactical operations than originally intended, making it one of the most useful war vessels to be found anywhere.\n\nSpecial Ability: 5% bonus to Large Hybrid Turret damage and 7.5% bonus to Large Hybrid Turret tracking speed per level.',2354,250,105200000,486000,675,1,8,108750000,1,NULL,0.07),(17729,107,'Megathron Navy Issue Blueprint','',43,0,0,0.01,0,1,NULL,0,1,NULL,0),(17730,27,'Ammatar Navy Battleship','Navy Battleship',335,250,110000000,486000,665,1,2,108750000,0,NULL,0.07),(17731,107,'Ammatar Navy Battleship Blueprint','',43,0,0,0.01,0,1,NULL,0,0,NULL,0),(17732,27,'Tempest Fleet Issue','The Fleet Tempest originally came into being as a variant licensed by the Fleet to Core Complexions, Inc., who intended to improve on the existing design with their now-famous emphasis on strong defensive capability. The designer, one Enoksur Steidentet, performed so well in this task that the Fleet promptly bought all rights to the design back from him for undisclosed billions, catapulting his small production and design corp into the major leagues.\n\nSpecial Ability: 5% bonus to Large Projectile Turret rate of fire and Large Projectile Turret damage per level.',2642,250,103300000,486000,600,1,2,108750000,1,NULL,0.07),(17733,107,'Tempest Fleet Issue Blueprint','',43,0,0,0.01,0,1,NULL,0,1,NULL,0),(17734,27,'Mordus Battleship','Navy Battleship',43,250,110000000,486000,665,1,1,108750000,0,NULL,0.07),(17735,107,'Mordus Battleship Blueprint','',43,0,0,0.01,0,1,NULL,0,0,NULL,0),(17736,27,'Nightmare','Since this terror was first seen haunting the spacelanes a year and a half ago, it has been the subject of persistent rumors to the effect that its design bears the indelible stamp of long-dead Sansha\'s own madness. Who else, the conspiracy theorists argue, could come up with such marvelously twisted designs?\n\nSpecial Ability: 100% bonus to Large Energy Turret damage\n\nAmarr Battleship Skill Bonus: 7.5% bonus to Large Energy Turret tracking per level\nCaldari Battleship Skill Bonus: 5% bonus to Large Energy Turret damage per level',2641,500,99300000,486000,665,1,4,108750000,1,NULL,0.07),(17737,107,'Nightmare Blueprint','',43,0,0,0.01,0,1,NULL,0,1,NULL,0),(17738,27,'Machariel','While its utilitarian look may not give much of an indication, many are convinced that the Machariel is based on an ancient Jovian design uncovered by the Angel Cartel in one of their extensive exploratory raids into uncharted territory some years ago. Whatever the case may be, this behemoth appeared on the scene suddenly and with little fanfare, and has very quickly become one of the Arch Angels\' staple war vessels.\n\nSpecial Ability: 25% bonus to Large Projectile Turret rate of fire\n\nMinmatar Battleship Skill Bonus: 5% bonus to Large Projectile Turret damage per level\nGallente Battleship Skill Bonus: 7.5% bonus to Large Projectile Turret tracking speed per level',335,500,121700000,486000,665,1,2,108750000,1,NULL,0.07),(17739,107,'Machariel Blueprint','',43,0,0,0.01,0,1,NULL,0,1,NULL,0),(17740,27,'Vindicator','Basing their design on the Federation Navy\'s much-vaunted Megathron, the Guardian Angels\' engineers set out to create a battleship that would instill fear in anyone fool enough to square off against the Cartel or its Serpentis protectorate. Based on the reputation this ship has engendered, they seem to have succeeded admirably.\n\nSpecial Ability: 25% bonus to Large Hybrid Turret damage\n\nGallente Battleship Skill Bonus: 7.5% bonus to Large Hybrid Turret tracking speed per level\nMinmatar Battleship Skill Bonus: 5% increase to MicroWarpdrive capacitor bonus per level',2157,250,105200000,486000,665,1,8,108750000,1,NULL,0.07),(17741,107,'Vindicator Blueprint','',43,0,0,0.01,0,1,NULL,0,1,NULL,0),(17742,818,'Uleen Bloodsworn','This is a fighter for the Blood Raiders. She is protecting the assets of the Blood Raiders and may attack anyone she perceives as a threat or easy pickings. Threat level: Very high',1764,40,2860000,28600,235,1,4,0,0,NULL,0.07),(17743,370,'Uleen Bloodsworn\'s Tag','This gold tag carries the rank insignia equivalent of a sergeant within the Blood Raider pirate cult. It may prove valuable if turned in at proper authorities.',2317,0,1,0.1,0,1,NULL,0,1,750,0),(17744,821,'Purple Particle Research Patrol','This deadly adversary houses the control bridge for the particle accelerator. Its defenses are considerable.',335,350,19000000,19000000,120,1,2,0,0,NULL,0),(17745,821,'General Hixous Puxley','Your sensors indicate that this battleship is the source of a lot of coded transmissions.',335,350,19000000,19000000,120,1,2,0,0,NULL,0),(17746,821,'Supply Headman','This ship looks like a standard Domination Seraphim vessel except this one is fitted with at least double the amount of what you normally see of missile turrets.',335,350,19000000,19000000,120,1,2,0,0,NULL,0),(17747,494,'Docked & Loaded Mammoth','This Bestower class industrial seems to be undergoing maintainance, but your sensors indicate that for some purpose, it is protected behind an extremely powerful shield...',309,660,100000,100000000,10000,1,2,0,0,NULL,0),(17748,494,'Megathron under frantic repair','There is a lot of activity around this partially constructed Megathron. As you start to wonder why, you notice that your sensors indicate it is protected by an extremely durable shield.',2408,539,100000,100000000,10000,1,NULL,0,0,NULL,0),(17749,821,'The Antimatter Channeler','If you ever saw a silent and unpredictable presence, this would be it.',335,350,19000000,19000000,120,1,2,0,0,NULL,0),(17754,283,'Activists','People engaged in anti-establishment activity of some sort, most often political or economical in nature.',1204,0,400,1,0,1,NULL,0,1,754,0),(17755,314,'Pro-Trade Pamphlets','Propaganda prose by supporters of Eman Autrech, singing the praise of free trade and universal love.',1192,0,1,0.1,0,1,NULL,0,1,754,0),(17756,314,'Virgin Forest Pulp','Tree pulp used to produce paper.',1181,0,1000,2,0,1,NULL,0,1,754,0),(17757,314,'Bronze Sculpture','Bronze Sculpture of president Souro Foiritan.',2041,0,100,5,0,1,NULL,0,1,NULL,0),(17759,314,'Silver Sculpture','Silver Sculpture of president Souro Foiritan.',2041,0,100,5,0,1,NULL,0,1,NULL,0),(17761,314,'Gold Sculpture','Gold sculpture of president Souro Foiritan.',2041,0,100,5,0,1,NULL,0,1,NULL,0),(17763,319,'Powerful EM Forcefield','A reinforced antimatter generator powered by muonal crystals, creating a perfect circle of electro-magnetic radiance.',2353,15000,100000,100000000,10000,1,NULL,0,0,NULL,0),(17764,404,'Ultra Fast Silo','Used to store or provide resources.',2301,911,1000000,1150,8850,1,NULL,2819328,0,NULL,0),(17765,283,'Exotic Dancers','Exotic dancing is considered an art form, even though not everyone might agree. Exposing the flesh in public places may be perfectly acceptable within the Federation, but in the Amarr Empire it\'s considered a grave sin and a sign of serious deviancy.',2543,0,50,1,0,1,NULL,0,1,23,0),(17767,283,'Kameiras','An elite type of foot soldier, originally bred from Minmatar slaves by the Amarr Empire. Raised from birth to become soldiers, they serve the Empire, Khanid Kingdom and Ammatar well, although always kept on a tight leash.',2549,0,90,1,0,1,NULL,50000,1,23,0),(17769,428,'Fluxed Condensates','When combined with other materials and alloys, fluxed condensates help contribute to a unique quantum state highly conducive to efficient reactor operation.',2664,0,0,1,0,1,NULL,512,1,500,0),(17770,426,'Large AutoCannon Battery','Fires a barrage of extra large projectiles at those the Control Tower deems its enemies. Maintains a consistent spread of fire and is able to track the faster-moving targets, but lacks the sheer bludgeoning force of its artillery counterpart.',2753,400,1000000,5000,2500,1,NULL,10000000,1,594,0),(17771,426,'Medium AutoCannon Battery','Fires a barrage of large projectiles at those the Control Tower deems its enemies. Maintains a consistent spread of fire and is able to track fast-moving targets, but lacks some of the power of its artillery counterpart.',1216,400,1000000,1000,1000,1,2,2000000,1,594,0),(17772,426,'Small AutoCannon Battery','Fires a barrage of medium projectiles at those the Control Tower deems its enemies. Maintains a very rapid spread of fire and is able to track the fastest targets at close ranges, but lacks some of the punch evidenced by its artillery counterpart.',1216,400,1000000,500,750,1,2,400000,1,594,0),(17773,417,'Citadel Torpedo Battery','A torpedo launcher capable of firing the most powerful type of torpedo ever invented. A volley of these deathbringers can make piecemeal of most anything that floats in space.',2622,366,1000000,5000,4500,1,NULL,12500000,1,479,0),(17774,9,'Ice Field','',2723,1,1e+35,1,0,1,NULL,0,0,NULL,0),(17775,319,'Starbase Major Assembly Array','Assembly Arrays are oftentimes required to manufacture many high-tech and illegal modules that the empires don\'t want manufactured in their stations. This is one of the biggest of its kind, able to churn out a great deal of equipment in relatively short order.',2366,1672,100000,100000000,10000,1,2,0,0,NULL,0),(17776,319,'Starbase Minor Assembly Array','Assembly Arrays are oftentimes required to manufacture many high-tech and illegal modules that the empires don\'t want manufactured in their stations. While humble in size, this one is able to operate at a high level of efficiency, bringing its operators quality modules with surprising speed.',2377,937,100000,100000000,10000,1,NULL,0,0,NULL,0),(17777,319,'Amarr Starbase Control Tower','The Amarr have always been fond of majestic and intimidating constructions. Their Control Towers do not deviate from that tradition and are truly big and powerful structures, intended more for preservation of territorial interests than commercial benefits.',2296,3394,100000,100000000,10000,1,4,0,0,NULL,0),(17778,319,'Caldari Starbase Control Tower','At first the Caldari Control Towers were manufactured by Kaalakiota, but since they focused their efforts mostly on other, more profitable installations, they soon lost the contract and the Ishukone corporation took over the Control Towers\' development and production.',2370,3275,100000,1150,8850,1,1,0,0,NULL,0),(17779,319,'Gallente Starbase Control Tower','Gallente Control Towers are more pleasing to the eye than they are strong or powerful. They have above average electronic countermeasures, average CPU output, and decent power output compared to towers from the other races, but are quite lacking in sophisticated defenses.',2297,3666,100000,1150,8850,1,8,0,0,NULL,0),(17780,319,'Minmatar Starbase Control Tower','The Matari aren\'t really that high-tech, preferring speed rather then firepower or involved technology. Unfortunately that doesn\'t apply very well to stationary objects, much to the liking of the Amarr Empire.\n\nAmarrians call it a scrapheap of epic proportions. But don\'t underestimate these structures. Minmatar commanders usually have the last laugh when it comes to combat.',2371,3346,100000,1150,8850,1,2,0,0,NULL,0),(17781,319,'Starbase Hangar','A stand-alone deep-space construction designed to allow pilots to dock and refit their ships on the fly.',2298,726,100000,1150,8850,1,NULL,0,0,NULL,0),(17782,319,'Starbase Ion Field Projection Battery','Projects a low intensity field of ionized particles to disrupt the effectivenes of enemy sensors. Very effective against Magnetometric-based sensors.',2379,366,100,100,0,1,NULL,0,0,NULL,0),(17783,319,'Starbase Force Field Array','This array projects a password-protected force field around structures outside the range of a control tower\'s shields.',2379,366,100,100,0,1,NULL,0,0,NULL,0),(17784,319,'Starbase Auxiliary Power Array','These arrays provide considerable added power output, allowing for an increased number of deployable structures in the starbase\'s field of operation.',2374,459,100,100,0,1,NULL,0,0,NULL,0),(17785,319,'Starbase Reactor Array','Moon Harvesting Arrays yield a number of moon materials that are then fed to Reactors. Reactors then process the materials in order to produce intermediate or final materials for use in keeping the Starbase\'s structures on-line and functioning.',2299,659,1000000,1150,1,1,NULL,0,0,NULL,0),(17786,319,'Starbase Shield Generator','Smaller confined shield generators with their own access restrictions can be deployed outside the Control Tower\'s defense perimeter. This allows for lesser security areas around the Starbase, for purposes of storage or pickup. ',2380,1263,1,1,0,1,NULL,0,0,NULL,0),(17787,319,'Starbase Storage Facility','Storage silos are much more secure and durable than their Secure Container counterparts. They are usually the focus of attacks on outposts and commonly contain ore, refined minerals or valuable items waiting to be transported to empire space.',2301,911,1000000,1150,8850,1,NULL,0,0,NULL,0),(17788,319,'Starbase Moon Harvester','A harvesting factory for collecting moon minerals.',2378,1218,1000000,1150,8850,1,NULL,0,0,NULL,0),(17789,319,'Starbase Medium Refinery','The refinery is the heart of any industrial outpost, increasing the efficiency of any mining operation through reduced travel time. They are less efficient than full fledged stations, but the benefits of not having to move unrefined ore outweighs this drawback considerably. ',2299,659,1000000,1150,8850,1,NULL,0,0,NULL,0),(17790,319,'Starbase Minor Refinery','A factory that refines ore into minerals.',2300,506,1000000,1150,8850,1,NULL,0,0,NULL,0),(17791,283,'Freedom Fighters','Freedom Fighters have dedicated their life to freeing those who have been enslaved by the Amarr Empire, Khanid Kingdom or various pirate factions. Their purpose is to bring freedom and equality to the population of the galaxy.\n\nBut although their ultimate goal may be noble, their methods are often not approved by the Minmatar authorities, nor their allies the Gallente Federation.  Their opponents call them terrorists, and they have been outlawed from the Caldari State due to the State\'s historical relationship with the Khanid Kingdom.',2544,0,400,2,0,1,NULL,0,1,23,0),(17793,314,'Amarr TIL-1 Nexus Chip','This small data chip stores the key elements of a ship\'s artificial intelligence system, and is used primarily for controlling the vessel\'s autonomous functions. This particular chip has been modified by top Viziam scientists for the Amarr Navy, made to be of better quality than what is available on the open market.\n\n\nThe TIL-1 chip is designed for battleship class vessels.',2038,0,1,0.1,0,1,NULL,8000000,1,738,0),(17794,314,'Amarr KIU-1 Nexus Chip','This small data chip stores the key elements of a ship\'s artificial intelligence system, and is used primarily for controlling the vessel\'s autonomous functions. This particular chip has been modified by top Viziam scientists for the Amarr Navy, made to be of better quality than what is available on the open market.\n  \n\nThe KIU-1 chip is designed for cruiser class vessels.',2038,0,1,0.1,0,1,NULL,2000000,1,738,0),(17795,314,'Amarr MIY-1 Nexus Chip','This small data chip stores the key elements of a ship\'s artificial intelligence system, and is used primarily for controlling the vessel\'s autonomous functions. This particular chip has been modified by top Viziam scientists for the Amarr Navy, made to be of better quality than what is available on the open market.\n \n\nThe MIY-1 chip is designed for frigate class vessels.',2038,0,1,0.1,0,1,NULL,500000,1,738,0),(17796,283,'Elite Slaves','Slavery has always been a questionable industry, favored by the Amarr Empire and detested by the Gallente Federation. These elite slaves are exceptionally well suited for physical labor.',2541,0,300,1,0,1,NULL,4000,1,23,0),(17798,496,'Dented Cask','This reinforced container is outfitted with a capturing mechanism to pick up data from nearby sensor arrays. The cargo ship carrying this to its destination seems to have met some kind of disasterous end.',16,14,10000,1200,1000,1,NULL,0,0,NULL,0),(17799,494,'Non-Secured Asteroid Colony','Carving out asteroids to act as habitats for miners and manufacturers is a cheap and efficient way to quickly cash in on the insatiable needs of the space industry. The construction of this one is underway and the defenses are weak.',1993,4737,100000,100000000,10000,1,NULL,0,0,NULL,0),(17800,819,'Retired Mining Veteran','The communication sensors on your ship are going haywire. Judging from the signals and coding being transmitted from this vessel, it could just be the big cahuna in this deadspace pocket. Who knows?',1827,50,1612000,16120,80,1,1,0,0,NULL,0),(17801,409,'Akori\'s Insignia','Identification tags such as these may prove valuable if handed to the proper organization.',2040,0,0.1,0.1,0,1,1,0,1,NULL,0),(17802,409,'Ibrahim\'s Insignia','Identification tags such as these may prove valuable if handed to the proper organization.',2040,0,0.1,0.1,0,1,4,0,1,NULL,0),(17803,409,'Karothas\'s Insignia','Identification tags such as these may prove valuable if handed to the proper organization.',2040,0,0.1,0.1,0,1,1,0,1,NULL,0),(17804,46,'5MN Afterburner I','Gives a boost to the maximum velocity of the ship when activated. The thrust that boosts the ship, and the corresponding maximum velocity bonus, are limited by the mass of the ship that uses this module.\n\nNote: Frigate class module',96,0,0,5,0,1,NULL,6450,0,NULL,0.07),(17805,126,'5MN Afterburner I Blueprint','',96,0,0,0.01,0,1,NULL,0,0,NULL,0),(17806,46,'25MN Afterburner I','Gives a boost to the maximum velocity of the ship when activated. The thrust that boosts the ship, and the corresponding maximum velocity bonus, are limited by the mass of the ship that uses this module.\n\nNote: Industrial class module',96,0,0,5,0,1,NULL,32256,0,NULL,0.07),(17807,126,'25MN Afterburner I Blueprint','',96,0,0,0.01,0,1,NULL,0,0,NULL,0),(17808,46,'5MN MicroWarpdrive I','Massive boost to speed for a very short time. The thrust that boosts the ship, and the corresponding maximum velocity bonus, are limited by the mass of the ship that uses this module. The sheer amount of energy needed to power this system means that it must use part of the capacitor output and the shield just to maintain the integrity of its warp containment field.\n\nPenalty: Max capacitor reduced.\n\nNote: Frigate class module',96,0,0,10,0,1,NULL,31636,0,NULL,0.07),(17809,126,'5MN MicroWarpdrive I Blueprint','',96,0,0,0.01,0,1,NULL,0,0,NULL,0),(17810,46,'25MN MicroWarpdrive I','Massive boost to speed for a very short time. The thrust that boosts the ship, and the corresponding maximum velocity bonus, are limited by the mass of the ship that uses this module. The sheer amount of energy needed to power this system means that it must use part of the capacitor output and the shield just to maintain the integrity of its warp containment field.\n\nPenalty: Max capacitor reduced.\n\nNote: Industrial class module',96,0,0,10,0,1,NULL,158188,0,NULL,0.07),(17811,126,'25MN MicroWarpdrive I Blueprint','',96,0,0,0.01,0,1,NULL,0,0,NULL,0),(17812,25,'Republic Fleet Firetail','The Firetail is modeled off a fighter frigate known as the Shamrock, a design used by a small, now-extinct pirate faction known as Lazari Dromitus. The blueprint found its way into the hands of Matari military forces after a raid on Lazari Dromitus\'s headquarters succeeded in killing its leader, thus beheading the organization and scattering its remnants to the four winds. It has since been improved upon and upgraded, and the Firetail is now a mainstay in most Republic Fleet patrols.\n\nMinmatar Frigate Skill Bonus: 5% bonus to maximum velocity and 7.5% bonus to Small Projectile Turret tracking speed per level',2635,62,1098000,16500,130,1,2,285000,1,NULL,0.07),(17813,105,'Republic Fleet Firetail Blueprint','',314,0,0,0.01,0,1,NULL,0,1,NULL,0),(17814,314,'Minmatar UUC Nexus Chip','This small data chip stores the key elements of a ship\'s artificial intelligence system, and is used primarily for controlling the vessel\'s autonomous functions. This particular chip has been modified by top Boundless Creation scientists for the Minmatar Fleet, made to be of better quality than what is available on the open market.\n\n\nThe UUC chip is designed for battleship class vessels.',2038,0,1,0.1,0,1,NULL,8000000,1,738,0),(17815,314,'Minmatar UUA Nexus Chip','This small data chip stores the key elements of a ship\'s artificial intelligence system, and is used primarily for controlling the vessel\'s autonomous functions. This particular chip has been modified by top Boundless Creation scientists for the Minmatar Fleet, made to be of better quality than what is available on the open market.\n \n\nThe UUA chip is designed for frigate class vessels.',2038,0,1,0.1,0,1,NULL,500000,1,738,0),(17816,314,'Minmatar UUB Nexus Chip','This small data chip stores the key elements of a ship\'s artificial intelligence system, and is used primarily for controlling the vessel\'s autonomous functions. This particular chip has been modified by top Boundless Creation scientists for the Minmatar Fleet, made to be of better quality than what is available on the open market.\n  \n\nThe UUB chip is designed for cruiser class vessels.',2038,0,1,0.1,0,1,NULL,2000000,1,738,0),(17817,409,'Genom Tara\'s Insignia','Identification tags such as these may prove valuable if handed to the proper organization.\n\nGenom Tara is a legendary Ammatar commander who bears deep hatred of the Minmatar Republic.  He is most notable for refusing to obay direct orders from the Ammatar government to withdraw from his position in the Minmatar - Ammatar border.',2040,0,0.1,0.1,0,1,2,0,1,737,0),(17818,494,'Serpentis Supply Stronghold','This gigantic station is one of the Serpentis military installations and a black jewel of the alliance between The Guardian Angels and The Serpentis Corporation. Even for it\'s size it has no commercial station services or docking bay to receive guests.',2356,8380,100000,100000000,10000,1,8,0,0,NULL,0),(17820,494,'Supply Traffic Management','Equally equipped for scientific observation and entertainment of all sorts, these multi-purpose structures, while not quite big enough to be classified as stations, nonetheless see quite a bit of use by both tourists and professionals.',1712,918,100000,100000000,10000,1,8,0,0,NULL,0),(17821,494,'Slaver Rig Control Tower','Amarr Control Tower',2296,3394,100000,100000000,10000,1,4,0,0,NULL,0),(17822,494,'Staff Quarters','The architectural design for the CreoDron Habitation Module started out as a contract deal from the Expert Housing Corporation to standardize the modular drifter homes normally used by miners and deep space explorers. When the project was cancelled due to insufficient funding, CreoDron utilized their design for the open market as high-orbit department buildings for commercial use. The marketing was a tremendous hit, making the Habitation Module a common sight across the universe. Common uses include anything from bars, casinos and brothels, to police stations and interrogation facilities.',2515,379,100000,100000000,10000,1,NULL,0,0,NULL,0),(17823,820,'Serpentis Chief of Security','This is a fighter for the Serpentis Corporation. It is protecting the assets of the Serpentis Corporation and may attack anyone it perceives 