escent Gneiss','Gneiss is often the first major league ore that up and coming miners graduate to. Finding the more expensive variation of Gneiss, called Iridescent Gneiss, is a major coup for these miners.\n\nGneiss is a popular ore type because it holds a bit of many minerals, increasing its utility value. It has a little something of tritanium, mexallon, isogen and zydrine. It has a portion size of 400 ore units for refining.',1377,1,1e+35,5,0,400,NULL,420840,1,525,0),(17866,467,'Prismatic Gneiss','Prismatic Gneiss has fracturized molecule-structure, which explains its unique appearance. It is the most sought after member of the Gneiss family, as it yields 10% more than common Gneiss.\n\nGneiss is a popular ore type because it holds a bit of many minerals, increasing its utility value. It has a little something of tritanium, mexallon, isogen and zydrine. It has a portion size of 400 ore units for refining.',1377,1,1e+35,5,0,400,NULL,439672,1,525,0),(17867,469,'Silvery Omber','Silvery Omber was first discovered some fifty years ago in an asteroid belt close to a large moon. The luminescence from the moon made this uncommon cousin of normal Omber seem silvery in appearance, hence the name.\n\nOmber is a common ore that is still an excellent ore for novice miners as it has a sizeable portion of isogen, as well as some tritanium and pyerite. A few trips of mining this and a novice is quick to rise in status. 500 ore units are needed for refining.',1271,1,1e+35,0.6,0,500,NULL,42892,1,526,0),(17868,469,'Golden Omber','Golden Omber spurred one of the largest gold rushes in the early days of space faring, when isogen was the king of minerals. The 10% extra yield it offers over common Omber was all it took to make it the most sought after ore for a few years.\n\nOmber is a common ore that is still an excellent ore for novice miners as it has a sizeable portion of isogen, as well as some tritanium and pyerite. A few trips of mining this and a novice is quick to rise in status. 500 ore units are needed for refining.',1271,1,1e+35,0.6,0,500,NULL,45020,1,526,0),(17869,468,'Magma Mercoxit','Mercoxit is a very dense ore that must be mined using specialized deep core mining techniques. It contains massive amounts of the extraordinary Morphite mineral but few other minerals of note.',2102,1,1e+35,40,0,250,NULL,18251776,1,530,0),(17870,468,'Vitreous Mercoxit','Mercoxit is a very dense ore that must be mined using specialized deep core mining techniques. It contains massive amounts of the extraordinary Morphite mineral but few other minerals of note.',2102,1,1e+35,40,0,250,NULL,19103744,1,530,0),(17871,738,'Hardwiring - Inherent Implants \'Noble\' ZET200','A neural Interface upgrade that boosts the pilot\'s skill in the operation of remote armor repair systems. 3% reduced capacitor need for remote armor repair system modules.',2224,1,0,1,0,1,NULL,0,1,1160,0.05),(17873,472,'System Scanner I','Scans the ore make-up of an asteroid.',108,60,0,5,0,1,NULL,2000,0,NULL,0.07),(17874,478,'System Scanner I Blueprint','',108,0,0,0.01,0,1,NULL,0,0,NULL,0),(17875,383,'Sentinel Angel','This Angel Station has been refitted with huge citadel torpedo batteries and a long range stasis web generators ',2357,6185,1000,1000,1000,1,2,0,0,NULL,0),(17876,383,'Sentinel Sansha','This Sansha Station has been refitted with huge citadel torpedo batteries and a long range stasis web generators ',2364,8960,1000,1000,1000,1,4,0,0,NULL,0),(17877,383,'Sentinel Serpentis','This Serpentis Battlestation has several formidable defensive systems. ',2356,8380,1000,1000,1000,1,8,0,0,NULL,0),(17878,383,'Sentinel Chimera Strain Mother','This Drone station has several formidable defensive systems. ',2565,3500,1000,1000,1000,1,NULL,0,0,NULL,0),(17879,383,'Sentinel Jormungand Strain Mother','This Drone station has several formidable defensive systems. ',2430,3500,1000,1000,1000,1,NULL,0,0,NULL,0),(17880,383,'Sentinel Gallente','This Gallente Battlestation has several formidable defensive s