sakami all along.\n\nSpecial Ability: 50% bonus to Cruise Missile and Torpedo velocity\n\nCaldari Battleship Skill Bonus: 5% bonus to Cruise Missile and Torpedo rate of fire per level\nGallente Battleship Skill Bonus: 5% bonus to Large Hybrid Turret damage per level',2159,250,99300000,486000,665,1,1,108750000,1,NULL,0.07),(17919,107,'Rattlesnake Blueprint','',43,0,0,0.01,0,1,NULL,0,1,NULL,0),(17920,27,'Bhaalgorn','Named after a child-devouring demon of Amarrian legend, the Bhaalgorn is the pride and joy of the Blood Raider cabal. Though it is known to be based on an Armageddon blueprint, the design\'s origin remains shrouded in mystery. Those of a superstitious persuasion whisper in the dark of eldritch ceremonies and arcane rituals, but for most people, the practical aspect of the matter will more than suffice: you see one of these blood-red horrors looming on the horizon, it\'s time to make yourself scarce.\n\nSpecial Ability: 50% reduction in Large Energy Turret capacitor use\n\nAmarr Battleship Skill Bonus: 10% bonus to Energy Vampire and Energy Neutralizer drain amount per level\nMinmatar Battleship Skill Bonus: 10% bonus to Stasis Webifier activation range per level',2644,400,97100000,517500,675,1,4,112500000,1,NULL,0.07),(17921,107,'Bhaalgorn Blueprint','',296,0,0,0.01,0,1,NULL,0,1,NULL,0),(17922,26,'Ashimmu','In those of the Empire\'s regions where naughty children are frightened into submission with tales of the Blood Raiders and their gallery of horrors, the terrible spear of the Ashimmu is known by all as a bringer of things worse than death. This is one of the few things that small children and capsule pilots generally agree upon.\n\nSpecial Ability: 50% reduction in Medium Energy Turret capacitor use\n\nAmarr Cruiser Skill Bonus: 10% bonus to Energy Vampire and Energy Neutralizer drain amount per level\nMinmatar Cruiser Skill Bonus: 10% bonus to Stasis Webifier activation range per level',2636,192,11010000,118000,280,1,4,8375000,1,NULL,0.07),(17923,106,