us, are limited by the mass of the ship that uses this module.\n\nNote: Battleship class module',96,0,0,5,0,1,NULL,161280,0,NULL,0.07),(19493,314,'Arms Cache','Personal weapons and armaments, used both for warfare and personal security.',1366,0,2500,2,0,1,NULL,100,1,NULL,0),(19500,747,'Zor\'s Custom Navigation Link','A neural Interface upgrade that boost the pilots skill in a specific area. This Navigation Link was created for the ruthless pirate commander, referred to as \'Zor\'. It gives a 10% bonus to Afterburner duration.',2224,1,0,1,0,1,NULL,800000,1,1165,0.05),(19501,494,'The Damsels Wimpy Prison_MISSION','The architectural design for the CreoDron Habitation Module started out as a contract deal from the Expert Housing Corporation to standardize the modular drifter homes normally used by miners and deep space explorers. When the project was cancelled due to insufficient funding, CreoDron utilized their design for the open market as high-orbit department buildings for commercial use. The marketing was a tremendous hit, making the Habitation Module a common sight across the universe. Common uses include anything from bars, casinos and brothels, to police stations and interrogation facilities.',2520,416,100000,100000000,10000,1,NULL,0,0,NULL,0),(19502,494,'The Damsels Wimpy Brothel_MISSION','The architectural design for the CreoDron Habitation Module started out as a contract deal from the Expert Housing Corporation to standardize the modular drifter homes normally used by miners and deep space explorers. When the project was cancelled due to insufficient funding, CreoDron utilized their design for the open market as high-orbit department buildings for commercial use. The marketing was a tremendous hit, making the Habitation Module a common sight across the universe. Common uses include anything from bars, casinos and brothels, to police stations and interrogation facilities.',2514,416,100000,100000000,10000,1,NULL,0,0,NULL,0),(19504,494,'Damsel Headquarters_MISS