ntense pressure deep within large asteroids and moons. Used in electronic and weapon manufacturing. Only found in abundance in a few areas. ',402,0,0,0.01,0,1,NULL,128,1,18,0),(38,18,'Nocxium','A highly volatile mineral only formed during supernovas, thus severely limiting the extent of its distribution. Vital ingredient in capsule production, making it very coveted.',1201,0,0,0.01,0,1,NULL,512,1,18,0),(39,18,'Zydrine','Only found in huge geodes, rocks on the outside with crystal-like quartz on the inside. The rarest and most precious of these geodes are those that contain the dark green zydrine within. Very rare and very expensive.',404,0,0,0.01,0,1,NULL,2048,1,18,0),(40,18,'Megacyte','An extremely rare mineral found in comets and very occasionally in asteroids that have traveled through gas clouds. Has unique explosive traits that make it very valuable in the armaments industry. ',1202,0,0,0.01,0,1,NULL,8192,1,18,0),(41,280,'Garbage','Production waste can mean garbage to some but valuable resource material to others.',1179,0,2500,0.25,0,1,NULL,20,1,20,0),(42,280,'Spiced Wine','Luxury goods are always solid commodities for inter-stellar trading. Spiced wine is not the rarest of luxury goods, but it can still be sold at small outposts and bases that don\'t manufacture any themselves.',27,0,500,0.5,0,1,NULL,1500,1,492,0),(43,280,'Antibiotics','Antibiotics are in constant demand everywhere and new, more potent versions, are always made available to counter the increased immunity of bacteria against antibiotics.',28,0,5,0.2,0,1,NULL,325,1,492,0),(44,282,'Enriched Uranium','Enriched Uranium is used in many kinds of manufacturing and as a fuel, making it a steady trade commodity. Enriched Uranium is generally manufactured by combining standard semiconductor PVD methods with ionic separation by means of mass spectrometry.',29,0,2000,1,0,1,NULL,5000,1,22,0),(45,281,'Frozen Plant Seeds','Frozen plant seeds are in high demand in many regions, especially on stations orbiting a non-habitable planet.',1200,0,400,0.5,0,1,NULL,75,1,492,0),(48,20,'Personal Nuclear Methadone','Nuclear Methadone is a potent and popular smart drug, which can boost your abilities for a short while. It is illegal in Caldari space and you\'ll be branded a smuggler if found carrying it therein. You can buy and sell Nuclear Methadone just like any other trade commodity, but you can also buy dosages for personal usage. This is the personal version.',32,0,0,1,0,1,NULL,0,0,NULL,0),(49,24,'Player Kill','Kill confirmation',37,0,0,0,0,1,NULL,0,0,NULL,0),(50,24,'Company Shares','Shares of a corporation.',2243,0,0,0,0,1,NULL,0,0,NULL,0),(51,24,'Bookmark','',1700,0,0,0,0,1,NULL,0,0,NULL,0),(52,94,'Trading','',195,0,0,0,0,1,NULL,0,0,NULL,0),(53,95,'Trade Session','',196,0,0,0,0,1,NULL,0,0,NULL,0),(54,15,'Station (Caldari 4)','',237,15351,0,1,0,1,1,600000,0,NULL,0),(56,15,'Station (Gallente 1)','',239,23836,0,1,0,1,8,600000,0,NULL,0),(57,15,'Station (Gallente 2)','',240,27072,0,1,0,1,8,600000,0,NULL,0),(58,15,'C-O-1','Caldari Outpost 1',346,1000,0,1,0,1,1,600000,0,NULL,0),(59,15,'C-O-2','Caldari Outpost 2',347,1000,0,1,0,1,1,600000,0,NULL,0),(164,23,'Clone Grade Alpha','',34,0,0,1,0,1,NULL,0,0,NULL,0),(165,23,'Clone Grade Beta','',35,0,0,1,0,1,NULL,40000,0,NULL,0),(166,23,'Clone Grade Gamma','',36,0,0,1,0,1,NULL,65000,0,NULL,0),(178,83,'Carbonized Lead S','Small Projectile Ammo. This ammo uses a simple lead slug encased in a hard shell of crystalline carbon. It is fairly cheap and works very well against most armors. Shields, however, are a problem. ',1308,1,0.01,0.004,0,100,NULL,200,1,113,0.07),(179,83,'Nuclear S','Small Projectile Ammo. Nuclear weapons are considered by most races to be crude and primitive. However, the Minmatar still favor them over more sophisticated weapons due to the abundance of materials for plutonium production in Minmatar space. ',1288,1,0.01,0.0035,0,100,NULL,300,1,113,0.07),(180,83,'Proton S','Small Projectile Ammo. Emits a focused, high intensity 