rimitive. However, the Minmatar still favor them over more sophisticated weapons due to the abundance of materials for plutonium production in Minmatar space. ',1304,10,1,0.035,0,100,NULL,3000,1,109,0.07),(196,83,'Proton L','Large Projectile Ammo. Emits a focused, high intensity proton burst upon impact. Fairly effective vs. both shields and armor.',1306,10,1,0.03,0,100,NULL,4000,1,109,0.07),(197,83,'Depleted Uranium L','Large Projectile Ammo. Very commonly used by Minmatar pilots, this ammo is incendiary and also has great penetration. Just be careful handling it unless you want to wake up with an extra toe on your forehead.',1301,10,1,0.025,0,100,NULL,5000,1,109,0.07),(198,83,'Titanium Sabot L','Large Projectile Ammo. This is among the most feared ammunition around. It has excellent penetration. Once the ship\'s outer layer is penetrated, the core explodes, spraying the interior with a cloud of fragmentation fletchets that cause considerable damage to the vulnerable interior structure.',1307,10,1,0.0325,0,100,NULL,6000,1,109,0.07),(199,83,'Fusion L','Large Projectile Ammo. The destructive power of a fusion warhead is superior to most other projectile warhead available. Has problems penetrating heavy shield systems.',1303,10,1,0.0375,0,100,NULL,7000,1,109,0.07),(200,83,'Phased Plasma L','Large Projectile Ammo. This ammo uses a similar plasma containment core as hybrid charges except that it is mounted in a standard cannon shell. ',1305,10,1,0.0425,0,100,NULL,8000,1,109,0.07),(201,83,'EMP L','Large Projectile Ammo. A new technology, this highly advanced ammunition emits a focused EM pulse. Very potent against shields.',1302,10,1,0.05,0,100,NULL,10000,1,109,0.07),(202,386,'Paradise Cruise Missile','Extra heavy assault missile. The mother of all missiles, the Paradise delivers a tremendous payload, guaranteed to get its victims acquainted with their personal god in a quick, but painful manner.',182,300,1250,0.05,0,100,NULL,15000,1,921,0.07),(203,386,'Wrath Cruise Missile','Extra heavy assault missile. The first and only Minmatar-made large missile. Constructed of reactionary alloys, the Wrath is built to get to the target. Guidance and propulsion systems are of Gallentean origin and were inititally used in drones, making Wrath fast and nimble despite its heavy payload. ',183,300,1250,0.05,0,100,NULL,10000,1,921,0.07),(204,386,'Cataclysm Cruise Missile','Extra heavy assault missile. An Amarrian large missile with good capabilities, the Cataclysm was for a long time confined solely to the Amarr armed forces, but exports began some years ago and the missile is now found throughout the universe.',184,300,1250,0.05,0,100,NULL,12500,1,921,0.07),(205,386,'Devastator Cruise Missile','Extra heavy assault missile. A very basic missile for large launchers with reasonable payload. Utilizes the now sub-standard technology of bulls-eye guidance system.',185,300,1250,0.05,0,100,NULL,7500,1,921,0.07),(206,385,'Havoc Heavy Missile','The be-all-end-all of medium sized missiles, the Havoc is a must for those who want a guaranteed kill no matter the cost.',186,300,1000,0.03,0,100,NULL,2000,1,924,0.07),(207,385,'Thunderbolt Heavy Missile','Recently introduced by the armaments lab of the Wiyrkomi Corporation, the Thunderbolt is a solid investment with a large payload and steady performance.',187,300,1000,0.03,0,100,NULL,3500,1,924,0.07),(208,385,'Widowmaker Heavy Missile','Originally designed as a \'finisher\' - the killing blow to a crippled ship - the Widowmaker has since gone through various technological upgrades. The latest version has a lighter payload than the original, but much improved guidance systems.',188,300,1000,0.03,0,100,NULL,3000,1,924,0.07),(209,385,'Scourge Heavy Missile','The Scourge is an old relic from the Caldari-Gallente War that is still in widespread use because of its low price and versatility.',189,300,1000,0.03,0,100,NULL,2500,1,924,0.07),(210,384,'Bloodclaw Light Missile','Light assault missile. Fresh out of the Minmatar