e expense of shield boosting.',1032,500,20,5,0,1,NULL,4864,1,667,0.07),(508,770,'Basic Shield Flux Coil','Increases shield recharge rate while lowering the maximum shield capacity.',1062,500,20,5,0,1,NULL,1664,1,687,0.07),(509,768,'Basic Capacitor Flux Coil','Increases capacitor recharge rate, but causes a reduction in maximum capacitor storage. ',1032,500,20,5,0,1,NULL,1664,1,666,0.07),(518,59,'Basic Gyrostabilizer','Gives a bonus to the speed and damage of projectile turrets. Penalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',1046,0,0,5,0,1,NULL,9728,1,646,0.07),(519,59,'Gyrostabilizer II','Gives a bonus to the speed and damage of projectile turrets. Penalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',1046,0,0,5,0,1,NULL,95108,1,646,0.06),(520,59,'Gyrostabilizer I','Gives a bonus to the speed and damage of projectile turrets. Penalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',1046,0,0,5,0,1,NULL,24320,1,646,0.07),(521,60,'Basic Damage Control','Utilizes a combination of containment field emitters and redundancy systems to prevent critical system damage.\n\nGrants a bonus to resistance for shield, armor and hull.\n\nOnly one Damage Control can be activated at a given time.',1034,0,5000,5,0,1,NULL,2000,1,615,0.07),(522,61,'Micro Capacitor Battery I','Increases capacitor storage.',89,500,0,2.5,0,1,NULL,4000,1,702,0.07),(523,62,'Small Armor Repairer I','This module uses nano-assemblers to repair damage done to the armor of the ship.',80,0,500,5,0,1,NULL,20000,1,1049,0.07),(524,63,'Small Hull Repairer I','Makes use of nano-assembler technology in order to repair damage done to the structure.',80,0,1000,12.5,0,1,NULL,49998,1,1053,0.07),(526,65,'Stasis Webifier I','Reduces the maximum speed of a ship by employing micro energy streams which effectively entangle the target temporarily, thereby slowing it down.',1284,500,0,5,0,1,NULL,22488,1,683,0.07),(527,65,'Stasis Webifier II','Reduces the maximum speed of a ship by employing micro energy streams which effectively entangle the target temporarily, thereby slowing it down.',1284,500,0,5,0,1,NULL,190098,1,683,0.06),(529,67,'Small Energy Transfer Array I','Transfers capacitor energy to another ship',1035,1000,1000,25,0,1,NULL,30000,1,695,0.07),(530,68,'Small Nosferatu I','Drains energy from the target ship and adds it to your own.',1029,0,1000,5,0,1,NULL,39504,1,692,0.07),(533,71,'Small Energy Neutralizer I','Neutralizes a portion of the energy in the target ship\'s capacitor.',1283,0,2000,5,0,1,NULL,28160,1,689,0.07),(561,74,'75mm Gatling Rail I','A small multi-barreled railgun for frigates. Railguns use magnetic rails to fire solid chunks of matter at hypersonic speed. The accurate range of railguns is very good, but due to technical limitations it cannot use onboard guidance. This results in a fairly rapid drop in accuracy at extreme ranges.\n\nRequires hybrid ammo types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',349,10,200,5,1,1,NULL,2000,1,564,0.07),(562,74,'Light Electron Blaster I','Particle blasters operate on a similar principle as the railgun except they fire a magnetically contained ball of subatomic particles. No other turret class can match the sheer destructive power of particle blasters, but due to the rapid dispersion of the containment field, it also has the worst range of all turrets.\n\nRequires hybrid ammo types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',378,10,150,5,1,1,NULL,6000,1,561,0.07),(563,74,'Light Ion Blaster I','Particle blasters operate on a similar principle as the railgun except they fire a magnetically contained ball of subatomic particles. No other turret class can match the sheer destructive power of particle blasters, but due to the rapid dispersion of 