board guidance. This results in a fairly rapid drop in accuracy at extreme ranges.\n\nRequires hybrid ammo types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',373,100,175,10,4,1,NULL,20000,1,565,0.07),(568,74,'Heavy Neutron Blaster I','Particle blasters operate on a similar principle as the railgun except they fire a magnetically contained ball of subatomic particles. No other turret class can match the sheer destructive power of particle blasters, but due to the rapid dispersion of the containment field, it also has the worst range of all turrets.\n\nRequires hybrid ammo types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',372,100,100,25,2,1,NULL,120000,1,562,0.07),(569,74,'Heavy Ion Blaster I','Particle blasters operate on a similar principle as the railgun except they fire a magnetically contained ball of subatomic particles. No other turret class can match the sheer destructive power of particle blasters, but due to the rapid dispersion of the containment field, it also has the worst range of all turrets.\n\nRequires hybrid ammo types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',371,100,125,10,3,1,NULL,90000,1,562,0.07),(570,74,'250mm Railgun I','Cruiser-sized large barrel turret. Railguns use magnetic rails to fire solid chunks of matter at hypersonic speed. The accurate range of railguns is very good, but due to technical limitations it cannot use onboard guidance. This results in a fairly rapid drop in accuracy at extreme ranges.\n\nRequires hybrid ammo types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',370,100,50,25,1,1,NULL,150000,1,565,0.07),(571,74,'Electron Blaster Cannon I','Particle blasters operate on a similar principle as the railgun except they fire a magnetically contained ball of subatomic particles. No other turret class can match the sheer destructive power of particle blasters, but due to the rapid dispersion of the containment field, it also has the worst range of all turrets.\n\nRequires hybrid ammo types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',369,1000,400,50,10,1,NULL,600000,1,563,0.07),(572,74,'Dual 250mm Railgun I','This battleship-sized weapon is a double-barreled version of the cruiser class 250mm railgun. Railguns use magnetic rails to fire solid chunks of matter at hypersonic speed. The accurate range of railguns is very good, but due to technical limitations it cannot use onboard guidance. This results in a fairly rapid drop in accuracy at extreme ranges.\n\nRequires hybrid ammo types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',368,1000,1500,20,8,1,NULL,199998,1,566,0.07),(573,74,'Neutron Blaster Cannon I','Particle blasters operate on a similar principle as the railgun except they fire a magnetically contained ball of subatomic particles. No other turret class can match the sheer destructive power of particle blasters, but due to the rapid dispersion of the containment field, it also has the worst range of all turrets.\n\nRequires hybrid ammo types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',367,1000,1000,50,4,1,NULL,1200000,1,563,0.07),(574,74,'425mm Railgun I','This large battleship-sized weapon packs quite a punch. Railguns use magnetic rails to fire solid chunks of matter at hypersonic speed. The accurate range of railguns is very good, but due to technical limitations it cannot use onboard guidance. This results in a fairly rapid drop in accuracy at extreme ranges.\n\nRequires hybrid ammo types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',366,1000,750,50,2,1,NULL,1500000,1,566,0.07),(575,74,'Ion Blaster Cannon I','Particle blasters operate on a similar principle as the railgun except they fire a magnetically contained ball of subatomic particles. No other turret class can match the sheer destructive power of particle blasters, but due to the rapid dispersion of the containment field, it also has the worst range of all turrets.\n\nRequires hybrid ammo types: Antimatter, Iridium, Iron, Lead, Plutonium, Thorium, Tungsten, Uranium.',365,1000,500,50,6,1,NULL,900000,1,563,0.07),(577,76,'Medium Capacitor Booster I','Provides a quick injection of power into the capacitor.',1031,0,0,10,32,1,NULL,28124,1,700,0.07),(578,77,'Invulnerability Field I','Boosts shield resistance against all damage types. Penalty: Using more than one type of this module, or similar modules that affect the same resistance type, will result in a penalty to the boost you get on that type of resistance.',1045,0,10000,20,0,1,NULL,75000,1,553,0.07),(580,80,'ECM Burst I','Emits random electronic bursts intended to disrupt target locks on any ship with lower sensor strengths than the ECM burst jamming strength. Given the unstable nature of the bursts and the amount of internal shielding needed to ensure they do not affect their own point of origin, only battleship-class vessels can use this module to its fullest extent. On all other classes, ship bonuses are not applied to the module.\n\nNote: Only one module of this type can be activated at the same time',109,0,5000,5,0,1,NULL,41664,1,678,0.07),(581,82,'Passive Targeter I','Uses advanced acoustical and visual targeting to identify threats. Allows target lock without alerting the ship to a possible threat.',104,0,2000,25,0,1,NULL,25000,1,672,0.07),(582,25,'Bantam','The Bantam is a strong and sturdy craft, and an extremely effective mining frigate. In addition, its large structure makes it ideal for trading and the Bantam is very popular among budding inter-stellar traders.\n\nSpecial Ability: 5% bonus to cargo capacity and 20% bonus to mining laser yield per skill level. -60% mining laser capacitor use',38,31,1155000,20000,235,1,1,23500,1,61,0.07),(583,25,'Condor','The Condor is fast and agile. It has limited cargo space so it\'s not very suitable for trading or mining. It is best used as an assault vessel in a hit-and-run type of operations.\n\nSpecial Ability: 5% bonus to light missile and rocket kinetic damage 10% bonus to light missile and rocket velocity per skill level.',39,33,1185000,18000,150,1,1,28750,1,61,0.07),(584,25,'Griffin','The Griffin is much used by the Caldari Navy as a support vessel in combat squadrons, using its impressive array of electronic gadgetry to disrupt the operation of target ships, making them easy prey for traditional combat vessels.\n\nSpecial Ability: 15% bonus to ECM Target Jammer strength and 10% bonus to ECM Target Jammers\' capacitor need per level.',40,42.93,1056000,19400,160,1,1,160000,1,61,0.07),(585,25,'Slasher','The Slasher is cheap, but versatile. It\'s been manufactured en masse, making it one of the most common vessels in Minmatar space. The Slasher is extremely fast, with decent armaments, and is popular amongst budding pirates and smugglers.\n\nSpecial Ability: 5% bonus to Small Projectile Turret damage and 7.5% bonus to Small Projectile Turret tracking speed per skill level.',44,32.89,1150000,17400,120,1,2,27500,1,64,0.07),(586,25,'Probe','The Probe is large compared to most Minmatar frigates and is considered a good scout and cargo-runner. Uncharacteristically for a Minmatar ship, its hard outer coating makes it difficult to destroy, while the limited weapon hardpoints force it to rely on fighter assistance if engaged in combat.\n\nSpecial Ability: 5% bonus cargo capacity per skill level. 5% increase to scan strength of probes per level',45,19.95,1123000,19500,320,1,2,108500,1,64,0.07),(587,25,'Rifter','The Rifter is a very powerful combat frigate and can easily tackle the best frigates out there. It has gone through many radical design phases since its inauguration during the Minmatar Rebellion. The Rifter has a wide variety of offensive capabilities, making it an unpredictable and deadly adversary.\n\nSpecial Ability: 5% bonus to Small Projectile Turret damage and 7.5% bonus to tracking per level.',46,37.07,1067000,27289,130,1,2,280000,1,64,0.07),(588,237,'Reaper','The Reaper-class is the smallest of the Minmatar frigates, just barely reaching frigate status instead of a manned fighter. The Reaper is very cheap and is used en masse in daring hit-and-run operations by Minmatars either side of the law. Special Ability: 5% bonus to velocity per skill level.',53,38.4,1157000,15800,120,1,2,0,0,NULL,0.07),(589,25,'Executioner','The Executioner is another newly commissioned ship of the Amarr Imperial Navy. The Executioner was designed specially to counter the small, fast raider frigates of the Minmatar Republic, thus it is different from most Amarr ships in favoring speed over defenses. With the Executioner, the Amarrians have expanded their tactical capabilities on the battlefield.\n\nSpecial Ability: 10% bonus to Small Energy Turret capacitor use and 5% Small Energy Turret damage per skill level.',54,13,1124000,28100,135,1,4,30000,1,72,0.07),(590,25,'Inquisitor','The Inquisitor is another example of how the Amarr Imperial Navy has modeled their design to counter specific tactics employed by the other empires. The Inquisitor is a fairly standard Amarr ship in most respects, having good defenses and lacking mobility. It is more Caldari-like than most Amarr ships, however, since its arsenal mostly consists of missile bays.\n\nSpecial Ability: 10% bonus to EM missile damage and 5% bonus to Explosive, Kinetic and Thermal missile damage per level.',55,20.5,1130000,28700,315,1,4,212500,1,72,0.07),(591,25,'Tormentor','The Tormentor has been in service for many decades, mainly as a mining ship. It is not big enough to cut it as a battle frigate, but as with most Amarr ships its strong defenses make it a tough opponent to crack. Exactly for this and the way it seems to be curling up on itself has given the Tormentor-class the nickname \'Armadillo\'.\n\nSpecial Ability: 5% bonus to cargo capacity and 20% bonus to mining laser yield per level. -60% mining laser capacitor use',56,30.68,1180000,24398,235,1,4,24250,1,72,0.07),(592,25,'Navitas','The Navitas is a solid mining vessel, in wide use by independent excavators. It is also one of the best ships available for budding traders or even scavengers. The long-range scanners and sturdy outer shell of the ship help to protect the ship from harassment.\n\nSpecial Ability: 5% bonus to cargo capacity and 20% bonus to mining laser yield per level. -60% mining laser capacitor use',59,39,1221000,10000,215,1,8,22500,1,77,0.07),(593,25,'Tristan','Often nicknamed The Fat Man this nimble little frigate is mainly used by the Federation in escort duties or on short-range patrols. The Tristan has been very popular throughout Gallente space for years because of its versatility. It is rather expensive, but buyers will definitely get their money\'s worth, as the Tristan is one of the more powerful frigates available on the market.\n\nSpecial Ability: 5% bonus to Small Hybrid Turret damage and 7.5% bonus to Small Hybrid Turret tracking speed per skill level.',60,36.16,1006000,26500,140,1,8,282500,1,77,0.07),(594,25,'Incursus','The Incursus is commonly found spearheading Gallentean military operations. Its speed and surprising strength make it excellent for skirmishing duties. Incursus-class ships move together in groups and can quickly and effectively gang up on ships many times their size and overwhelm them. In recent years the Incursus has increasingly found its way into the hands of pirates, who love its aggressive appearance.\n\nSpecial Ability: 10% bonus to Small Hybrid Turret falloff and 5% bonus to Small Hybrid Turret damage per skill level.',61,42,1028000,29500,165,1,8,220000,1,77,0.07),(595,25,'Gallente Police Ship','The standard police vessel of the Gallente Federation. Renowned for its high quality equipment and loadout.',66,38,2040000,20400,200,1,8,0,0,NULL,0.07),(596,237,'Impairor','The Impairor-class frigate has been mass-produced by the Amarr Empire for decades. It is the most common spacevessel sighted within the Amarrian boundaries, and is used both as a basic trade vessel and as a small-scale slave transport.\n\nSpecial Ability: 10% bonus to energy turret capacitor use per skill level.',299,39,1148000,28100,120,1,4,0,0,NULL,0.07),(597,25,'Punisher','The Amarr Imperial Navy has been upgrading many of its ships in recent years and adding new ones. The Punisher is one of the most recent ones and considered by many to be the best Amarr frigate in existence. As witnessed by its heavy armaments, the Punisher is mainly intended for large-scale military operations, acting in coordination with larger military vessels, but it is more than powerful enough for solo operations.\n\nSpecial Ability: 10% bonus to Small Energy Turret capacitor use and 5% bonus to armor resistances per level.',300,40,1047000,28600,135,1,4,287500,1,72,0.07),(598,25,'Breacher','The Breacher\'s structure is little more than a fragile scrapheap, but the ship\'s missile launcher hardpoints and superior sensors have placed it among the most valued Minmatar frigates when it comes to long range combat.\n\nSpecial Ability: 10% bonus to Explosive missile damage and 5% bonus to EM, Kinetic and Thermal missile damage per level.',305,49.78,1187000,20000,175,1,2,222500,1,64,0.07),(599,25,'Burst','The Burst is a small and fast cargo vessel. It can easily be used as a small-time miner, but requires some crunching assistance for large-scale mining operations.\n\nSpecial Ability: 5% bonus to cargo capacity and 20% bonus to mining laser yield per level. -60% mining laser capacitor use',306,61,1096000,17100,225,1,2,22500,1,64,0.07),(600,25,'Minmatar Peacekeeper Ship','Minmatar Police 1',307,62,1200000,12000,80,1,2,0,0,NULL,0.07),(601,237,'Ibis','The Caldari Ibis frigate is a small but stout frigate that fits admirably well as a cargo hauler or small-scale miner. Its reliability makes it a good choice for novice ship captains.\n\nSpecial Ability: 10% bonus hybrid turret optimal range per skill level.',312,47,1163000,15000,120,1,1,0,0,NULL,0.07),(602,25,'Kestrel','The Kestrel is a heavy missile boat with a fairly large cargo space and one of the most sophisticated sensor arrays around. Interestingly enough, it has been used by both the Caldari Navy and several wealthy trade corporations as a cargo-hauling vessel. It is one of few trading vessels with good punching power, making it ideal for solo trade-runs in dangerous areas. The Kestrel was designed so that it could take up to four missile launchers but instead it can not be equipped with turret weapons nor mining lasers.\n\nSpecial Ability: 10% bonus to Kinetic missile damage and 5% bonus to EM, Explosive, and Thermal missile damage per level.',313,45.98,1163000,19700,305,1,1,225000,1,61,0.07),(603,25,'Merlin','The Merlin is the most powerful all-out combat frigate of the Caldari. It is highly valued for its versatility in using both missiles and turrets, while its defenses are exceptionally strong for a Caldari vessel.\n\nSpecial Ability: 5% bonus to shield resistances and 10% bonus to Small Hybrid Turret optimal range per skill level.',314,39,997000,16500,130,1,1,285000,1,61,0.07),(604,25,'Caldari Enforcer Ship','Caldari Frigate 8',315,44,1680000,17400,90,1,1,0,0,NULL,0.07),(605,25,'Heron','The Heron has good computer and electronic systems, giving it the option of participating in electronic warfare. But it has relatively poor defenses and limited weaponry, so it\'s more commonly used for scouting and exploration.\n\nSpecial Ability: 5% bonus kinetic missile damage per skill level 5% increase to scan strength of probes per level',316,47,1150000,18900,320,1,1,97250,1,61,0.07),(606,237,'Velator','The Velator class frigate is one of the older vessel types in the Gallente fleet. It was first deployed on the market as a fast passenger craft but the extra passenger quarters were later modified into weapon hardpoints as the newer models came to be used for small-scale security and military duties. The Velator is still a very solid mining and trading vessel.\n\nSpecial Ability: 5% bonus to hybrid turret damage per skill level.',321,40,1148000,24500,120,1,8,0,0,NULL,0.07),(607,25,'Imicus','The Imicus is a slow but hard-shelled frigate, ideal for any type of scouting activity. Used by merchant, miner and combat groups, the Imicus is usually relied upon as the operation\'s eyes and ears when traversing low security sectors.\n\nSpecial Ability: 5% bonus to drone range per skill level.  5% increase to scan strength of probes per level',322,42,997000,21500,320,1,8,100250,1,77,0.07),(608,25,'Atron','The Atron is a hard nugget with an advanced power conduit system, but little space for cargo. Although it is a good harvester when it comes to mining, its main ability is as a combat vessel.\n\nSpecial Ability: 10% bonus to Small Hybrid Turret falloff and 5% Small Hybrid Turret damage per skill level.',323,31,1164000,22500,125,1,8,29250,1,77,0.07),(609,25,'Maulus','The Maulus is a high-tech vessel, specialized for electronic warfare. It is particularly valued in fleet warfare due to its optimization for sensor dampening technology.\n\nSpecial Ability: 5% bonus to Small Hybrid Turret damage and Remote Sensor Dampener effectiveness per skill level.',324,39,1063000,23000,175,1,8,180000,1,77,0.07),(610,25,'Wraith','Little is known about Jovian vessels, safe for their technical superiority.',332,60,1000000,13000,110,1,16,0,0,NULL,0.07),(611,25,'Specter','Little is known about Jovian vessels, safe for their technical superiority.',333,38,1000000,13400,80,1,16,0,0,NULL,0.07),(612,25,'Chaos','Pirate Frigate 1',338,50,1200000,16450,130,1,2,0,0,NULL,0.07),(613,25,'Devourer','Pirate Frigate 2',339,43.6,1200000,19100,110,1,2,0,0,NULL,0.07),(614,25,'Fury','Pirate Frigate 3',340,29.96,1200000,26000,180,1,2,0,0,NULL,0.07),(615,25,'Styx','Pirate Frigate 4',341,36,1200000,17400,60,1,2,0,0,NULL,0.07),(616,25,'Medusa','Pirate Frigate 5',342,66.78,1200000,17500,30,1,2,0,0,NULL,0.07),(617,25,'Echo','The Echo assault frigate was developed and produced by the Indocon Corporation early on in the first era of galactic conquest. Asteroid mining had become increasingly dangerous due to pirate traffic, and the first prototype of the Echo was made.',343,28,1200000,17660,50,1,2,0,0,NULL,0.07),(618,25,'Lynx','Pirate Frigate 7',344,64,1200000,22500,200,1,2,0,0,NULL,0.07),(619,25,'Swordspine','Pirate Frigate 8',345,39,1047000,21120,220,1,2,0,0,NULL,0.07),(620,26,'Osprey','The Osprey offers excellent versatility and power for its low price. Designed from the top down as a cheap but complete cruiser, the Osprey utilizes the best the Caldari have to offer in state-of-the-art armor alloys, sensor technology and weaponry - all mass manufactured to ensure low price. In the constant struggle to stay ahead of the Gallente, new technology has been implemented in the field of mining laser calibration. A notable improvement in ore yields has been made, especially in the hands of a well trained pilot.\n\nSpecial Ability: 20% bonus to mining laser yield per level. 10% bonus to capacitor use of shield transporters per level. 500% bonus to range of shield transporters.\n',41,221.9,11230000,107000,485,1,1,2875000,1,75,0.07),(621,26,'Caracal','The Caracal is a powerful vessel that specializes in missile deployment. It has excellent shield defenses, but poor armor plating. Its missile arsenal, when fully stocked, is capable of making a piece-meal of almost anyone.\n\nSpecial Ability: 5% bonus Kinetic Missile Damage per skill level and 10% bonus to Light, Heavy Assault and Heavy Missile Velocity per level.',42,221.05,12910000,92000,450,1,1,4560000,1,75,0.07),(622,26,'Stabber','The Stabber is the mainstay of the Minmatar fleet. It is light and extremely fast, yet surprisingly powerful, with a wide variety of weapons. It is one of few Minmatar vessels that have reached popularity outside Minmatar space.\n\nSpecial Ability: 5% bonus to Medium Projectile Turret firing speed per level and 5% bonus to max velocity per level.',47,123.03,11400000,80000,420,1,2,4450000,1,73,0.07),(623,26,'Moa','The Moa was designed as an all-out combat ship, and its heavy armament allows the Moa to tackle almost anything that floats in space. In contrast to its nemesis the Thorax, the Moa is most effective at long range where its railguns and missile batteries can rain death upon foes.\n\nSpecial Ability: 10% bonus to Medium Hybrid Turret optimal range per level and 5% bonus to shield resistance per level.\n',49,199.86,11720000,101000,250,1,1,8000000,1,75,0.07),(624,26,'Maller','Quite possibly the toughest cruiser in the galaxy, the Maller is a common sight in Amarrian Imperial Navy operations. It is mainly used for military duty, although a few can be found in the private sector acting as escort ships for very important dispatches.\n\nSpecial Ability: 10% bonus to Medium Energy Turret capacitor use per level and 5% bonus to all Armor Resistances per level.\n',57,134.43,11550000,118000,280,1,4,8375000,1,74,0.07),(625,26,'Augoror','The Augoror-class cruiser is one of the old warhorses of the Amarr Empire, having seen action in both the Jovian War and the Minmatar Rebellion. It is mainly used by the Amarrians for escort and scouting duties where frigates are deemed too weak. Like most Amarrian vessels, the Augoror depends first and foremost on its resilience and heavy armor to escape unscathed from unfriendly encounters.\n\nSpecial ability: 10% bonus to armor hitpoints per level. 10% bonus to capacitor need of energy transfer arrays per level. 500% bonus to range of energy transfer arrays.',58,91.59,10730000,115000,465,1,4,2907500,1,74,0.07),(626,26,'Vexor','The Vexor is a strong combat ship that is also geared to operate in a variety of other roles. The Vexor is especially useful for surveying in potentially hostile sectors as it can stay on duty for a very long time before having to return to base. Furthermore, it is well capable of defending itself against even concentrated attacks.\n\nSpecial Ability: 5% bonus to Medium Hybrid Turret damage per level and 10% bonus to drone hitpoints, damage and mining yield per skill level.\n\n',62,140.15,10310000,115000,480,1,8,4377500,1,76,0.07),(627,26,'Thorax','The Thorax-class cruiser is the latest combat ship commissioned by the Federation. While the Thorax is a very effective ship at any range, typical of modern Gallente design philosophy it is most effective when working at extreme close range where its blasters and hordes of combat drones tear through even the toughest of enemies.\n\nSpecial Ability: 5% bonus to Medium Hybrid Turret damage per level and 5% increase to MicroWarpdrive capacitor bonus per level.\n',63,167.24,11280000,112000,265,1,8,7400000,1,76,0.07),(628,26,'Arbitrator','The Arbitrator is unusual for Amarr ships in that it\'s primarily a drone carrier. While it is not the best carrier around, it has superior armor that gives it greater durability than most ships in its class.\n\nSpecial Ability: 5% bonus to Tracking Disruptor effectiveness per skill level and 10% bonus to drone hitpoints, damage and mining yield per skill level.\n\n',298,192,11200000,120000,345,1,4,3537500,1,74,0.07),(629,26,'Rupture','The Rupture is slow for a Minmatar ship, but it more than makes up for it in power. The Rupture has superior firepower and is used by the Minmatar Republic both to defend space stations and other stationary objects and as part of massive attack formations.\n\nSpecial Ability: 5% bonus to Medium Projectile Turret firing speed per level and 5% bonus to Medium Projectile Turret damage per level.',302,109,11650000,96000,300,1,2,6875000,1,73,0.07),(630,26,'Bellicose','Being a highly versatile class of Minmatar ships, the Bellicose has been used as a combat juggernaut as well as a support ship for wings of frigates. While not quite in the league of newer navy cruisers, the Bellicose is still a very solid ship for most purposes, especially in terms of long range combat.\n\nSpecial Ability: 5% bonus to Medium Projectile Turret Rate of Fire and 7.5% bonus to target painter effectiveness per skill level.\n\n',303,131,11550000,85000,315,1,2,3542500,1,73,0.07),(631,26,'Scythe','The Scythe-class cruiser is the oldest Minmatar ship still in use. It has seen many battles and is an integrated part in Minmatar tales and heritage. Recent firmware upgrades \"borrowed\" from the Caldari have vastly increased the efficiency of its mining output.\n\nSpecial Ability: 20% bonus to mining laser yield per level. 3.5% bonus to tracking links per level. 500% bonus to range of tracking links.\n',304,134,11110000,89000,440,1,2,2877500,1,73,0.07),(632,26,'Blackbird','The Blackbird is a small high-tech cruiser newly employed by the Caldari Navy. Commonly seen in fleet battles or acting as wingman, it is not intended for head-on slugfests, but rather delicate tactical situations.\n\nSpecial Ability: 15% bonus to ECM Target Jammer strength and 20% bonus to ECM Target Jammer optimal range per skill level.\n\n',311,175,13190000,96000,305,1,1,3512500,1,75,0.07),(633,26,'Celestis','The Celestis cruiser is a versatile ship which can be employed in a myriad of roles, making it handy for small corporations with a limited number of ships. True to Gallente style the Celestis is especially deadly in close quarters combat due to its advanced targeting systems.\n\nSpecial Ability: 5% bonus to Medium Hybrid Turret Damage and Remote Sensor Dampener effectiveness per skill level.\n\n',319,113,12070000,116000,320,1,8,3457500,1,76,0.07),(634,26,'Exequror','The Exequror is a heavy cargo cruiser capable of defending itself against raiding frigates, but lacks prowess in heavier combat situations. It is mainly used in relatively peaceful areas where bulk and strength is needed without too much investment involved.\n\nSpecial Ability: 10% bonus to Cargo Capacity per level. 10% bonus to capacitor need of remote armor repair system per level. 500% bonus to range of remote armor repair systems.',320,246,11020000,113000,600,1,8,2962500,1,76,0.07),(635,26,'Opux Luxury Yacht','The Opux Luxury Yachts are normally used by the entertainment industry for pleasure tours for wealthy Gallente citizens. These Opux Luxury Yacht cruisers are rarely seen outside of Gallente controlled space, but are extremely popular within the Federation.',330,287,13075000,115000,1750,1,8,0,0,NULL,0.07),(636,26,'Ixion','Pirate Cruiser 1',336,101,12155000,99000,1600,1,2,0,0,NULL,0.07),(637,26,'Ghoul','Pirate Cruiser 2',337,187,10900000,109000,300,1,2,0,0,NULL,0.07),(638,27,'Raven','The Raven is the powerhouse of the Caldari Navy. With its myriad launcher slots and powerful shields, few ships can rival it in strength or majesty.\n\nSpecial Ability: 5% bonus to Cruise and Siege Launcher Rate Of Fire and 10% bonus to Cruise Missile and Torpedo Velocity per level.',43,250,99300000,486000,665,1,1,108750000,1,80,0.07),(639,27,'Tempest','The Tempest is one of the Republic Fleet\'s key vessels, a versatile gunship proficient at long-range bombardment and capable of dishing out specialized types of damage with great effectiveness. A well-rounded squadron of Tempests has been proven time and time again to be an invaluable wild card in a fleet battle, one which opponents should ignore at their own peril.\n\nSpecial Ability: 5% bonus to Large Projectile Turret rate of fire and Large Projectile Turret damage per level.',48,250,103300000,450000,600,1,2,103750000,1,78,0.07),(640,27,'Scorpion','The first Scorpion-class battleship was launched only a couple of years ago, and those that have been built are considered to be prototypes. Little is known of its capabilities, but what has been garnered suggests that the Scorpion is crammed to the brink with sophisticated hi-tech equipment that few can match.\n\nSpecial Ability: 15% bonus to ECM Target Jammer strength and 20% bonus to ECM Target Jammer optimal range per level.',50,250,103600000,468000,550,1,1,71250000,1,80,0.07),(641,27,'Megathron','The Megathron has established itself as one of the most feared and respected battleships around. Since its first appearance almost two decades ago it has seen considerable service in the troublesome regions on the outskirts of the Federation, helping to expand and defend Gallentean influence there.\n\nSpecial Ability: 5% bonus to Large Hybrid Turret damage and 7.5% bonus to Large Hybrid Turret tracking speed per level.',64,250,98400000,513000,675,1,8,105000000,1,81,0.07),(642,27,'Apocalypse','In days past, only those in high favor with the Emperor could hope to earn the reward of commanding one of the majestic and powerful Apocalypse class battleships. In latter years, even though now in full market circulation, these golden, metallic monstrosities are still feared and respected as enduring symbols of Amarrian might.\n\nSpecial Ability: 10% bonus to Large Energy Turret capacitor use and 7.5% bonus to Large Energy Turret optimal range per level.',296,400,97100000,517500,675,1,4,112500000,1,79,0.07),(643,27,'Armageddon','The mighty Armageddon class is the main warship of the Amarr Empire. Its heavy armaments and strong front are specially designed to crash into any battle like a juggernaut and deliver swift justice in the name of the Emperor.\n\nSpecial Ability: 10% bonus to Large Energy Turret capacitor use and 5% Large Energy Turret rate of fire per level.',297,250,105200000,495000,600,1,4,66250000,1,79,0.07),(644,27,'Typhoon','Much praised by its proponents and much maligned by its detractors, the Typhoon-class battleship has always been one of the most hotly debated spacefaring vessels around. Its distinguishing aspect - and the source of most of the controversy - is its sheer versatility, variously seen as either a lack of design focus or a deliberate freedom for pilot modification.\n\nSpecial Ability: 5% bonus to Large Projectile Turret firing speed and 5% bonus to siege and cruise missile launcher firing speed per level.',301,250,103600000,414000,625,1,2,75000000,1,78,0.07),(645,27,'Dominix','The Dominix is one of the old warhorses dating back to the Gallente-Caldari War. While no longer regarded as the king of the hill, it is by no means obsolete. Its formidable hulk and powerful weapons batteries means that anyone not in the largest and latest battleships will regret ever locking horns with it.\n\nSpecial Ability: 5% bonus to Large Hybrid Turret damage and 10% bonus to drone hitpoints and damage per skill level.\n\n',318,250,97100000,454500,600,1,8,62500000,1,81,0.07),(647,27,'Eidolon','Little is known about Jovian vessels, safe for their technical superiority.',331,500,100000000,441000,700,1,16,2999998,0,NULL,0.07),(648,28,'Badger','The Badger-class freighter is the main cargo-carrier for the Caldari State, particularly in long, arduous trade-runs. Its huge size and comfortable armament makes it perfectly equipped for those tasks, although the Caldari seldom let it roam alone.\n\nSpecial Ability: 5% Bonus Cargo Capacity and Max Velocity per Caldari Industrial skill level ',51,216.4,12750000,250000,4125,1,1,348750,1,84,0.07),(649,28,'Badger Mark II','The Badger Mark II is the latest version of the famous Badger, it\'s mostly used by the military or the mega corps for transports of goods of great value. The Mark II has stronger defenses and more high-tech equipment, making it one of the best freight carriers available.\n\nSpecial Ability: 5% Bonus Cargo Capacity and Max Velocity per Caldari Industrial skill level ',52,313.45,13500000,270000,5250,1,1,742500,1,84,0.07),(650,28,'Iteron','The Iteron-class cargo tugger is fast and reliable and there are many versions of it. It is equally popular among civilians and militaries alike as it\'s cheap and can be fitted in myriad different ways, allowing it to be used to freight almost anything. It is, however, quite vulnerable and needs to be protected while in unfriendly territories.\n\nSpecial Ability: 5% Bonus Cargo Capacity and Max Velocity per Gallente Industrial skill level ',65,94.79,10250000,240000,3000,1,8,310000,1,83,0.07),(651,28,'Hoarder','The Hoarder is the second in line of the Minmatar industrial ships, it\'s not as strong as the Mammoth but its cargo space is very large for its price. It\'s perfect for operation in peaceful areas or when it has strong escort.\n\nSpecial Ability: 5% Bonus Cargo Capacity and Max Velocity per Minmatar Industrial skill level ',308,216,11500000,240000,5100,1,2,452500,1,82,0.07),(652,28,'Mammoth','The Mammoth is the biggest and the strongest industrial ship of the Minmatar Republic. It was designed with aid from the Gallente Federation, making the Mammoth both large and powerful yet also nimble and technologically advanced. A very good buy.\n\nSpecial Ability: 5% Bonus Cargo Capacity and Max Velocity per Minmatar Industrial skill level ',309,660,12500000,255000,5625,1,2,937500,1,82,0.07),(653,28,'Wreathe','The Wreathe is an old ship of the Minmatar Republic and one of the oldest ships still in usage. The design of the Wreathe is very plain, which is the main reason for its longevity, but it also makes the ship incapable of handling anything but the most mundane tasks.\n\nSpecial Ability: 5% Bonus Cargo Capacity and Max Velocity per Minmatar Industrial skill level ',310,207,10000000,225000,3300,1,2,322500,1,82,0.07),(654,28,'Iteron Mark II','The Iteron-class cargo tugger is fast and reliable and there are many versions of it. It is equally popular among civilians and militaries alike as it\'s cheap and can be fitted in myriad different ways, allowing it to be used to freight almost anything. It is, however, quite vulnerable and needs to be protected while in unfriendly territories.\n\nSpecial Ability: 5% Bonus Cargo Capacity and Max Velocity per Gallente Industrial skill level ',325,256,11000000,245000,3750,1,8,342500,1,83,0.07),(655,28,'Iteron Mark III','The Iteron-class cargo tugger is fast and reliable and there are many versions of it. It is equally popular among civilians and militaries alike as it\'s cheap and can be fitted in myriad different ways, allowing it to be used to freight almost anything. It is, however, quite vulnerable and needs to be protected while in unfriendly territories.\n\nSpecial Ability: 5% Bonus Cargo Capacity and Max Velocity per Gallente Industrial skill level ',326,283,10500000,250000,4875,1,8,428750,1,83,0.07),(656,28,'Iteron Mark IV','The Iteron-class cargo tugger is fast and reliable and there are many versions of it. It is equally popular among civilians and militaries alike as it\'s cheap and can be fitted in myriad different ways, allowing it to be used to freight almost anything. It is, however, quite vulnerable and needs to be protected while in unfriendly territories.\n\nSpecial Ability: 5% Bonus Cargo Capacity and Max Velocity per Gallente Industrial skill level ',327,153,11250000,265000,5250,1,8,600000,1,83,0.07),(657,28,'Iteron Mark V','The Iteron-class cargo tugger is fast and reliable and there are many versions of it. It is equally popular among civilians and militaries alike as it\'s cheap and can be fitted in myriad different ways, allowing it to be used to freight almost anything. It is, however, quite vulnerable and needs to be protected while in unfriendly territories.\n\nSpecial Ability: 5% Bonus Cargo Capacity and Max Velocity per Gallente Industrial skill level ',328,553,11750000,275000,6000,1,8,1125000,1,83,0.07),(658,28,'Visitant','Little is known about Jovian vessels, safe for their technical superiority.',334,506,15260000,240000,10000,1,16,196000,0,NULL,0.07),(659,29,'Capsule Home-201','',1679,10,32000,1000,0,1,NULL,0,0,NULL,0.07),(660,29,'Capsule Home-201.7','',1679,10,32000,1000,0,1,NULL,0,0,NULL,0.07),(661,29,'Capsule Home-601.5','',1679,10,32000,1000,0,1,NULL,0,0,NULL,0.07),(662,29,'Capsule Home-1.401','',1679,10,32000,1000,0,1,NULL,0,0,NULL,0.07),(663,29,'Capsule Home-1.501','',1679,10,32000,1000,0,1,NULL,0,0,NULL,0.07),(664,29,'Capsule Home-2.201','',1679,10,32000,1000,0,1,NULL,0,0,NULL,0.07),(665,29,'Capsule CP-100','',1679,10,32000,1000,0,