ation and the Caldari state deteriorated rapidly and, for a while, it seemed as if war might be brewing. It was seen by certain high-ranking officers within the Gallente navy as being of vital importance to be able to match the Caldari\'s cloaking technology in an effort to maintain the balance of power.\n\nGallente Frigate Skill Bonus: 5% bonus to Small Hybrid Turret damage and 10% bonus to Scout Drone Thermal damage per level\n\nCovert Ops Skill Bonus: -98% to -100% reduction in Cloaking Device CPU use per level and 10% increase to scan strength of probes per level\n\nNote: can fit covert cynosural field generators',1841,39,1271000,23000,175,1,8,2313068,1,423,0.04),(11173,105,'Helios Blueprint','',324,0,0,0.01,0,1,NULL,1800000,1,428,0),(11174,893,'Keres','Hull: Maulus Class\nRole: Electronic Attack Ship\n\nElectronic attack ships are mobile, resilient electronic warfare platforms. Although well suited to a variety of situations, they really come into their own in skirmish and fleet encounters, particularly against larger ships. For anyone wanting to decentralize their fleets electronic countermeasure capabilities and make them immeasurably harder to counter, few things will serve better than a squadron or two of these little vessels.\n\nDeveloper: Duvolle Labs \n\nDuvolle Labs manufactures sturdy ships with a good mix of offensive and defensive capabilities. Since the company is one of New Edens foremost manufacturers of particle blasters, its ships tend to favor turrets and thus have somewhat higher power output than normal.\n\nGallente Frigate Skill Bonus: 5% bonus to remote sensor dampener effectiveness and 10% reduction in remote sensor dampener capacitor need per level\n\nElectronic Attack Ships Skill Bonus: 10% bonus to warp disruptor range and 10% reduction in warp disruptor capacitor need per level\n',1913,39,1095000,23000,175,1,8,2154348,1,1068,0.04),(11175,105,'Keres Blueprint','',324,0,0,0.01,0,1,NULL,1800000,1,NULL,0),(11176,831,'Crow','Name: Crow\nHull: Condor Class\nRole: Interceptor \n\nInterceptors utilize a combination of advanced alloys and electronics to reduce their effective signature radius.  This, along with superior maneuverability and speed, makes them very hard to target and track, particularly for high caliber turrets. \n\nDeveloper: Kaalakiota\n\nAs befits one of the largest weapons manufacturers in the known world, Kaalakiota\'s ships are very combat focused. Favoring the traditional Caldari combat strategy, they are designed around a substantial number of weapons systems, especially missile launchers. However, they have rather weak armor and structure, relying more on shields for protection.\n \nCaldari Frigate Skill Bonus: 10% bonus to Kinetic Missile damage per level\n\nInterceptor Skill Bonus: 15% reduction in MicroWarpdrive signature radius penalty and 10% bonus to Missile Velocity per level\n\nRole bonus: 80% reduction in Propulsion Jamming systems activation cost',1848,33,999000,18000,150,1,1,2065190,1,401,0.04),(11177,105,'Crow Blueprint','',39,0,0,0.01,0,1,NULL,287500,1,411,0),(11178,831,'Raptor','Name: Raptor\nHull: Condor Class\nRole: Interceptor\n\nInterceptors utilize a combination of advanced alloys and electronics to reduce their effective signature radius.  This, along with superior maneuverability and speed, makes them very hard to target and track, particularly for high caliber turrets. \n\nDeveloper: Lai Dai\n\nLai Dai ships favor a balanced mix of ship systems, making them very versatile but also less powerful when it comes to specific tactics.\n\nCaldari Frigate Skill Bonus: 5% bonus to Small Hybrid Turret Damage and 10% bonus to Small Hybrid Turret optimal range per level\n\nInterceptor Skill Bonus: 15% reduction in MicroWarpdrive signature radius penalty and 5% bonus to Warp Scrambler and Warp Disruptor range per level\n\nRole bonus: 80% reduction in Propulsion Jamming systems activation cost',1878,33,1075000,18000,150,1,1,2067158,1,401,0.04),(11179,105,'Raptor Blueprint','',39,0,0,0.01,0,1,NULL,287500,1,411,0),(11180,324,'Rapier Frigate','Hull: Vigil Class\nDeveloper: Brutor Tribe\nRole: Recon Frigate \nSpecial: 90% less cpu need for Modules requiring Black Ops ',1973,37.07,1200000,28100,155,1,2,2315288,0,NULL,0.04),(11181,105,'Rapier Frigate Blueprint','',NULL,0,0,0.01,0,1,NULL,1725000,0,NULL,0),(11182,830,'Cheetah','Name: Cheetah\nHull: Probe Class\nRole: Covert Ops Frigate\n\nDesigned for commando and espionage operation, its main strength is the ability to travel unseen through enemy territory and to avoid unfavorable encounters.\n\nDeveloper: Thukker Mix\n\nIt is unclear how Thukker Mix could master the intricacies of cloaking technology so quickly after the fall of Crielere. According to Professor Oggand Viftuin, head of R&D, the tribe managed to recruit some senior Caldari scientist that used to work on the Mirage Project at Crielere. Ishukone has denied this, claiming that the Thukkers aquired the technology from prototypes stolen by the Guristas.\n\nMinmatar Frigate Skill Bonus: 5% bonus to Small Projectile Turret damage and 10% bonus to Small Projectile Turret optimal range per level\n\nCovert Ops Skill Bonus: -98% to -100% reduction in Cloaking Device CPU use per level and 10% increase to scan strength of probes per level\n\nNote: can fit covert cynosural field generators',1948,32.89,1430000,17400,200,1,2,2316560,1,424,0.04),(11183,105,'Cheetah Blueprint','',NULL,0,0,0.01,0,1,NULL,1725000,1,429,0),(11184,831,'Crusader','Name: Crusader\nHull: Executioner Class\nRole: Interceptor \n\nInterceptors utilize a combination of advanced alloys and electronics to reduce their effective signature radius.  This, along with superior maneuverability and speed, makes them very hard to target and track, particularly for high caliber turrets. \n\nDeveloper: Carthum Conglomerate\n\nCarthum ships are the very embodiment of the Amarrian warfare philosophy. Possessing sturdy armor and advanced weapon systems, they provide a nice mix of offense and defense. On the other hand, their electronic and shield systems tend to be rather limited.    \n\nAmarr Frigate Skill Bonus: 10% reduction in Small Energy Turret capacitor use and 5% bonus to Small Energy Turret damage per level\n\nInterceptor Skill Bonus: 15% reduction in MicroWarpdrive signature radius penalty and 7.5% bonus to Small Energy Turret Tracking Speed per level\n   \nRole bonus: 80% reduction in Propulsion Jamming systems activation cost',1921,30,1050000,28100,135,1,4,2070216,1,400,0.04),(11185,105,'Crusader Blueprint','',54,0,0,0.01,0,1,NULL,300000,1,410,0),(11186,831,'Malediction','Name: Malediction\nHull: Executioner Class\nRole: Interceptor\n\nInterceptors utilize a combination of advanced alloys and electronics to reduce their effective signature radius.  This, along with superior maneuverability and speed, makes them very hard to target and track, particularly for high caliber turrets.\n\nDeveloper: Khanid Innovations \n\nIn addition to robust electronics systems, the Khanid Kingdom\'s ships possess advanced armor alloys capable of withstanding a great deal of punishment. Generally eschewing the use of turrets, they tend to gear their vessels more towards close-range missile combat.\n\nAmarr Frigate Skill Bonus: 5% bonus to rocket damage and 5% bonus to armor resistances per level\n\nInterceptor Skill Bonus: 15% reduction in MicroWarpdrive signature radius penalty and 5% bonus to Warp Scrambler and Warp Disruptor range per level\n\nRole bonus: 80% reduction in Propulsion Jamming systems activation cost',1861,13,999000,28100,135,1,4,2080264,1,400,0.04),(11187,105,'Malediction Blueprint','',54,0,0,0.01,0,1,NULL,300000,1,410,0),(11188,830,'Anathema','Name: Anathema\nHull: Magnate Class\nRole: Covert Ops Frigate\n\nDesigned for commando and espionage operation, its main strength is the ability to travel unseen through enemy territory and to avoid unfavorable encounters.\n\nDeveloper: Khanid Innovation \n\nKhanid Innovations was quick to take advantage of the disintegration of the Crielere Project. Through shrewd diplomatic and financial maneuvering they were able to aquire a working Buzzard prototype as well as several of the former top scientists of Project Mirage to work on adapting its innovations to Khanid ship technology.\n\nAmarr Frigate Skill Bonus: 5% bonus to rocket damage and 5% reduction of capacitor recharge time per level\n\nCovert Ops Skill Bonus: -98% to -100% reduced CPU need for cloaking device per level and 10% increase to scan strength of probes per level\n\nNote: can fit covert cynosural field generators',3424,39,1147000,28100,190,1,4,2291660,1,421,0.04),(11189,105,'Anathema Blueprint','',1066,0,0,0.01,0,1,NULL,1500000,1,425,0),(11190,893,'Sentinel','Hull: Crucifier Class\nRole: Electronic Attack Ship\n\nElectronic attack ships are mobile, resilient electronic warfare platforms. Although well suited to a variety of situations, they really come into their own in skirmish and fleet encounters, particularly against larger ships. For anyone wanting to decentralize their fleets electronic countermeasure capabilities and make them immeasurably harder to counter, few things will serve better than a squadron or two of these little vessels.\n\nDeveloper: Viziam\n\nViziam ships are quite possibly the most durable ships money can buy. Their armor is second to none and that, combined with superior shields, makes them hard nuts to crack. Of course this does mean they are rather slow and possess somewhat more limited weapons and electronics options.\n\nAmarr Frigate Skill Bonus: 20% bonus to energy vampire and energy neutralizer transfer amount per level and 5% bonus to effectiveness of tracking disruptors per level\n\nElectronic Attack Ships Skill Bonus: 40% bonus to energy vampire and energy neutralizer range and 5% reduction in capacitor recharge time per level',3365,39,1112000,28100,165,1,4,2152006,1,1066,0.04),(11191,105,'Sentinel Blueprint','',1066,0,0,0.01,0,1,NULL,1500000,1,NULL,0),(11192,830,'Buzzard','Name: Buzzard\nHull: Heron Class\nRole: Covert Ops Frigate\n\nDesigned for commando and espionage operation, its main strength is the ability to travel unseen through enemy territory and to avoid unfavorable encounters.\n\nDeveloper: Ishukone \n\nThe Buzzard was developed according to the exacting specifications of Admiral Okaseilen Fukashi, head of the Caldari Navy Recon Division, and was the first production level ship specifically built to take full advantage of the cloaking breakthroughs achieved by Project Mirage at Crielere.\n\nCaldari Frigate Skill Bonus: 5% bonus to Missile Kinetic Damage and 5% bonus to Missile Launcher rate of fire per level\n\nCovert Ops Skill Bonus: -98% to -100% reduction in Cloaking Device CPU use per level and 10% increase to scan strength of probes per level\n\nNote: can fit covert cynosural field generators',1902,42.93,1270000,19400,190,1,1,2291676,1,422,0.04),(11193,105,'Buzzard Blueprint','',40,0,0,0.01,0,1,NULL,1600000,1,427,0),(11194,893,'Kitsune','Hull: Griffin Class\nRole: Electronic Attack Ship\n\nElectronic attack ships are mobile, resilient electronic warfare platforms. Although well suited to a variety of situations, they really come into their own in skirmish and fleet encounters, particularly against larger ships. For anyone wanting to decentralize their fleets electronic countermeasure capabilities and make them immeasurably harder to counter, few things will serve better than a squadron or two of these little vessels.\n\nDeveloper: Lai Dai\n\nLai Dai have always favored a balanced approach to their mix of on-board systems, leading to a line-up of versatile ships but providing very little in terms of tactical specialization.\n\nCaldari Frigate Skill Bonus: 20% bonus to ECM target jammer strength and 10% reduction in ECM target jammers\' capacitor need per level\n\nElectronic Attack Ships Skill Bonus: 10% bonus to ECM target jammer optimal range and 5% bonus to capacitor capacity per level\n',3364,42.93,111700