% reduction in Propulsion Jamming systems activation cost',1779,32.89,1100000,17400,120,1,2,2059228,1,403,0.04),(11199,105,'Stiletto Blueprint','',44,0,0,0.01,0,1,NULL,275000,1,413,0),(11200,831,'Taranis','Name: Taranis\nHull: Atron Class\nRole: Interceptor \n\nInterceptors utilize a combination of advanced alloys and electronics to reduce their effective signature radius. This, along with superior maneuverability and speed, makes them very hard to target and track, particularly for high caliber turrets.\n\nDeveloper: Duvolle Labs\n\nDuvolle labs manufactures sturdy ships with a good mix of offensive and defensive capacities. Since its foremost manufacturer of Particle Blasters its ships tend to favor turrets and thus have somewhat higher power output than normal.\n\nGallente Frigate Skill Bonus: 10% Small Hybrid Turret damage per level\n\nInterceptor Skill Bonus: 15% reduction in MicroWarpdrive signature radius penalty and 7.5% Small Hybrid Turret tracking speed Per Interceptor Skill Level \n\nRole bonus: 80% reduction in Propulsion Jamming systems activation cost',1912,31,1075000,22500,125,1,8,2077810,1,402,0.04),(11201,105,'Taranis Blueprint','',323,0,0,0.01,0,1,NULL,292500,1,412,0),(11202,831,'Ares','Name: Ares\nHull: Atron Class\nRole: Interceptor\n\nInterceptors utilize a combination of advanced alloys and electronics to reduce their effective signature radius.  This, along with superior maneuverability and speed, makes them very hard to target and track, particularly for high caliber turrets. \n\nDeveloper: Roden Shipyards \n\nUnlike most Gallente ship manufacturers, Roden Shipyards tends to favor missiles over drones and their ships are generally faster than other Gallente ships in their class. They generally have a substantial amount of hull modification options but limited electronic systems.  \n\nGallente Frigate Skill Bonus: 5% bonus to Small Hybrid Turret damage and 7.5% bonus to Small Hybrid Turret tracking speed per level\n\nInterceptor Skill Bonus: 1