.07),(11360,350,'Large Remote Armor Repair System I Blueprint','',80,0,0,0.01,0,1,NULL,312440,1,334,0),(11365,324,'Vengeance','Name: Vengeance\nHull: Punisher Class\nRole: Assault Ship\n\nThe Vengeance represents the latest in the Kingdom\'s ongoing mission to wed Amarr and Caldari tech, molding the two into new and exciting forms. Sporting a Caldari ship\'s launcher hardpoints as well as an Amarr ship\'s armor systems, this relentless slugger is perfect for when you need to get up close and personal.\n\nDeveloper: Khanid Innovation\n\nConstantly striving to combine the best of two worlds, Khanid Innovation have utilized their Caldari connections to such an extent that the Kingdom\'s ships now possess the most advanced missile systems outside Caldari space, as well as fairly robust electronics systems.\n\nAmarr Frigate Skill Bonus: 5% bonus to rocket damage\n\nAssault Ships Skill Bonus: 5% bonus to armor resistances and 5% bonus to cap recharge rate per level',1860,40,1163000,28600,210,1,4,3402384,1,433,0.04),(11366,105,'Vengeance Blueprint','',300,0,0,0.01,0,1,NULL,2875000,1,459,0),(11367,318,'map Landmark','',NULL,0,0,0,0,1,NULL,0,0,NULL,0),(11369,226,'Particle Acceleration Superstructure','',2069,4553,0,0,0,1,NULL,0,0,NULL,0),(11370,330,'Prototype Cloaking Device I','This prototype of an advanced cloaking mechanism was one of the last major technological breakthroughs to come out of Crielere Labs. Although it does work it is not really a finished product and has some serious drawbacks, most notably the fact that the module creates high sensor disruption while fitted and can not operate unless at minimum velocity.\n\nNote: Fitting two or more cloaking devices to a ship negates their use, as unsynchronized light deflection causes interference.',2106,0,0,100,0,1,NULL,802680,1,675,0),(11371,324,'Wolf','Name: Wolf\nHull:  Rifter Class\nRole:  Assault Ship\n\nNamed after a mythical beast renowned for its voraciousness, the Wolf is one of the most potentially destructive frigates currently in existence.  While hardier than its brother the Jaguar it has less in the way of shield systems, and the capabilities of its onboard computer leave something to be desired.  Nevertheless, the mere sight of a locked and loaded Wolf should be enough to make most pilots turn tail and flee.\n\nDeveloper:  Boundless Creation\n\nBoundless Creation\'s ships are based on the Brutor tribe\'s philosophy of warfare: simply fit as much firepower onto your ship as possible.  Defense systems and electronics arrays therefore take a back seat to sheer annihilative potential. \n\nMinmatar Frigate Skill Bonus: 5% Small Projectile Damage bonus\n\nAssault Ships Skill Bonus: 5% Small Projectile Turret damage and 10% falloff per level',1931,39,1309000,27289,165,1,2,3295668,1,436,0.04),(11372,105,'Wolf Blueprint','',1066,0,0,0.01,0,1,NULL,1500000,1,463,0),(11373,324,'Blade','Hull: Rifter Class\nRole: Escort\nDeveloper: Core Complexions\n\nCore Complexions ships are unusual in that they favor electronics and defence over the typical \"Lots of guns\" approach traditionaly favored by the Minmatar   \n\nRace Bonus: 30% Small projectile turret dmg bonus',1782,37,1200000,28600,130,1,2,3435444,0,NULL,0.04),(11374,105,'Blade Blueprint','',1066,0,0,0.01,0,1,NULL,1500000,0,NULL,0),(11375,324,'Erinye','Hull: Tristan Class\nDeveloper: Roden Shipyards\nRole: Assault Frigate \nSpecial: 90% less cpu need for Modules requiring Advanced Gunnery ',1770,39,2810000,28100,165,1,8,2617652,0,NULL,0.04),(11376,105,'Erinye Blueprint','',1066,0,0,0.01,0,1,NULL,1500000,0,NULL,0),(11377,834,'Nemesis','Name: Nemesis\nHull: Tristan Class\nRole: Stealth Bomber\n\nSpecifically engineered to fire cruise missiles, stealth bombers represent the next generation in covert ops craft. Advanced techniques in spatial distortion technology enable them to potentially fly faster when cloaked than when uncloaked - a fact which, coupled with their considerable firepower, makes them extremely dangerous in the hands of an accomplished pilot.\n\nIn addition, stealth bombers\' extremely advanced missile navigation subroutines are able to triangulate a cruise missile\'s trajectory in advance, resulting in a decreased factor of signature radius and making the missile more effective against smaller targets.\n\nDeveloper: Duvolle Laboratories\n\nDuvolle Labs manufactures sturdy ships with a good mix of offensive and defensive capabilities. Being the foremost manufacturer of particle blasters, its ships tend to favor turrets and thus have somewhat higher power output than normal.\n\nGallente Frigate Skill Bonus: 5% bonus to Cruise Missile damage and -16.66% reduction in Explosion Radius of Cruise Missiles per level\n\nCovert Ops Skill Bonus: 5% bonus to Cruise Missile and bomb thermal damage and multiplies the cloaked velocity by 125% per level\n\nRole Bonus: -99% reduction in Cruise Launcher powergrid needs, -99% reduction in Bomb Launcher CPU use and -100% targeting delay after decloaking\n\nNote: can fit covert cynosural field generators',1909,39,1421000,28100,215,1,8,3143456,1,423,0.04),(11378,105,'Nemesis Blueprint','',1066,0,0,0.01,0,1,NULL,1500000,1,428,0),(11379,324,'Hawk','Name: Hawk\nHull: Merlin Class\nRole: Assault Ship \n\nFollowing in the footsteps of Caldari vessels since time immemorial, the Hawk relies on tremendously powerful shield systems to see it through combat, blending launchers and turrets to provide for a powerful, well-rounded combat vessel.\n\nDeveloper:  Lai Dai\n\nLai Dai have always favored a balanced approach to their mix of on-board systems, leading to a line-up of versatile ships but providing very little in terms of tactical specialization.\n\nCaldari Frigate Skill Bonus: 5% bonus to Missile Kinetic Damage\n\nAssault Ships Skill Bonus: 10% bonus to missile velocity and 7.5% bonus to shield boost amount per level',1882,39,1217000,16500,300,1,1,3445488,1,434,0.04),(11380,105,'Hawk Blueprint','',1066,0,0,0.01,0,1,NULL,1500000,1,461,0),(11381,324,'Harpy','Name: Harpy\nHull: Merlin Class\nRole: Assault Ship\n\nAlready possessing a reputation despite its limited initial circulation, the Harpy is a powerful railgun platform with long range capability and strong defensive systems.  Formidable both one-on-one and as a support ship, it was referred to as the \"little Moa\" by the pilots who participated in its safety and performance testing.\n\nDeveloper: Ishukone\n\nIshukone created the Harpy as a long-range support frigate for defense of Ishukone holdings as well as increased muscle and visibility in the constantly shifting game of cold war the Caldari megacorps\' police forces play amongst themselves.\n\nCaldari Frigate Skill Bonus: 10% bonus to Small Hybrid Turret optimal range\n\nAssault Ships Skill Bonus: 10% bonus to Small Hybrid Turret optimal range and 5% bonus to Small Hybrid Turret damage per level',1901,39,1155000,16500,165,1,1,3412932,1,434,0.04),(11382,105,'Harpy Blueprint','',1066,0,0,0.01,0,1,NULL,1500000,1,461,0),(11383,324,'Gatherer','Developer: Viziam\nRole: Mining Frigate\nSpecial: -90% less cpu need for Deep Core Miner',1868,39,5250000,28100,400,1,4,2260028,0,NULL,0.04),(11384,105,'Gatherer Blueprint','',1066,0,0,0.01,0,1,NULL,1500000,0,NULL,0),(11385,324,'Sparrow','Hull: Bantam ClassDeveloper: Lai Dai Role: Mining FrigateSpecial: -90% less cpu need for Deep Core Miner',1970,39,5250000,28100,165,1,1,1940028,0,NULL,0.04),(11386,105,'Sparrow Blueprint','',1066,0,0,0.01,0,1,NULL,1500000,0,NULL,0),(11387,893,'Hyena','Hull: Vigil Class\nRole: Electronic Attack Ship\n\nElectronic attack ships are mobile, resilient electronic warfare platforms. Although well suited to a variety of situations, they really come into their own in skirmish and fleet encounters, particularly against larger ships. For anyone wanting to decentralize their fleets electronic countermeasure capabilities and make them immeasurably harder to counter, few things will serve better than a squadron or two of these little vessels.\n\nDeveloper: Core Complexion\n\nCore Complexions ships are unusual in that they favor electronics and defense over the lots of guns approach traditionally favored by the Minmatar.\n\nMinmatar Frigate Skill Bonus: 5% increase to MicroWarpdrive capacitor bonus and 7.5% bonus to effectiveness of target painters per level\n\nElectronic Attack Ships Skill Bonus: 20% bonus to stasis webifier range and 3% reduction in signature radius per level\n',1973,32.89,1083000,17400,150,1,2,2158606,1,1069,0.04),(11388,105,'Hyena Blueprint','',1066,0,0,0.01,0,1,NULL,1500000,1,NULL,0),(11389,324,'Kishar','Hull: Maulus Class\nDeveloper: Duvolle Laboratories',1913,39,5125000,28100,450,1,8,1940028,0,NULL,0.04),(11390,105,'Kishar Blueprint','',1066,0,0,0.01,0,1,NULL,1500000,0,NULL,0),(11393,324,'Retribution','Name: Retribution\nHull: Punisher Class\nRole: Assault Ship\n\nThe Retribution is an homage to the glory days of the Empire, informed by classical Amarrian design philosophy: if it\'s strong, sturdy and packs a punch, it\'s ready for action.  What this powerhouse lacks in speed and maneuverability it more than makes up for with its wide range of firepower possibilities and superb defensive ability.\n\nDeveloper:  Carthum Conglomerate\n\nCarthum ships are the very embodiment of the Amarrian warfare philosophy. Possessing sturdy armor and advanced weapon system they provide a nice mix of offence and defence.\n\nAmarr Frigate Skill Bonus: 10% reduction in Small Energy Turret cap use\n\nAssault Ships Skill Bonus: 10% bonus to Small Energy Turret optimal range and 5% bonus to Small Energy Turret damage per level\n',1920,40,1171000,28600,135,1,4,3433904,1,433,0.07),(11394,105,'Retribution Blueprint','',300,0,0,0.01,0,1,NULL,2875000,1,459,0),(11395,268,'Deep Core Mining','Skill at operating mining lasers requiring Deep Core Mining. 20% reduction per skill level in the chance of a damage cloud forming while mining Mercoxit.',33,0,0,0.01,0,1,NULL,500000,1,369,0),(11396,468,'Mercoxit','Mercoxit is a very dense ore that must be mined using specialized deep core mining techniques. It contains massive amounts of the extraordinary Morphite mineral but few other minerals of note.',2102,1,1e+35,40,0,250,NULL,17367040,1,530,0),(11399,18,'Morphite','Morphite is a highly unorthodox mineral that can only be found in the hard-to-get Mercoxit ore. It is hard to use Morphite as a basic building material, but when it is joined with existing structures it can enhance the performance and durability manifold. This astounding quality makes this the material responsible for ushering in a new age in technology breakthroughs. ',2103,0,0,0.01,0,1,NULL,32768,1,18,0),(11400,324,'Jaguar','Name: Jaguar\nHull:  Rifter Class\nRole:  Assault Ship\n\nThe Jaguar is a versatile ship capable of reaching speeds unmatched by any other assault-class vessel. While comparatively weak on the defensive front it sports great flexibility, allowing pilots considerable latitude in configuring their loadouts for whatever circumstances they find themselves in.\n\nDeveloper:  Thukker Mix\n\nBeing the brain-child of the nomadic Thukkers, it is no surprise the Jaguar is as fast as it is.  Initially conceived as a way for the tribe to pack some added punch to their organized detachments, they\'ve found it to be equally useful as messenger, scout and escort, and it is likely to become one of the most commonly-seen ships in the Thukkers\' stomping grounds.\n\nMinmatar Frigate Skill Bonus: 5% Small Projectile damage bonus\n\nAssault Ships Skill Bonus: 10% Small Projectile Turret optimal range and 5% projectile damage per level.',1950,39,1366000,27289,130,1,2,3435444,1,436,0.04),(11401,105,'Jaguar Blueprint','',1066,0,0,0.01,0,1,NULL,1500000,1,463,0),(11433,270,'High Energy Physics','Skill and knowledge of High Energy Physics and its use in the development of advanced technology.\n\nUses primarily in the research of various energy system modules as well as smartbombs and laser based weaponry. \n\nAllows High Energy Physics research to be performed with the help of a research agent. \n\nNeeded for all research and manufacturing operations on related blueprints\n\nCan not be trained on Trial Accounts',33,0,0,0.01,0,1,NULL,10000000,1,375,0),(11441,270,'Plasma Physics','Skill and knowledge of Plasma physics and its use in the development of advanced technology.\n\nUses primarily in the research of particle blaster weaponry as well as plasma based missiles and smartbombs. \n\nAllows Plasma Physics research to be performed with the help of a research agent. \n\nNeeded for all research and manufacturing operations on related blueprints\n\nCan not be trained on Trial Accounts',33,0,0,0.01,0,1,NULL,10000000,1,375,0),(11442,270,'Nanite Engineering','Skill and knowledge of Nanorobotics and its use in the development of advanced technology .\n\nUses primarily in the research of various armor and hull systems. \n\nAllows Nanite Engineering research to be performed with the help of a research agent. \n\nNeeded for all research and manufacturing operations on related blueprints\n\nCan not be trained on Trial Accounts',33,0,0,0.01,0,1,NULL,10000000,1,375,0),(11443,270,'Hydromagnetic Physics','Skill and knowledge of Hydromagnetic Physics and its use in the development of advanced technology .\n\nUses primarily in the research of shield system.\n\nAllows Hydromagnetic Physics research to be performed with the help of a research agent. \n\nNeeded for all research and manufacturing operations on related blueprints.\n\nCan not be trained on Trial Accounts.',33,0,0,0.01,0,1,NULL,10000000,1,375,0),(11444,270,'Amarrian Starship Engineering','Skill and knowledge of Amarrian Starship Engineering.\n\nUsed Exclusively in the research of Amarrian Ships of all Sizes.\n\nAllows Amarrian Starship Engineering research to be performed with the help of a research agent. \n\nNeeded for all research and manufacturing operations on related blueprints\n\nCan not be trained on Trial Accounts',33,0,0,0.01,0,1,NUL