d constructed by the most skilled starship engineers and architects of the Empire, the imperial issue of the mighty Armageddon class is an upgraded version of the most-used warship of the Amarr. Its heavy armaments and strong front are specially designed to crash into any battle like a juggernaut and deliver swift justice in the name of the Emperor.\n\nSpecial Ability: 10% bonus to Large Energy Turret capacitor use and 5% Large Energy Turret rate of fire per level.',2240,250,97100000,495000,600,1,4,66250000,1,NULL,0.07),(11939,107,'Armageddon Imperial Issue Blueprint','',297,0,0,0.01,0,1,NULL,0,0,NULL,0),(11940,25,'Gold Magnate','This ship is a masterly designed frigate as much as it is an exquisite piece of art. The Magnate class has been the pet project of a small elite group of royal ship engineers for a decade. Only recently has the long years of expensive research paid off with the Gold issue of this renowned masterwork.\n\nSpecial Ability: \n5% bonus to Small Energy Turret capacitor use and Small Energy Turret damage per skill level.',2242,49,1072000,28100,135,1,4,30000,1,NULL,0.07),(11942,25,'Silver Magnate','This decoratively designed ship is a luxury in it\'s own class. The Magnate frigate has been the pet project of a small elite group of royal ship engineers for a decade. Over the long years of expensive research, the design process has gone through several stages, each setting a new standard in frigate design, with the Silver issue being one of the most recent issues of this line of masterworks.\n\nSpecial Ability: \n5% bonus to Small Energy Turret capacitor use and Small Energy Turret damage per skill level.',2241,49,1063000,28100,100,1,4,535544,1,NULL,0.07),(11944,314,'Synthetic Coffee','This stimulating aromatic drink, made out of dried, roasted and ground seeds, is a particular favorite among scientists and software engineers.',2244,0,2500,0.2,0,1,NULL,0,1,492,0),(11947,687,'Khanid Fighter','This is a fighter for the Khanid Kingdom. It is protecting 