s have onboard facilities designed to maximize the effectiveness of electronic countermeasure modules of all kinds.  Filling a role next to their class counterpart, the heavy assault ship, combat recon ships are the state of the art when it comes to anti-support support.  They are also devastating adversaries in smaller skirmishes, possessing strong defensive capabilities in addition to their electronic superiority.\n\nDeveloper: Kaalakiota\n\nAs befits one of the largest weapons manufacturers in the known world, Kaalakiota\'s ships are very combat focused. Favoring the traditional Caldari combat strategy, they are designed around a substantial number of weapons systems, especially missile launchers. However, they have rather weak armor and structure, relying more on shields for protection.\n\nCaldari Cruiser Skill Bonus:  10% reduction in ECM Target Jammer capacitor use and 20% bonus to ECM Target Jammer optimal range per level\n\nRecon Ships Skill Bonus:  20% bonus to ECM Target Jammer strength per level and 5% bonus to heavy and light missile kinetic damage.\n',1847,131,12730000,96000,305,1,1,15001492,1,830,0.07),(11960,106,'Rook Blueprint','',303,0,0,0.01,0,1,NULL,0,1,901,0),(11961,906,'Huginn','Name: Huginn\nHull: Bellicose\nRole: Combat Recon Ship\n\nBuilt to represent the last word in electronic warfare, combat recon ships have onboard facilities designed to maximize the effectiveness of electronic countermeasure modules of all kinds.  Filling a role next to their class counterpart, the heavy assault ship, combat recon ships are the state of the art when it comes to anti-support support.  They are also devastating adversaries in smaller skirmishes, possessing strong defensive capabilities in addition to their electronic superiority.\n\nDeveloper:  Boundless Creation\n\nBoundless Creation\'s ships are based on the Brutor tribe\'s philosophy of warfare: simply fit as much firepower onto your ship as possible.  Defense systems and electronics arrays therefore tend to take a back seat to sheer annihilative potential.\n\nMinmatar Cruiser Skill Bonus:  5% bonus to Medium Projectile Turret rate of fire and 7.5% bonus to target painter effectiveness per level\n\nRecon Ships Skill Bonus:  60% bonus to stasis webifier range and 5% bonus to Heavy Missile Launcher, heavy assault missile launcher and Assault Missile Launcher rate of fire per level',1945,131,11550000,85000,315,1,2,14988558,1,836,0.07),(11962,106,'Huginn Blueprint','',303,0,0,0.01,0,1,NULL,0,1,903,0),(11963,833,'Rapier','Name: Rapier\nHull: Bellicose\nRole: Force Recon Ship\n\nForce recon ships are the cruiser-class equivalent of covert ops frigates.  While not as resilient as combat recon ships, they are nonetheless able to do their job as reconaissance vessels very effectively, due in no small part to their ability to interface with covert ops cloaking devices and set up cynosural fields for incoming capital ships.\n\nDeveloper: Core Complexion\n\nCore Complexion\'s ships are unusual in that they favor electronics and defense over the \"lots of guns\" approach traditionally favored by the Minmatar.   \n\nMinmatar Cruiser Skill Bonus:  5% bonus to Medium Projectile Turret rate of fire and 7.5% bonus to target painter effectiveness per level\n\nRecon Ships Skill Bonus:  60% bonus to stasis webifier range and -96% to -100% reduction in Cloaking Device CPU use per level\n\nRole Bonus:  80% reduction in liquid ozone consumption for cynosural field generation and 50% reduction in cynosural field duration.\n\nNote: can fit covert cynosural field generators',1777,131,11040000,85000,315,1,2,14990532,1,836,0.07),(11964,106,'Rapier Blueprint','',303,0,0,0.01,0,1,NULL,0,1,903,0),(11965,833,'Pilgrim','Name: Pilgrim\nHull: Arbitrator\nRole: Force Recon Ship\n\nForce recon ships are the cruiser-class equivalent of covert ops frigates.  While not as resilient as combat recon ships, they are nonetheless able to do their job as reconaissance vessels very effectively, due in no small part to their ability to interface with covert ops cloaking devices and set up cynosural fields for incoming capital ships.\n\nDeveloper: Carthum Conglomerate\n\nCarthum ships are the very embodiment of the Amarrian warfare philosophy. Possessing sturdy armor and advanced weapon systems, they provide a nice mix of offense and defense. On the other hand, their electronic and shield systems tend to be rather limited.  \n\nAmarr Cruiser Skill Bonus:  5% bonus to Tracking Disruptor effectiveness and 10% bonus to drone hit points and damage per level.\n\nRecon Ships Skill Bonus:  20% bonus to Energy Vampire and Energy Neutralizer transfer amount and -96% to -100% reduction in Cloaking Device CPU use per level\n\nRole Bonus:  80% reduction in liquid ozone consumption for cynosural field generation and 50% reduction in cynosural field duration.\n\nNote: can fit covert cynosural field generators',1914,131,11370000,120000,315,1,4,15013042,1,827,0.07),(11966,106,'Pilgrim Blueprint','',303,0,0,0.01,0,1,NULL,0,1,900,0),(11969,833,'Arazu','Name: Arazu\nHull: Celestis\nRole: Force Recon Ship\n\nForce recon ships are the cruiser-class equivalent of covert ops frigates.  While not as resilient as combat recon ships, they are nonetheless able to do their job as reconaissance vessels very effectively, due in no small part to their ability to interface with covert ops cloaking devices and set up cynosural fields for incoming capital ships.\n\nDeveloper: Duvolle Labs\n\nDuvolle Labs manufactures sturdy ships with a good mix of offensive and defensive capabilities. Since the company is one of New Edens foremost manufacturers of particle blasters, its ships tend to favor turrets and thus have somewhat higher power output than normal.\n\nGallente Cruiser Skill Bonus:  5% bonus to Medium Hybrid Turret damage and 5% bonus to Remote Sensor Dampener effectiveness per level\n\nRecon Ships Skill Bonus:  20% bonus to warp disruptor range and -96% to -100% reduction in Cloaking Device CPU use per level\n\nRole Bonus:  80% reduction in liquid ozone consumption for cynosural field generation and 50% reduction in cynosural field duration.\n\nNote: can fit covert cynosural field generators',1903,131,11650000,116000,315,1,8,14962526,1,833,0.07),(11970,106,'Arazu Blueprint','',303,0,0,0.01,0,1,NULL,0,1,902,0),(11971,906,'Lachesis','Name: Lachesis\nHull: Celestis\nRole: Combat Recon Ship\n\nBuilt to represent the last word in electronic warfare, combat recon ships have onboard facilities designed to maximize the effectiveness of electronic countermeasure modules of all kinds.  Filling a role next to their class counterpart, the heavy assault ship, combat recon ships are the state of the art when it comes to anti-support support.  They are also devastating adversaries in smaller skirmishes, possessing strong defensive capabilities in addition to their electronic superiority.\n\nDeveloper: Roden Shipyards\n\nUnlike most Gallente ship manufacturers, Roden Shipyards tend to favor missiles over drones and their ships generally possess stronger armor.  Their electronics capacity, however, tends to be weaker than that of their competitors.\n\nGallente Cruiser Skill Bonus:  5% bonus to Medium Hybrid Turret damage and 5% bonus to Remote Sensor Dampener effectiveness per level\n\nRecon Ships Skill Bonus:  20% bonus to warp disruptor range and 5% bonus to Heavy Missile Launcher and Assault Missile Launcher rate of fire per level\n',2140,131,12070000,116000,320,1,8,15072684,1,833,0.07),(11972,106,'Lachesis Blueprint','',303,0,0,0.01,0,1,NULL,0,1,902,0),(11973,358,'Nocturne','Hull: Osprey ClassDeveloper: Kaalakiota Role: Support Cruiser ',1844,131,10000000,85000,315,1,1,4361700,0,NULL,0.07),(11974,106,'Nocturne Blueprint','',303,0,0,0.01,0,1,NULL,0,0,NULL,0),(11978,832,'Scimitar','Hull: Scythe Class\nRole: Support Cruiser\n\nBuilt with special tracking support arrays, the Scimitar was designed in large part to assist heavy combat vessels in tracking fast-moving targets.  Relatively nimble for a support cruiser, it can often be found ducking between battleships, protecting its own back while lending the behemoths the support they need to take out their enemies.\n\nDeveloper: Core Complexions, Inc.\n\nCore Complexions ships are unusual in that they favor electronics and defense over the \"Lots of guns\" approach traditionally favored by the Minmatar.  Being a support cruiser, the Scimitar therefore fits ideally into their design scheme.\n\nMinmatar Cruiser Skill Bonus: 150% bonus to Tracking Link and Shield Transport range and 20% bonus to Shield Maintenance Bot transport amount per level\n\nLogistics Skill Bonus: 10% bonus to Tracking Link efficiency and 15% reduction in Shield Transport capacitor use per level\n\nRole Bonus: -50% CPU need for Shield Transporters',1778,134,12090000,89000,440,1,2,12450072,1,441,0.07),(11979,106,'Scimitar Blueprint','',303,0,0,0.01,0,1,NULL,0,1,446,0),(11980,358,'Drifter','Hull: Scythe ClassDeveloper: Thukker MixRole: Support Cruiser ',1946,131,10000000,85000,315,1,2,4361700,0,NULL,0.07),(11981,106,'Drifter Blueprint','',303,0,0,0.01,0,1,NULL,0,0,NULL,0),(11982,358,'Sanctity','Hull: Auguror ClassDeveloper: ViziamRole: Support Cruiser ',1750,131,10000000,85000,315,1,4,4361700,0,NULL,0.07),(11983,106,'Sanctity Blueprint','',303,0,0,0.01,0,1,NULL,0,0,NULL,0),(11985,832,'Basilisk','Name: Basilisk\nHull: Osprey Class\nRole: Support Cruiser\n\nFollowing in the time-honored Caldari spaceship design tradition, the Basilisk sports top-of-the-line on-board computer systems specially designed to facilitate shield transporting arrays, while sacrificing some of the structural strength commonly found in vessels of its class.\n\nDeveloper: Lai Dai\n\nLai Dai have always favored a balanced approach to their mix of on-board systems, leading to a line-up of versatile ships but providing very little in terms of tactical specialization.  With the Basilisk, their aim was to continue pushing forward the development of cutting-edge defense optimization systems while providing powerful support capability.\n\nCaldari Cruiser Skill Bonus: 150% bonus to Shield Transport and Energy Transfer Array range and 20% bonus to Shield Maintenance Bot transfer amount per level\n\nLogistics Skill Bonus: 15% reduction in Shield Transport and Energy Transfer Array capacitor use per level\n\nRole Bonus: -50% CPU need for Shield Transporters and -50% power need for Energy Transfer Arrays',1823,221.9,13130000,107000,485,1,1,13340104,1,439,0.07),(11986,106,'Basilisk Blueprint','',303,0,0,0.01,0,1,NULL,0,1,444,0),(11987,832,'Guardian','Hull: Augoror Class\nRole: Support Cruiser\n\nThe Guardian is the first vessel to feature Carthum Conglomerate\'s brand new capacitor flow maximization system, allowing for greater amounts of energy to be stored in the capacitor as well as providing increased facilities for transporting that energy to other ships.\n\nDeveloper: Carthum Conglomerate\n\nWhile featuring Carthum\'s trademark armor and hull strength, the Guardian, being a support ship, has limited room for armaments.  Its intended main function is to serve as an all-round support vessel, providing the raw energy for fleet compatriots to do what they need to do in order to achieve victory.\n\nAmarr Cruiser Skill Bonus: 150% bonus to Energy Transfer Array and Remote Armor Repair System range and 20% bonus to Armor Maintenance Bot transfer amount per level\n\nLogistics Skill Bonus: 15% reduction in Energy Transfer Array and Remote Armor Repair System capacitor use per level\n\nRole Bonus: -65% power need for Remote Armor Repair Systems and -50% power need for Energy Transfer Arrays',1916,91.59,11980000,115000,465,1,4,12567518,1,438,0.07),(11988,106,'Guardian Blueprint','',303,0,0,0.01,0,1,NULL,0,1,443,0),(11989,832,'Oneiros','Hull: Exequror Class\nRole: Support Cruiser\n\nDesigned specifically as an armor augmenter, the Oneiros provides added defensive muscle to fighters on the front lines.  Additionally, its own formidable defenses make it a tough nut to crack.  Breaking through a formation supported by an Oneiros is no mean feat.\n\nDeveloper: Roden Shipyards\n\nDeciding that added defensive capabilities would serve to strengthen the overall effectiveness of Gallente ships, who traditionally have favored pure firepower over other aspects, Roden Shipyards came up with the Oneiros.  Intrigued, Gallente Navy officials are reportedly considering incorporating this powerful defender into their fleet formations.\n\nGallente Cruiser Skill Bonus: 150% bonus to Remote Armor Repair System and Tracking Link range 20% bonus to Armor Maintenance Bot transfer amount per level\n\nLogistics Skill Bonus: 15% reduction in Remote Armor Repair System capacitor use and 10% bonus to Tracking Link efficiency per level\n\nRole Bonus: -65% power need for Remote Armor Repair Systems',2141,246,13160000,113000,600,1,8,12691246,1,440,0.07),(11990,106,'Oneiros Blueprint','',303,0,0,0.01,0,1,NULL,0,1,445,0),(11991,358,'Clotho','Hull: Exequror ClassDeveloper: Duvolle LabsRole: Support Cruiser',1903,131,10000000,85000,315,1,8,4361700,0,NULL,0.07),(11992,106,'Clotho Blueprint','',303,0,0,0.01,0,1,NULL,0,0,NULL,0),(11993,358,'Cerberus','Hull: Caracal Class\nRole: Heavy Assault Ship\n\nNo cruiser currently in existence can match the superiority of the Cerberus\'s onboard missile system.  With a well-trained pilot jacked in, this fanged horror is capable of unleashing a hail of missiles to send even the most seasoned armor tankers running for cover.\n\nDeveloper:  Lai Dai\n\nMoving away from their traditionally balanced all-round designs, Lai Dai have created a very specialized - and dangerous - missile boat in the Cerberus.  Many have speculated that due to recent friction between Caldari megacorporations, LD may be looking to beef up their own police force with these missile-spewing monstrosities.\n\nCaldari Cruiser Skill Bonus: 5% bonus to Kinetic Missile damage and 10% bonus to Missile velocity per level\n\nHeavy Assault Ship Skill Bonus: 10% bonus to Heavy Assault and Heavy Missile flight time and 5% bonus to Missile Launcher rate of fire per level\n',1825,221.05,12720000,92000,650,1,1,17950950,1,450,0.07),(11994,106,'Cerberus Blueprint','',303,0,0,0.01,0,1,NULL,0,1,455,0),(11995,894,'Onyx','Hull: Moa Class\nRole: Heavy Interdictor\n\nEffectively combining the trapping power of interdictors with the defensive capabilities of heavy assault ships, the heavy interdictor is an invaluable addition to any skirmish force, offensive or defensive. Heavy interdictors are the only ships able to use the warp disruption field generator, a module which creates a warp disruption field that moves with the origin ship wherever it goes.  \n\nDeveloper: Kaalakiota \n\nAs befits one of the largest weapons manufacturers in the known world, Kaalakiotas ships are very combat focused. Favoring the traditional Caldari combat strategy, they are designed around a substantial number of weapons systems, especially missile launchers. However, they have rather weak armor and structure, relying more on shields for protection.\n\nCaldari Cruiser Skill Bonus: 5% bonus to kinetic missile damage and 5% bonus to shield resistances per level\n\nHeavy Interdictors Skill Bonus: 10% bonus to heavy assault and heavy missile velocity and 5% bonus to range of warp disruption fields per level\n\nNote: can fit warp disruption field generators\n',3362,131,15420000,92000,450,1,1,18302524,1,1072,0.07),(11996,106,'Onyx Blueprint','',303,0,0,0.01,0,1,NULL,0,1,NULL,0),(11997,358,'Glaive','Hull: Stabber ClassDeveloper: Core Complexions Inc.Role: Patrol Cruiser',1775,131,10000000,85000,315,1,2,4361700,0,NULL,0.07),(11998,106,'Glaive Blueprint','',303,0,0,0.01,0,1,NULL,0,0,NULL,0),(11999,358,'Vagabond','Hull: Stabber Class\nRole: Heavy Assault Ship\n\nThe fastest cruiser invented to date, this vessel is ideal for hit-and-run ops where both speed and firepower are required.  Its on-board power core may not be strong enough to handle some of the larger weapons out there, but when it comes to guerilla work, the Vagabond can\'t be beat.\n\nDeveloper: Thukker Mix\n\nImproving on the original Stabber design, Thukker Mix created the Vagabond as a cruiser-sized skirmish vessel equally suited to defending mobile installations and executing lightning strikes at their enemies.  Honoring their tradition of building the fastest vessels to ply the spacelanes, they count the Vagabond as one of their crowning achievements.\n\nMinmatar Cruiser Skill Bonus:  5% bonus to Medium Projectile Turret rate of fire and 5% bonus to max velocity per level\n\nHeavy Assault Ship Skill Bonus:  10% bonus to Medium Projectile Turret falloff range and 5% bonus to Medium Projectile Turret damage per level\n',1943,123.03,11590000,80000,360,1,2,17944848,1,452,0.07),(12000,106,'Vagabond Blueprint','',303,0,0,0.01,0,1,NULL,0,1,457,0),(12003,358,'Zealot','Hull: Omen Class\nRole: Heavy Assault Ship\n\nThe Zealot is built almost exclusively as a laser platform, designed to wreak as much havoc as its energy beams can be made to.  As a vanguard vessel, its thick armor and dazzling destructive power make it capable of cutting through enemy fleets with striking ease.  Zealots are currently being mass-produced by Viziam for the Amarr Navy.\n\nDeveloper: Viziam \n\nFor their first production-ready starship design, Viziam opted to focus on their core proficiencies - heavy armor and highly optimized weaponry. The result is an extremely focused design that, when used correctly, can go toe-to-toe with any contemporary cruiser design.\n\nAmarr Cruiser Skill Bonus: 10% bonus to Medium Energy Turret capacitor use and 5% bonus to Medium Energy Turret rate of fire per level\n\nHeavy Assault Ship Skill Bonus:  10% bonus to Medium Energy Turret optimal range and 5% bonus to Medium Energy Turret damage per level\n',1751,134.43,12580000,118000,240,1,4,17956216,1,449,0.07),(12004,106,'Zealot Blueprint','',303,0,0,0.01,0,1,NULL,0,1,454,0),(12005,358,'Ishtar','Hull: Vexor Class\nRole: Heavy Assault Ship\n\nWhile not endowed with as much pure firepower as other ships of its category, the Ishtar is more than able to hold its own by virtue of its tremendous capacity for drones and its unique hard-coded drone-control subroutines.\n\nDeveloper: CreoDron\n\nTouted as \"the Ishkur\'s big brother,\" the Ishtar design is the furthest CreoDron have ever gone towards creating a completely dedicated drone carrier.  At various stages in its development process plans were made to strengthen the vessel in other areas, but ultimately the CreoDron engineers\' fascination with pushing the drone carrier envelope overrode all other concerns.\n\nGallente Cruiser Skill Bonus: 5% bonus to Medium Hybrid Turret damage and 10% bonus to drone hitpoints and damage per skill level.\n\nHeavy Assault Ship Skill Bonus: +5 km bonus to Scout and Heavy Drone operation range and +50 m3 extra Drone Bay space per level\n',1835,140.15,11100000,115000,460,1,8,17949992,1,451,0.07),(12006,106,'Ishtar Blueprint','',303,0,0,0.01,0,1,NULL,0,1,456,0),(12007,358,'Atropos','Hull: Vexor ClassDeveloper: Duvolle LabsRole: Patrol Cruiser',1905,131,10000000,85000,315,1,8,4361700,0,NULL,0.07),(12008,106,'Atropos Blueprint','',303,0,0,0.01,0,1,NULL,0,0,NULL,0),(12009,358,'Obsidian','Hull: Moa ClassDeveloper: Kaalakiota Role: Battlecruiser',1785,131,10000000,85000,315,1,1,4361700,0,NULL,0.07),(12010,106,'Obsidian Blueprint','',303,0,0,0.01,0,1,NULL,0,0,NULL,0),(12011,358,'Eagle','Hull: Moa Class\nRole: Heavy Assault Ship\n\nBuilt on the shoulders of the sturdy Moa and improving on its durability and range, the Eagle is the next generation in Caldari gunboats.  Able to fire accurately and do tremendous damage at ranges considered extreme by any cruiser pilot,  this powerhouse will be the bane of anyone careless enough to think himself out of its range.\n\nDeveloper: Ishukone\n\nCaldari starship design is showing a growing trend towards armaments effective at high ranges, and in this arena, as in others, Ishukone do not let themselves get left behind, the Eagle was intended by them as a counter to the fearsome long-range capabilities of Lai Dai\'s Cerberus ship.\n\nCaldari Cruiser Skill Bonus: 10% bonus to Medium Hybrid Turret optimal range per level and 5% bonus to shield resistances per level.\n\nHeavy Assault Ship Skill Bonus: 10% bonus to Medium Hybrid Turret optimal range and 5% bonus to Medium Hybrid Turret damage per level\n',1894,199.86,11720000,101000,450,1,1,17062524,1,450,0.07),(12012,106,'Eagle Blueprint','',303,0,0,0.01,0,1,NULL,0,1,455,0),(12013,894,'Broadsword','Hull: Rupture Class\nRole: Heavy Interdictor\n\nEffectively combining the trapping power of interdictors with the defensive capabilities of heavy assault ships, the heavy interdictor is an invaluable addition to any skirmish force, offensive or defensive. Heavy interdictors are the only ships able to use the warp disruption field generator, a module which creates a warp disruption field that moves with the origin ship wherever it goes.  \n\nDeveloper: Core Complexion Inc.\n\nCore Complexions ships are unusual in that they favor electronics and defense over the lots of guns approach traditionally favored by the Minmatar.\n\nMinmatar Cruiser Skill Bonus: 5% bonus to medium projectile turret rate of fire and 5% bonus to shield resistances per level\n \nHeavy Interdictors Skill Bonus: 10% bonus to medium projectile turret falloff and 5% bonus to range of warp disruption fields per level\n\nNote: can fit warp disruption field generators\n',1776,109,14820000,96000,452,1,2,18302768,1,1074,0.07),(12014,106,'Broadsword Blueprint','',303,0,0,0.01,0,1,NULL,0,1,NULL,0),(12015,358,'Muninn','Hull: Rupture Class\nRole: Heavy Assault Ship\n\nCommissioned by the Republic Fleet to create a powerful assault vessel for the strengthening of the Matari tribes as well as a commercial platform for the Howitzers and other guns produced by the Fleet, Boundless Creation came up with the Muninn.  Heavily armored, laden with turret hardpoints and sporting the latest in projectile optimization technology, this is the very definition of a gunboat.\n\nDeveloper: Boundless Creation\n\nBoundless Creation\'s ships are based on the Brutor tribe\'s philosophy of warfare: simply fit as much firepower onto your ship as is humanly possible.  The Muninn is far from being an exception.\n\nMinmatar Cruiser Skill Bonus: 5% bonus to Medium Projectile Turret rate of fire and 5% bonus to Medium Projectile Turret damage per level\n\nHeavy Assault Ship Skill Bonus: 10% bonus to Medium Projectile Turret optimal range and 7.5% bonus to Medium Projectile Turret tracking speed per level\n',1925,109,11750000,96000,415,1,2,17062768,1,452,0.07),(12016,106,'Muninn Blueprint','',303,0,0,0.01,0,1,NULL,0,1,457,0),(12017,894,'Devoter','Hull: Maller Class\nRole: Heavy Interdictor\n\nEffectively combining the trapping power of interdictors with the defensive capabilities of heavy assault ships, the heavy interdictor is an invaluable addition to any skirmish force, offensive or defensive. Heavy interdictors are the only ships able to use the warp disruption field generator, a module which creates a warp disruption field that moves with the origin ship wherever it goes.  \n\nDeveloper: Viziam\n\nViziam ships are quite possibly the most durable ships money can buy. Their armor is second to none and that, combined with superior shields, makes them hard nuts to crack. Of course this does mean they are rather slow and possess somewhat more limited weapons and electronics options.\n\nAmarr Cruiser Skill Bonus: 10% reduction in medium energy turret capacitor use and 5% bonus to armor resistances per level\n\nHeavy Interdictors Skill Bonus: 5% bonus to medium energy turret rate of fire and 5% bonus to range of warp disruption fields per level\n\nNote: can fit warp disruption field generators\n',3363,131,15200000,118000,280,1,4,18302600,1,1071,0.07),(12018,106,'Devoter Blueprint','',303,0,0,0.01,0,1,NULL,0,1,NULL,0),(12019,358,'Sacrilege','Hull: Maller Class\nRole: Heavy Assault Ship\n\nKhanid\'s engineers have spent months perfecting the Sacrilege\'s on-board missile launcher optimization systems, making it a very effective heavy assault missile platform.  In addition, its supremely advanced capacitor systems make it one of the most dangerous ships in its class.\n\nDeveloper: Khanid Innovation\n\nIn an effort to maintain the fragile peace with the old empire through force of deterrence, Khanid Innovation have taken the Maller blueprint and morphed it into a monster.  State-of-the-art armor alloys, along with missile systems developed from the most advanced Caldari designs, mean the Sacrilege may be well on its way to becoming the Royal Khanid Navy\'s flagship cruiser.\n\nAmarr Cruiser Skill Bonus: 5% bonus to Heavy Assault Missile damage and 5% bonus to all armor resistances per level\n\nHeavy Assault Ship Skill Bonus:  5% reduction of capacitor recharge time and 5% bonus to Missile Launcher rate of fire per level\n',1855,134.43,12290000,118000,615,1,4,17062600,1,449,0.07),(12020,106,'Sacrilege Blueprint','',303,0,0,0.01,0,1,NULL,0,1,454,0),(12021,894,'Phobos','Hull: Thorax Class\nRole: Heavy Interdictor\n\nEffectively combining the trapping power of interdictors with the defensive capabilities of heavy assault ships, the heavy interdictor is an invaluable addition to any skirmish force, offensive or defensive. Heavy interdictors are the only ships able to use the warp disruption field generator, a module which creates a warp disruption field that moves with the origin ship wherever it goes.  \n\nDeveloper: Roden Shipyards \n\nUnlike most Gallente ship manufacturers, Roden Shipyards tend to favor missiles over drones and their ships generally possess stronger armor. Their electronics capacity, however, tends to be weaker than ships from their competitors.\n\nGallente Cruiser Skill Bonus: 5% bonus to medium hybrid turret damage and 5% bonus to armor resistances per level\n\nHeavy Interdictors Skill Bonus: 10% bonus to medium hybrid turret falloff per level and 5% bonus to range of warp disruption fields per level\n\nNote: can fit warp disruption field generators\n',3361,167.24,15080000,112000,315,1,8,18302588,1,1073,0.07),(12022,106,'Phobos Blueprint','',303,0,0,0.01,0,1,NULL,0,1,NULL,0),(12023,358,'Deimos','Hull: Thorax Class\nRole: Heavy Assault Ship\n\nSharing more tactical elements with smaller vessels than with its size-class counterparts, the Deimos represents the final word in up-close-and-personal cruiser combat.  Venture too close to this one, and swift death is your only guarantee.\n\nDeveloper: Duvolle Labs\n\nRumor has it Duvolle was contracted by parties unknown to create the ultimate close-range blaster cruiser.  In this their engineers and designers haven\'t failed, but the identity of the company\'s client remains to be discovered. \n\nGallente Cruiser Skill Bonus: 5% bonus to Medium Hybrid Turret damage and 5% increase to MicroWarpdrive capacitor bonus per level\n\nHeavy Assault Ship Skill Bonus: 10% bonus to Medium Hybrid Turret falloff and 5% bonus to Medium Hybrid Turret damage per level\n',1804,167.24,11460000,112000,315,1,8,17062588,1,451,0.07),(12024,106,'Deimos Blueprint','',303,0,0,0.01,0,1,NULL,0,1,456,0),(12028,306,'Storage Bin','The enclosed storage bin drifts quietly in space, waiting patiently to be pried open by a hungry looter.',16,14,10000,1200,1000,1,NULL,0,0,NULL,0),(12029,687,'Khanid Elite Fighter','This is a fighter for the Khanid Kingdom. It is protecting the assets of the Khanid Kindgom and may attack anyone it perceives as a threat. Threat level: High',1862,20.5,2870000,28700,315,1,4,0,0,NULL,0.07),(12030,324,'Manticore OLD','Hull: Kestrel Class\nDeveloper: Lai Dai\n\nLai Dai ships favor a balanced mix of ship systems making them very versatile but also making them less powerful in specific tactics.\n\nRole: Bomber\n\n15% X Bomber skill level bonus to light missile amd rocket ranges per bomber level ',1881,39,2810000,28100,305,1,1,3217008,0,NULL,0.04),(12031,105,'Manticore Blueprint','',1066,0,0,0.01,0,1,NULL,0,1,427,0),(12032,834,'Manticore','Name: Manticore\nHull: Kestrel Class\nRole: Stealth Bomber\n\nSpecifically engineered to fire cruise missiles, stealth bombers represent the next generation in covert ops craft. Advanced techniques in spatial distortion technology enable them to potentially fly faster when cloaked than when uncloaked - a fact which, coupled with their considerable firepower, makes them extremely dangerous in the hands of an accomplished pilot.\n\nIn addition, stealth bombers\' extremely advanced missile navigation subroutines are able to triangulate a cruise missile\'s trajectory in advance, resulting in a decreased factor of signature radius and making the missile more effective against smaller targets.\n\nDeveloper: Lai Dai\n\nLai Dai have always favored a balanced approach to their mix of on-board systems, leading to a line-up of versatile ships. \n\nCaldari Frigate Skill Bonus: 5% bonus to Cruise Missile damage and -16.66% reduction in Explosion Radius of Cruise Missiles per level\n\nCovert Ops Skill Bonus: 5% bonus to Cruise Missile and bomb kinetic damage and multiplies the cloaked velocity by 125% per level\n\nRole Bonus: -99% reduction in Cruise Launcher powergrid needs, -99% reduction in Bomb Launcher CPU use and -100% targeting delay after decloaking\n\nNote: can fit covert cynosural field generators',1881,39,1466000,28100,185,1,1,3090544,1,422,0.04),(12033,105,'Manticore OLD Blueprint','',1066,0,0,0.01,0,1,NULL,0,0,NULL,0),(12034,834,'Hound','Name: Hound\nHull: Breacher Class\nRole: Stealth Bomber\n\nSpecifically engineered to fire cruise missiles, stealth bombers represent the next generation in covert ops craft. Advanced techniques in spatial distortion technology enable them to potentially fly faster when cloaked than when uncloaked - a fact which, coupled with their considerable firepower, makes them extremely dangerous in the hands of an accomplished pilot.\n\nIn addition, stealth bombers\' extremely advanced missile navigation subroutines are able to triangulate a cruise missile\'s trajectory in advance, resulting in a decreased factor of signature radius and making the missile more effective against smaller targets.\n\nDeveloper: Boundless Creation\n\nBoundless Creation ships are based on the Brutor tribe\'s philosophy of warfare: simply fit as much firepower onto your ship as humanly possible. On the other hand, defense systems and \"cheap tricks\" like electronic warfare have never been a high priority.\n\nMinmatar Frigate Skill Bonus: 5% bonus to Cruise Missile damage and -16.66% reduction in Explosion Radius of Cruise Missiles per level\n\nCovert Ops Skill Bonus: 5% bonus to Cruise Missile and bomb explosive damage and multiplies the cloaked velocity by 125% per level\n\nRole Bonus: -99% reduction in Cruise Launcher powergrid needs, -99% reduction in Bomb Launcher CPU use and -100% targeting delay after decloaking\n\nNote: can fit covert cynosural field generators',1966,39,1370000,28100,195,1,2,3013104,1,424,0.04),(12035,105,'Hound Blueprint','',1066,0,0,0.01,0,1,NULL,0,1,429,0),(12036,324,'Dagger','',1963,39,2810000,28100,175,1,2,2802544,0,NULL,0.04),(12037,105,'Dagger Blueprint','',1066,0,0,0.01,0,1,NULL,0,0,NULL,0),(12038,834,'Purifier','Name: Purifier\nHull: Inquisitor Class\nRole: Stealth Bomber\n\nSpecifically engineered to fire cruise missiles, stealth bombers represent the next generation in covert ops craft. Advanced techniques in spatial distortion technology enable them to potentially fly faster when cloaked than when uncloaked - a fact which, coupled with their considerable firepower, makes them extremely dangerous in the hands of an accomplished pilot.  \n\nIn addition, stealth bombers\' extremely advanced missile navigation subroutines are able to triangulate a cruise missile\'s trajectory in advance, resulting in a decreased factor of signature radius and making the missile more effective against smaller targets.\n\nDeveloper: Viziam\n\nViziam ships are quite possibly the most durable ships money can buy. Their armor is second to none and that, combined with superior shields, makes them hard nuts to crack. Of course this does mean they are rather slow and possess somewhat more limited weapons and electronics options.\n\nAmarr Frigate Skill Bonus: 5% bonus to Cruise Missile damage and -16.66% reduction in Explosion Radius of Cruise Missiles per level\n\nCovert Ops Skill Bonus: 5% bonus to Cruise Missile and bomb EM damage and and multiplies the cloaked velocity by 125% per level\n\nRole Bonus: -99% reduction in Cruise Launcher powergrid needs, -99% reduction in Bomb Launcher CPU use and -100% targeting delay after decloaking\n\nNote: can fit covert cynosural field generators',1872,20.5,1396000,28100,260,1,4,3072448,1,421,0.04),(12039,105,'Purifier OLD Blueprint','',1066,0,0,0.01,0,1,NULL,0,0,NULL,0),(12040,324,'Purifier OLD','Hull: Rifter Class\nDeveloper: Brutor Angels\nRole: Assault Frigate \nSpecial: 90% less cpu need for Modules requiring Advanced Gunnery ',1872,20.5,2155000,28100,315,1,4,3171968,0,NULL,0.04),(12041,105,'Purifier Blueprint','',1066,0,0,0.01,0,1,NULL,0,1,425,0),(12042,324,'Ishkur','Name: Ishkur\nHull:  Incursus Class\nRole:  Assault Ship\n\nSpecialized as a frigate-class drone carrier, the Ishkur carries less in the way of firepower than most other Gallente gunboats.  With a fully stocked complement of drones and a skilled pilot, however, no one should make the mistake of thinking this vessel easy prey.\n\nDeveloper:  CreoDron\n\nAs the largest drone developer and manufacturer in space, CreoDron has a vested interest in drone carriers.  While sacrificing relatively little in the way of defensive capability, the Ishkur can chew its way through surprisingly strong opponents - provided, of course, that the pilot uses top-of-the-line CreoDron drones. \n\nGallente Frigate Skill Bonus: 5% bonus to Small Hybrid Turret damage\n\nAssault Ships Skill Bonus: 10% bonus to Small Hybrid Turret optimal range and +5 Drone Bay capacity per level\n',1840,39,1216000,29500,165,1,8,3208068,1,435,0.04),(12043,105,'Ishkur Blueprint','',1066,0,0,0.01,0,1,NULL,0,1,462,0),(12044,324,'Enyo','Name: Enyo\nHull: Incursus Class\nRole: Assault Ship\n\nThe single-fanged Enyo sports good firepower capability, a missile hardpoint and some extremely strong armor plating, making it one of the best support frigates out there.  Ideal for use as point ships to draw enemy fire from more vulnerable friendlies.\n\nDeveloper:  Roden Shipyards\n\nUnlike most Gallente ship manufacturers, Roden Shipyards tend to favor missiles over drones and their ships generaly possess stronger armor.  Their electronics capacity, however, tends to be weaker than ships from their competitors.\n\nGallente Frigate Skill Bonus: 5% bonus to Small Hybrid Turret damage\n\nAssault Ships Skill Bonus: 10% bonus to Small Hybrid Turret optimal range and 7.5% bonus to Small Hybrid Turret Tracking Speed per level',1771,39,1171000,29500,165,1,8,3417700,1,435,0.04),(12045,105,'Enyo Blueprint','',1066,0,0,0.01,0,1,NULL,0,1,462,0),(12046,668,'Ammatar Slave Trader','This is a slave trader working for the Ammatar. Slave traders often have to fend off hostile ships, such as Minmatar Freedom Fighters or bounty hunters, and therefore come well equipped to deal with any such encounters. Slave traders are also known to attack remote settlements throughout the galaxy to bolster their supply of slaves. The Minmatar Republic has put a bounty on the head of any known slaver. Threat level: Deadly',1738,192,12000000,120000,345,1,4,0,0,NULL,0),(12047,689,'Khanid Slave Trader','This is a slave trader working for the Khanid Kingdom. Slave traders often have to fend off hostile ships, such as Minmatar Freedom Fighters or bounty hunters, and therefore come well equipped to deal with any such encounters. Slave traders are also known to attack remote settlements throughout the galaxy to bolster their supply of slaves. The Minmatar Republic has put a bounty on the head of any known slaver. Threat level: Deadly',1854,192,12000000,120000,550,1,4,0,0,NULL,0),(12048,668,'Amarr Slave Trader','This is a slave trader working for the Amarr Empire. Slave traders often have to fend off hostile ships, such as Minmatar Freedom Fighters or bounty hunters, and therefore come well equipped to deal with any such encounters. Slave traders are also known to attack remote settlements throughout the galaxy to bolster their supply of slaves. The Minmatar Republic has put a bounty on the head of any known slaver. Threat level: Deadly',1729,134.43,11800000,118000,1775,1,4,0,0,NULL,0),(12049,283,'Slaver','Slavers thrive in the lawless areas of the galaxy, and in the Amarrian territories which view the slave business as a legal profession. Some slavers are notorious for their brutality and lack of morals, and will attack remote settlements without hesitation to capture innocent victims to be sold on the black market. The Minmatar Republic has been especially keen on setting bounties on all slave traders, as they bear a deep resentment and hatred towards slavery.',2546,0,100,2,0,1,NULL,0,1,23,0),(12052,46,'10MN MicroWarpdrive I','Massive boost to speed for a very short time. The thrust that boosts the ship, and the corresponding maximum velocity bonus, are limited by the mass of the ship that uses this module. The sheer amount of energy needed to power this system means that it must use part of the capacitor output and the shield just to maintain the integrity of its warp containment field.\n\nPenalty: Max capacitor reduced.\n\nNote: Cruiser class module',96,0,0,25,0,1,NULL,158188,1,131,0.07),(12053,126,'10MN MicroWarpdrive I Blueprint','',96,0,0,0.01,0,1,NULL,1581880,1,331,0),(12054,46,'100MN MicroWarpdrive I','Massive boost to speed for a very short time. The thrust that boosts the ship, and the corresponding maximum velocity bonus, are limited by the mass of the ship that uses this module. The sheer amount of energy needed to power this system means that it must use part of the capacitor output and the shield just to maintain the integrity of its warp containment field.\n\nPenalty: Max capacitor reduced.\n\nNote: Battleship class module',96,0,0,50,0,1,NULL,790940,1,131,0.07),(12055,126,'100MN MicroWarpdrive I Blueprint','',96,0,0,0.01,0,1,NULL,7909400,1,331,0),(12056,46,'10MN Afterburner I','Gives a boost to the maximum velocity of the ship when activated. The thrust that boosts the ship, and the corresponding maximum velocity bonus, are limited by the mass of the ship that uses this module.\n\nNote: Cruiser class module',96,0,0,25,0,1,NULL,32256,1,542,0.07),(12057,126,'10MN Afterburner I Blueprint','',96,0,0,0.01,0,1,NULL,322560,1,331,0),(12058,46,'10MN Afterburner II','Gives a boost to the maximum velocity of the ship when activated. The thrust that boosts the ship, and the corresponding maximum velocity bonus, are limited by the mass of the ship that uses this module.\n\nNote: Cruiser class module',96,0,0,5,0,1,NULL,168784,1,542,0.07),(12059,126,'10MN Afterburner II Blueprint','',96,0,0,0.01,0,1,NULL,0,1,331,0),(12066,46,'100MN Afterburner I','Gives a boost to the maximum velocity of the ship when activated. The thrust that boosts the ship, and the corresponding maximum velocity bonus, are limited by the mass of the ship that uses this module.\n\nNote: Battleship class module',96,0,0,50,0,1,NULL,161280,1,542,0.07),(12067,126,'100MN Afterburner I Blueprint','',96,0,0,0.01,0,1,NULL,1612800,1,331,0),(12068,46,'100MN Afterburner II','Gives a boost to the maximum velocity of the ship when activated. The thrust that boosts the ship, and the corresponding maximum velocity bonus, are limited by the mass of the ship that uses this module.\n\nNote: Battleship class module',96,0,0,5,0,1,NULL,447024,1,542,0.07),(12069,126,'100MN Afterburner II Blueprint','',96,0,0,0.01,0,1,NULL,0,1,331,0),