tially more energy than normal and its energy signature is very easy to lock onto. It also requires the ship\'s shields to be strengthened around the turret to prevent critical backlashes.\n \nCan only be used by small tech level II+ Beam Lasers    ',1131,1,1,1,0,4,NULL,119968,1,868,0.07),(12558,726,'Gleam S Blueprint','',1145,0,0,0.01,0,1,NULL,0,1,NULL,0),(12559,374,'Aurora S','A Carthum Conglomerate small Beam Laser Crystal based on an upgraded version of the standard radio Crystal. Huge range and damage boost but far longer cooldown time. It is next to useless at close ranges.\n\nCan only be used by small tech level II+ Beam Lasers    \n\n\n',1145,1,1,1,0,4,NULL,119968,1,868,0.07),(12560,726,'Aurora S Blueprint','',1145,0,0,0.01,0,1,NULL,0,1,NULL,0),(12561,375,'Blaze S','This frequency modulation crystal uses a modified microwave crystal coupled with a relatively low energy electron beam generator to alter the electric charge of molecules causing them to violently break apart.\n\nCan only be used by small tech level II Pulse Lasers      ',1139,1,1,1,0,4,NULL,35768,0,NULL,0.07),(12562,726,'Blaze S Blueprint','',1145,0,0,0.01,0,1,NULL,0,0,NULL,0),(12563,375,'Scorch S','The Scorch is a UV crystal designed by Carthum Conglomerate . utilizing AI microtrackers it gives a good boost to range but has fairly low damage potential, low tracking and is of limited use against heavily armored targets.\n\nCan only be used by small tech level II  Pulse Lasers    ',1141,1,1,1,0,4,NULL,80000,1,871,0.07),(12564,726,'Scorch S Blueprint','',1145,0,0,0.01,0,1,NULL,0,1,NULL,0),(12565,375,'Conflagration S','The Conflagration is a supercharged X-Ray crystal created by Carthum Conglomerate for the Imperial Navy. Has much greater damage potential than the standard version, but needs considerably more capacitor and also has reduced effective range.\n\nCan only be used by small tech level II  Pulse Lasers   ',1140,1,1,1,0,4,NULL,80000,1,871,0.07),(12566,726,'Conflagration S Blueprint','',114