n high favor with the Emperor can earn the reward of commanding one of the majestic and powerful Apocalypse class battleships. These metallic monstrosities see to it that the word of the Emperor is carried out among the denizens of the Empire and beyond. Threat level: Deadly',2239,400,107500000,1150000,675,1,4,0,0,NULL,0),(14357,706,'Minmatar Outpost','A tactical outpost originally designed by the Minmatar. Normally used as a base of operations in the frontier, it has powerful defensive capabilities.',1711,1000,110000000,1100000,600,1,2,0,0,NULL,0.07),(14358,314,'Zemnar','Zemnar is an uncommon type of antibiotic specifically used to combat rare bacterial infections. Originally discovered by the late Gallente biologist, Lameur Zemnar, the drug is now frequently kept in stock in the more wealthy quarters of the galaxy, in case of a bacterial outbreak.',28,0,5,0.2,0,1,NULL,100,1,492,0),(14359,671,'Caldari Navy Condor','The Condor is fast and agile. It has limited cargo space so it\'s not very suitable for trading or mining. It is best used as an assault vessel in a hit-and-run type of operations. It is sometimes used by the Caldari Navy and is generally considered an expendable low-cost craft. Threat level: Moderate',1788,33,1300000,18000,150,1,1,0,0,NULL,0),(14360,683,'Republic Fleet Slasher','The Slasher is cheap, but versatile. It\'s been manufactured en masse, making it one of the most common vessels in Minmatar space. The Slasher is extremely fast, with decent armaments, and is popular amongst budding pirates and smugglers. It is sometimes used by the Minmatar Fleet and is generally considered an expendable low-cost craft. Threat level: Moderate',1888,32.89,1000000,17400,120,1,2,0,0,NULL,0),(14361,677,'Gallente Navy Atron','The Atron is a hard nugget with an advanced power conduit system, but little space for cargo. Although the Atron is a good harvester when it comes to mining, its main ability is as a combat vessel. It is sometimes used by the Gallente Navy and 