 Brutor Blueprint','',48,0,0,0.01,0,1,NULL,0,0,NULL,0),(22440,898,'Panther','Hull: Typhoon Class\nRole: Black Ops\n\nBlack Ops battleships are designed for infiltration and espionage behind enemy lines. With the use of a short-range jump drive and a portal generator, they are capable of making a special type of jump portal usable only by covert ops vessels. This enables them to stealthily plant reconnaissance and espionage forces in enemy territory. For the final word in clandestine maneuvers, look no further.\n\nDeveloper: Thukker Mix \n\nThe Thukkers generally favor speed and offensive power over defensive capability. While many of them could be said to lack technological innovation, Thukker Mix vessels are invariably the swiftest and most agile of their kind.\n\nMinmatar Battleship Skill Bonus: 5% bonus to large projectile turret rate of fire and 5% bonus to large projectile turret damage per level\n\nBlack Ops Skill Bonus: 5% bonus to velocity and multiplies the cloaked velocity by 125% per level\n\nNote: can fit covert cynosural field generators and covert jump portal generators. No targeting delay after decloaking',3355,250,148800000,414000,625,1,2,129864580,1,1079,0.07),(22441,107,'Panther Blueprint','',301,0,0,0.01,0,1,NULL,0,1,NULL,0),(22442,540,'Eos','Name: Eos\nHull: Brutix\nRole: Fleet Command Ship\n\nCommand ships are engineered specifically to wreak havoc on a battlefield of many.  Sporting advanced command module interfaces, these vessels are more than capable of turning the tide in large engagements.  Fleet command ships represent the ultimate in warfare link efficiency, while not packing the punch of their field command counterparts, the boosts they give their comrades in combat make them indispensable assets to any well-rounded fleet.\n\nDeveloper: CreoDron\n\nAs the largest drone developer and manufacturer in space, CreoDron has a vested interest in drone carriers.  While sacrificing relatively little in the way of defensive capability, the Eos can chew its way through surprisingly strong opponents - provided, of course, that the pilot uses top-of-the-line CreoDron drones.\n\nBattlecruiser Skill Bonus:  5% bonus to Medium Hybrid Turret damage and 7.5% bonus to Armor Repairer effectiveness per level\n\nCommand Ships Skill Bonus:  +15 m3 extra Drone Bay space and 3% bonus to effectiveness of Information Warfare Links per level\n\nRole Bonus: 99% reduction in Warfare Link module CPU need.  Can use 3 Warfare Link modules simultaneously.',2925,266,13250000,270000,400,1,8,59965600,1,831,0.07),(22443,489,'Eos Blueprint','',1748,0,0,0.01,0,1,NULL,599156000,1,898,0),(22444,540,'Sleipnir','Name: Sleipnir\nHull: Cyclone\nRole: Field Command Ship\n\nCommand ships are engineered specifically to wreak havoc on a battlefield of many.  Sporting advanced command module interfaces, these vessels are more than capable of turning the tide in large engagements.  Field command ships are geared more towards out-and-out combat than their fleet command counterparts, though both ships can hold their own in battle.  \n\nDeveloper: Boundless Creation\n\nBoundless Creation\'s ships are based on the Brutor tribe\'s philosophy of warfare: simply fit as much firepower onto your ship as possible.  Defense systems and electronics arrays therefore tend to take a back seat to sheer annihilative potential.\n\nBattlecruiser Skill Bonus:  5% bonus to Medium Projectile Turret rate of fire and 7.5% bonus to Shield Booster effectiveness per level\n\nCommand Ships Skill Bonus:  5% bonus to Medium Projectile Turret damage and 10% bonus to Medium Projectile Turret falloff per level\n\nRole Bonus: 99% reduction in Warfare Link module CPU need',2912,345,12500000,216000,475,1,2,53673600,1,834,0.07),(22445,489,'Sleipnir Blueprint','',1748,0,0,0.01,0,1,NULL,536736000,1,899,0),(22446,540,'Vulture','Name: Vulture\nHull: Ferox\nRole: Fleet Command Ship\n\nCommand ships are engineered specifically to wreak havoc on a battlefield of many.  Sporting advanced comm