o Medium Energy Turret damage and 5% bonus to Medium Energy Turret rate of fire per level\n\nRole Bonus: 99% reduction in Warfare Link module CPU need\n',2926,198,13500000,234000,350,1,4,56953600,1,825,0.07),(22449,489,'Absolution Blueprint','',1748,0,0,0.01,0,1,NULL,569536000,1,896,0),(22450,541,'Elite Catalyst Creodron','Ideally suited for both skirmish warfare and fleet support, the Catalyst is touted as one of the best anti-frigate platforms out there. Faced with its top-of-the-line tracking equipment, not many can argue.\n\nDestroyer Skill Bonus: 7.5% Bonus to Small Hybrid Turret tracking speed and 10% bonus to Small Hybrid Turret falloff per level\n\nPenalty: -25% rate of fire for all turrets',2895,163,1750000,55000,400,1,8,788780,0,NULL,0.07),(22451,487,'Elite Catalyst Creodron Blueprint','',1748,0,0,0.01,0,1,NULL,0,0,NULL,0),(22452,541,'Heretic','Name: Heretic\nHull: Coercer\nRole: Interdictor\n\nInterdictors are destroyer-sized vessels built to fill a single important tactical niche: the breaching of enemy warp tunnels.  Capable of launching warp-disrupting interdiction spheres, interdictors are of great value in locations of strategic importance where enemy movement must be restricted.  Additionally, much like their destroyer-class progenitors, they are well-suited to offensive strikes against frigate-sized craft.\n\nDeveloper: Khanid Innovations\n\nIn addition to robust electronics systems, the Khanid Kingdom\'s ships possess advanced armor alloys capable of withstanding a great deal of punishment. Generally eschewing the use of turrets, they tend to gear their vessels more towards close-range missile combat.\n\nDestroyer Skill Bonus:  5% bonus to rocket damage and 5% bonus to rocket and missile explosion velocity per level\n\nInterdictors Skill Bonus:  10% bonus to missile velocity and 10% bonus to Interdiction Sphere Launcher rate of fire per level\n\nSpecial Ability: Interdiction Sphere Launchers require 99% less CPU when fitted on this ship',2805,197,