ermine the cause of the accident.  ',2038,0,1,0.1,0,1,NULL,0,1,NULL,0),(22704,494,'General Minas Iksan','Minas Iksan is a vetern war hero of the Amarr Empire. He led the fleet that defeated the largest Blood Raider armada ever to attack an Amarrian settlement eight years ago. His credentials also include over 40 years of dedicated service to the Amarr Navy. Born of Royalty, his place as a commander of the military was quickly established upon his entrance into the Imperial Academy.\n\nMinas now leads the Amarr/Ammatar/Khanid/Caldari campaign against the Minmatar and their allies in Audesder.',2743,1700,1125000000,18500000,7250,1,4,0,0,NULL,0),(22705,526,'Minas\'s Voucher','This voucher was given to all recruitment officers by General Minas Iksan. Any mercenary with one of these vouchers who is well regarded by the Amarr Empire should speak with Minas Iksan for possible employment.',1192,0,1,1,0,1,NULL,0,1,NULL,0),(22706,677,'Gallente Spy Drone','This fragile high-tech drone is frequently used in Gallente espionage missions.',2826,45,100000,60,1200,1,NULL,0,0,NULL,0),(22707,526,'Oggiin Kalda\'s DNA','DNA samples are any of various nucleic acids that are usually the molecular basis of heredity, are localized especially in cell nuclei, and are constructed of a double helix held together by hydrogen bonds between purine and pyrimidine bases which project inward from two chains containing alternate links of deoxyribose and phosphate.\n\nThis DNA sample is taken from the Minmatar collaberator, Oggiin Kalda.',2302,0,1,0.1,0,1,NULL,0,1,NULL,0),(22708,283,'Amarrian Spy','A spy working for the Amarr Empire.',2536,0,80,1,0,1,NULL,0,1,NULL,0),(22709,494,'Minmatar Starbase Control Tower_Alliance Barracks','The Matari aren\'t really that high-tech, preferring speed rather then firepower or involved technology. Unfortunately that doesn\'t apply very well to stationary objects, much to the liking of the Amarr Empire.\n\nAmarrians call it a scrapheap of epic proportions. But don\'t underestimate these structures. Minmatar commanders usually have the last laugh when it comes to combat.',2371,3346,100000,1150,8850,1,2,0,0,NULL,0),(22710,494,'Minmatar Command Post','Outfitted with makeshift sensor arrays and second-hand tactical data analysis equipment, these outposts will, to anyone not in the know, look like useless scrapyards. Which is exactly what the Matari would have you think.',1711,471,100000,100000000,10000,1,2,0,0,NULL,0),(22711,319,'Extremely Powerful EM Forcefield_2','A reinforced antimatter generator powered by muonal crystals, creating a perfect circle of electro-magnetic radiance penetrable only by a coordinated attack from the strongest armaments.',2353,15000,100000,100000000,10000,1,NULL,0,0,NULL,0),(22712,319,'Republic Fleet Naglfar - Under Construction','This mighty behemoth of a ship is currently under construction. Only the last few touches of polish remain before it is ready for test flight.',2755,1700,1025000000,15500000,10250,1,2,0,0,NULL,0),(22713,545,'10mn webscramblifying Drone','Warp Scrambling Drone',1084,15,3000,5,1200,1,NULL,2000,0,NULL,0.07),(22714,176,'10mn webscramblifying Drone Blueprint','',1084,0,0,0.01,0,1,NULL,0,0,NULL,0),(22715,783,'Republic Special Ops Field Enhancer - Gamma','This image processor implanted in the parietal lobe grants a +4 bonus to one\'s Willpower and a 5% bonus to the ship\'s maximum speed.',2054,1,0,1,0,1,NULL,0,1,NULL,0.05),(22716,821,'General Matar Pol','The Tempest battleship can become a real behemoth when fully equipped.\nThreat level: Deadly',2161,250,102500000,850000,600,1,2,0,0,NULL,0.07),(22718,319,'Minas Iksan\'s Revelation_old','General Minas Iksan is the highest ranking officer of the Amarr forces and their allies stationed in Kenobanala. His responsibility is to see to it that the \'Tyrion incident\' is resolved, and to lead his armada into Audesder should it come to all-out-war.\n\nMinas commands a Revelation.  It represents the pinnacle of Amarrian military technology.  Maintaining their proud tradition of producing the strongest armor plating to be found anywhere, the Empire\'s engineers outdid themselves in creating what is arguably the most resilient dreadnought in existence.\n\nAdded to that, the Revelation\'s ability to fire capital beams makes its position on the battlefield a unique one.  When extended sieges are the order of the day, this is the ship you call in.',2743,1700,1125000000,18500000,7250,1,4,0,0,NULL,0),(22719,517,'Minas Iksan\'s Control Tower','General Minas Iksan is the highest ranking officer of the Amarr forces and their allies stationed in Kenobanala. His responsibility is to see to it that the \'Tyrion incident\' is resolved, and to lead his armada into Audesder should it come to all-out-war.\n\nMinas commands a Revelation, which is currently undergoing maintenance.\n\nMissions: \n\n<b>Difficulty Rating: Grade 8.5</b> ',2296,3394,100000,100000000,10000,1,4,0,0,NULL,0),(22725,494,'Oggiin Kalda\'s Residence','The architectural design for the CreoDron Habitation Module started out as a contract deal from the Expert Housing Corporation to standardize the modular drifter homes normally used by miners and deep space explorers. When the project was cancelled due to insufficient funding, CreoDron utilized their design for the open market as high-orbit department buildings for commercial use. The marketing was a tremendous hit, making the Habitation Module a common sight across the universe. ',2515,379,100000,100000000,10000,1,NULL,0,0,NULL,0),(22726,517,'Oggiin Kalda\'s Maller','A Maller piloted by an agent.',1739,134.43,12750000,118000,280,1,4,0,0,NULL,0),(22728,306,'Minmatar Bunker_Alliance Barracks','A small bunker, there for accommodation and increased mobility of troops and other personnel. ',2479,713,100000,100000000,10000,1,NULL,0,0,NULL,0),(22729,803,'Strain Domination Drone Replica','Rogue drones are hi-tech drones that have the ability to manufacture themselves. These drones are however simply a replica of