to decode valuable transmissions often sent via none FTL transport.',1362,0,80,50,0,1,NULL,0,1,NULL,0),(23883,526,'Methros Enhanced Decoding Device','A standard decoding device, used to decode valuable transmissions often sent via none FTL transport.',1362,0,80,50,0,1,NULL,0,1,NULL,0),(23888,356,'Methros Enhanced Decoding Device Blueprint','',194,0,0,0,0,1,NULL,0,0,NULL,0),(23889,226,'LCO Acceleration Gate','This acceleration gate has been locked down and is not usable by the general public.',2341,12706,100000,0,0,1,NULL,0,0,NULL,0),(23890,526,'Inter-Galactic Media Report - The Audesder Incident (1 of 3)','Minmatar pioneers recently discovered an ancient Nefantar holy site within Audesder which was thought to have been lost forever during the Rebellion. It is the burial place of the long-dead Nefantar prophet, Tyrion Plethar, the first Minmatar priest of the Amarrian religion, as well as hundreds of other priests and saints. It so happens that this holy site is located inside a giant space ship, still intact despite many years of neglect, and incredibly the crew was found still alive, albeit in a cryogenic state. <br><br> Originally this holy site was located in Hjoramold XII which now resides in Minmatar Republic space. During the great Rebellion, the Nefantar government on the planet had given up all hope of defending their solar system against the massive rebel forces headed their way. The neighboring constellations had already fallen and it was only a matter of time before their own fell into the hands of their enemies. So they decided upon a drastic plan to save the holiest site located within Nefantar space, the burial place of Tyrion Plethar. <br><br> The plan was to transfer as much of the holy site, buildings and all, into a giant space ship, renamed to the Pletharian\', which would in turn fly towards the Amarr Empire, where it would most assuredly be kept safe. The ship had originally been built by Amarrian engineers to be a mobile outpost of sorts, but was the only available vessel that could carry the massive buildings which were part of the burial site. <br><br> Loading the burial site onto the ship took a matter of days, although it was quite a hasty procedure and resulted in a number of mishaps, where a number of the buildings were damaged and one even completely destroyed as it toppled from the cranes used to elevate it from the ground. But eventually the majority of the buildings had been painstakingly transferred into the space ship. It was then that the rebels attacked, appearing out of nowhere and quickly descended upon the meager Nefantar defenses,. <br><br> But even though the defenders were no match for the incoming Minmatar armada, they still bought the Pletharian enough time to set off on its course towards Amarr Space. The only problem was, it was too massive to use the stargate. It had been brought to the system in parts and assembled, but in its current state there was no way it could access the stargate out of Hjoramold. So they had to manually fly it through the vastness of space, without any jump-drive capability. <br><br> The destination was Audesder, a solar-system heavily fortified with Amarr forces. At the time the Nefantar government in Hjormold believed that it was impossible for the rebels to advance far enough to conquer Audesder. Ironically this system was one of the last to be taken during the later stages of the rebellion.',2038,0,1,0.1,0,1,NULL,0,1,NULL,0),(23891,526,'Inter-Galactic Media Report - The Audesder Incident (2 of 3)','Little is known of what happened to the Pletharian during its journey, and eventually the remaining Nefantars, now called Ammatars, gave up hope of ever finding it again. But with its discovery by Minmatar explorers, the situation has changed dramatically. The Republic has released little info on their findings to the public, but one thing is clear, something must have caused the Pletharian to malfunction and become stranded in space for all these years. Possibly a collision with an asteroid, or simply a breakdown of their thruster system. Whatever the cause, the Pletharian has now become the hottest topic on everyone\'s lips within the Ammatar / Minmatar border zone. <br><br> Needless to say, shortly after the discovery had been confirmed by Republic authorities, the Ammatar government demanded that it be handed over to them. The Republic refused, citing that it contains the remains of convicted mass-murderers and Amarrian collaborators, and it would be an affront to all those enslaved and tortured during Amarrian rule to hand them over to the Ammatar. Instead they intend to make it into a museum, to be shown to Republic citizens as a grim reminder of the past. <br><br> The Ammatars were far from pleased. This was the last straw in a chain of political collisions between their people and the Republic. Their citizens demanded action, and even within the Amarr empire itself there were rumors that the imperial fleet was preparing for war. After all, Tyrion Plethar was the most highly regarded member of the Amarr faith which was of Minmatar origin. The Republic\'s refusal to hand over his remains was not only an affront to the Ammatar nation, but to the Amarrian church as well. <br><br> And so the buildup for war has begun. The Amarr and Ammatars have built a massive military outpost in Kenobanala, which is directly connected to Audesder. Cruisers and battleships keep arriving daily from all over the empire, and media reports indicate that even Minas Iksan, one of the Empire\'s most prestigious military generals, who led the successful campaign against the Blood Raiders a few years ago, has arrived. This does not bode well for the stability of the region, which is already on the brink of a potentially disastrous war. <br><br> To top it all off, the Caldari and Khanid, which have recently become official allies of the Amarr Empire and Ammatar, have been caught up in the fray. They have sent both financial support and military aid to the front lines, boosting up the already massive invasion force.',2038,0,1,0.1,0,1,NULL,0,1,NULL,0),(23892,526,'Inter-Galactic Media Report - The Audesder Incident (3 of 3)','On the other side of the fence, the Minmatar Republic has been flooding Audesder with its own troops. Desperate to prevent another Amarr occupation, it has poured all of its resources into creating an impregnable defensive barrier between it and the Ammatar. The Gallente Federation and ORE have lent their support as well, the Federation sending an armada of ships to help defend Audesder incase of an attack, and ORE supplying the Minmatar forces with financial aid as well as hired mercenaries. <br><br> War looms over this troubled area, and analysts suspect that it may spread to outlying regions. This could even be the start of a new galactic war that no one wants except the most fanatical nationalists. CONCORD are monitoring the situation closely, and have reportedly been trying their hardest to soothe the political climate to prevent an all-out-war. But even they cannot prevent the inevitable battle over Audesder, and we can only hope the conflict will not spread to the neighboring regions.\n',2038,0,1,0.1,0,1,NULL,0,1,NULL,0),(23893,526,'Enigma Cypher Book','Cyphers used by Lord Mythos.',33,0,1,0.01,0,1,NULL,0,1,NULL,0),(23894,768,'\'Page\' Capacitor Flux Coil I','Increases capacitor recharge rate, but causes a reduction in maximum capacitor storage. ',1032,500,20,5,0,1,NULL,4160,1,NULL,0.06),(23895,137,'\'Page\' Capacitor Flux Coil I Blueprint','',1032,0,0,0.01,0,1,NULL,0,0,NULL,0),(23896,767,'\'Motte\' Capacitor Power Relay I','Increases capacitor recharge rate at the expense of shield boosting.',1032,500,20,5,0,1,NULL,9744,1,NULL,0.06),(23897,137,'\'Motte\' Capacitor Power Relay I Blueprint','',1032,0,0,0.01,0,1,NULL,0,0,NULL,0),(23898,769,'\'Portcullis\' Reactor Control Unit I','Boosts power core output.',70,500,20,5,0,1,NULL,9920,1,NULL,0.06),(23899,137,'\'Portcullis\' Reactor Control Unit I Blueprint','',70,0,0,0.01,0,1,NULL,0,0,NULL,0),(23900,205,'\'Mangonel\' Heat Sink I','Dissipates energy weapon damage efficiently, thus allowing them to be fired more rapidly. Penalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',1046,1,1,5,0,1,NULL,24960,1,NULL,0.07),(23901,218,'\'Mangonel\' Heat Sink I Blueprint','',194,0,0,0,0,1,NULL,0,0,NULL,0),(23902,205,'\'Trebuchet\' Heat Sink I','Dissipates energy weapon damage efficiently, thus allowing them to be fired more rapidly. Penalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',1046,1,1,5,0,1,NULL,24960,1,NULL,0.07),(23903,218,'\'Trebuchet\' Heat Sink I Blueprint','',194,0,0,0,0,1,NULL,0,0,NULL,0),(23904,306,'The Scope Storage Container','This storage container is property of The Scope. Tamper with it at your own risk.',16,14,10000,1200,1000,1,NULL,0,0,NULL,0),(23906,319,'Stationary Revelation','A stationary Revelation Dreadnought.',2743,1700,0,0,0,1,4,0,0,NULL,0),(23907,474,'Shiny Sentry Key','This security passcard is one of two needed to pass this sentry station.',2038,0,1,0.1,0,1,NULL,0,1,NULL,0),(23908,494,'Core Serpentis Sentry','This is a well defended guard station.',1712,918,100000,100000000,10000,1,8,0,0,NULL,0),(23909,314,'Komni History (1 of 2)','The Komni corporation was founded by the multi-billionaire Kaimo Nayen, who had garnered his fortune by building up a real estate empire on Caldari Prime. The purpose of the company was to give his firstborn son, Shojin Nayen, a chance to receive experience as a CEO, before the time came for him to take over the reigns of his father\'s mega-corporation. Komni dealt in simple garbage hauling tasks, employing a few dozen washed up pilots to do the sordid task of transporting unrecyclable material to remote locations within the Caldari solarsystems.<br><br>Unfortunately Shojin had been inexcusably spoiled as a child, and lacked all of his fathers virtues which had helped him become so successful. The Komni corporation quickly began losing money, bad deals were made and the daily affairs were generally ignored by Shojin who spent most of his time dating beautiful women and staying out late at night at popular Caldari bars. But when his father learned of the state of things, and that the Komni corporation had slid to the verge of bankruptcy, he became furious. He demanded that his son straighten things out, or all of his shares within the mega-real-estate corporation would go to his other son, Akimo.<br><br>Shojin became terrified at these grim tidings, and was especially worried that his father would also strip him of access to his bank account which he so much relied on to live his extravagant lifestyle. So he turned to the underworld for aid, secretly contacting an agent employed by the Guristas Pirates, Drako Minai, to manage his corporate affairs. At first this worked out perfectly, the Komni stock rose considerably and money came streaming in. Better pilots and maintainance on the old company haulers were finally affordable, without any intervention from Kaimo.',1192,0,1,1,0,1,NULL,0,1,NULL,0),(23911,547,'Thanatos','Sensing the need for a more moderately-priced version of the Nyx, Federation Navy authorities commissioned the design of the Thanatos. Designed to act primarily as a fighter carrier for small- to mid-scale engagements, its significant defensive capabilities and specially-fitted fighter bays make it ideal for its intended purpose.\n\nGallente Carrier Skill Bonuses:\n50% bonus to Capital Shield and Armor transfer range per level\n5% bonus to deployed Fighters damage per level\n99% reduction in CPU need for Warfare Link modules\n99% reduction in CPU need for Tactical Logistics Reconfiguration modules\nCan deploy 1 additional Fighter per level\n200% bonus to Fighter control range\n',2932,1150,1163250000,13095000,3500,1,8,844884708,1,820,0.07),(23912,643,'Thanatos Blueprint','',309,0,0,0.01,0,1,NULL,1250000000,1,890,0),(23913,659,'Nyx','The Nyx is a gigantic homage to a figure much loved in Gallente society. The ships design is based on the scepter of Doule dos Rouvenor III, the king who, during his peaceful 36-year reign, was credited with laying the foundation for the technologically and socially progressive ideologies which have pervaded Gallente thought in the millennia since. Indeed, the Nyx itself is emblematic of the Gallenteans love for progress, packed to the ergonomic brim with the latest in cutting-edge advancements, it is a proud reminder of the things that make the Federation what it is.\n\nGallente Carrier Skill Bonuses:\n50% bonus to Capital Shield and Armor transfer range per level\n5% bonus to deployed Fighters damage per level\n99% reduction in CPU need for Clone Vat Bay\n99% reduction in CPU need for Warfare Link modules\n99% reduction in CPU need for Projected Electronic Counter Measures modules\n99% reduction in CPU need for Tactical Logistics Reconfiguration modules\nCan deploy 3 additional Fighters per level\nCan fit 1 additional Warfare Link module per level\n200% bonus to Fighter control range\nImmune to all forms of Electronic Warfare\n',2909,1625,1615625000,58200000,5250,1,8,15827570900,1,820,0.07),(23914,643,'Nyx Blueprint','',309,0,0,0.01,0,1,NULL,20000000000,1,890,0),(23915,547,'Chimera','The Chimeras design is based upon the Kairiola, a vessel holding tremendous historical significance for the Caldari. Initially a water freighter, the Kairiola was refitted in the days of the Gallente-Caldari war to act as a fighter carrier during the orbital bombardment of Caldari Prime.\n\nIt was most famously flown by the legendary Admiral Yakia Tovil-Toba directly into Gallente Primes atmosphere, where it fragmented and struck several key locations on the planet.  This event, where the good Admiral gave his life, marked the culmination of a weeks concentrated campaign of distraction which enabled the Caldari to evacuate their people from their besieged home planet.  Where the Chimera roams, the Caldari remember.\n\nCaldari Carrier Skill Bonuses:\n50% bonus to Capital Energy and Shield transfer range per level\n5% bonus to all Shield resistances per level\n99% reduction in CPU need for Warfare Link modules\n99% reduction in CPU need for Tactical Logistics Reconfiguration modules\nCan deploy 1 additional Fighter per level\n200% bonus to Fighter control range\n',2931,650,1188000000,11925000,3475,1,1,733826590,1,819,0.07),(23916,643,'Chimera Blueprint','',309,0,0,0.01,0,1,NULL,1050000000,1,889,0),(23917,659,'Wyvern','The Wyvern is based on documents detailing the design of the ancient Raata empires seafaring flagship, the Oryioni-Haru. According to historical sources the ship was traditionally taken on parade runs between the continent of Tikiona and the Muriyuke archipelago, seat of the Emperor, and represented the pride and joy of what would one day become the Caldari State. Todays starfaring version gives no ground to its legendary predecessor, with its varied applications in the vast arena of deep space, the Wyvern is likely to stand as a symbol of Caldari greatness for untold years to come.\n\nCaldari Carrier Skill Bonuses:\n50% bonus to Capital Energy and Shield transfer range per level\n5% bonus to all Shield resistances per level\n99% reduction in CPU need for Clone Vat Bay\n99% reduction in CPU  need for Warfare Link modules\n99% reduction in CPU need for Projected Electronic Counter Measures modules\n99% reduction in CPU need for Tactical Logistics Reconfiguration modules\nCan deploy 3 additional Fighters per level\nCan fit 1 additional Warfare Link module per level\n200% bonus to Fighter control range\nImmune to all forms of Electronic Warfare\n',2928,1650,1650000000,53000000,5215,1,1,14032432500,1,819,0.07),(23918,643,'Wyvern Blueprint','',309,0,0,0.01,0,1,NULL,18000000000,1,889,0),(23919,659,'Aeon','Ships like the Aeon have been with the Empire for a long time. They have remained a mainstay of Amarr expansion as, hopeful for a new beginning beyond the blasted horizon, whole cities of settlers sojourn from their time-worn homesteads to try their luck on infant worlds. The Aeon represents the largest ship of its kind in the history of the Empire, capable of functioning as a mobile citadel in addition to fielding powerful armaments.\n\nAmarr Carrier Skill Bonuses:\n50% bonus to Capital Energy and Armor transfer range per level\n5% bonus to all Armor resistances per level\n99% reduction in CPU need for Clone Vat Bay\n99% reduction in CPU need for Warfare Link modules\n99% reduction in CPU need for Projected Electronic Counter Measures modules\n99% reduction in CPU need for Tactical Logistics Reconfiguration modules\nCan deploy 3 additional Fighters per level\nCan fit 1 additional Warfare Link module per level\n200% bonus to Fighter control range\nImmune to all forms of Electronic Warfare\n',2911,2840,1546875000,62000000,4950,1,4,14573872400,1,818,0.07),(23920,643,'Aeon Blueprint','',309,0,0,0.01,0,1,NULL,18500000000,1,888,0),(23921,803,'Strain Annihilator Alvum','Rogue drones are hi-tech drones that have the ability to manufacture themselves. Rogue drone hives can be found throughout the universe of EVE and are a constant menace to space travelers. Threat level: Significant',1222,150,100000,60,1200,1,NULL,0,0,NULL,0),(23922,803,'Strain Devastator Alvum','Rogue drones are hi-tech drones that have the ability to manufacture themselves. Rogue drone hives can be found throughout the universe of EVE and are a constant menace to space travelers. Threat level: Significant',1222,150,100000,60,1200,1,NULL,0,0,NULL,0),(23923,803,'Strain Viral Infector Alvum','Rogue drones are hi-tech drones that have the ability to manufacture themselves. Rogue drone hives can be found throughout the universe of EVE and are a constant menace to space travelers. Threat level: Extreme',1226,150,100000,60,1200,1,NULL,0,0,NULL,0),(23924,8