l in good order.',1030,0,250,2,0,1,NULL,0,1,NULL,0),(23937,526,'Perpetual Chamber Warden','A security and surveillance device used to track movement and other activity inside buildings. This one is used to track and record all activity inside the personal chambers of Lord Arachnan.',1361,0,2500,2,0,1,NULL,0,1,NULL,0),(23939,798,'Deuce Murderer','Guristas Commanders are master tacticians, frequently veterans of empire navies before swerving off the straight path to become outlaws. Threat level: Deadly.',1824,150,10100000,101000,235,1,1,0,0,NULL,0.07),(23940,579,'Vagrant Nihilist','This is a fighter for the Guristas. It is protecting the assets of Guristas and may attack anyone it perceives as a threat or easy pickings. Threat level: Very high',2920,50,1650000,16500,235,1,1,0,0,NULL,0.07),(23941,579,'Vagrant Anarchist','This is a fighter for the Guristas. It is protecting the assets of Guristas and may attack anyone it perceives as a threat or easy pickings. Threat level: Very high',2920,50,1650000,16500,235,1,1,0,0,NULL,0.07),(23942,799,'Desperado Nihilist','This is a fighter for the Guristas. It is protecting the assets of Guristas and may attack anyone it perceives as a threat or easy pickings. Threat level: Very high',2920,50,1650000,16500,235,1,1,0,0,NULL,0.07),(23943,799,'Desperado Anarchist','This is a fighter for the Guristas. It is protecting the assets of Guristas and may attack anyone it perceives as a threat or easy pickings. Threat level: Very high',2920,50,1650000,16500,235,1,1,0,0,NULL,0.07),(23945,314,'Komni History (2 of 2)','But soon the old man became suspicious. He couldn\'t believe the incredibly good fortune his son was suddenly blessed with was simply due to hard, honest work. So he hired an expensive private detective, Asamura, to investigate the internal affairs within Komni, to better understand exactly what had changed since disaster loomed over the corporation. Asamura, being an ex-elite agent within the Caldari State special forces, quickly discovered who was behind this turn of events, that the Guristas had been using the garbage haulers as a means to smuggle drugs and other illegal goods into Caldari high secure space for enormous profits. Due to Kaimos\'s close relationship with many members of the Caldari State government, the garbage haulers received far less attention from local security forces than other, more suspcious craft.<br><br>When Kaimo heard of these tidings he became furious. If the news surfaced about Komni being under the influence of the Guristas Pirates and committing illegal acts within the Caldari State borders, his status and even his life might be forfeit. He immediately confronted his son and ordered him to cut all ties with the Guristas, as well as letting him know that he had just blown any chance he had of acquiring the family fortune. But there was one single flaw in Kaimos plan, and that was his underestimating of his sons determination to remain wealthy. Threatening to expose Komnis illegal dealings to the media, Shojin played the only card he had. Either his father leave his corporation alone and give it a large credit \"donation\", or both of their reputations would be ruined. In return Shojin would severe all ties with the Guristas. His father reluctantly accepted his sons terms.<br><br>Shortly thereafter Shojin held a secret meeting with his contact within the Guristas. He demanded that Drako stop the illegal activity the Guristas had been conducting behind his back, and remove all ties they had with Komni. But the wry, finely dressed agent simply laughed, they had played Shojin for a fool all along. While Shojin had been endulging himself with the finer things in life, Drako had been busily hoarding the company stocks in preparation for a takeover. He knew about Asamuras involvement, and expected this very conversation. As Shojin looked in horror, two burly, brown-skinned men entered the room where he stood next to Drako. With a simple move of his right hand, Drako ordered his guards to execute his unfortunate client. And as he left the room, followed by high-pitched screams which were quickly silenced, the smiling, middle-aged man dressed in a shiny black tuxedo thought of how happy he was that the Komni stock had risen drastically upon the news of the takeover. No longer would he need to answer to his less-than-trustworthy superiors within the Guristas, from this day forward he would own his very own branch within the vast Caldari criminal network.\n\n',1192,0,1,1,0,1,NULL,0,1,NULL,0),(23946,517,'Dakumon\'s Punisher','A Punisher piloted by an agent.',300,40,0,0,0,1,4,0,0,NULL,0),(23947,517,'Ebotiz\'s Retribution','A Retribution piloted by an agent.',1920,40,0,0,0,1,4,0,0,NULL,0),(23948,314,'Native Freshfood Special','The Native Freshfood Special is a meat-heavy meal which is sought after all throughout the Minmatar Republic. The recipe has been handed down through countless generations, and is considered part of the Minmatar heritage. ',30,0,400,0.5,0,1,NULL,0,1,NULL,0),(23949,319,'Serpentis Battlestation','This gigantic suprastructure is one of the military installations of the Serpentis pirate corporation. Even for its size, it has no commercial station services or docking bay to receive guests.',1403,8658,100000,100000000,10000,1,8,0,0,NULL,0),(23950,257,'Command Ships','Skill for the operation of Command Ships. Can not be trained on Trial Accounts.',33,0,0,0.01,0,1,NULL,64000000,1,377,0),(23951,533,'Aradim Arachnan','The Omen is a good example of the sturdy and powerful cruisers of the Amarr, with super strong armor and defenses. It also mounts multiple turret hardpoints. This Omen is piloted by Aradim Arachnan, the son of Lord Arachnan.',1731,134.43,11950000,118000,450,1,4,0,0,NULL,0.07),(23952,715,'Karo Zulak\'s Bestower','This Bestower-class industrial is currently undergoing maintenance. Although an excellent military tactician, Zulak is not known for his bravery in combat, rather opting to fly in a heavily armored