ame. Its defensive capabilities make it ideally suited for small raid groups or solo work, while its 8 turret hardpoints present opportunities for untold carnage on the fleet battlefield.\n\nSpecial Ability: 5% large projectile weapon rate of fire per level and 7.5% shield boost amount per level ',3134,250,103600000,472500,550,1,2,145000000,1,78,0.07),(24695,107,'Maelstrom Blueprint','',48,0,0,0.01,0,1,NULL,1450000000,1,278,0),(24696,419,'Harbinger','Right from its very appearance on a battlefield, the Harbinger proclaims its status as a massive weapon, a laser burning through the heart of the ungodly. Everything about it exhibits this focused intent, from the lights on its nose and wings that root out the infidels, to the large number of turreted high slots that serve to destroy them. Should any heathens be left alive after the Harbinger\'s initial assault, its drones will take care of them.\n\nBattlecruiser Skill Bonus: 10% reduction in laser capacitor need and 5% bonus to laser damage per level.\n\n99% reduction in the CPU need of Warfare Link modules.',3133,198,13500000,234000,350,1,4,38500000,1,470,0.07),(24697,489,'Harbinger Blueprint','',1748,0,0,0.01,0,1,NULL,385000000,1,589,0),(24698,419,'Drake','Of the meticulous craftsmanship the Caldari are renowned for, the Drake was born. It was found beneath such a ship to rely on anything other than the time-honored combat tradition of missile fire, while the inclusion of sufficient CPU capabilities for decent electronic warfare goes without saying.\n\nBattlecruiser Skill Bonus: 5% shield resistance and 5% bonus kinetic damage of heavy missiles and heavy assault missiles\n\n99% reduction in the CPU need of Warfare Link modules.',3169,363,14010000,252000,345,1,1,38000000,1,471,0.07),(24699,489,'Drake Blueprint','',1748,0,0,0.01,0,1,NULL,380000000,1,590,0),(24700,419,'Myrmidon','Worried that their hot-shot pilots would burn brightly in their eagerness to engage the enemy, the Federation Navy created a ship that encoura