base without a fleet behind him.\n\nDocking has been prohibited into this station without proper authorization.',1249,10252,0,0,0,1,4,0,0,NULL,0),(26897,319,'Sisters of EVE Aid Station','The Sisters need to rapidly receive and deploy aid has led to the creation of the Aid Stations, relatively quick and easy to construct and place in orbit these stations can recieve vast quantities of aid and transfer them to orbital craft for quick deployment on a planet. Since their inception they have saved vast quantities of lives and other corporations have leased the design for their own purposes.',2403,1255,100000,100000000,10000,1,NULL,0,0,NULL,0),(26898,319,'Asteroid Slave Mine','\"There are some who will never embrace enlightment, and those poor souls we must.. educate\"<br>\nGavrin Lothril - Asteroid Mine XVII-232 Foreman',1717,9213,0,1,0,1,NULL,0,0,NULL,0),(26899,319,'Unlicensed Mindclash Arena','Mind Clash is one of the most popular sports throughout known space, it is as enthusiastically played in the royal court on Amarr Prime as in the gambling halls of the Caldari. However there are a certain cadre of people who think that the official sport is too tame, so they created a new set of rules, to the death - which was promptly banned from Empire space. However their is much underground hunger for this sport so hidden in space arena\'s have started to be constructed in which sport enthusiasts can enjoy watching their heroes fight and die without the inteference of the beaurcratic empires.',2513,2495,100000,100000000,10000,1,NULL,0,0,NULL,0),(26900,319,'Broadcast Tower','The Caldari call these propoganda towers, however the Gallente people prefer to call them liberty towers. Whatever their designation these hidden broadcast towers send their amplified signal throughout the system they are located in. The Gallente networks use them to broadcast their channels to areas of space where such signals are usually banned. There are a network of relay towers which utilise the FTL networks to bring their underground signal to the source tower.',2505,2636,100000,100000000,10000,1,NULL,0,0,NULL,0),(26901,283,'Breeder Slave','These slaves are held within breeder colonies for years for the sole purpose of increasing a slaver\'s stock. Discarded when they have outlived their usefulness, these poor creatures have a short life expectancy that might be a blessing when compared to the misery of their existence in captivity. ',2541,0,80,1.5,0,1,NULL,0,1,NULL,0),(26902,526,'Fedo','The Fedo is an omnivorous, sponge-like creature. It has reddish skin and numerous small claw-like tentacles which it uses to move around and protect itself. A primitive being, the Fedo\'s method of eating and absorbing nutrition is slow and inefficient. This means that food stays for a long time in the Fedo\'s body, and will most often have rotted or turned foul before the animal passes it out of its system. The Fedos eject fumes from their body which, for the reasons explained above, have a most horrible odor. The Fedos possess a fantastic sense of smell and so use these fumes to communicate with each other, they are however both blind and deaf, having no eyes or ears. The mouth is located on the underside of the beast, and the Fedo feeds by positioning itself over the food and lowering itself down on it.',1188,0,3000,0.5,0,1,NULL,0,1,NULL,0),(26903,526,'Military Intelligence Report','A military intelligence report on Fleet movements in the local vicinity, patrol schedules and current strength,',1192,0,1,0.1,0,1,NULL,0,1,NULL,0),(26904,526,'Secure Coded Package','A generic package containing goods in a protective wrapping. It is secured with a code lock and cannot be opened without knowing the proper combination.',2039,0,25,10,0,1,NULL,0,1,NULL,0),(26905,526,'Slave Ownership Record','A Record of owner ship of a single slave, previous owners, work history and current state of health',1192,0,1,0.1,0,1,NULL,0,1,NULL,0),(26906,526,'Slave Manifests','A Manifest of slave movements in the local area, quantity and quality of stock',1192,0,1,0.1,0,1,NULL,0,1,NULL,0),(26907,283,'Starkmanir Slave','The Starkmanir Tribe was virtually wiped after a failed rebellion, only a handful remain in the Empire and have now turned into collector\'s items for Amarrian Holder\'s. These slave\'s are rarely ever put to hard labour and generally live out their lives as exhibits for their Amarrian masters to show off. A pure blooded Starkmanir slave has made many a Holder a rich man',2541,0,200,3,0,1,NULL,0,0,NULL,0),(26908,283,'Valkears','\"We aren\'t going to try to train you, we\'re going to try to kill you.\"<br>\n- Valklear Instructor\n<br><br>\nIn the great war for liberation the Minmatar tribes, finding themselves lacking able-bodied men, were forced to create soldiers from their most dangerous criminalstheir thieves, schemers, and murderers. This method proved remarkably successful and continues to this day. One would have to be mad to join in a Valkear unit\'s fifteen-year tour of duty, and among the criminal element, the rivers of madness run deep indeed.',2549,0,90,1,0,1,2,50000,0,NULL,0),(26909,972,'Multispectral Frequency Probe','The Multispectral Frequency Probe scans the entire solar system for multispectral frequencies, and gives a readout on which types of frequencies exist.',2704,1,1,1.25,0,1,NULL,19978,0,NULL,0.07),(26910,486,'Multispectral Frequency Probe Blueprint','',1007,0,0,0.01,0,1,NULL,5000000,1,NULL,0),(26911,226,'Avatar Wreck','These are the remnants of the Avatar-class titan piloted by CYVOK of Ascendant Frontier. It was destroyed by Band of Brothers in the war between the two alliances. The event marked the destruction of the first capsuleer owned titan in existence.',3100,3106,0,0,0,1,NULL,0,0,NULL,0),(26912,325,'Small Remote Armor Repair System II','This module uses nano-assemblers to repair damage done to the armor of the Target ship.',80,0,20,5,0,1,NULL,49398,1,1059,0.07),(26913,325,'Medium Remote Armor Repair System II','This modul