onally, the Rorqual is able to fit a capital tractor beam unit, capable of pulling in cargo containers from far greater distances and at far greater speeds than smaller beams can. It also possesses a sizeable drone bay, jump drive capability and the capacity to fit a clone vat bay. This combination of elements makes the Rorqual the ideal nexus to build deep space mining operations around.\n\nDue to its specialization towards industrial operations, its ship maintenance bay is able to accommodate only industrial ships, mining barges and their tech 2 variants\n\nCapital Industrial Ships skill bonuses:\n-5% reduction in fuel consumption for industrial cores per level\n5% bonus to effectiveness of mining foreman gang links per level when in deployed mode\n50% bonus to the range of Capital Shield Transporters per level.\n20% bonus to drone damage and hitpoints per level.\n\nRole Bonuses: \n900% bonus to the range of survey scanners\n200% bonus to the range of cargo scanners\n\n99% reduction in CPU need for Gang Link modules\n99% reduction in CPU need for Clone Vat Bay\n\nCan use 3 Gang Link modules simultaneously.',3331,1100,1180000000,14500000,40000,1,8,1520784302,1,1048,0.07),(28353,944,'Rorqual Blueprint','',309,0,0,0.01,0,1,NULL,3000000000,1,1046,0),(28354,884,'Test Compressed Ore','test ore ',1277,0,10000,0.01,0,1,NULL,0,0,NULL,0),(28356,885,'Cosmic Anomaly','A cosmic signature.',0,0,0,1,0,1,NULL,0,0,NULL,0),(28359,314,'Alliance Tournament Silver Medal','The great Alliance Tournament silver medal. So close, and yet so far. Second place in the Alliance Tournament signifies many things to many people. It does, however, stand for one undeniable truth: the holder kicked several metric tons of arse to get it.\n',2093,0,1,0.1,0,1,NULL,0,0,NULL,0),(28360,314,'Alliance Tournament Bronze Medal','The great Alliance Tournament bronze medal. No capsuleer aims for it, and no one glorifies in it. Some call its holders the worst of the best, but there are victories to be gained even in loss. While glory may elude the holder, honor and respect do not.\n',2093,0,1,0.1,0,1,NULL,0,0,NULL,0),(28361,886,'Drone Synaptic Relay Wiring','The relay wiring of a rogue drones synaptic system, these wires allow for a much higher flow of power and information than standard empire technology has yet to achieve. ',3333,0,0.5,0.1,0,1,NULL,0,1,1096,0),(28362,886,'Drone Capillary Fluid','The fluid that flows through rogue drone relays, the substance is a amalgamation of various chemical compounds that many scientists theorize to be akin to the life blood of a rogue drone.\n\nWhatever the reason the fluid combined with synaptic relays allows for an astonishing high flow of data.',3334,0,1,0.2,0,1,NULL,0,1,1096,0),(28363,886,'Drone Cerebral Fragment','A fragment of a rogue drones cerebral cortex.',3335,0,1,0.3,0,1,NULL,0,1,1096,0),(28364,886,'Drone Tactical Limb','A multipurpose limb of a rogue drone which, in combat models, is a mount for the primary weapon. The modular design of such limbs allows for them to be incorporated into standard drone designs with some ingenuity.',3336,0,2,0.7,0,1,NULL,0,1,1096,0),(28365,886,'Drone Epidermal Shielding Chunk','A chunk of the epidermal shielding from a rogue drone, while being both more durable and resistant than standard drone shielding, it is also thinner and more flexible forming, as it does, the skin of a rogue drone.',3337,0,5,1,0,1,NULL,0,1,1096,0),(28366,886,'Drone Coronary Unit','The beating heart of a rogue drone, this power unit is a marvel of technology providing a greater size/power ratio than is currently achievable by modern designs. With some clever tinkering it is possible to adapt this to interface with current drone technology.',3338,0,2,0.8,0,1,NULL,0,1,1096,0),(28367,450,'Compressed Arkonor','The rarest and most sought-after ore in the known universe. A sizable nugget of this can sweep anyone from rags to riches in no time. Arkonor has the largest amount of megacyte of any ore, and also contains some zydrine and tritanium.\n\nThis ore is a compressed and much more dense version of the original ore.',3307,0,1e+35,800,0,1,NULL,15342520,1,512,0),(28368,888,'Compressed Arkonor Blueprint','Note: This blueprint can only be used with the Rorqual Capital Industrial Ships assembly lines.',318,0,0,0.01,0,1,NULL,1000000,1,1042,0),(28369,54,'Miner II (China)','Has an improved technology beam, making the extraction process more efficient. Useful for extracting all but the rarest ore.',1061,25,0,5,0,1,NULL,79128,0,NULL,0.06),(28371,839,'test Cynosural System Jammer','Creates a system-wide inhibitor field which prevents cynosural generators of all kinds from functioning',2615,629,100,4000,0,1,NULL,8000000,0,NULL,0),(28372,889,'Test Arkonor Enhancement','',318,0,0,0.01,0,1,8,0,0,NULL,0),(28373,268,'Ore Compression','',33,0,0,0,0,1,NULL,0,0,NULL,0),(28374,257,'Capital Industrial Ships','Skill at operating Capital Industrial Ships\n\nCannot be trained on trial accounts.',33,0,0,0,0,1,NULL,500000000,1,377,0),(28375,771,'Republic Fleet Heavy Assault Missile Launcher','A launcher intended for use on cruiser-class spacecraft. While heavy assault launchers do not possess the sheer damage-dealing capability of regular heavy missile launchers, their blend of speed and attack power lends them application across a good range of tactical situations.\n\nHas to be fitted with regular Assault Missiles: Fulmination, Hellfire, Terror, Torrent.',3241,0,0,10,1.005,1,NULL,34096,1,NULL,0.07),(28376,136,'Republic Fleet Heavy Assault Missile Launcher Blueprint','',194,0,0,0,0,1,NULL,300000,0,NULL,0),(28377,771,'Caldari Navy Heavy Assault Missile Launcher','A launcher intended for use on cruiser-class spacecraft. While heavy assault launchers do not possess the sheer damage-dealing capability of regular heavy missile launchers, their blend of speed and attack power lends them application across a good range of tactical situations.\n\nHas to be fitted with regular Assault Missiles: Fulmination, Hellfire, Terror, Torrent.',3241,0,0,10,1.125,1,NULL,34096,1,NULL,0.07),(28378,136,'Caldari Navy Heavy Assault Missile Launcher Blueprint','',194,0,0,0,0,1,NULL,300000,0,NULL,0),(28379,771,'Domination Heavy Assault Missile Launcher','A launcher intended for use on cruiser-class spacecraft. While heavy assault launchers do not possess the sheer damage-dealing capability of regular heavy missile launchers, their blend of speed and attack power lends them application across a good range of tactical situations.\n\nHas to be fitted with regular Assault Missiles: Fulmination, Hellfire, Terror, Torrent.',3241,0,0,10,1.005,1,NULL,34096,1,NULL,0.07),(28380,136,'Domination Heavy Assault Missile Launcher Blueprint','',194,0,0,0,0,1,NULL,300000,0,NULL,0),(28381,771,'Dread Guristas Heavy Assault Missile Launcher','A launcher intended for use on cruiser-class spacecraft. While heavy assault launchers do not possess the sheer damage-dealing capability of regular heavy missile launchers, their blend of speed and attack power lends them application across a good range of tactical situations.\n\nHas to be fitted with regular Assault Missiles: Fulmination, Hellfire, Terror, Torrent.',3241,0,0,10,1.125,1,NULL,34096,1,NULL,0.07),(28382,136,'Dread Guristas Heavy Assault Missile Launcher Blueprint','',194,0,0,0,0,1,NULL,300000,0,NULL,0),(28383,771,'True Sansha Heavy Assault Missile Launcher','A launcher intended for use on cruiser-class spacecraft. While heavy assault launchers do not possess the sheer damage-dealing capability of regular heavy missile launchers, their blend of speed and attack power lends them application across a good range of tactical situations.\n\nHas to be fitted with regular Assault Missiles: Fulmination, Hellfire, Terror, Torrent.',3241,0,0,10,1.005,1,NULL,34096,1,NULL,0.07),(28384,136,'True Sansha Heavy Assault Missile Launcher Blueprint','',194,0,0,0,0,1,NULL,300000,0,NULL,0),(28385,450,'Compressed Crimson Arkonor','While fairly invisible to all but the most experienced miners, there are significant molecular differences between Arkonor and its crimson counterpart, so-named because of the blood-red veins running through it.\n\nThe rarest and most sought-after ore in the known universe. A sizable nugget of this can sweep anyone from rags to riches in no time. Arkonor has the largest amount of megacyte of any ore, and also contains some zydrine and tritanium.\n\nThis ore is a compressed and much more dense version of the original ore.',3307,1,1e+35,800,0,1,NULL,16120910,1,512,0),(28386,888,'Compressed Crimson Arkonor Blueprint','Note: This blueprint can only be used with the Rorqual Capital Industrial Ships assembly lines.',318,0,0,0.01,0,1,NULL,1000000,1,1042,0),(28387,450,'Compressed Prime Arkonor','Prime Arkonor is the rarest of the rare, the king of ores. Giving a 10% greater mineral yield than regular ark, this is the stuff that makes billionaires out of people lucky enough to stumble upon a vein.\n\nThe rarest and most sought-after ore in the known universe. A sizable nugget of this can sweep anyone from rags to riches in no time. Arkonor has the largest amount of megacyte of any ore, and also contains some zydrine and tritanium.\n\nThis ore is a compressed and much more dense version of the original ore.',3307,1,1e+35,800,0,1,NULL,16868580,1,512,0),(28388,451,'Compressed Bistot','Bistot is a very valuable ore as it holds large portions of two of the rarest minerals in the universe, megacyte and zydrine.\n\nThis ore is a compressed and much more dense version of the original ore.',3308,1,1e+35,800,0,1,NULL,10461840,1,514,0),(28389,451,'Compressed Monoclinic Bistot','Monoclinic bistot is a variant of bistot with a slightly different crystal structure. It is highly sought-after, as it gives a slightly higher yield than its straightforward counterpart.\n\nBistot is a very valuable ore as it holds large portions of two of the rarest minerals in the universe, megacyte and zydrine. \n\nThis ore is a compressed and much more dense version of the original ore.',3308,1,1e+35,800,0,1,NULL,11507000,1,514,0),(28390,451,'Compressed Triclinic Bistot','Bistot with a triclinic crystal system occurs very rarely under natural conditions, but is highly popular with miners due to its extra-high concentrations of the zydrine and megacyte minerals.\n\nBistot is a very valuable ore as it holds large portions of two of the rarest minerals in the universe, megacyte and zydrine.\n\nThis ore is a compressed and much more dense version of the original ore.',3308,1,1e+35,800,0,1,NULL,11004920,1,514,0),(28391,452,'Compressed Crokite','Crokite is a very heavy ore that is always in high demand because it has the largest ratio of zydrine for any ore in the universe.\n\nThis ore is a compressed and much more dense version of the original ore.',3309,1,1e+35,1000,0,1,NULL,7639790,1,521,0),(28392,452,'Compressed Crystalline Crokite','Crystalline crokite is the stuff of legend in 0.0 space. Not only does it give a 10% greater yield than regular crokite, but chunks of the rock glitter beautifully in just the right light, making crystalline crokite popular as raw material for jewelry.\n\nCrokite is a very heavy ore that is always in high demand because it has the largest ratio of zydrine for any ore in the world.\n\nThis ore is a compressed and much more dense version of the original ore.',3309,1,1e+35,1000,0,1,NULL,8400440,1,521,0),(28393,452,'Compressed Sharp Crokite','In certain belts, environmental conditions will carve sharp, jagged edges into crokite rocks, resulting in the formation of sharp crokite.\n\nCrokite is a very heavy ore that is always in high demand because it has the largest ratio of zydrine for any ore in the world.\n\nThis ore is a compressed and much more dense version of the original ore.',3309,1,1e+35,1000,0,1,NULL,8021400,1,521,0),(28394,453,'Compressed Dark Ochre','Dark Ochre was for years ignored as a worthwhile ore to mine until improved refining techniques managed to extract the huge amount of nocxium inside it, the highest ratio of nocxium found in any ore in the universe.\n\nThis ore is a compressed and much more dense version of the original ore.',3310,1,1e+35,800,0,1,NULL,3842500,1,522,0),(28395,453,'Compressed Obsidian Ochre','Obsidian Ochre, the most valuable member of the Dark Ochre family, was only first discovered a decade ago. The sleek black surface of this mineral managed to reflect scanning waves, making Obsidian Ochre asteroids almost invisible. Advances in scanning technology revealed these beauties at last.\n\nDark Ochre was for years ignored as a worthwhile ore to mine until improved refining techniques managed to extract the huge amount of nocxium inside it, the highest ratio of nocxium found in any ore in the universe.\n\nThis ore is a compressed and much more dense version of the original ore.',3310,1,1e+35,800,0,1,NULL,4226750,1,522,0),(28396,453,'Compressed Onyx Ochre','Shiny black nuggets of Onyx Ochre look very nice and are occasionally used in ornaments. But the great amount of nocxium is what miners are really after. Like in all else, good looks are only an added bonus.\n\nDark Ochre was for years ignored as a worthwhile ore to mine until improved refining techniques managed to extract the huge amount of nocxium inside it, the highest ratio of nocxium found in any ore in the universe. \n\nThis ore is a compressed and much more dense version of the original ore.',3310,1,1e+35,800,0,1,NULL,4039750,1,522,0),(28397,467,'Compressed Gneiss','Gneiss is a popular ore type because it holds a bit of many minerals, increasing its utility value. It has a little something of tritanium, mexallon, isogen and zydrine.\n\nThis ore is a compressed and much more dense version of the original ore.',3321,1,1e+35,1000,0,1,NULL,3999260,1,525,0),(28398,467,'Compressed Iridescent Gneiss','Gneiss is often the first major league ore that up and coming miners graduate to. Finding the more expensive variation of Gneiss, called Iridescent Gneiss, is a major coup for these miners.\n\nGneiss is a popular ore type because it holds a bit of many minerals, increasing its utility value. It has a little something of tritanium, mexallon, isogen and zydrine. \n\nThis ore is a compressed and much more dense version of the original ore.',3321,1,1e+35,1000,0,1,NULL,4208400,1,525,0),(28399,467,'Compressed Prismatic Gneiss','Prismatic Gneiss has fracturized molecule-structure, which explains its unique appearance. It is the most sought after member of the Gneiss family, as it yields 10% more than common Gneiss.\n\nGneiss is a popular ore type because it holds a bit of many minerals, increasing its utility value. It has a little something of tritanium, mexallon, isogen and zydrine.\n\nThis ore is a compressed and much more dense version of the original ore.',3321,1,1e+35,1000,0,1,NULL,4396720,1,525,0),(28400,454,'Compressed Glazed Hedbergite','Asteroids containing this shiny ore were formed in intense heat, such as might result from a supernova. The result, known as Glazed Hedbergite, is a more concentrated form of Hedbergite that has 10% higher yield.\n\nHedbergite is sought after for its high concentration of isogen, although the high portion size needed for refining makes it a bit less attractive.  Hedbergite also yields some Nocxium and a small amount of Zydrine.\n\nThis ore is a compressed and much more dense version of the original ore.',3311,1,1e+35,750,0,1,NULL,3705600,1,527,0),(28401,454,'Compressed Hedbergite','Hedbergite is sought after for its high concentration of isogen, although the high portion size needed for refining makes it a bit less attractive. Hedbergite also yields some Nocxium and a small amount of Zydrine.\n\nThis ore is a compressed and much more dense version of the original ore.',3311,1,1e+35,750,0,1,NULL,3374080,1,527,0),(28402,454,'Compressed Vitric Hedbergite','When asteroids containing Hedbergite pass close to suns or other sources of intense heat can cause the Hedbergite to glassify. The result is called Vitric Hedbergite and has 5% better yield than normal Hedbergite.\n\nHedbergite is sought after for its high concentration of isogen, although the high portion size needed for refining makes it a bit less attractive.  Hedbergite also yields some Nocxium and a small amount of Zydrine.\n\nThis ore is a compressed and much more dense version of the original ore.',3311,1,1e+35,750,0,1,NULL,3552000,1,527,0),(28403,455,'Compressed Hemorphite','With a large portion of nocxium the Hemorphite is always a good find. It is common enough that even novice miners can expect to run into it. Hemorphite also has a bit of tritanium and isogen as well as trace amounts of Zydrine.\n\nThis ore is a compressed and much more dense version of the original ore.',3312,1,1e+35,750,0,1,NULL,3019920,1,528,0),(28404,455,'Compressed Radiant Hemorphite','Hemorphite exists in many different color variations. Interestingly, the more colorful it becomes, the better yield it has. Radiant Hemorphite has 10% better yield than its more bland brother.\n\nWith a large portion of nocxium the Hemorphite is always a good find. It is common enough that even novice miners can expect to run into it. Hemorphite also has a bit of tritanium and isogen as well as trace amounts of Zydrine. \n\nThis ore is a compressed and much more dense version of the original ore.',3312,1,1e+35,750,0,1,NULL,3323700,1,528,0),(28405,455,'Compressed Vivid Hemorphite','Hemorphite exists in many different color variations. Interestingly, the more colorful it becomes, the better yield it has. Vivid Hemorphite has 5% better yield than its more bland brother.\n\nWith a large portion of nocxium the Hemorphite is always a good find. It is common enough that even novice miners can expect to run into it. Hemorphite also has a bit of tritanium and isogen as well as trace amounts of Zydrine. \n\nThis ore is a compressed and much more dense version of the original ore.',3312,1,1e+35,750,0,1,NULL,3162220,1,528,0),(28406,456,'Compressed Jaspet','Jaspet has many mineral types, making it easy to sell. It has a large portion of mexallon plus some tritanium, pyerite and nocxium.\n\nThis ore is a compressed and much more dense version of the original ore.',3313,1,1e+35,750,0,1,NULL,2522370,1,529,0),(28407,456,'Compressed Pristine Jaspet','Pristine Jaspet is very rare, which is not so surprising when one considers that it is formed when asteroids collide with comets or ice moons. It has 10% better yield than normal Jaspet.\n\nJaspet has many mineral types, making it easy to sell. It has a large portion of mexallon plus some tritanium, pyerite and nocxium. \n\nThis ore is a compressed and much more dense version of the original ore.',3313,1,1e+35,750,0,1,NULL,2781630,1,529,0),(28408,456,'Compressed Pure Jaspet','Pure Jaspet is popular amongst corporate miners who are looking for various minerals for manufacturing, rather than mining purely for profit.\n\nJaspet has many mineral types, making it easy to sell. It has a large portion of mexallon plus some tritanium, pyerite and nocxium. \n\nThis ore is a compressed and much more dense version of the original ore.',3313,1,1e+35,750,0,1,NULL,2636640,1,529,0),(28409,457,'Compressed Fiery Kernite','Known as Rage Stone to veteran miners after a discovery of a particularly rich vein of it caused a bar brawl of epic proportions in the Intaki Syndicate. It has a 10% higher yield than basic Kernite.\n\nKernite is a fairly common ore type that yields the largest amount of mexallon of any ore types in the universe. Besides mexallon the Kernite also has a bit of tritanium and isogen. \n\nThis ore is a compressed and much more dense version of the original ore.',3314,1,1e+35,720,0,1,NULL,2473500,1,523,0),(28410,457,'Compressed Kernite','Kernite is a fairly common ore type that yields the largest amount of mexallon of any ore types in the universe. Besides mexallon the Kernite also has a bit of tritanium and isogen.\n\nThis ore is a compressed and much more dense version of the original ore.',3314,1,1e+35,720,0,1,NULL,2247480,1,523,0),(28411,457,'Compressed Luminous Kernite','Prophets tell of the mystical nature endowed in Luminous Kernite. To the rest of us, it\'s an average looking ore that has 5% more yield than normal Kernite and can make you rich if you mine it 24/7 and live to be very old.\n\nKernite is a fairly common ore type that yields the largest amount of mexallon of any ore types in the universe. Besides mexallon the Kernite also has a bit of tritanium and isogen. \n\nThis ore is a compressed and much more dense version of the original ore.',3314,1,1e+35,720,0,1,NULL,2359020,1,523,0),(28412,468,'Compressed Magma Mercoxit','Mercoxit is a very dense ore that must be mined using specialized deep core mining techniques. It contains massive amounts of the extraordinary Morphite mineral but few other minerals of note.\n\nThis ore is a compressed and much more dense version of the original ore.',3322,1,1e+35,1000,0,1,NULL,36503552,1,530,0),(28413,468,'Compressed Mercoxit','Mercoxit is a very dense ore that must be mined using specialized deep core mining techniques. It contains massive amounts of the extraordinary Morphite mineral but few other minerals of note.\n\nThis ore is a compressed and much more dense version of the original ore.',3322,1,1e+35,1000,0,1,NULL,34734080,1,530,0),(28414,468,'Compressed Vitreous Mercoxit','Mercoxit is a very dense ore that must be mined using specialized deep core mining techniques. It contains massive amounts of the extraordinary Morphite mineral but few other minerals of note.\n\nThis ore is a compressed and much more dense version of the original ore.',3322,1,1e+35,1000,0,1,NULL,38207488,1,530,0),(28415,469,'Compressed Golden Omber','Golden Omber spurred one of the largest gold rushes in the early days of space faring, when isogen was the king of minerals. The 10% extra yield it offers over common Omber was all it took to make it the most sought after ore for a few years.\n\nOmber is a common ore that is still an excellent ore for novice miners as it has a sizeable portion of isogen, as well as some tritanium and pyerite. A few trips of mining this and a novice is quick to rise in status. \n\nThis ore is a compressed and much more dense version of the original ore.',3315,1,1e+35,750,0,1,NULL,2251000,1,526,0),(28416,469,'Compressed Omber','Omber is a common ore that is still an excellent ore for novice miners as it has a sizeable portion of isogen, as well as some tritanium and pyerite. A few trips of mining this and a novice is quick to rise in status.\n\nThis ore is a compressed and much more dense version of the original ore.',3315,1,1e+35,750,0,1,NULL,2044700,1,526,0),(28417,469,'Compressed Silvery Omber','Silvery Omber was first discovered some fifty years ago in an asteroid belt close to a large moon. The luminescence from the moon made this uncommon cousin of normal Omber seem silvery in appearance, hence the name.\n\nOmber is a common ore that is still an excellent ore for novice miners as it has a sizeable portion of isogen, as well as some tritanium and pyerite. A few trips of mining this and a novice is quick to rise in status. \n\nThis ore is a compressed and much more dense version of the original ore.',3315,1,1e+35,750,0,1,NULL,2144600,1,526,0),(28418,461,'Compressed Bright Spodumain','Spodumain is occasionaly found with crystaline traces in its outer surface. Known as Bright Spodumain, the crystal adds considerable value to an already valuable mineral.\n\nSpodumain is amongst the most valuable ore types around, as it is one of only three ore types that yields the ultra-rare megacyte. Otherwise very plain, with a bit of tritanium and pyerite. \n\nThis ore is a compressed and much more dense version of the original ore.',3316,1,1e+35,1000,0,1,NULL,6034350,1,517,0),(28419,461,'Compressed Gleaming Spodumain','Once in a while Spoudumain is found with crystaline veins running through it. The increased value this yields puts the gleam in the eye of any miner lucky enough to find it.\n\nSpodumain is amongst the most valuable ore types around, as it is one of only three ore types that yields the ultra-rare megacyte. Otherwise very plain, with a bit of tritanium and pyerite. \n\nThis ore is a compressed and much more dense version of the original ore.',3316,1,1e+35,1000,0,1,NULL,6321700,1,517,0),(28420,461,'Compressed Spodumain','Spodumain is amongst the most valuable ore types around, as it is one of only three ore types that yields the ultra-rare megacyte. Otherwise very plain, with a bit of tritanium and pyerite.\n\nThis ore is a compressed and much more dense version of the original ore.',3316,1,1e+35,1000,0,1,NULL,5747000,1,517,0),(28421,458,'Compressed Azure Plagioclase','Azure Plagioclase was made infamous in the melancholic song prose Miner Blues by the Gallentean folk singer Jaroud Dertier three decades ago.\n\nPlagioclase is not amongst the most valuable ore types around, but it has the largest amount of pyerite of any ore and is thus always in constant demand. It also yields some tritanium and mexallon. \n\nThis ore is a compressed and much more dense version of the original ore.',3320,1,1e+35,292,0,1,NULL,1345000,1,516,0),(28422,458,'Compressed Plagioclase','Plagioclase is not amongst the most valuable ore types around, but it has the largest amount of pyerite of any ore and is thus always in constant demand. It also yields some tritanium and mexallon.\n\nThis ore is a compressed and much more dense version of the original ore.',3320,1,1e+35,292,0,1,NULL,1280000,1,516,0),(28423,458,'Compressed Rich Plagioclase','With Rich Plagioclase, having 10% better yield than the normal one, miners can finally regard Plagioclase as a mineral that provides a noteworthy profit.\n\nPlagioclase is not amongst the most valuable ore types around, but it has the largest amount of pyerite of any ore and is thus always in constant demand. It also yields some tritanium and mexallon. \n\nThis ore is a compressed and much more dense version of the original ore.',3320,1,1e+35,292,0,1,NULL,1409200,1,516,0),(28424,459,'Compressed Pyroxeres','Pyroxeres is an interesting ore type, as it is very plain in most respects except one - deep core refining yields a little bit of nocxium, increasing its value considerbly. It also has a large portion of tritanium and some pyerite and mexallon.\n\nThis ore is a compressed and much more dense version of the original ore.',3318,1,1e+35,375,0,1,NULL,1744800,1,515,0),(28425,459,'Compressed Solid Pyroxeres','Solid Pyroxeres, sometimes called the Flame of Dam\'Torsad, is a relative of normal Pyroxeres. The Flame has 5% higher yield than its more common cousin.\n\nPyroxeres is an interesting ore type, as it is very plain in most respects except one - deep core refining yields a little bit of nocxium, increasing its value considerably. It also has a large portion of tritanium and some pyerite and mexallon. \n\nThis ore is a compressed and much more dense version of the original ore.',3318,1,1e+35,375,0,1,NULL,1866600,1,515,0),(28426,459,'Compressed Viscous Pyroxeres','Viscous Pyroxeres is the secret behind the success of ORE in the early days. ORE has since then moved into more profitable minerals, but Viscous Pyroxeres still holds a special place in the hearts of all miners dreaming of becoming the next mining moguls of EVE.\n\nPyroxeres is an interesting ore type, as it is very plain in most respects except one - deep core refining yields a little bit of nocxium, increasing its value considerbly. It also has a large portion of tritanium and some pyerite and mexallon.\n\nThis ore is a compressed and much more dense version of the original ore.',3318,1,1e+35,375,0,1,NULL,1911600,1,515,0),(28427,460,'Compressed Condensed Scordite','Condensed Scordite is a close cousin of normal Scordite, but with 5% better yield. The increase may seem insignificant, but matters greatly to new miners where every ISK counts.\n\nScordite is amongst the most common ore types in the known universe. It has a large portion of tritanium plus a fair bit of pyerite. Good choice for those starting their mining careers. \n\nThis ore is a compressed and much more dense version of the original ore.',3317,1,1e+35,375,0,1,NULL,1573800,1,519,0),(28428,460,'Compressed Massive Scordite','Massive Scordite was the stuff of legend in the early days of space exploration. Though it has long since been taken over in value by other ores it still has a special place in the hearts of veteran miners.\n\nScordite is amongst the most common ore types in the known universe. It has a large portion of tritanium plus a fair bit of pyerite. Good choice for those starting their mining careers. \n\nThis ore is a compressed and much more dense version of the original ore.',3317,1,1e+35,375,0,1,NULL,1648800,1,519,0),(28429,460,'Compressed Scordite','Scordite is amongst the most common ore types in the known universe. It has a large portion of tritanium plus a fair bit of pyerite. Good choice for those starting their mining careers.\n\nThis ore is a compressed and much more dense version of the original ore.',3317,1,1e+35,375,0,1,NULL,1498200,1,519,0),(28430,462,'Compressed Concentrated Veldspar','Clusters of Veldspar, called Concentrated Veldspar, are sometimes found in areas where normal Veldspar is already in abundance.\n\nThe most common ore type in the known universe, Veldspar can be found almost everywhere. It is still in constant demand as it holds a large portion of the much-used tritanium mineral. \n\nThis ore is a compressed and much more dense version of the original ore.',3319,1,4000,417,0,1,NULL,1050000,1,518,0),(28431,462,'Compressed Dense Veldspar','In asteroids above average size, the intense pressure can weld normal Veldspar into what is known as Dense Veldspar, increasing the yield by 10%.\n\nThe most common ore type in the known universe, Veldspar can be found almost everywhere. It is still in constant demand as it holds a large portion of the much-used tritanium mineral. \n\nThis ore is a compressed and much more dense version of the original ore.',3319,1,4000,417,0,1,NULL,1100000,1,518,0),(28432,462,'Compressed Veldspar','The most common ore type in the known universe, Veldspar can be found almost everywhere. It is still in constant demand as it holds a large portion of the much-used tritanium mineral.\n\nThis ore is a compressed and much more dense version of the original ore.',3319,1,4000,417,0,1,NULL,1000000,1,518,0),(28433,465,'Compressed Blue Ice','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. Due to its unique chemical composition and the circumstances under which it forms, blue ice contains more oxygen isotopes than any other ice asteroid.\n\nThis ore has been compressed into a much more dense version.',3327,1,1000,100,0,1,NULL,76000,1,493,0),(28434,465,'Compressed Clear Icicle','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. These crystalline formations can be found scattered around many an ice field, and are known as the universe\'s primary source of helium isotopes.\n\nThis ore has been compressed into a much more dense version.',3324,1,1000,100,0,1,NULL,376000,1,493,0),(28435,465,'Compressed Dark Glitter','Dark glitter is one of the rarest of the interstellar ices, formed only in areas with large amounts of residual electrical current. Little is known about the exact way in which it comes into being, the staggering amount of liquid ozone to be found inside one of these rocks makes it an intriguing mystery for stellar physicists and chemists alike. In addition, it contains large amounts of heavy water and a decent measure of strontium clathrates.\n\nThis ore has been compressed into a much more dense version.',3325,1,1000,100,0,1,NULL,1550000,1,493,0),(28436,465,'Compressed Enriched Clear Icicle','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. These crystalline formations can be found scattered around many an ice field and are known as the universe\'s primary source of helium isotopes. Due to environmental factors, this fragment\'s isotope deposits have become even richer than its regular counterparts\'.\n\nThis ore has been compressed into a much more dense version.',3324,1,1000,100,0,1,NULL,466000,1,493,0),(28437,465,'Compressed Gelidus','Fairly rare and very valuable, Gelidus-type ice formations are a large-scale source of strontium clathrates, one of the rarest ice solids found in the universe, in addition to which they contain unusually large concentrations of heavy water and liquid ozone.\n\nThis ore has been compressed into a much more dense version.',3328,1,1000,100,0,1,NULL,825000,1,493,0),(28438,465,'Compressed Glacial Mass','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. Glacial masses are known to contain hydrogen isotopes in abundance, in addition to smatterings of heavy water and liquid ozone.\n\nThis ore has been compressed into a much more dense version.',3326,1,1000,100,0,1,NULL,76000,1,493,0),(28439,465,'Compressed Glare Crust','In areas with high concentrations of electromagnetic activity, ice formations such as this one, containing large amounts of heavy water and liquid ozone, are spontaneously formed during times of great electric flux. Glare crust also contains a small amount of strontium clathrates.\n\nThis ore has been compressed into a much more dense version.',3323,1,1000,100,0,1,NULL,1525000,1,493,0),(28440,465,'Compressed Krystallos','The universe\'s richest known source of strontium clathrates, Krystallos ice formations are formed only in areas where a very particular combination of environmental factors are at play. Krystallos compounds also include quite a bit of liquid ozone.\n\nThis ore has been compressed into a much more dense version.',3330,1,1000,100,0,1,NULL,450000,1,493,0),(28441,465,'Compressed Pristine White Glaze','When star fusion processes occur near high concentrations of silicate dust, such as those found in interstellar ice fields, the substance known as White Glaze is formed. While White Glaze generally is extremely high in nitrogen-14 and other stable nitrogen isotopes, a few rare fragments, such as this one, have stayed free of radioactive contaminants and are thus richer in isotopes than their more impure counterparts.\n\nThis ore has been compressed into a much more dense version.\n',3329,1,1000,100,0,1,NULL,116000,1,493,0),(28442,465,'Compressed Smooth Glacial Mass','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. Glacial masses are known to contain hydrogen isotopes in abundance, but the high surface diffusion on this particular mass means it has considerably more than its coarser counterparts.\n\nThis ore has been compressed into a much more dense version.',3326,1,1000,100,0,1,NULL,116000,1,493,0),(28443,465,'Compressed Thick Blue Ice','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. Due to its unique chemical composition and the circumstances under which it forms, blue ice will, under normal circumstances, contain more oxygen isotopes than any other ice asteroid. This particular formation is an old one and therefore contains even more than its less mature siblings.\n\nThis ore has been compressed into a much more dense version.\n',3327,1,1000,100,0,1,NULL,116000,1,493,0),(28444,465,'Compressed White Glaze','When star fusion processes occur near high concentrations of silicate dust, such as those found in interstellar ice fields, the substance known as White Glaze is formed. White Glaze is extremely high in nitrogen-14 and other stable nitrogen isotopes, and is thus a necessity for the sustained operation of certain kinds of control tower.\n\nThis ore has been compressed into a much more dense version.',3329,1,1000,100,0,1,NULL,76000,1,493,0),(28448,888,'Compressed Prime Arkonor Blueprint','Note: This blueprint can only be used with t