oid Station - 1 - Strong HP','Dark and ominous metal structures jut outwards from this crumbled asteroid. Scanners indicate a distant powersource far within the adamant rock.',2898,2617,1000000,100000000,10000,1,NULL,0,0,NULL,0),(28609,257,'Heavy Interdictors','Skill for operation of the Heavy Interdictor class cruisers. Can not be trained on Trial Accounts.',33,0,0,0.01,0,1,NULL,32000000,1,377,0),(28610,483,'Test Modulated Veldspar Sucker of Doom','The modulated deep core miner is a technological marvel that combines the capacities of the commonly used Miner II with that of the deep core mining laser. Using a modular mining crystal system, it can be altered on the fly for maximum efficiency.\n\nNote: 99.5% less CPU usage when fitted on a Mining Barge.',2527,25,0,5,50,1,NULL,617520,0,NULL,0.07),(28611,490,'Test Modulated Veldspar Sucker of Doom Blueprint','',1061,0,0,0.01,0,1,NULL,0,0,NULL,0),(28612,892,'Test Veldspar Blast Mining Crystal I','A custom-cut frequency crystal whose refractive qualities are specifically suited to boosting Mercoxit yield. Due to their molecular make-up and the strength of the modulated miner\'s beam, these crystals will deteriorate through extended use. Can be loaded into modulated mining lasers only.',2654,1,1,30,0,1,NULL,204800,0,NULL,0.07),(28613,727,'Veldspar Blast Mining Crystal I Blueprint','',1142,0,0,0.01,0,1,NULL,1000000,0,NULL,0),(28614,284,'Toxic Gunk','Gunk with toxic properties',1199,0,1000000,5,0,1,NULL,850,0,NULL,0),(28615,257,'Electronic Attack Ships','Skill for the operation of Electronic Attack Frigates\n\nCan not be trained on Trial Accounts.',33,0,0,0.01,0,1,NULL,4000000,1,377,0),(28616,319,'Gallentean Laboratory w/scientists','Equally equipped for scientific observation and entertainment of all sorts, these multi-purpose structures, while not quite big enough to be classified as stations, nonetheless see quite a bit of use by both tourists and professionals.',1712,918,100000,100000000,10000,1,8,0,0,NULL,0),(28617,462,'Banidine','A variant of the common ore Veldspar, Banidine is found in far lesser abundance - which causes no problems for miners since the latter ore is virtually worthless, being riddled with impurities.\n',232,1,4000,0.1,0,1,NULL,0,1,NULL,0),(28618,459,'Augumene','Despite its resemblance to common Pyroxeres, Augumene ore in its raw form is both rare and highly toxic to humans. Thus, while it is also a source of many of the minerals found in Pyroxeres ore, Augumene is generally considered virtually worthless due to the dangers posed by its handling. ',231,1,1e+35,0.3,0,1,NULL,0,1,NULL,0),(28619,469,'Mercium','The rare mineral Mercium is thought to be closely related to Omber, varying slightly in chemical composition, in fact, these ores were classified as separate types only recently. However, current refining technologies have been found to do irreparable damage to Mercium ore, rendering it unusable for all practical purposes. ',1271,1,1e+35,0.6,0,1,NULL,0,1,NULL,0),(28620,457,'Lyavite','Lyavite is a relatively rare ore quite similar in some respects to Kernite. However, due to the circumstances under which this ore is formed, it is highly unstable when refined, this quality renders it worthless to all but the most desperate of miners. ',1270,1,1e+35,1.2,0,1,NULL,0,1,NULL,0),(28621,456,'Pithix','Pithix (sometimes spelled Pythix), sister ore to Jaspet, also contains a myriad of mineral types, but is found only in asteroids of a certain age, this oddity, combined with the fact that current Pithix refining methods are quite inefficient, makes the ore little more than a minor curiosity to the scientific community as a whole. ',1279,1,1e+35,2,0,1,NULL,0,1,NULL,0),(28622,467,'Green Arisite','Green Arisite is a close cousin to Gneiss, although it is much less commonly found in known space. It is not at all valuable to miners or refiners, however, since its byproducts tend to foul up refining equipment, thus requiring exorbitant maintenance costs. ',1377,1,1e+35,5,0,1,NULL,0,1,NULL,0),(28623,453,'Oeryl','Very similar in composition to Dark Ochre, Oeryl has come into the spotlight only since advanced refining techniques have made Dark Ochre highly sought after for its high Nocxium content. While refining processes for Oeryl remain utterly ineffective, making this mineral worthless to most manufacturers, scientists believe it may become equally as valuable as its Ochre counterpart given a few years of research. ',1275,1,1e+35,8,0,1,NULL,0,1,NULL,0),(28624,452,'Geodite','Geodite ore used to be common, but was mined heavily in the early years of interstellar industry, before the discovery of Crokite. The quality of Zydrine taken from Geodite is very poor by today\'s refining standards, making the ore nearly worthless.',1272,1,1e+35,16,0,1,NULL,0,1,NULL,0),(28625,450,'Polygypsum','The rarest and most valuable ore in the known universe, Arkonor, has a less well known cousin called Polygypsum. While the two are very similar in chemical composition, the latter is quite unstable, having a tendency to ignite when handled roughly. While posing little danger to a spacecraft, which is built to withstand tremendous heat, this property makes the ore too dangerous under any other circumstances - such as in the business of refining. ',1277,1,1e+35,16,0,1,NULL,0,1,NULL,0),(28626,468,'Zuthrine','Zuthrine is one of the most dense ores in known space, a close relative of Mercoxit, it also contains enormous amounts of Morphite. It is found only in the very core of asteriods it requires specialized deep core mining techniques to extract.',2102,1,1e+35,40,0,1,NULL,0,1,NULL,0),(28627,465,'Azure Ice','Interstellar ices are formed by the accretion of gas molecules onto silicate dust particles. Azure ice forms under the same circumstances as \"blue ice,\" but due to its slightly different chemical composition, it contains substantially fewer oxygen isotopes by volume than its blue cousin, rendering it a \"lesser\" material.',2554,1,1000,1000,0,1,NULL,0,1,NULL,0),(28628,465,'Crystalline Icicle','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. These crystalline formations can be found scattered around many stellar ice fields, but \"crystalline icicles\" have a very low isotope count compared to other minable ices, making it relatively worthless. It\'s simply \"space ice.\" ',2556,1,1000,1000,0,1,NULL,0,1,NULL,0),(28629,711,'Gamboge Cytoserocin','Light-bluish crystal, formed by intense pressure deep within large asteroids and moons. Used in electronic and weapon manufacturing. Only found in abundance in a few areas. ',3225,100,0,10,0,1,NULL,0,1,NULL,0),(28630,711,'Chartreuse Cytoserocin','Light-bluish crystal, formed by intense pressure deep within large asteroids and moons. Used in electronic and weapon manufacturing. Only found in abundance in a few areas. ',3219,100,0,10,0,1,NULL,0,1,NULL,0),(28631,272,'Amarr Navy Security Clearance','Fake skill that specifies the owners security clearance for Amarr Navy facilities (e.g. acceleration gates).',33,0,0,0.01,0,1,NULL,0,0,NULL,0),(28632,896,'Amarr Navy Restricted Security Transponder','This ship modification grants security clearance for restricted Amarr Navy facilities.\n',3199,100,200,5,0,1,NULL,0,0,NULL,0.07),(28633,787,'Amarr Navy Restricted Security Transponder Blueprint','',1038,0,0,0.01,0,1,NULL,125000,0,NULL,0),(28634,896,'Amarr Navy Secret Security Transponder','This ship modification grants security clearance for secret Amarr Navy facilities.\n',3199,100,200,5,0,1,NULL,0,0,NULL,0.07),(28635,787,'Amarr Navy Secret Security Transponder Blueprint','',1038,0,0,0.01,0,1,NULL,125000,0,NULL,0),(28636,896,'Amarr Navy Black Ops Security Transponder','This ship modification has no distinctive markings.\n',3199,100,200,5,0,1,NULL,0,0,NULL,0.07),(28637,787,'Amarr Navy Black Ops Security Transponder Blueprint','',1038,0,0,0.01,0,1,NULL,125000,0,NULL,0),(28638,896,'Amarr Navy Top Secret Security Transponder','This ship modification grants security clearance for top secret Amarr Navy facilities.\n',3199,100,200,5,0,1,NULL,0,0,NULL,0.07),(28639,787,'Amarr Navy Top Secret Security Transponder Blueprint','',1038,0,0,0.01,0,1,NULL,125000,0,NULL,0),(28644,896,'Amarr Navy Confidential Security Transponder','This ship modification grants security clearance for confidential Amarr Navy facilities.\n',3199,100,200,5,0,1,NULL,0,0,NULL,0.07),(28645,787,'Amarr Navy Confidential Security Transponder Blueprint','',1038,0,0,0.01,0,1,NULL,125000,0,NULL,0),(28646,658,'Covert Cynosural Field Generator I','Generates an undetectable cynosural field which only Black Ops jump drives can lock on to.\n\nNote: can only be fitted on Black Ops, Covert Ops, Stealth Bombers and force Recon Ships.',1444,0,0,25,0,1,NULL,7259244,1,779,0),(28647,532,'Covert Cynosural Field Generator I Blueprint','',194,0,0,0.01,0,1,NULL,31372640,1,799,0),(28650,897,'Covert Cynosural Field I','A precise frequency energy field, used as a target beacon for jumpdrives.',2742,1,1,5,0,1,NULL,23442,0,NULL,0.07),(28651,532,'Covert Cynosural Field I Blueprint','',1007,0,0,0.01,0,1,NULL,0,0,NULL,0),(28652,590,'Covert Jump Portal Generator I','A piece of machinery designed to allow a black ops vessel to create a bridge between systems without the use of a stargate, allowing its companions access through vast tracts of space to join it on the battlefield.\n\nNote: can only be fitted on Black Ops.',2985,1,1,125,0,1,NULL,37849280,1,779,0.07),(28653,516,'Covert Jump Portal Generator I Blueprint','',194,0,0,0,0,1,NULL,481455760,1,799,0),(28654,899,'Warp Disruption Field Generator I','The field generator projects a warp disruption sphere centered upon the ship for its entire duration. The field prevents any warping or jump drive activation within its area of effect.\n\nThe generator has several effects upon the parent ship whilst active.  It increases its signature radius and agility whilst penalizing the velocity bonus of any afterburner or microwarpdrive modules. It also prevents any friendly remote effects from being rendered to the parent ship.  \n\nThis module\'s effect can be modified with scripts.\n\nNote: can only be fitted on the Heavy Interdictors.',111,0,0,50,1,1,NULL,3588216,1,1085,0.07),(28655,132,'Warp Disruption Field Generator I Blueprint','',111,0,0,0.01,0,1,NULL,50000000,1,323,0),(28656,257,'Black Ops','Skill for the operation of Black Ops. Can not be trained on Trial Accounts.',33,0,0,0.01,0,1,NULL,64000000,1,377,0),(28658,365,'Test Control Tower','The Amarr have always been fond of majestic and intimidating constructions. Their Control Towers do not deviate from that tradition and are truly big and powerful structures, intended more for preservation of territorial interests than commercial benefits.\n\nRacial Bonuses:\n50% bonus to Energy Sentry Optimal Range\n25% bonus to Energy Sentry Damage\n50% bonus to Silo Cargo Capacity',2593,3394,1000000,8000,110000,1,4,400000000,0,NULL,0),(28659,900,'Paladin','Hull: Apocalypse Class\nRole: Marauder\n\nGeared toward versatility and prolonged deployment in hostile environments, Marauders represent the cutting edge in todays warship technology. While especially effective at support suppression and wreckage salvaging, they possess comparatively weak sensor strength and may find themselves at increased risk of sensor jamming. Nevertheless, these thick-skinned, hard-hitting monsters are the perfect ships to take on long trips behind enemy lines.\n\nDeveloper: Carthum Conglomerate \n\nCarthum ships are the very embodiment of the Amarrian warfare philosophy. Possessing sturdy armor and advanced weapon systems, they provide a nice mix of offense and defense.\n\nAmarr Battleship Skill Bonus: 5% bonus to capacitor capacity and 10% bonus to the velocity factor of stasis webifiers per level\n\nMarauder Skill Bonus: 7.5% bonus to repair amount of armor repair systems and 5% bonus to large energy turret damage per level\n\nRole Bonus: 100% bonus to large energy weapon damage, 100% bonus to range and velocity of tractor beams\n',3351,250,105200000,517500,1125,1,4,156911362,1,1081,0.07),(28660,107,'Paladin Blueprint','',297,0,0,0.01,0,1,NULL,1800000000,1,NULL,0),(28661,900,'Kronos','Hull: Megathron Class\nRole: Marauder\n\nGeared toward versatility and prolonged deployment in hostile environments, Marauders represent the cutting edge in todays warship technology. While especially effective at support suppression and wreckage salvaging, they possess comparatively weak sensor strength and may find themselves at increased risk of sensor jamming. Nevertheless, these thick-skinned, hard-hitting monsters are the perfect ships to take on long trips behind enemy lines.\n\nDeveloper: Duvolle Labs\n\nDuvolle Labs manufactures sturdy ships with a good mix of offensive and defensive capabilities. Since the company is one of New Edens foremost manufacturers of particle blasters, its ships tend to favor turrets and thus have somewhat higher power output than normal.\n\nGallente Battleship Skill Bonus: 5% bonus to large hybrid weapon damage and 10% bonus to the velocity factor of stasis webifiers per level\n\nMarauder Skill Bonus: 7.5% bonus to repair amount of armor repair systems and 7.5% bonus to large hybrid weapon tracking per level\n\nRole Bonus: 100% bonus to large hybrid weapon damage, 100% bonus to range and velocity of tractor beams\n',3353,250,101800000,513000,1275,1,8,156497220,1,1083,0.07),(28662,107,'Kronos Blueprint','',64,0,0,0.01,0,1,NULL,1760000000,1,NULL,0),(28665,900,'Vargur','Hull: Tempest Class\nRole: Marauder\n\nGeared toward versatility and prolonged deployment in hostile environments, Marauders represent the cutting edge in todays warship technology. While especially effective at support suppression and wreckage salvaging, they possess comparatively weak sensor strength and may find themselves at increased risk of sensor jamming. Nevertheless, these thick-skinned, hard-hitting monsters are the perfect ships to take on long trips behind enemy lines.\n\nDeveloper: Boundless Creation\n\nBoundless Creations ships are based on the Brutor Tribes philosophy of warfare: simply fit as much firepower onto your ship as possible. Defense systems and electronics arrays therefore take a back seat to sheer annihilative potential.\n\nMinmatar Battleship Skill Bonus: 5% bonus to large projectile turret rate of fire and 10% bonus to large projectile turret falloff per level\n\nMarauder Skill Bonus: 7.5% bonus to shield boost amount and 7.5% bonus to large projectile turret tracking per level\n\nRole Bonus: 100% bonus to large projectile weapon damage, 100% bonus to range and velocity of tractor beams\n',3354,250,106100000,450000,1150,1,2,156428356,1,1084,0.07),(28666,107,'Vargur Blueprint','',48,0,0,0.01,0,1,NULL,1450000000,1,NULL,0),(28667,257,'Marauders','Skill for the operation of Marauder. Can not be trained on Trial Accounts.',33,0,0,0.01,0,1,NULL,64000000,1,377,0),(28668,916,'Nanite Repair Paste','A thick, heavy liquid, typically stored in tanks or container systems intended for liquids. It is composed of billions of nanites that can be programmed to repair damaged ship modules on the fly. The paste is simply applied to the damaged area, and the nanites meld into an exact copy of the damaged area, thus effecting repairs upon the module. This is a one-time process, as the nanites use themselves up along with the trace elements mixed into their carrier fluid.\n\nThe Repair Paste is generally only used for emergency on-site repairs. It is then recommended to have the damaged components looked at by a certified technician at first opportunity.',3302,0,2500,0.01,0,1,NULL,6500,1,1103,0),(28670,303,'Synth Blue Pill Booster','This booster relaxes a pilot\'s ability to control certain shield functions, among other things. It creates a temporary feeling of euphoria that counteracts the unpleasantness inherent in activating shield boosters, and permits the pilot to force the boosters to better performance without suffering undue pain.',3215,1,1,1,1,1,NULL,8192,1,977,0),(28671,718,'Synth Blue Pill Booster Blueprint','',194,0,0,0,0,1,NULL,0,1,NULL,0),(28672,303,'Synth Crash Booster','This booster quickens a pilot\'s reactions, pushing him into the delicate twitch territory inhabited by the best missile marksmen. Any missile he launches at his hapless victims will hit its mark with that much more precision, although the pilot may be too busy grinding his teeth to notice.',3210,1,1,1,1,1,NULL,8192,1,977,0),(28673,718,'Synth Crash Booster Blueprint','',194,0,0,0,0,1,NULL,0,1,NULL,0),(28674,303,'Synth Drop Booster','This booster throws a pilot into temporary dementia, making every target feel like a monstrous threat that must be destroyed at all cost. The pilot manages to force his turrets into better tracking, though it may take a while before he stops wanting to kill everything in sight.',3212,1,1,1,1,1,NULL,8192,1,977,0),(28675,718,'Synth Drop Booster Blueprint','',194,0,0,0,0,1,NULL,0,1,NULL,0),(28676,303,'Synth Exile Booster','This booster hardens a pilot\'s resistance to attacks, letting him withstand their impact to a greater extent. The discomfort of having his armor reduced piecemeal remains unaltered, but the pilot is filled with such a surge of rage that he bullies through it like a living tank.',3211,1,1,1,1,1,NULL,8192,1,977,0),(28677,718,'Synth Exile Booster Blueprint','',194,0,0,0,0,1,NULL,0,1,NULL,0),(28678,303,'Synth Frentix Booster','This strong concoction of painkillers helps the pilot block out all inessential thought processes (along with the occasional needed one) and to focus his attention completely on the task at hand. When that task is to hit a target, it certainly makes for better aim, though it does tend to make one\'s extremities go numb for short periods.',3213,1,1,1,1,1,NULL,8192,1,977,0),(28679,718,'Synth Frentix Booster Blueprint','',194,0,0,0,0,1,NULL,0,1,NULL,0),(28680,303,'Synth Mindflood Booster','This booster relaxant allows the pilot to control his ship more instinctively and expend less energy in doing so. This in turn lets the ship utilize more of its resources for mechanical functions, most notably its capacitor, rather than constantly having to compensate for the usual exaggerated motions of a stressed pilot.',3214,1,1,1,1,1,NULL,8192,1,977,0),(28681,718,'Synth Mindflood Booster Blueprint','',194,0,0,0,0,1,NULL,0,1,NULL,0),(28682,303,'Synth X-Instinct Booster','This energizing booster grants its user a vastly improved economy of effort when parsing the data streams needed to sustain space flight. The main benefit of this lie not in improved performance but less waste of transmission and extraneous micromaneuvers, making the pilot\'s ship sleeker in performance and harder to detect. The booster\'s only major drawback is the crazed notion that the pilot\'s inventory would be look so much better if merely rearranged ONE MORE TIME.',3217,1,1,1,1,1,NULL,8192,1,977,0),(28683,718,'Synth X-Instinct Booster Blueprint','',194,0,0,0,0,1,NULL,0,1,NULL,0),(28684,303,'Synth Sooth Sayer Booster','This booster induces a trancelike state whereupon the pilot is able to sense the movement of faraway items without all the usual static flooding the senses. Being in a trance helps the pilot hit those moving items with better accuracy, although he has to be careful not to start dreaming awake.',3216,1,1,1,1,1,NULL,8192,1,977,0),(28685,718,'Synth Sooth Sayer Booster Blueprint','',194,0,0,0,0,1,NULL,0,1,NULL,0),(28686,712,'Pure Synth Blue Pill Booster','Synth Blue Pill compound in its uncut form, ready to be processed into the final version of the combat booster.',2664,0,0,1,0,1,NULL,0,1,NULL,0),(28687,712,'Pure Synth Crash Booster','Synth Crash compound in its uncut form, ready to be processed into the final version of the combat booster.',2664,0,0,1,0,1,NULL,0,1,NULL,0),(28688,712,'Pure Synth Drop Booster','Synth Drop compound in its uncut form, ready to be processed into the final version of the combat booster.',2664,0,0,1