iegeman of House Tash-Murkon.\n',1656,0,1,0.1,0,1,NULL,0,1,NULL,0),(28830,314,'Brutor Tribe Roster','These data logs, precious to any Minmatar but especially to a member of the Brutor Tribe, hold information on the history and lineage of that tribe\'s members from over a century ago. ',2038,0,1,0.2,0,1,NULL,0,1,NULL,0),(28832,283,'Stranded Pilot','This simple starship pilot, lacking the pod and other resources of a capsuleer, has been forced to eject from his ship in a mundane escape pod. ',2544,0,80,1,0,1,NULL,0,1,NULL,0),(28833,314,'Ishukone Corporate Records','These encoded reports hold extremely sensitive information regarding Ishukone Corporation holdings and infrastructure.',1192,0,1,0.1,0,1,NULL,0,1,NULL,0),(28834,314,'Federation Court Logs','These reports hold data of utmost importance to Federation Judicial Services. ',2038,0,10,1,0,1,NULL,0,1,NULL,0),(28835,283,'Professor Kajurei Delainen','This odd little man is possibly the most well-respected particle physicist of the current age, and is also considered a foremost expert in Artificial Intelligence. He is perhaps most famous for his establishment of the \"Seven Pillars of Artificial Intelligence\" theory, published almost 14 years ago.',2891,0,65,1,0,1,NULL,0,1,NULL,0),(28836,314,'Letters of Bishop Dalamaid','The letters of Bishop Dalamaid have been the subject of volumes of intellectual discourse. The primary contention of the letters, that true saintly martyrdom is an impossibility for anyone even aware of the concept of sainthood, has gone through various levels of favor over the generations. <br><br>\n\nLetters XIII through XV include a few juicy morsels about a prostitution ring that was run illegally from a monastery of one of the more prestigious orders in Dalamaid\'s time.',1192,0,25,0.5,0,1,NULL,0,1,NULL,0),(28837,526,'Achuran White Song Birds','A single male White Song bird. The female seems to have died, perhaps due to the stress of recent events. <br><br>\nThe White Song was once the symbol of the Achura\'s Imperial line. Only government buildings were allowed to keep White Songs in captivity. It was said that when the last White Song left the Royal Tower, the Achura Empire would die. The Achura Empire died first, but the White Song is still regarded with great reverence. ',1641,0,0.02,0.01,0,1,NULL,0,1,NULL,0),(28838,526,'Armor of Rouvenor','Rouvenor is supposedly a mythical hero-king of Garoun, the temporal paradise that has been the subject of poetry, story, and song for centuries. If legends are to be believed, this armor was worn by Rouvenor when he faced the seven armies of Morthane. <br><br>\nStrangely, a few of the gold accents are turning slightly green.',1030,0,35,1,0,1,NULL,0,1,NULL,0),(28839,319,'Blood Raider Cathedral (weak)','This impressive structure operates as a place for religious practice and the throne of a high ranking member within the clergy.',2401,2787,100000,100000000,10000,1,NULL,0,0,NULL,0),(28840,333,'Magic Crystal Ball','Allows you to see into <i>the future</i> by looking for new TypeIDs on Singularity.\n\nWarning: Side-effects may include speculation, jumping to conclusions, overanalysis, misunderstandings, unwarranted assumptions, ten-page forum threads, baseless concerns, undue panic, virtual stampedes, threadnaughts, premature account cancellation and unneeded developer stress. USE WITH CAUTION.',3232,0,1,1,0,1,NULL,0,0,NULL,0),(28841,306,'Cargo Container - Data Chip','This cargo container is flimsily constructed and will not survive the rigors of space for long.',16,14,10000,27500,2700,1,NULL,0,0,NULL,0),(28842,283,'Amarr Sympathizer','This Minmatar politician pleads his innocence whenever you look his way. He claims that he has been framed, that everything has been a complex scheme to discredit his family. His tattoos mark him as not as a Nefantar, but as one of the member tribes of the Republic. His body is heavily bruised, but whether the injuries are from the Amarr agents or the Minmatar guards is hard to tell. Perhaps only the Republic courts can decide his innocence. ',2536,0,85,1,0,1,NULL,0,1,NULL,0),(28843,314,'Altered Datacore - Mechanical Engineering','This datacore has been altered and thus rendered useless for manufacturing purposes. It has value only as a reference tool. ',3231,0,0.75,0.1,0,1,NULL,0,1,NULL,0),(28844,902,'Rhea','Name: Rhea\nHull: Charon\nRole: Jump Freighter\n\nIt wasnt long after the Thukkers began deploying their jump capable freighters that other corporations saw the inherent tactical value of such ships.  After extended negotiations, Ishukone finally closed a deal exchanging undisclosed technical data for the core innovations underpinning the original Thukker Tribes design allowing them to rapidly bring to the market the largest jump capable freighter of them all, the Rhea, a true behemoth of the stars.\n\nDeveloper : Ishukone\n\nIshukone, always striving to be ahead of the competition, have proved themselves to be one of the most adept starship designers in the State.  A surprising majority of the Caldari Fleets ships of the line were created by their designers.  Respected and feared by their peers Ishukone remain amongst the very top of the Caldari corporate machine.\n\nCaldari Freighter Skill Bonus: 5% bonus to cargo hold capacity and 5% bonus to agility per level\nJump Freighters Skill Bonus: 10% bonus to shield, armor and hull hitpoints and 10% reduction in jump fuel need per level',3358,800,960000000,16250000,294375,1,1,1552813680,1,1091,0.07),(28845,525,'Rhea Blueprint','',309,0,0,0.01,0,1,NULL,2000000000,1,NULL,0),(28846,902,'Nomad','Name: Nomad\nHull: Fenrir\nRole: Jump Freighter\n\nThere is continuing speculation as to how exactly the Thukkers manage to move their vast caravans throughout space relatively undetected, but their expertise with jump drive technology became glaringly apparent when they created the Nomad.  Now seeing widespread service with roving Thukker outrider detachments, the Nomad is rapidly becoming an essential part of Thukker life away from the great caravans.\n\nDeveloper : Thukker Mix\n\nThukkers spend their entire lives forever wandering the infinite in their vast caravans.  As such their technology is based as much upon necessity as their ingenious ability to tinker.  Their ship designs therefore tend to based upon the standard empire templates but extensively modified for the Thukkers unique needs.  \n\nMinmatar Freighter Skill Bonus: 5% bonus to cargo hold capacity and 5% bonus to agility per level\nJump Freighters Skill Bonus: 10% bonus to shield, armor and hull hitpoints and 10% reduction in jump fuel need per level',3360,700,820000000,15500000,270000,1,2,1552813680,1,1093,0.07),(28847,525,'Nomad Blueprint','',309,0,0,0.01,0,1,NULL,1850000000,1,NULL,0),(28848,902,'Anshar','Name: Anshar\nHull: Obelisk\nRole: Jump Freighter\n\nCreodron surprised many by their quick conception of the Anshar, a stark diversification from their usual drone centric ship designs.  The Anshar\'s specially-developed cargo-manipulation drones allowed Creodron to optimize their loading algorithms and fully utilize every nook and cranny of the ship\'s spacious interior, ensuring it more than holds its own amongst its peers.  \n\nDeveloper : CreoDron\n\nAs the largest drone developer and manufacturer in space, CreoDron has a vested interest in drone carriers but has recently began to expand their design focus and employ drone techniques on whole other levels which has lead some to question where this leap in technology came from.\n\nGallente Freighter Skill Bonus: 5% bonus to cargo hold capacity and 5% bonus to agility per level\nJump Freighters Skill Bonus: 10% bonus to shield, armor and hull hitpoints and 10% reduction in jump fuel need per level',3359,600,940000000,17550000,281250,1,8,1552813680,1,1092,0.07),(28849,525,'Anshar Blueprint','',309,0,0,0.01,0,1,NULL,1950000000,1,NULL,0),(28850,902,'Ark','Name: Ark\nHull: Providence\nRole: Jump Freighter\n\nAt the end of days when they descend\nWatch for the coming of the Ark\nFor within it\nSalvation is carried.\n\n<i>-The Scriptures, Apocalypse Verses 32:6</i>\n\nDeveloper : Carthum Conglomerate\n\nCarthum ships are the very embodiment of the Amarrian warfare philosophy. Possessing sturdy armor and advanced weapon systems they provide a nice mix of offence and defence. On the other hand, their electronics and shield systems tend to be rather limited.\n\nAmarr Freighter Skill Bonus: 5% bonus to cargo hold capacity and 5% bonus to agility per level\nJump Freighters Skill Bonus: 10% bonus to shield, armor and hull hitpoints and 10% reduction in jump fuel need per level',3357,900,900000000,18500000,275625,1,4,1552813680,1,1090,0.07),(28851,525,'Ark Blueprint','',309,0,0,0.01,0,1,NULL,1900000000,1,NULL,0),(28852,306,'Ancient Starbase Ruins','Ruins.',1414,6941,10000,27500,2700,1,NULL,0,0,NULL,0),(28854,319,'Communications Tower','Communications Tower.',2505,2636,100000,100000000,10000,1,NULL,0,0,NULL,0),(28859,306,'Cargo Container - Ancient Amarrian Relic','This cargo container is flimsily constructed and will not survive the rigors of space for long.',16,14,10000,27500,2700,1,NULL,0,0,NULL,0),(28860,306,'Cargo Container - Ishukone Corporate Records','This cargo container is flimsily constructed and will not survive the rigors of space for long.',16,14,10000,27500,2700,1,NULL,0,0,NULL,0),(28861,306,'Cargo Container - Federation Court Logs','This cargo container is flimsily constructed and will not survive the rigors of space for long.',16,14,10000,27500,2700,1,NULL,0,0,NULL,0),(28862,306,'Cargo Container - Brutor Tribe Roster','This cargo container is flimsily constructed and will not survive the rigors of space for long.',16,14,10000,27500,2700,1,NULL,0,0,NULL,0),(28863,821,'Angel Overseer - Level 6','Scuttling from Heaven the Domination Commanders pursue a secret agenda as dark and sinister as their reputation. Threat level: Deadly.',335,350,19000000,19000000,120,1,2,0,0,NULL,0.07),(28864,821,'Serpentis Overseer - 