sue','The Scythe Fleet Issue is a throwback to earlier days of Minmatar ship design, when the scarcity of resources meant that a single ship needed to be able to do almost everything. While often dubbed a \"mini-Typhoon\" for this reason, this versatile gunboat nonetheless has nowhere near the defensive capabilities of its larger ancestor. What it does bring to the table, however, is unparalleled agility and unpredictability. A squadron of these ships can be an immense thorn in the side of even the most able and well-equipped fleet commander.\n\nSpecial Ability: 5% bonus to Medium Projectile Turret rate of fire and 5% bonus to Assault, Heavy Assault and Heavy Missile Launcher rate of fire per level.\n',1887,134,10910000,89000,440,1,2,5177344,1,NULL,0.07),(29337,26,'Augoror Navy Issue','The Navy-issued version of the Augoror cruiser is an extremely resilient piece of hardware able to provide very good support in fleet battles, but it is also a relatively nimble cruiser ideally suited for escort duties as well as smaller skirmishes. Created to fill a void within the ranks of the traditionally slow and lumbering Amarrian fleet, this vessel has fit in perfectly.\n\nSpecial ability: 10% bonus to Medium Energy Turret Capacitor Usage and 10% bonus to Armor Hitpoints per level.',1730,91.59,10650000,101000,250,1,4,5228052,1,NULL,0.07),(29338,106,'Augoror Navy Issue Blueprint','',49,0,0,0.01,0,1,NULL,0,1,NULL,0),(29339,106,'Scythe Fleet Issue Blueprint','',304,0,0,0.01,0,1,NULL,28775000,1,NULL,0),(29340,26,'Osprey Navy Issue','Caldari ships have never been renowned for their speed. With this in mind, Caldari Navy engineers set about designing the Osprey Navy Issue. The fastest Caldari cruiser in existence and a formidable missile boat, this vessel gives Navy personnel and State loyalists alike greater opportunities to conduct true skirmish warfare than ever before.\n\nSpecial Ability: 5% bonus to Assault, Heavy Assault and Heavy Missile Launcher rate of fire and 10% bonus to 