 damage.',3376,230,0,0,0,1,4,0,0,NULL,0),(29351,226,'Armageddon Stern','Despite the obvious absence of a front end, this section of wreck appears largely intact at first glance. A more detailed scan though reveals deep fractures throughout the structure, betraying the titanic stresses it has been subjected to.',3377,265,0,0,0,1,4,0,0,NULL,0),(29352,226,'Raven Hull','While the wings and bow have been sheared off this Raven-class battleship, the central hull structure has lived up to Caldari engineering standards and remained intact. Any remaining crew will likely have evacuated or perished by now.',3378,318,0,0,0,1,1,0,0,NULL,0),(29353,226,'Raven Wing','This piece of wreckage is the starboard wing of a Raven-class battleship, sheared off at the root. Where the rest of the ship ended up is anyone\'s guess.',3379,189,0,0,0,1,1,0,0,NULL,0),(29354,226,'Scorpion Lower Hull','This piece of wreckage is part of the lower hull of a Scorpion-class battleship. This area is mainly given over to ship systems, so loss of life resulting from the multiple hull breaches should have been comparatively minimal',3380,167,0,0,0,1,1,0,0,NULL,0),(29355,226,'Scorpion Masthead','The masthead section of Scorpion-class battleships contains a large amount of sensitive equipment that would be of great interest to rival empires. In this case, though, it\'s clear that the damage inflicted means whatever\'s inside would only be of interest to scrap dealers',3381,99,0,0,0,1,1,0,0,NULL,0),(29356,226,'Scorpion Upper Hull','Containing a large number of crew battle stations, the damage to this section of Scorpion superstructure must have entailed a huge loss of life',3382,151,0,0,0,1,1,0,0,NULL,0),(29357,226,'Megathron Bow','This Megathron bow section functioned as designed, tearing cleanly away from the rest of the hull under sustained fire',3383,253,0,0,0,1,8,0,0,NULL,0),(29358,226,'Megathron Hull','This Megathron hull has weathered significant damage, with most major protrusions ripped away. Distress beacons still function within the wreckage, but it seems unlikely that any pockets of atmosphere remain',3384,325,0,0,0,1,8,0,0,NULL,0),(29359,226,'Tempest Lower Sail','As is common with Minmatar designs, this Tempest battleship has fragmented into multiple sections under heavy fire. This lower section appears largely inert, with only a few arcing connectors showing any signs of activity',3385,392,0,0,0,1,2,0,0,NULL,0),(29360,226,'Tempest Upper Sail','As is common with Minmatar designs, this Tempest battleship has fragmented into multiple sections under heavy fire. A few red lights still blink forlornly within the bridge section, but the corpses drifting inside make clear that there are no other signs of life on board',3386,281,0,0,0,1,2,0,0,NULL,0),(29361,226,'Tempest Midsection','As is common with Minmatar designs, this Tempest battleship has fragmented into multiple sections under heavy fire. This midsection seems to have taken the brunt of the damage in this case',3387,199,0,0,0,1,2,0,0,NULL,0),(29362,226,'Tempest Stern','As is common with Minmatar designs, this Tempest battleship has fragmented into multiple sections under heavy fire. The sparking power relays at the forward end of this drive section suggest there is still some life in the main reactors, but the radiation readings indicate that this was probably not a good thing for any surviving crew.',3388,159,0,0,0,1,2,0,0,NULL,0),(29363,226,'Naglfar Lower Half','The lower half of this mighty Naglfar-class dreadnaught has been comprehensively pulverized. Its opponents must have been extremely powerful in order to inflict this level of damage',3389,1095,0,0,0,1,2,0,0,NULL,0),(29364,226,'Naglfar Upper Half','The upper half of this mighty Naglfar-class dreadnaught has sustained considerable damage to its starboard batteries. A few intermittent signals which might be signs of life deep inside can still be detected, but there\'s no easy way to cut through the mangled wreckage and find out',3390,906,0,0,0,1,2,0,0,NULL,0),(29365,186,'Mission Faction Industrials Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',3120,14,10000,27500,27500,1,NULL,0,1,NULL,0),(29382,226,'Caldari Prime Station (Under Construction)','',3394,48526,0,0,0,1,1,0,0,NULL,0),(29386,226,'CONCORD Battleship Wreck','CONCORD vessels employ advanced hull technology which allows them to maintain external integrity even after the ship has suffered complete systems failure. This is definitely one of those cases - while the hull appears intact, the rest of the ship is very clearly non-functional',1060,250,0,0,0,1,8,0,0,NULL,0),(29387,15,'Amarr Station Hub (Damaged)','',3391,42489,0,0,0,1,4,600000,0,NULL,0),(29388,15,'Amarr Station Military (Damaged)','',3392,48532,0,0,0,1,4,600000,0,NULL,0),(29389,15,'Amarr Trade Post (Damaged)','',3393,13887,0,0,0,1,4,600000,0,NULL,0),(29390,15,'Concord Starbase (Damaged)','',3395,60518,0,0,0,1,8,600000,0,NULL,0),(29391,319,'Caldari Navy Leviathan','',2930,9000,100000,100000000,10000,1,1,0,0,NULL,0),(29414,922,'10km Caldari Capture Point','This object registers the presence of ships within 10km',1708,300,1000000,1,0,1,NULL,0,0,NULL,0),(29415,922,'10km Gallente Capture Point','This object registers the presence of ships within 10km',2373,782,1000000,1,0,1,NULL,0,0,NULL,0),(29416,922,'10km Minmatar Capture Point','This object registers the presence of ships within 10km',1711,471,1000000,1,0,1,NULL,0,0,NULL,0),(29418,922,'20km Caldari Capture Point','This object registers the presence of ships within 20km',1708,300,1000000,1,0,1,NULL,0,0,NULL,0),(29419,922,'20km Gallente Capture Point','This object registers the presence of ships within 20km',2373,782,1000000,1,0,1,NULL,0,0,NULL,0),(29420,922,'20km Minmatar Capture Point','This object registers the presence of ships within 20km',1711,471,1000000,1,0,1,NULL,0,0,NULL,0),(29421,922,'30km Caldari Capture Point','This object registers the presence of ships within 30km',1708,300,1000000,1,0,1,NULL,0,0,NULL,0),(29422,922,'30km Gallente Capture Point','This object registers the presence of ships within 30km',2373,782,1000000,1,0,1,NULL,0,0,NULL,0),(29423,922,'30km Minmatar Capture Point','This object registers the presence of ships within 30km',1711,471,1000000,1,0,1,NULL,0,0,NULL,0),(29437,319,'Starbase Auxiliary Power Array I','These arrays provide considerable added power output, allowing for an increased number of deployable structures in the starbase\'s field of operation.',2374,459,100,100,0,1,NULL,0,1,NULL,0),(29438,306,'Disabled Badger','The engines of this cargo vessel have been disabled so that it cannot move.',52,14,10000,27500,2700,1,NULL,0,1,NULL,0),(29439,283,'Admiral Meledier ','Admiral Meledier apparently wishes to defect to Amarr. Well, so be it: It\'s all a bit suspicious, but it\'s not your decision. ',2536,0,85,1,0,1,NULL,0,1,NULL,0),(29445,306,'Cargo Container - Physical Samples','This cargo container is flimsily constructed and will not survive the rigors of space for long.',16,14,10000,27500,2700,1,NULL,0,1,NULL,0),(29446,319,'Large Container of Explosives','This large container is full of explosives.',2007,1226,100000,100000000,10000,1,NULL,0,1,NULL,0),(29447,283,'Gallente Politician','A planetside politician of the Gallente Federation.',2538,0,90,2,0,1,NULL,0,1,NULL,0),(29452,226,'LCO Gallente Bunker','A Gallente Bunker',2458,831,100000,100000000,0,1,NULL,0,1,NULL,0),(29453,226,'LCO Gallente Lookout','A lookout. Look out.',2461,689,0,0,0,1,NULL,0,1,NULL,0),(29454,226,'LCO Gallente Barricade','A barricade.',2464,603,0,0,0,1,NULL,0,1,NULL,0),(29455,226,'LCO Gallente Barrier','A barrier.',2466,622,0,0,0,1,NULL,0,1,NULL,0),(29456,226,'LCO Gallente Battery','A battery. Juicy.',2462,244,0,0,0,1,NULL,0,1,NULL,0),(29457,226,'LCO Gallente Fence','A fence.',2465,463,0,0,0,1,NULL,0,1,NULL,0),(29458,226,'LCO Gallente Junction','A junction.',2460,194,0,0,0,1,NULL,0,1,NULL,0),(29459,226,'LCO Gallente Wall','A wall.',2463,462,0,0,0,1,NULL,0,1,NULL,0),(29460,226,'Gallente Starbase Control Tower_LCO','Gallente Control Towers are more pleasing to the eye than they are strong or powerful. They have above average electronic countermeasures, average CPU output, and decent power output compared to towers from the other races, but are quite lacking in sophisticated defenses.',2297,3394,100000,100000000,10000,1,4,0,1,NULL,0),(29461,319,'Starbase Hangar Tough','A stand-alone deep-space construction designed to allow pilots to dock and refit their ships on the fly.',2298,726,100000,1150,8850,1,NULL,0,1,NULL,0),(29464,314,'Runaway Daughter','She\'s gone into suspended animation. It\'s probably for the best.',2092,0,400,25,0,1,NULL,100,1,NULL,0),(29466,927,'The Incredible Hulk','The backbone of any serious industrial operation, Hulks are amongst the most efficient mining vessels in circulation and sometimes re-engineered for survivability.',2938,330,40000000,200000,8000,1,8,0,0,NULL,0),(29467,319,'Power Generator 250k','This generator provides power to nearby structures. ',1684,8000,100000,100000000,10000,1,NULL,0,1,NULL,0),(29468,319,'Shipyard Tough','Large construction tasks can be undertaken at this shipyard.',2625,1913,100000,100000000,10000,1,2,0,1,NULL,0),(29469,319,'Amarr Starbase Control Tower Tough','The Amarr have always been fond of majestic and intimidating constructions. Their Control Towers do not deviate from that tradition and are truly big and powerful structures, intended more for preservation of territorial interests than commercial benefits.',2296,3394,100000,100000000,10000,1,4,0,1,NULL,0),(29470,281,'Starcakes','The recipe for this highly ornate, traditional Jin-Mei sweet varies from planet to planet, and sometimes from city to city, but its fillings are always dense, sugary, and rich. Each cake\'s jelly center is held in place with a crusty exterior that, as befits tradition, is so highly decorated with symbols that it resembles a volcanic planet: It is possible to read the baker\'s story, lineage, and certifications in the crust\'s maze of lines and ridges, although a reader must be quite dedicated to finish the task before falling to temptation. ',3435,0,400,2,0,1,NULL,98,1,NULL,0),(29471,314,'Ancient Painblade','This antique weapon is the traditional precursor to the modern day\'s Painblade. <br><br>\n\nIn ancient times, Jin-Mei soldiers riding to the field used to plunge their swords into filth, in the well-founded expectation that the wounds they inflicted would cause infection and rot. This nasty tactic was given new life when royal technicians (in those days referred to as <i>Nuyin</i>, something akin to \"wizards\") developed a blade whose surface, when unsheathed, swiftly attracted and encouraged bacterial growth, giving life to all kinds of deadly filth. <br><br>\n\nNowadays, these items are mostly used in theatrical plays, and anyone who gets within a hand\'s reach of their swinging blades usually spends half an act wailing about it before finally dropping dead. ',3436,0,1,0.1,0,1,NULL,0,1,NULL,0),(29472,526,'Ceremonial Brush','Before the advent of electronics, these writing tools were used throughout the Achuran continent. In times of war, it was not at all uncommon for a victor to use a brush-like pen to draw stylized icons representing the outcome of the battle and the heroics performed by his side. These icons would then be copied and molded onto an ivory or metal stamp, which was dipped into hot wax and used to stamp the victor\'s seal on the final agreement. <br><br>\n\nIt should be noted that the brushes and stamps are not the only tools in this box. Cleaning implements are of course included, and so are tiny pliers and some manner of disinfectant, for it was traditional that the victor\'s brush be inset with eyelashes drawn from the screaming conquered.',3437,0,0.5,0.1,0,1,NULL,0,1,NULL,0),(29473,526,'Medicinal Herbs','Traditional herbal remedies have been used for perhaps tens of thousands of years among the Vheriokor tribes of Minmatar. However, they have become so popular over time, particularly among the Gallente peoples, that various herbal concoctions and infusions can be found in virtually every part of inhabited space. <br><br>\n\nBut don\'t eat the roots. <br><br>\n\nNo, seriously. No matter what any scary prophet says. <br><br>\n\nHerbs are said to cure everything from colds to warp sickness, though they are also popular for mild recreation. If a cargo container of herbs seems the slightest bit lighter after a long ship\'s journey, it is the wise captain who does not question his crew too closely, nor visit their living quarters after hours. ',3438,0,5,0.2,0,1,NULL,0,1,NULL,0),(29474,314,'Singing Staff','A traditional musical instrument of the Vheriokor peoples, the singing staff is made from a few tightly-wound strings attached to a small staff. It is today played only ceremonially, and those proficient in its use are rare. <br><br>\n\nThe instrument is fitted over a pole, strings on one side and staff on the other, and then drawn diagonally across the pole\'s surface, eliciting soft monotones. The staffs themselves are usually made from ivory or some other type of bone. Some of these latter types are preferred, for it is said that they have an extra tone that can be heard only when one plays a song of sadness and loss. <br><br>\n\nWhile there exist plenty of poles specifically designed for this instrument, technically just about anything will do: a metal stand, a chair leg, or even, if the strings are wound tightly enough, a human appendage. ',3439,0,1,0.1,0,1,NULL,0,1,NULL,0),(29475,314,'Intaki Clackers','A traditional Intaki musical instrument, the clacker consists of two flat pieces of lightweight material, loosely bound at one edge. When that end is held and the other end swung forward, the instrument produces a sharp clashing sound. <br><br>\n\nGiven the scarcity of wood in space, the instrument today is often made from plastic or other polymer variants. More complex variants have lights or chemicals inset in the material that can make the clackers do anything from reflecting light to taking on an eerie glow, or even emitting sparks. <br><br>\n\nIt\'s not at all uncommon for older siblings to frighten their younger relatives by sneaking up at them in the dark of night, rattling their clackers like some red-eyed beast of myth snapping its jaws. ',3440,0,1,0.1,0,1,NULL,0,1,NULL,0),(29476,314,'Folkloric Painting','The Intaki have a long and glorious tradition of three-color paintings that depict scenes from both history and mythology, often melding the two into a highly symbolic rendition of their people\'s presence and purpose in the world of New Eden. <br><br>\n\nIn recent decades, the traditional Intaki painting style has been adopted by painters of the abstract \"Reticular school,\" an anti-factionalist, neo-traditional movement made famous by Suri Naatha and the Circle of Nineteen. ',3441,0,0.5,0.2,0,1,NULL,0,1,NULL,0),(29477,314,'Number Box','This construction, consisting of rows of pellets set onto colorful pins, once allowed Ni-Kunni mathematicians and natural philosophers to perform highly complex calculations. Its use faded into memory, as most things do, only to be rediscovered as a tool with which to teach students the particulars of certain highly abstract three-dimensional calculations required for space flight. <br><br>\n\nThe number box\'s pins are placed both horizontally and vertically, so the pellets can be slid along a triple axis, the box is also, to the relief of some teachers, heavy and solid enough to hit a student firmly over the head if he still can\'t grasp the math. ',3442,0,5,0.2,0,1,NULL,0,1,NULL,0),(29478,314,'Traditional Board Game','An ancient board game said to have been devised by the Ni-Kunni, this game was reputedly used for anything from entertainment on long ship hauls to deciding the fates of battles. Pieces in ancient times were made of wood or bone, but now most often consist of polymer compounds cast into intricate shapes. The game is easy to learn, hard to master, and really stupid to bet on. ',3443,0,0.5,0.1,0,1,NULL,0,1,NULL,0),(29479,526,'Firecrackers','Small explosive devices with extremely loud retorts  some even relying on cheap, built-in speakers to amplify their effects  these items are used for celebration (and often to prompt heart attacks) throughout the world of New Eden. ',3444,0,100,1,0,1,NULL,0,1,NULL,0),(29480,314,'Antique Vheriokor Statue','This statue represents a serpentine figure from ancient Vheriokor mythology, whether it bodes good or ill depends on its origin and the mindset of its viewer. Regardless, originals are increasingly rare these days. ',3445,0,5,0.2,0,1,NULL,0,1,NULL,0),(29481,281,'Ghalen Pastries','Ghalen is an old Achuran dish of ground meat mixed with chopped vegetables, wrapped in large green leaves and cooked in fat and oils. Each Ghalen pastry is usually the size of a man\'s fist, dripping with juice when one bites into it. It is served piping hot and is one of the few dishes of old that has not only retained its appeal, but become known throughout the world of New Eden. ',3449,0,100,1,0,1,NULL,98,1,NULL,0),(29482,281,'Ghalen Dumplings','Ghalen dumplings are variants of the more common Ghalen pastries. The dumplings have far less filling, if any, and usually consist merely of rice balls rolled in leaves and then deep-fried. On holy days, they are eaten without any condiment or side dish, but in recent times they\'ve gained vast popularity with young consumers, who tend to dip them in all manner of spicy sauces. ',3446,0,120,1,0,1,NULL,98,1,NULL,0),(29483,526,'Zydrine Wine','This delicate wine is brewed from rice leaves. It often takes on a faint green hue akin to that of raw Zydrine ore, whence it derives its popular name. <br><br>\n\nWhile Zydrine wine is in fact quite potent, it is very light on the palate and has an aftertaste of green tea. The resultant tendency for drinkers to assume the wine is non-alcoholic has led to some very amusing situations. ',3447,0,500,1,0,1,NULL,0,1,NULL,0),(29484,526,'Zydrine Burn','A cousin of the more refined Zydrine wine, Zydrine Burn (or just \"Burn\") is made from rice leaves and several unspecified components, one of which may or may not be liquefied fedo scent glands. The experience of drinking Burn has been compared to standing behind a spaceship\'s subspace engine, while the ship is running, with one\'s mouth open. <br><br>\n\nZydrine Burn is enjoyed, or at least ingested, throughout New Eden by masses in search of a new life experience. In this, it generally rewards. ',3448,0,400,1,0,1,NULL,0,1,NULL,0),(29485,526,'Kuashi','Two moderately ornate sticks ending in sharp points, with two-inch serrated blades along the forward edge, kuashi are used as eating utensils by the Jin-Mei people (and in fact their use has become common throughout the Caldari State). They are versatile implements, used to pick up small morsels or to stab larger items on their points (and even, among less couth folk, to cut portions away from platters of food). When the point is used to stab, the serrated edges help keep the largest mouthfuls attached to the sticks, thus avoiding clumsy faux pas. <br><br>\n\nIn some modern kuashi, tiny magnets are inset into the pointed tips to help the wielder keep them together (and thus to keep food properly pinned between), with pressure sensors in the dull ends determining their level of magnetism. ',3450,0,50,0.5,0,1,NULL,0,1,NULL,0),(29489,283,'Fugitive Slaves','These slaves have escaped from their masters, but have yet to gain legal protection or recognition as free people.',2541,0,80,1.5,0,1,NULL,0,0,NULL,0),(29494,226,'Large Unstable Wormhole','Your sensors show readings of the chart when you aim them at this peculiar phenomenon. From what little information you can gather you surmise that a stabling mechanism of some sort is needed for it to be safe to venture through the wormhole. But the readings also seem to indicate that this wormhole might not be a totally random natural phenomenon, but rather something that was created. When or by whom is impossible to tell and where it leads is an even bigger mystery.',3428,1274,1,0,0,1,NULL,0,1,NULL,0),(29495,937,'Rank','',NULL,0,0,0,0,1,NULL,0,0,NULL,0),(29496,937,'Medal','',NULL,0,0,0,0,1,NULL,0,0,NULL,0),(29497,937,'Ribbon','',NULL,0,0,0,0,1,NULL,0,0,NULL,0),(29503,226,'Minmatar Starbase Control Tower_LCO','The Matari aren\'t really that high-tech, preferring speed rather then firepower or involved technology. Unfortunately that doesn\'t apply very well to stationary objects, much to the liking of the Amarr Empire. Amarrians call it a scrapheap of epic proportions. But don\'t underestimate these structures. Minmatar commanders usually have the last laugh when it comes to combat.',2371,3394,100000,100000000,10000,1,2,0,1,NULL,0),(29504,284,'OP Insecticide','Organophosphates, similar to nerve gases, have long been used as insecticides, and as bugs evolve, so too must the methods for dealing with them. This particular insecticide is perhaps the most lethal known to humankind, and can kill nearly anything exposed to it. ',1187,0,250,0.25,0,1,NULL,320,1,NULL,0),(29505,226,'LCO Amarr Bunker','A bunker. Beware.',2422,705,0,0,0,1,NULL,0,1,NULL,0),(29506,226,'LCO Caldari Bunker','A bunker. Beware.',2470,870,0,0,0,1,NULL,0,1,NULL,0),(29507,226,'Caldari Starbase Control Tower_LCO','At first the Caldari Control Towers were manufactured by Kaalakiota, but since they focused their efforts mostly on other, more profitable installations, they soon lost the contract and the Ishukone corporation took over the Control Towers\' development and production.',2370,3394,100000,100000000,10000,1,1,0,1,NULL,0),(29508,226,'LCO Caldari Lookout','A lookout. Look out.',2451,630,0,0,0,1,NULL,0,1,NULL,0),(29509,226,'LCO Caldari Elevator','An elevator.',2449,689,0,0,0,1,NULL,0,1,NULL,0),(29511,226,'China Monument','',1266,3657,0,0,0,1,NULL,0,0,NULL,0),