es catalysis for a variety of generative and reactive machine processes.',2664,0,0,1,0,1,NULL,320,1,500,0),(29665,667,'Independent Green-Crewed Armageddon','The mighty Armageddon class is the main warship of the Amarr Empire. Its heavy armaments and strong front are specially designed to crash into any battle like a juggernaut and deliver swift justice in the name of the Emperor.\n\nThe markings on this ship reveal no obvious connection to the Empire.',297,350,20500000,1100000,235,1,4,0,0,NULL,0.07),(29667,667,'Independent Green-Crewed Apocalypse','In days past, only those in high favor with the Emperor could hope to earn the reward of commanding one of the majestic and powerful Apocalypse class battleships. In latter years, even though now in full market circulation, these golden, metallic monstrosities are still feared and respected as enduring symbols of Amarrian might.\n\nThe markings on this ship reveal no obvious connection to the Empire.',296,350,19500000,1150000,235,1,4,0,0,NULL,0.07),(29668,943,'30 Day Pilot\'s License Extension (PLEX)','This item extends your game time by 30 days when activated. It cannot leave stations but may be traded on the market and through contracts, except courier.',3001,0,0,0.001,0,1,NULL,0,1,1108,0),(29671,667,'Independent Green-Crewed Abaddon ','The Abaddon class ship is a celestial tool of destruction. It is designed to enter combat from the outset, targeting enemies at range and firing salvo after salvo at them, and to remain intact on the battlefield until every heretic in sight has been torn to shreds.\n\nThe markings on this ship reveal no obvious connection to the Empire.\n',3132,350,20500000,1100000,235,1,4,0,0,NULL,0.07),(29673,667,'Independent Armageddon ','The mighty Armageddon class is the main warship of the Amarr Empire. Its heavy armaments and strong front are specially designed to crash into any battle like a juggernaut and deliver swift justice in the name of the Emperor.\n\nThe markings on this ship reveal no ob