 markings on this ship reveal no obvious connection to the State.\n\n',50,350,1080000,22000000,235,1,1,0,0,NULL,0.07),(29689,680,'Independent Green-Crewed Dominix','The Dominix is one of the old warhorses dating back to the Gallente-Caldari War. While no longer regarded as the king of the hill, it is by no means obsolete. Its formidable hulk and powerful weapons batteries means that anyone not in the largest and latest battleships will regret ever locking horns with it.\n\nThe markings on this ship reveal no obvious connection to the Federation.',318,350,17500000,1140000,480,1,8,0,0,NULL,0),(29690,680,'Independent Green-Crewed Hyperion','Recognizing the necessity for a blaster platform to round out their high-end arsenal, the Federation Navy brought in top-level talent to work on the Hyperion. The result: one of the most lethal and versatile gunboats ever to take to the dark skies.\n\nThe markings on this ship reveal no obvious connection to the Federation.',3207,350,17500000,1140000,480,1,8,0,0,NULL,0),(29691,680,'Independent Green-Crewed Megathron','The Megathron has established itself as one of the most feared and respected battleships around. Since its first appearance almost two decades ago it has seen considerable service in the troublesome regions on the outskirts of the Federation, helping to expand and defend Gallentean influence there.\n\nThe markings on this ship reveal no obvious connection to the Federation.',64,350,17500000,1140000,480,1,8,0,0,NULL,0),(29692,680,'Independent Dominix','The Dominix is one of the old warhorses dating back to the Gallente-Caldari War. While no longer regarded as the king of the hill, it is by no means obsolete. Its formidable hulk and powerful weapons batteries means that anyone not in the largest and latest battleships will regret ever locking horns with it.\n\nThe markings on this ship reveal no obvious connection to the Federation.',318,350,17500000,1140000,480,1,8,0,0,NULL,0),(29693,680,'Independent Hyperion','Recogniz