0000,27500,2700,1,NULL,0,0,NULL,0),(29745,306,'Serpentis Ship Waste','You surmise that with some salvaging equipment there is still something of value to be had from this wreck.',3383,14,10000,27500,2700,1,NULL,0,0,NULL,0),(29746,668,'Independent Green-Crewed Augoror','The Augoror-class cruiser is one of the old warhorses of the Amarr Empire, having seen action in both the Jovian War and the Minmatar Rebellion. It is mainly used by the Amarrians for escort and scouting duties where frigates are deemed too weak. Like most Amarrian vessels, the Augoror depends first and foremost on its resilience and heavy armor to escape unscathed from unfriendly encounters.\n\nThe markings on this ship reveal no obvious connection to the Empire.',58,150,12000000,120000,450,1,4,0,0,NULL,0),(29747,668,'Independent Green-Crewed Arbitrator','The Arbitrator is unusual for Amarr ships in that it\'s primarily a drone carrier. While it is not the best carrier around, it has superior armor that gives it greater durability than most ships in its class.\n\nThe markings on this ship reveal no obvious connection to the Empire.',298,150,12000000,120000,450,1,4,0,0,NULL,0),(29748,668,'Independent Green-Crewed Maller','Quite possibly the toughest cruiser in the galaxy, the Maller is a common sight in Amarrian Imperial Navy operations. It is mainly used for military duty, although a few can be found in the private sector acting as escort ships for very important dispatches.\n\nThe markings on this ship reveal no obvious connection to the Empire.',57,150,12000000,120000,450,1,4,0,0,NULL,0),(29749,668,'Independent Green-Crewed Omen','The Omen is a stereotypical example of the Amarrian School of thinking when it comes to ship design: thick armor and hard hitting lasers. Advancements in heat dissipation allow the Omen to fire its lasers faster than other ships without this technology.\n\nThe markings on this ship reveal no obvious connection to the Empire.',1065,150,12000000,120000,450,1,4,0,0,NULL,0),(