,235,1,8,0,0,NULL,0.07),(29777,678,'Independent Green-Crewed Thorax ','The Thorax-class cruiser is the latest combat ship commissioned by the Federation. While the Thorax is a very effective ship at any range, typical of modern Gallente design philosophy it is most effective when working at extreme close range where its blasters and hordes of combat drones tear through even the toughest of enemies.\n\nThe markings on this ship reveal no obvious connection to the Federation.\n',63,150,11300000,113000,235,1,8,0,0,NULL,0.07),(29778,678,'Independent Green-Crewed Vexor','The Vexor is a strong combat ship that is also geared to operate in a variety of other roles. The Vexor is especially useful for surveying in potentially hostile sectors as it can stay on duty for a very long time before having to return to base. Furthermore, it is well capable of defending itself against even concentrated attacks.\n\nThe markings on this ship reveal no obvious connection to the Federation.\n',62,150,11300000,113000,235,1,8,0,0,NULL,0.07),(29779,678,'Independent Celestis','The Celestis cruiser is a versatile ship which can be employed in a myriad of roles, making it handy for small corporations with a limited number of ships. True to Gallente style the Celestis is especially deadly in close quarters combat due to its advanced targeting systems.\n\nThe markings on this ship reveal no obvious connection to the Federation.\n',319,150,11200000,112000,480,1,8,0,0,NULL,0),(29780,678,'Independent Exequror','The Exequror is a heavy cargo cruiser capable of defending itself against raiding frigates, but lacks prowess in heavier combat situations. It is mainly used in relatively peaceful areas where bulk and strength is needed without too much investment involved.\n\nThe markings on this ship reveal no obvious connection to the Federation.\n',320,150,11200000,112000,480,1,8,0,0,NULL,0),(29781,678,'Independent Thorax','The Thorax-class cruiser is the latest combat ship commissioned by the Federatio