 designed specially to counter the small, fast raider frigates of the Minmatar Republic, thus it is different from most Amarr ships in favoring speed over defenses. With the Executioner, the Amarrians have expanded their tactical capabilities on the battlefield.\n\nThe markings on this ship reveal no obvious connection to the Empire.',54,50,2820000,24398,235,1,4,0,0,NULL,0.07),(29805,665,'Independent Green-Crewed Inquisitor','The Inquisitor is another example of how the Amarr Imperial Navy has modeled their design to counter specific tactics employed by the other empires. The Inquisitor is a fairly standard Amarr ship in most respects, having good defenses and lacking mobility. It is more Caldari-like than most Amarr ships, however, since its arsenal mostly consists of missile bays.\n\nThe markings on this ship reveal no obvious connection to the Empire.',55,50,2820000,24398,235,1,4,0,0,NULL,0.07),(29806,665,'Independent Green-Crewed Punisher','The Amarr Imperial Navy has been upgrading many of its ships in recent years and adding new ones. The Punisher is one of the most recent ones and considered by many to be the best Amarr frigate in existence. As witnessed by its heavy armaments, the Punisher is mainly intended for large-scale military operations, acting in coordination with larger military vessels, but it is more than powerful enough for solo operations.\n\nThe markings on this ship reveal no obvious connection to the Empire.',300,50,2820000,24398,235,1,4,0,0,NULL,0.07),(29807,665,'Independent Green-Crewed Crucifier','The Crucifier was first designed as an explorer/scout, but the current version employs the electronic equipment originally intended for scientific studies for more offensive purposes. The Crucifier\'s electronic and computer systems take up a large portion of the internal space leaving limited room for cargo or traditional weaponry.\n\nThe markings on this ship reveal no obvious connection to the Empire.',1066,50,2820000,24398,235,1,4,0,0,NULL,0.