ndent Veteran Maulus','The Maulus is a high-tech vessel, specialized for electronic warfare. It is particularly valued in fleet warfare due to its optimization for sensor dampening technology.\n\nThe markings on this ship reveal no obvious connection to the Federation.',324,50,2650000,26500,235,1,8,0,0,NULL,0.07),(29875,677,'Independent Veteran Tristan','Often nicknamed The Fat Man, this nimble little frigate is mainly used by the Federation in escort duties or on short-range patrols. The Tristan has been very popular throughout Gallente space for years because of its versatility. It is rather expensive, but buyers will definitely get their money\'s worth, as the Tristan is one of the more powerful frigates available on the market.\n\nThe markings on this ship reveal no obvious connection to the Federation.',60,50,2650000,26500,235,1,8,0,0,NULL,0.07),(29876,683,'Independent Green-Crewed Breacher','The Breacher\'s structure is little more than a fragile scrapheap, but the ship\'s missile launcher hardpoints and superior sensors have placed it among the most valued Minmatar frigates when it comes to long range combat.\n\nThe markings on this ship reveal no obvious connection to the Republic.',305,61,2250000,22500,75,1,2,0,0,NULL,0),(29878,683,'Independent Green-Crewed Probe','The Probe is large compared to most Minmatar frigates and is considered a good scout and cargo-runner. Uncharacteristically for a Minmatar ship, its hard outer coating makes it difficult to destroy, while the limited weapon hardpoints force it to rely on fighter assistance if engaged in combat.\n\nThe markings on this ship reveal no obvious connection to the Republic.',45,61,2250000,22500,75,1,2,0,0,NULL,0),(29879,683,'Independent Green-Crewed Rifter','The Rifter is a very powerful combat frigate and can easily\ntackle the best frigates out there. It has gone through \nmany radical design phases since its inauguration during \nthe Minmatar Rebellion. The Rifter has a wide variety of \noffensive capabilities, making it an unpredictable and deadly adversary. \n\nThe markings on this ship reveal no obvious connection to the Republic.',46,61,2250000,22500,75,1,2,0,0,NULL,0),(29881,683,'Independent Green-Crewed Vigil','The Vigil is an unusual Minmatar ship, serving both as a long range scout as well as an electronic warfare platform. It is fast and agile, allowing it to keep the distance needed to avoid enemy fire while making use of jammers or other electronic gadgets.\n\nThe markings on this ship reveal no obvious connection to the Republic.',1240,61,2250000,22500,75,1,2,0,0,NULL,0),(29882,683,'Independent Breacher','The Breacher\'s structure is little more than a fragile scrapheap, but the ship\'s missile launcher hardpoints and superior sensors have placed it among the most valued Minmatar frigates when it comes to long range combat.\n\nThe markings on this ship reveal no obvious connection to the Republic.',305,50,1645000,16450,120,1,2,0,0,NULL,0.07),(29883,683,'Independent Probe','The Probe is large compared to most Minmatar frigates and is considered a good scout and cargo-runner. Uncharacteristically for a Minmatar ship, its hard outer coating makes it difficult to destroy, while the limited weapon hardpoints force it to rely on fighter assistance if engaged in combat.\n\nThe markings on this ship reveal no obvious connection to the Republic.',45,50,1645000,16450,120,1,2,0,0,NULL,0.07),(29884,683,'Independent Rifter','The Rifter is a very powerful combat frigate and can easily\ntackle the best frigates out there. It has gone through \nmany radical design phases since its inauguration during \nthe Minmatar Rebellion. The Rifter has a wide variety of \noffensive capabilities, making it an unpredictable and deadly adversary. \n\nThe markings on this ship reveal no obvious connection to the Republic.',46,50,1645000,16450,120,1,2,0,0,NULL,0.07),(29885,683,'Independent Slasher','The Slasher is cheap, but versatile. It\'s been manufactured en masse, making it one of the most common vessels in Minmatar space. The Slasher is extremely fast, with decent armaments, and is popular amongst budding pirates and smugglers.\n\nThe markings on this ship reveal no obvious connection to the Republic.',44,50,1645000,16450,120,1,2,0,0,NULL,0.07),(29886,683,'Independent Vigil','The Vigil is an unusual Minmatar ship, serving both as a long range scout as well as an electronic warfare platform. It is fast and agile, allowing it to keep the distance needed to avoid enemy fire while making use of jammers or other electronic gadgets.\n\nThe markings on this ship reveal no obvious connection to the Republic.',1240,50,1645000,16450,120,1,2,0,0,NULL,0.07),(29887,683,'Independent Veteran Breacher','The Breacher\'s structure is little more than a fragile scrapheap, but the ship\'s missile launcher hardpoints and superior sensors have placed it among the most valued Minmatar frigates when it comes to long range combat.\n\nThe markings on this ship reveal no obvious connection to the Republic.',305,50,1645000,16450,120,1,2,0,0,NULL,0.07),(29888,683,'Independent Veteran Probe','The Probe is large compared to most Minmatar frigates and is considered a good scout and cargo-runner. Uncharacteristically for a Minmatar ship, its hard outer coating makes it difficult to destroy, while the limited weapon hardpoints force it to rely on fighter assistance if engaged in combat.\n\nThe markings on this ship reveal no obvious connection to the Republic.',45,50,1645000,16450,120,1,2,0,0,NULL,0.07),(29889,683,'Independent Veteran Rifter','The Rifter is a very powerful combat frigate and can easily\ntackle the best frigates out there. It has gone through \nmany radical design phases since its inauguration during \nthe Minmatar Rebellion. The Rifter has a wide variety of \noffensive capabilities, making it an unpredictable and deadly adversary. \n\nThe markings on this ship reveal no obvious connection to the Republic.',46,50,1645000,16450,120,1,2,0,0,NULL,0.07),(29891,683,'Independent Green-Crewed Slasher','The Slasher is cheap, but versatile. It\'s been manufactured en masse, making it one of the most common vessels in Minmatar space. The Slasher is extremely fast, with decent armaments, and is popular amongst budding pirates and smugglers.\n\nThe markings on this ship reveal no obvious connection to the Republic.',44,61,2250000,22500,75,1,2,0,0,NULL,0),(29892,683,'Independent Veteran Slasher','The Slasher is cheap, but versatile. It\'s been manufactured en masse, making it one of the most common vessels in Minmatar space. The Slasher is extremely fast, with decent armaments, and is popular amongst budding pirates and smugglers.\n\nThe markings on this ship reveal no obvious connection to the Republic.',44,50,1645000,16450,120,1,2,0,0,NULL,0.07),(29893,683,'Independent Veteran Vigil','The Vigil is an unusual Minmatar ship, serving both as a long range scout as well as an electronic warfare platform. It is fast and agile, allowing it to keep the distance needed to avoid enemy fire while making use of jammers or other electronic gadgets.\n\nThe markings on this ship reveal no obvious connection to the Republic.',1240,50,1645000,16450,120,1,2,0,0,NULL,0.07),(29894,306,'Angel Ship Ruins','You surmise that with some salvaging equipment there is still something of value to be had from this wreck.',3115,418,10000,27500,2700,1,NULL,0,0,NULL,0),(29895,306,'Blood Ship Ruins','You surmise that with some salvaging equipment there is still something of value to be had from this wreck.',3115,418,10000,27500,2700,1,NULL,0,0,NULL,0),(29896,306,'Guristas Ship Ruins','You surmise that with some salvaging equipment there is still something of value to be had from this wreck.',3115,418,10000,27500,2700,1,NULL,0,0,NULL,0),(29897,306,'Sansha Ship Ruins','You surmise that with some salvaging equipment there is still something of value to be had from this wreck.',3115,418,10000,27500,2700,1,NULL,0,0,NULL,0),(29898,306,'Serpentis Ship Ruins','You surmise that with some salvaging equipment there is still something of value to be had from this wreck.',3115,418,10000,27500,2700,1,NULL,0,0,NULL,0),(29899,306,'Angel Ship Hulk','You surmise that with some salvaging equipment there is still something of value to be had from this wreck.',3388,14,10000,27500,2700,1,NULL,0,0,NULL,0),(29900,306,'Blood Ship Hulk','You surmise that with some salvaging equipment there is still something of value to be had from this wreck.',3375,14,10000,27500,2700,1,NULL,0,0,NULL,0),(29901,306,'Guristas Ship Hulk','You surmise that with some salvaging equipment there is still something of value to be had from this wreck.',3382,14,10000,27500,2700,1,NULL,0,0,NULL,0),(29902,306,'Sansha Ship Hulk','You surmise that with some salvaging equipment there is still something of value to be had from this wreck.',3376,14,10000,27500,2700,1,NULL,0,0,NULL,0),(29903,306,'Serpentis Ship Hulk','You surmise that with some salvaging equipment there is still something of value to be had from this wreck.',3384,14,10000,27500,2700,1,NULL,0,0,NULL,0),(29904,818,'Lieutenant Orien Hakk','Raised on the Archangels station in Hemin, Orien Hakk spent most of his adult life fighting to survive amid a sea of crime and poverty. His lucky break came a few years ago, where he managed to sneak aboard an outbound industrial. Quickly realizing that he had unwittingly inserted himself into a slave transport bound for the Amarr home worlds, he commandeered the vessel and its captured crew. For months he roamed the spacelanes of Curse before an Angel raiding party pinned him down. Impressed with his merciless determination and cruel ingenuity, he was offered a place inside the Cartel, a lasting home for people of his caliber, and a place where he has gone from strength to strength.',338,50,1645000,16450,120,1,2,0,0,NULL,0.07),(29905,817,'Lieutenant Thora Faband','Though she was once an honorary member of their tribe, Thora Fabands name is one the Thukkers would nowadays rather forget. For almost a decade, she earned their trust under the guise of a failed trader seeking new beginnings. Over time she built up a foundation of goodwill and support, eventually earning a position as a production overseer in a covert facility said to be hidden deep inside the B-ROFP system. <p>\n\nFor almost a full year, she secretly turned the Thukkers production capabilities toward her own ends, manufacturing massive amounts of the illegal X-Instinct booster. When her plans were eventually uncovered, she convinced the Thukkers that she had been producing them for use in their own roaming caravan fleets. Before the matter could be resolved by the tribal elders, however, she had destroyed the facility, stolen all the stock and vanished south toward the Heaven constellation.',337,150,10900000,109000,120,1,2,0,0,NULL,0.07),(29906,816,'Captain Artey Vinck','Angel Captain Artey Vinck used to be one of the most successful civilian traders in the entire Nadire constellation of Sinq Laison, a place known for ruthlessly competitive trading practices. As with many booming Gallentean traders, his success eventually put him in the crosshairs of the criminal underworld. Recognizing an opportunity to shift their goods deep inside Federation space, Serpentis thugs threatened him with financial ruin if he didnt begin smuggling boosters for them. <p>\n\nTheir extortion attempt ended poorly, however, when Vinck decided to go over their heads and cut a far more lucrative and efficient deal with their superiors. Days later they were all dead and Vinck vanished down the path of piracy and narcotics peddling. Since that time he has never been directly linked to any criminal activity, although in recent times he is rumored to have begun leading countless operations involving X-Instinct sales, both inside Federation space and beyond.',335,350,19000000,19000000,120,1,2,0,0,NULL,0.07),(29907,816,'Captain Appakir Tarvia','Although few ever know the true histories of the Domination Angels members, rumors abound that Tarvia was once a humble and harmless archaeologist working on the Eve gate alongside his colleagues in the Servant Sisters of Eve. The Angel Cartel has an immense and well-funded interest in uncovering the valuable secrets locked away inside the ancient Jovian stations they now inhabit. If the rumors are indeed true, then Tarvia would undoubtedly have been tempted away from his work, often viewed as a secondary aim by the Sisters, who set the provision of humanitarian aid as their top priority. Few men of science would have been able to resist the opportunity to conduct research that could change the face of New Eden overnight.',335,350,19000000,19000000,120,1,2,0,0,NULL,0.07),(29908,817,'Lieutenant Kaura Triat','Formerly a Thukker Tribe member, Triat was enticed into work for the Salvation Angels when it became clear that a life of wandering would not get her any closer to the goals she had set for herself and her people. A firm believer in the potential of booster technology to uplift all of humanity, she has turned away from aimless and simple-minded drug peddling and begun working for the Cartel, who, like their partners in Serpentis, appreciate the deeper benefits of their trade. In Triats eyes, the final manifestation of booster technology represents nothing less than the end of slavery.',337,150,10900000,109000,120,1,2,0,0,NULL,0.07),(29909,818,'Lieutenant Tolen Akochi','Caldari by birth, Tolen Akochi was the youngest of seven siblings in a highly successful family that built its fortunes on the back of risk-averse applied research. Even had he ever become heir to anything of substance, his daring methods would have never been tolerated by his family. Accepting these harsh realities, Akochi took what few assets were in his possession and set out for Curse. Serpentis agents soon realized that like their own leader, he had inherited the most important thing of all -- his fathers talents. After a particularly ruthless SARO raid which almost cost him his life, Akochi saw first-hand how science on the frontier was an industry under constant threat. From that moment on, he changed paths and turned his brilliant mind toward combat training.',338,50,1645000,16450,120,1,2,0,0,NULL,0.07),(29910,816,'Captain Saira Katori','Katori has years of combat experience, having worked her way up from a lowly grunt to a respected commander. Prior to her days of piracy she served as a rookie inside the Caldari Navy but when they ruled her unfit to be a starship captain she sought other means to take to the stars. She is allegedly a close personal friend of Vepas Minimala who, as the rumor goes, was the one that recognized her raw talent and paid for everything she needed to grow into the fearsome pilot she is today.',2158,350,1080000,22000000,235,1,1,0,0,NULL,0.07),(29911,816,'Captain Isoryn Ardorele','Formerly a Federation Navy commander, Isoryn Ardorele joined the Guristas Pirates for the simplest of reasons. While deployed inside Caldari borders on a reconnaissance operation for the Federation, Ardorele was targeted back home by State black ops soldiers who kidnapped her family and threatened to kill them if she didnt withdraw her forces. Against the orders of her superiors, Ardorele complied with the Caldari and was consequently labeled a traitor to the nation she had served for years. Although devastated by the decision, she was able to understand how it came to be. What she could not understand, however, was the death of her family at the hands of Caldari soldiers who, without any apparent thought or compassion, reneged on their end of the bargain. <p>\n\nSince that day, her mental wellbeing has come into question time and time again, since she engages in nothing short of genocide on the spacelanes. Keen to harness both her military knowledge and raw hatred for the Caldari people, Guristas leadership offered her a position overseeing their new narcotics operations near State borders. Ardorele is said to be completely uninterested in the booster side of things, but nobody can argue with the results of her security patrols. Her tendency to indiscriminately slaughter every Caldari that she comes across has meant that the curious stay well away. ',2158,350,1080000,22000000,235,1,1,0,0,NULL,0.07),(29912,817,'Lieutenant Asitei Ohkunen','There is a great deal said about Asitei Ohkunen but separating the fact from the fiction is no easy task. Reclusive and secretive, he has made himself scarce to everyone but his Gurista cohorts since abandoning his post in the Caldari Navy. Although the Caldari State initially denied he ever worked for them, a leaked CONCORD file later revealed that Ohkunen was indeed registered with them as an electronics expert. The political backlash from the State following the leak was in fact the only time people ever heard the name Asitei Ohkunen. Whatever crimes he may have committed, if any, his name certainly hasnt been linked to them.',1824,150,10100000,101000,235,1,1,0,0,NULL,0.07),(29913,817,'Lieutenant Sukkenen Fusura','A computer expert like few others, Sukkenen Fusura was once destined for a promising career in the Caldari State. As an inquisitive young man with few moral qualms, he would often roam the greater network looking for challenging databases to hack into. It was this dubious hobby of his that saw him fall from grace inside the State, after he was caught digging around classified corporate databases. It didnt take long for the Guristas Pirates to notice just how easily he bypassed many of the States classified systems, and soon enough he was spotted slipping out of Lonetrek towards Venal in the north. Fusura recently caused quite a stir when he boasted on a public network that the Caldari States biotech corporations had all contributed heavily toward improving the design and production of the Guristas Crash boosters.',1824,150,10100000,101000,235,1,1,0,0,NULL,0.07),(29914,818,'Lieutenant Rodani Mihra','As a lower-class Khanid exiled from the Amarr Empire, Rodani Mihra had to quickly adapt to a challenging and foreign environment. Pledging that he would never submit himself to manual labor, Mihra fine-tuned his talents at trading and market analysis. His service to the Guristas began almost a decade ago, just as he was about to enter into legitimate work as an advertising consultant. After a chance meeting with a Gurista booster manufacturer made him realize just how much money he could make with his skills, he left for Venal and never returned. Mihra is said to be absurdly protective of the financial kingdom he has built up around Blue Pill boosters these past years.',1831,50,1650000,16500,235,1,1,0,0,NULL,0.07),(29915,818,'Lieutenant Onoki Ekala','Like so many ranking Guristas commanders, Onoki Ekala once had strong ties to the Caldari Navy. A knowledge nomad similar to the famed Tyma Raitaru, he spent many years as a freelance scientist selling his patents to the highest bidder, which in his case were most commonly Navy subsidiaries. Considered a brilliant innovator across a number of disciplines, Ekala made a small fortune optimizing anything from missile manufacturing processes to bio-weapon delivery mechanisms. <p>\n\nRealizing that it was a simple matter of ISK and greed, the Guristas offered him access to research funding and cloning technology in exchange for his lasting loyalty. Ekala has stayed with them for almost a decade since then, much to the disappointment of his former clients in the Caldari Navy.',1831,50,1650000,16500,235,1,1,0,0,NULL,0.07),(29916,816,'Captain Scane Essyn','Scane Essyn worked alongside Serpentis Officer Brynn Jerdola at the Federal Intelligence Office for many years. As one of the few close enough to her to be aware of her mission to infiltrate the Serpentis hierarchy, he was often rumored to be her lover. Not long after it became widely acknowledged that Jerdola had defected, Essyn quietly slipped outside Federation borders and was next seen in the Wyvern Constellation, flanked by a fleet of Serpentis Vindicators. Whether he followed her lead in defecting -- or, indeed, was the reason for it happening -- remains unknown. Most likely this very issue is still an ongoing investigation inside the shadowy corridors of the FIO.',2157,350,17500000,1140000,480,1,8,0,0,NULL,0),(29917,816,'Captain Amiette Barcier','Originally a high-ranking fleet commander for the Angel Cartels Archangel Division, Barcier first came in to contact with Serpentis on a joint operation with the Guardian Angels, where her squadron was tasked with the defense of Serpentis Inquest HQ. Seeing what they thought was a weak link in Fountains defensive line, CONCORD raiding parties repeatedly tried to hamper Inquest research operations. Rumor has it that Barcier eventually came to the attention of Salvador Sarpati himself when  after four long months of nothing but failed attempts  CONCORDs elite SARO Division called for an end to the assaults. Since that day, Barcier has continued to deliver results and impress her new employer.',2157,350,17500000,1140000,480,1,8,0,0,NULL,0),(29918,817,'Lieutenant Elois Ottin','Once destined to be a holovid star, Elois Ottins promising career as an actress was crushed under the weight of a severe Drop addiction. Her drug dependence became a huge public scandal when a jaded lover ran to the press with the story. Unfortunately for Ottin, the revelation came on the heels of a highly successful anti-drug campaign. Federation politicians and their lackeys in the media wasted little time in alienating her completely. Seizing the opportunity to counter the Federations propaganda machine, Serpentis Corporation saw to it that from then on, she would have access to training, cloning technology and anything else needed to become a flag-bearer for their ideals.',1815,150,11200000,112000,480,1,8,0,0,NULL,0),(29919,817,'Lieutenant Rayle Melania','Born and bred on the Serpentis headquarters station in Serpentis Prime, Rayle Melania lived a daily life of crime, poverty and booster addiction. He struggled for many years as a lowly pimp and failed drug dealer before his far more impressive capabilities as a capsuleer pilot were uncovered. Taking the hard lessons from the station ghettos with him straight into the spacelanes, Melania quickly earned a name for himself as one of the most rough and ruthless narco-thugs Serpentis had employed in recent years.',1815,150,11200000,112000,480,1,8,0,0,NULL,0),(29920,818,'Lieutenant Raute Viriette','A relic from the early years following the booster ban, Raute Viriette spent the last few decades locked away inside Poteque Pharmaceuticals biolabs, supposedly working on a top-secret research project for the Federal government. It was one of the worst kept secrets inside Poteque that her entry into science had come at a time when booster research was still seen in some fringe communities as the next great scientific breakthrough. Over the years however, people had forgotten about these associations. It was only recently, when she vanished from her post in the Federation, that people began to remember.',1818,50,2650000,26500,235,1,8,0,0,NULL,0.07),(29921,818,'Lieutenant Irrie Carlan','Formerly a Federation Customs officer, few understand the ways of customs and anti-narcotic squads like Irrie Carlan. Tempted away from her duty to the Federation by the promise of vast riches and access to Serpentis Inquests cloning technology, she wasted little time in defecting. Although she gambled the promise of a successful career away, the decision has been one she could hardly regret, having rocketed up the Serpentis chain of command on the back of her rare and precious knowledge.',1818,50,2650000,26500,235,1,8,0,0,NULL,0.07),(29922,816,'Captain Tori Aanai','A graduate from the School of Applied Knowledge, Tori Aanai stands as one of many lessons about the dangerous freedom that capsuleer technology bestows. Shortly after her graduation, Aanai found herself deployed deep inside Stain. She was guarding what was to become a failed attempt by the Poksu Mineral Group to uncover mineral riches in a system they wrongly assumed was unexploited. When the industrial convoy fled in the face of an unexpected Sansha presence, for reasons known only to her, Aanai decided to stay. From that point on, she has been linked to countless illegal activities. <p>\n\nDED reports state that she has been killed over a thousand times on the fringes of empire space, recklessly exposing herself to near-harmless physical death as she coordinates large-scale Frentix production and distribution on the front lines. Despite their success at reining her operations in, the DED has never brought them to a complete standstill. Indeed, many say that each death has only hardened her resolve.',2295,350,10010000,100100,235,1,4,0,0,NULL,0.07),(29923,817,'Lieutenant Onuoto TS-08A','The pilot inside this Phantasm-class cruiser seems to be locked into a series of highly complex tactical maneuvers designed to hit hard and leave little room for their opponent to survive the opening assault. Although this battle strategy would spell instant death for a rookie or even an intermediate pilot, to a capsuleer these maneuvers are severely limited and, after some observation, easily predicted. Every few seconds the pilot attempts to open a comms link. When accepted, all that is transmitted is a deafening static.',1236,150,10010000,100100,235,1,4,0,0,NULL,0.07),(29924,818,'Lieutenant Onuoto TS-08B','The pilot inside this Succubus-class cruiser seems to be locked into a series of highly-complex tactical maneuvers designed to pin down an enemy in anticipation for a larger onslaught. Although this battle strategy would spell instant death for a rookie or even an intermediate pilot, to a capsuleer these maneuvers are severely limited and, after some observation, easily predicted. Every few seconds the pilot attempts to open a comms link. When accepted, it does nothing other than fill the audio receivers with the same looping audio fragment of some long-forgotten speech by Sansha Kuvakei.',1237,50,2112000,21120,235,1,4,0,0,NULL,0.07),(29925,816,'Captain Aneika Sareko','Known across Delve for her ruthless rise to Captain of the Crimson Hand fleet, Sareko has built a reputation for no-nonsense dealings and zero tolerance for insubordination. Of Caldari descent, she is primarily interested in business and getting the job done, but when clients arrangements start to look suspect, her Sani Sabik side comes out in force. One particular story bears out the truth of this, although it has never been substantiated by CONCORD. <p>\n\nApparently, during a particularly successful SARO raid deep into Delve, officers came across what appeared to be a cloning facility. Inside, however, the infrastructure had been converted into a prison of sorts. Rebellious Crimson Hand personnel had been cloned and subjected to a daily regime of capital punishment. Unofficial sources claimed they had been locked up inside their capsule prisons for as long as nine months, dying a new death each day only to be reborn to suffer it all over again. ',2121,350,19500000,1150000,235,1,4,0,0,NULL,0.07),(29926,817,'Lieutenant Kannen Sumas','A former Priest based out of Penirgman, Sumas was once a famed theologian back in his home system. He served almost two decades in the Imperial Navy before the lure of immortality brought him into the Crimson Hands service. His finely honed expertise in Amarrian warfare, now augmented with the limitless potential of capsule technology has shaped him into a fearsome personal bodyguard for high-ranking military officers.',1759,150,11800000,118000,235,1,4,0,0,NULL,0.07),(29927,818,'Lieutenant Anton Rideux','To most customers, Rideux is the public face for the outfit and the only person in the Hand theyre likely to ever see. As a relatively calm and amicable Intaki he is perfectly suited to handle the front end of business with clients both large and small. Very rarely will he get his hands dirty but if his own personal honor or credibility comes under attack then he is quick to have an example made out of his detractors.',1764,50,2860000,28600,235,1,4,0,0,NULL,0.07),(29932,314,'Sarekos Capsule','The self-destruct unit on this capsule has had the safety timer removed, a unique Crimson Hand modification that ensures military officers are rarely captured alive. The corpse also appears to have been liquefied in some way during the process, adding a dark ruby hue to the capsule fluid within.',73,0,32000,1000,0,1,NULL,0,1,NULL,0),(29933,314,'Victor Emblem','This is an expensive replica of an old Amarr Navy medal once given to soldiers on their 20th year of service. Crimson Hand lieutenant Kannen Sumas has embedded a data file underneath the resilient metal alloy exterior. The files sole contents are a few selected verses of the Amarrian Scriptures, all of them celebrating the virtues of humility in the face of a superior foe. ',2096,0,1,0.1,0,1,NULL,0,1,NULL,0),(29934,314,'Splinter Bodyguard','Although the explosion of Anton Rideuxs ship has scrambled the electronics, the intentions behind this Rogue Drone redesign remain clear. In typical Crimson Hand style, the violent and unpredictable Splinter variant has been captured and reprogrammed to protect its host ship. The fact that Rideux didnt launch it suggests perhaps the job hadnt quite been finished yet. ',2989,0,34000,25,0,1,NULL,0,1,NULL,0),(29935,314,'Cartel Holovids','Encapsulated in a surprisingly sturdy metal casing, this holovid collection appears to have survived the explosion of Serpentis drug lord Amiette Barciers vessel. It seems that each of the numerous holovids involve a different depiction of the Angel Cartel from amateur documentaries theorizing about secretive research projects to underground films glorifying the Cartels highly violent raids. ',1177,0,1,1,0,1,NULL,250,1,NULL,0),(29936,314,'Accounting Records','It appears as if the only thing designed to survive the explosion of Rayle Melanias vessel was his accounting log, perhaps so it could later be recovered by his Serpentis colleagues. Although heavily encrypted, fragments of data are decipherable. Even from what little is readable, it is clear that Melania handles the shifting of his narcotic goods personally. According to one transaction log, he made almost 300 individual deliveries across seven regions of New Eden, all in the space of a single day.',2886,0,1,1,0,1,NULL,10000,1,NULL,0),(29937,314,'Inquest Drone','Hundreds of these tiny devices were released momentarily before the explosion of Irrie Carlans vessel. Motionless upon launch, they began to spring to life shortly afterwards, flitting around the ruins of the ship as they assessed the damage. Most curiously, they appeared to perform some kind of in-space surgical procedure on Carlans corpse once it had been located amongst the wreckage. Now removed from the rest of its swarm, this particular drone has powered down entirely and seemingly erased its own subroutines. Any chance at reverse-engineering it in this state would be slim.',2989,0,1,1,0,1,NULL,0,1,NULL,0),(29938,314,'Cipher Router','This heavily damaged fluid router appears to offer a low-profile backdoor into classified FIO networks. In a more functional state this unit could have shed some light on whether or not Serpentis Captain Scane Essyn truly defected. Without a way to bypass the various built-in encryption systems, however, it will be impossible to make sense of any recoverable data. This could be proof of Essyn using old knowledge to his advantage in a new career, or simply his link back to one he never abandoned in the first place.',3230,0,10,2,0,1,NULL,0,1,NULL,0),(29939,314,'Ottin Holoreels Case','Kept safe from the explosion of her vessel, this Holoreel collection is a meticulous document of Serpentis Lieutenant Elois Ottins entire acting career. A large Impetus logo is emblazoned on the outside of the container, suggesting that perhaps the case was a gift from the corporation. Although Ottin rarely managed to snare contracts with Impetus to produce her works, they did manage and fund her two most successful acting ventures. At one point she had a third lined up, but when her drug dependency became public knowledge Impetus dropped the contract amid the scandal. ',16,0,1,1,0,1,NULL,0,1,NULL,0),(29940,314,'Advisory Notes',' Found among the wreckage of Serpentis Lieutenant Rautte Viriettes vessel, these notes offer a glimpse into her recent scientific pursuits. From what little is decipherable, Viriette seems to be advising Serpentis Inquest scientists on various methods of production efficiency, all of which appear to be applied to the manufacture of Drop boosters. Although there is no evidence directly linking any of her previous Poteque research to her current work with the Serpentis, it is clear that the methods she has learned in the last few decades are being put to good use.',2886,0,1,0.1,0,1,NULL,0,1,NULL,0),(29941,314,'Dysfunctional Fluid Router','The backbones of communication across New Eden, fluid routers play a crucial role in all faster than light (FTL) transmissions. The locator and identification subsystems on this particular model appear to have been removed entirely, most likely as part of an attempt to avoid CONCORD interference. Although the unit is heavily damaged from the explosion of Saira Katoris ship, fragments of data have survived in its cache. Most interesting among them is an unsent mail to Vepas Minimala which reveals a certain degree of familiarity between them.',3230,0,1,1,0,1,NULL,0,1,NULL,0),(29942,314,'Research Data Fragment','Barely intact as it lies among the wreckage of his ship, this data terminal offers a rare insight into the likely research interests of the enigmatic and reclusive pirate Asitei Ohkunen. Huge amounts of data have been compiled on the neurological states of test subjects, all of them under the effects of various boosters. The reasoning behind these tests remains uncertain, although the narrow focus on electrical impulses inside the brain might suggest an attempt at some kind of digitally-produced emulation.',2885,0,1,0.1,0,1,NULL,0,1,NULL,0),(29943,314,'Demographic Analyses','Moments before the destruction of his ship Rodani Mihra attempted to destroy these files. The formatting procedure didnt fully complete before his ship was downed, however, and fragments of data remain, including one important-looking document. Highly convoluted and riddled with economic terminology, it appears to be a comprehensive report on various regions. Each and every system has been broken down into demographic sub-groups that clearly outline where the demand for illegal boosters is currently greatest and where it is mostly likely to grow in the coming weeks and months.',2886,0,1,0.1,0,1,NULL,0,1,NULL,0),(29944,314,'Ardorele Heirloom','Found drifting in a container amongst the wreckage of her ship, Guristas Captain Isoryn Ardoreles personal possessions tell a tale of devastating loss. Federation Navy medals rewarding long years of service, hand paintings made by her late daughter, a wedding ring  all mementos of a past destroyed by Caldari thugs. With such a constant and effective reminder of her painful history, it is little wonder that Ardorele manages to sustain her murderous rage towards the Caldari. ',2705,0,1,0.1,0,1,NULL,0,1,NULL,0),(29945,314,'Network Decryption Analyzer','This strange-looking piece of equipment was discovered unharmed amid the shattered hull of Guristas Lieutenant Sukkenen Fusuras vessel. Although baffling in its complexity, it is clearly used as a tool to breach secure networks. All the software appears to be proprietary, however. Without some way to understand even the basic functionality or system design there is little chance of using the device, let alone reverse-engineering it.',2857,0,1,0.1,0,1,NULL,0,1,NULL,0),(29946,314,'Ekala\'s Design Documents','Heavily damaged from the explosion of his vessel, Guristas Captain Onoki Ekalas private designs fail to offer any significant insights into what his brilliant mind is currently working toward. Careful analysis of the reconstructed diagrams reveals various bio-chemical refining array designs, but many crucial details are missing. Presumably this facility has something to do with the processing of cytoserocin, the material harvested from gas clouds as part of booster production. Without access to more information, the designs alone offer no real clue as to what Ekala is up to save for the obvious, producing Crash boosters.',2886,0,1,0.1,0,1,NULL,0,1,NULL,0),(29947,314,'Enigmatic Reports','Completely unharmed from the destruction of Angel Captain Appakir Tarvias vessel, this data storage unit appears to contain a wealth of information, although every last byte is encrypted in an unknown cipher that looks leagues above current data protection technology. Every attempt made to crack the code returns nothing more than a list of strange errors, none of which are typical for decryption fault analysis. More ominously still, each attempt at decryption seems to activate an internal uplink to a remote system in the Heaven constellation, with no apparent way to stop what must be outbound transmissions. <p>\n\nDespite the impenetrability of the data, one small image juts out among the garbled text, offering an explanation as menacing as the fact that it was clearly excluded from the encryption as some kind of warning.  ',1566,0,1,0.1,0,1,NULL,0,1,NULL,0),(29948,314,'Insorum Booster Prototype','The only known cure for the infamous Vitoc method that Amarrians use to control their massive slave contingents, Insorum is the answer to every loyal Minmatars desire to see their people freed from its insidious grip. How Angel Lieutenant Kaura Triat even came into possession of such a rare and highly-valued Insorum sample is anyones guess. More intriguing, however, is the fact that it seems to have been heavily modified by scientists, perhaps those working for Serpentis Inquest. Encased in a resilient tamper-proof case that will destroy the contents within if opened by anyone but its owner, this sample seems to have been integrated with the Sooth Sayer booster. What purpose this process might have served remains entirely unclear. ',1193,0,1,0.1,0,1,NULL,0,1,NULL,0),(29949,314,'SARO Emblem','Bizarrely enough, it seems that Angel Cartel Lieutenant Tolan Akochi has been carrying around a CONCORD dog tag, even going to the trouble of protecting it against the rigors of exposure in space. A database query on the ID number offers a grim explanation as to why, revealing that it belongs to an ex-SARO Commander. Although nothing about him is listed on the CONCORD public network, third party news articles related to his name detail how he once lead an offensive on Serpentis Inquest Headquarters. Initially thought to be a success, later pieces tell the story of what eventually amounted to a large-scale operational failure in the face of unexpected resistance. The final article available outlines a particularly gruesome death suffered by him, his entire family and a swathe of known associates.',2552,0,1,0.1,0,1,NULL,0,1,NULL,0),(29950,314,'Customs Patrol Schedule','Found among the wreckage of Angel Captain Artey Vincks vessel, this innocuous looking data core actually holds a wealth of information about previous Federation Customs patrol routes, now probably a little outdated. The level of detail is staggering: including locations of almost every single Customs vessel in operation across the entire Sinq Laison region. With information like this, a smuggler could pass undetected anywhere they pleased with complete impunity. Attached to the information is a brief note bearing the logo of Serpentis Corporation that reads Fly safe Artey, times change. As ever, I.C.',1192,0,1,0.1,0,1,NULL,0,1,NULL,0),(29951,314,'DisX Stash','Encapsulated in a resilient Mexallon alloy container, this drug stash was clearly intended to survive the explosion of Angel Lieutenant Thora Fabands vessel, most likely so it could be recovered by her Cartel associates. A cursory analysis of the contents reveals them to be a modified version of an X-Instinct variant known as DisX which possesses greatly increased dissociative elements that serve to heighten sensory deprivation. Strangely enough, these drugs are most popular among the Matari tribes that she cheated to make them. They value DisX as a catalyst for self-exploration and spiritual insight.',3217,0,1,0.1,0,1,NULL,0,1,NULL,0),(29952,314,'Rebellion Cache','Locked away inside a secure container, this mass stockpile of small arms has somehow managed not to detonate following the explosion of Angel Lieutenant Orien Hakks vessel. There must be tens of thousands of rifles and pistols here, all of them fully loaded and ready for immediate use. The weapons are supplemented by a deadly assortment of explosives and blunt weapons. Emblazoned on the cover of the container is what appears to be a parachute mechanism and the words Rebel Cache.',1366,0,1000,50,0,1,NULL,0,1,NULL,0),(29953,314,'PDW-09FX Data Shell','This data storage unit must have contained invaluable insights into ongoing Sanshas Nation operations. However, it is encased within a neodymium trigger mechanism which caused it to auto-delete every single file in its database the moment it was exposed to the cold vacuum of space. A design utilizing the atmospheric reactivity of neodymium lies at the cutting edge of technology, requiring a level of ingenuity and craftsmanship well outside a True Slaves capabilities and indeed even beyond that of its former owner, Sanshas Nation Captain Toriiko Aanai. Stranger still, however, is the fact that this shell was also clearly designed to survive the explosion of her ship.',2889,0,1,0.1,0,1,NULL,0,1,NULL,0),(29954,314,'PDW-09FX Tactical Subroutines','This appears to be the logical nexus of the Phantasm-class cruiser once piloted by what was most probably a True Slave. Although heavily damaged following the explosion that freed it from the vessel, there are several semi-functional tactical subroutines still in operation now, seemingly unaware of their disconnection. The circuitry appears to have at one point been integrated into the pilot in some way, forming a frighteningly efficient harmony of mind and machine. Most disconcerting however, is the fact that various aspects of the software technology could only be a few years old. ',2886,0,1,0.1,0,1,NULL,0,1,NULL,0),(29955,314,'Address #298 Audio Fragment','Unmistakably the voice of Sansha Kuvakei, this audio fragment captures a brief glimpse of a low-key speech he made over a century ago. Dating from the height of his fame, Kuvakeis speech is riddled with self-indulgent rhetoric and delusions of grandeur. As the speechs intensity reaches its peak, his final line I am the answer loops repeatedly for a few minutes before the process begins all over again. ',2184,0,1,0.1,0,1,NULL,0,1,NULL,0),(29964,954,'Legion Defensive - Adaptive Augmenter','Capitalizing on the exceptional defensive capabilities of fullerene-based components, this subsystem allows a pilot to augment their Legions armor resistance, dramatically enhancing its survivability in combat. Tiny molecular-level conduits play a crucial role in orchestrating the flow of nano-assemblers beneath the armors surface, guarding the flow of vital repairs against disruptive impact.\n\nSubsystem Skill Bonus: \n5% bonus to all armor resistances per level \n10% bonus to remote armor repair system effectiveness per level',3631,0,1400000,20,300,1,4,0,1,1126,0.07),(29965,954,'Legion Defensive - Nanobot Injector','The advanced Sleeper-based technology in this subsystem is focused on increasing the effectiveness of a vessels armor nanobots. When integrated into the hull of a Legion, it offers a substantial increase in the armor output of any repair modules fitted, whether local or remote. Although the subsystem offers the same end result as other built-in armor repair augmentations, the technology driving it operates in a vastly different way, allowing for easy removal from its host vessel.\n\nSubsystem Skill Bonus: \n10% bonus to armor repairer effectiveness per level',3632,0,1400000,20,300,1,4,0,1,1126,0.07),(29966,954,'Legion Defensive - Augmented Plating','Although this subsystem uses the same armor nano-assemblers as standard empire technology, various optimizations have been made. Taking full advantage of recently discovered Sleeper designs, the use of fullerene-based technology has allowed for the combination of far smaller and more resilient components.\n\nSubsystem Skill Bonus: \n10% bonus to armor hitpoints per level.\n',3633,0,1400000,20,340,1,4,0,1,1126,0.07),(29967,954,'Amarr Defensive Subsystem 4','Defensive Subsystem',3634,0,1400000,20,300,1,4,0,0,NULL,0.07),(29968,954,'Amarr Defensive Subsystem 5','Defensive Subsystem',3635,0,1400000,20,190,1,4,0,0,NULL,0.07),(29969,954,'Tengu Defensive - Adaptive Shielding','Based on the same advanced technology employed by Sleeper drones to harden their armor plating, these tiny nano-assemblers have been reconfigured to improve a shields resistance to damage. The influx of superior construction materials and the modularity of Sleeper components have made even this drastic redesign into a fairly simple process.\n\nSubsystem Skill Bonus: \n5% bonus to all shield resistances per level\n10% bonus to shield transporter effectiveness per level\n',3606,0,1400000,20,420,1,1,0,1,1127,0.07),(29970,954,'Tengu Defensive - Amplification Node','When confronted with the challenge of adapting Sleeper designs to produce shield boost amplification systems, Caldari engineers turned to the defense systems used by certain Talocan structures that had also been found in a few ancient ruins. In some rare cases, the shielding systems on Talocan facilities were constructed using a harmony of Sleeper and Talocan designs. The first successful production of a shield boost amplification node drew heavily upon early study of this particular combination.\n\nSubsystem Skill Bonus: \n10% bonus to shield booster effectiveness per level\n',3607,0,1400000,20,440,1,1,0,1,1127,0.07),(29971,954,'Tengu Defensive - Supplemental Screening','Making full use of recent scientific advances afforded by the discovery of ancient technologies, Caldari starship designers have reverse engineered the equipment behind the Sleepers metallofullerene armor plating. Through a complex substitution method, skilled engineers and physicists have been able to supplement a Tengus shields, offering increased survivability for a pilot under heavy fire.\n\nSubsystem Skill Bonus: \n10% bonus to shield hitpoints per level.\n',3608,0,1400000,20,410,1,1,0,1,1127,0.07),(29972,954,'Caldari Defensive Subsystem 4','Defensive Subsystem',3609,0,1400000,20,290,1,1,0,0,NULL,0.07),(29973,954,'Caldari Defensive Subsystem 5','Defensive Subsystem',3610,0,1400000,20,270,1,1,0,0,NULL,0.07),(29974,954,'Loki Defensive - Adaptive Shielding','Based on the same advanced technology employed by Sleeper drones to harden their armor plating, these tiny nano-assemblers have been reconfigured to improve a shields resistance to damage. The influx of superior construction materials and the modularity of Sleeper components have made even this drastic redesign into a fairly simple process.\n\nSubsystem Skill Bonus: \n5% bonus to all shield resistances per level\n10% bonus to shield transporter effectiveness per level\n',3681,0,1400000,20,280,1,2,0,1,1128,0.07),(29975,954,'Loki Defensive - Adaptive Augmenter','Capitalizing on the exceptional defensive capabilities of fullerene-based components, this subsystem allows a pilot to augment their Loki armor resistance, dramatically enhancing its survivability in combat. Tiny molecular-level conduits play a crucial role in orchestrating the flow of nano-assemblers beneath the armors surface, guarding the flow of vital repairs against disruptive impact.\n\nSubsystem Skill Bonus: \n5% bonus to all armor resistances per level.',3682,0,1400000,20,270,1,2,0,1,1128,0.07),(29976,954,'Loki Defensive - Amplification Node','When confronted with the challenge of adapting Sleeper designs to produce shield boost amplification systems, Sebiestor engineers turned to the defense systems used by certain Talocan structures that had also been found amongst a few ancient ruins. In some rare cases, the shielding systems on Talocan facilities were constructed using a harmony of Sleeper and Talocan designs. The first successful production of a shield boost amplification node drew heavily upon early study of this particular combination.\n\nSubsystem Skill Bonus: \n5% reduction in signature radius per level.\n',3683,0,1400000,20,300,1,2,0,1,1128,0.07),(29977,954,'Minmatar Defensive Subsystem 4','Defensive Subsystem',3684,0,1400000,20,200,1,2,0,0,NULL,0.07),(29978,954,'Minmatar Defensive Subsystem 5','Defensive Subsystem',3685,0,1400000,20,200,1,2,0,0,NULL,0.07),(29979,954,'Proteus Defensive - Adaptive Augmenter','Capitalizing on the exceptional defensive capabilities of fullerene-based components, this subsystem allows a pilot to augment their Proteus armor resistance, dramatically enhancing its survivability in combat. Tiny molecular-level conduits play a crucial role in orchestrating the flow of nano-assemblers beneath the armors surface, guarding the flow of vital repairs against disruptive impact.\n\nSubsystem Skill Bonus: \n5% bonus to all armor resistances per level.\n10% bonus to remote armor repair system effectiveness per level\n',3656,0,1400000,20,320,1,8,0,1,1129,0.07),(29980,954,'Proteus Defensive - Nanobot Injector','The advanced Sleeper-based technology in this subsystem is focused on increasing the effectiveness of a vessels armor nanobots. When integrated into the hull of a Proteus, it offers a substantial increase in the armor output of any repair modules fitted, whether local or remote. Although the subsystem offers the same end result as other built-in armor repair augmentations, the technology driving it operates in a vastly different way, allowing for easy removal from its host vessel.\n\nSubsystem Skill Bonus: \n10% bonus to armor repairer effectiveness per level',3657,0,1400000,20,300,1,8,0,1,1129,0.07),(29981,954,'Proteus Defensive - Augmented Plating','This subsystem interfaces with drones only moments before they are launched, coating their armor in a thin and highly-resilient metallofullerene film. Although only a few millimeters thick, it represents over a million layers of hardened alloys and offers a substantial increase in the effective armor amount of a deployed drone.\n\nSubsystem Skill Bonus: \n10% bonus to armor hitpoints per level.\n',3658,0,1400000,20,280,1,8,0,1,1129,0.07),(29982,954,'Gallente Defensive Subsystem 4','Defensive Subsystem',3659,0,1400000,20,220,1,8,0,0,NULL,0.07),(29983,954,'Gallente Defensive Subsystem 5','Defensive Subsystem',3660,0,1400000,20,200,1,8,0,0,NULL,0.07),(29984,963,'Tengu','When we first saw the flock, we were surrounded, caught in a spectacle of stimuli. Brilliant colors, dancing lights, beautiful cacophonies, wafting ambrosia. Those birds surrounded us, each one a different shape, an altered species, a new wonder. I tried to follow a single bird, but my efforts were futile: Transformation is natural to their existence. Imagine it: an undulating mass, a changing mob, all those beasts partaking in wonderful transmogrification.\n\nThese were our augurs, our deliverers, our saviors. Standing amidst the flock, we should have feared their glory, instead, we drew hope. This moment is the first time I understood what it meant to be Caldari: Divinity in the flock, delivery in flux, one being, many changes.\n\n   - Janto Sitarbe, <i>The Legendary Flock</i>\n\nCaldari Strategic Cruiser Skill Bonus: 5% Reduction in the amount of heat damage absorbed by modules per level.\n',3762,221.05,8201000,92000,0,1,1,18400000,1,1140,0.07),(29985,996,'Tengu Blueprint','',42,0,0,0.01,0,1,NULL,0,1,NULL,0),(29986,963,'Legion','Revelation burrows through the material world, devours creations soil, digests the thoughtless void, and produces significance with Gods grace. From emptiness comes meaning, essence from existence, soul from matter.\n\nIs God through the wormhole? Did God grant us this boon, this new technology, a revelation from on high? These weapons are God\'s new prophecy, domain, and blessing. Let us use God\'s grace and prepare New Eden. We are Gods soldiers, weapons, glory. Our people are Gods army. Together, we are the legion.\n\n    -<i>The Heresies of Hinketsu</i>\n\nAmarr Strategic Cruiser Skill Bonus: 5% Reduction in the amount of heat damage absorbed by modules per level.\n',3763,134.43,6815000,118000,0,1,4,18400000,1,1139,0.07),(29987,996,'Legion Blueprint','',1065,0,0,0.01,0,1,NULL,0,1,NULL,0),(29988,963,'Proteus','Freedom is liquid, supple, mellifluous. It surrounds us, engulfs our bodies, drowns our fear. We plumb freedoms depths and consume the nourishment within. From these waters, we are born, when we die, we shall return to those waters.\n\nOut there, among the stars, are the waters, freedom incarnate. That dark, endless void is our destiny, our path, our goal. We must not fear it, nor should we control it. Rather, we should embrace it, trust it, love it. Its ever-changing face, its protean existence, is our very essence. We are those stars, the void, the awesome waters of space: ancient, forever, free.\n\n    - Jinsente Parmen, <i>The Gallente in New Eden</i>\n\nGallente Strategic Cruiser Skill Bonus: 5% Reduction in the amount of heat damage absorbed by modules per level.\n',3765,140.15,5341000,115000,0,1,8,18400000,1,1141,0.07),(29989,996,'Proteus Blueprint','',62,0,0,0.01,0,1,NULL,0,1,NULL,0),(29990,963,'Loki','For many Minmatar, the high mountains of Matar hold wonders unknown to the rest of New Eden: hidden glens, beautiful creatures, buried customs. Not surprisingly, the Krusual tribe lay claim to these mountaiins, their home for generations and base to their machinations.\n\nKrusual elders whisper ancient tales among their huddled tribes, describing the glory of heroes past and enigmatic prophecies of old. On the darkest day, at the most hopeless moments, an elder may speak of <i>loki</i>, in reverent tones and excited hushes. In the ancient tongue, the <i>loki</i> are the crux of Krusual thought. There is no direct translation for this word, in fact, <i>loki</i> translates differently among the elders. It can mean hidden wonder or secret passage, changing mask or unseen dagger. Regardless of its context, <i>loki</i> has one meaning common to all its tales across all the elders: hope.\n\nMinmatar Strategic Cruiser Skill Bonus: 5% Reduction in the amount of heat damage absorbed by modules per level.\n',3764,123.03,6540000,80000,0,1,2,18400000,1,1142,0.07),(29991,996,'Loki Blueprint','',47,0,0,0.01,0,1,NULL,0,1,NULL,0),(29992,964,'Optimized Nano-engines','Forming the beating heart of the Sleepers automated drones, these tiny engines count in the billions. When fully intact, they deliver levels of power efficiency unrivalled by current technology. Unfortunately, whenever a Sleeper drone is destroyed, these engines are the first to go with them, making it difficult to emulate their functionality without the addition of other materials.\n\nTo recreate a functional nanoengine housing, PPD fullerene fibers are combined with metallofullerenes and fullerene fiber conduits to rebuild the basic structures that once housed them. After that, the fused nanomechanical engines are connected to one another, forming a composite whole. \n\nAlthough mechanical engineers have theorized about this construction method for many decades, the process was always held back by a lack of fullerene material. It is said that only hours after the discovery of fullerite clouds in wormhole space, the empires used significant amounts of their fullerene stockpiles to produce these engines. The reasoning behind this is simply the staggering breadth of potential applications these engines have. When it comes to engineering, there isnt much they cant do.',3720,0,1,10,0,1,NULL,400000,1,1147,0),(29993,965,'Optimized Nano-Engines Blueprint','',96,0,0,1,0,1,NULL,10000000,1,1191,0),(29994,964,'Warfare Computation Core','Warfare computation cores begin as basic microprocessors that handle the flow of data between various combat analyzers, prioritizing vital information and calculations. The cores are first built around salvaged Sleeper warfare processors which are then further enhanced by the integration of fullerene polymers and other Sleeper technology. The addition of emergent combat analyzers expands the functionality to include more abstract combat calculations, such as comparative analyses of fleets and predictive IFF identifications.\n\nWhen encased in thermophased metallofullerene plating, the cores can be embedded directly into the ships hull. This allows for a far more efficient production method of Tech III vessels, enabling any subsystem variation to integrate into a hull without the need for further redesign in the combat electronics systems. ',3719,0,1,10,0,1,NULL,400000,1,1147,0),(29995,965,'Warfare Computation Core Blueprint','',96,0,0,1,0,1,NULL,10000000,1,1191,0),(29996,964,'Emergent Neurovisual Interface','As a capsuleer, few things are more important in space flight than the ability to instantly gauge ones surroundings and make decisions accordingly. For this reason, capsules inside starships make frequent use of neurovisual reproductions, emulations that recreate external stimuli using the most low-latency processor available  the human brain. This process relies on digital relays from camera drones and monitoring systems embedded into the hull. After capturing the data, they then feed it directly into the brain, at which point the external surrounds are recreated almost instantaneously. Functions familiar to any capsuleer such as the overview, tactical overlay and hostile threat indicators are just a few examples of the devices capabilities.\n\nAlthough NVI technology has been around since the inception of the capsule, the addition of salvaged Sleeper drone components and the now widely available fullerene polymers has carried the functionality forward into the new Tech III paradigm. Even before the first Strategic Cruiser was built, engineers hypothesized about potential issues with an NVI trying to communicate with an almost limitless combination of subsystems. Fortunately, the solution to the problem came wrapped up in the same technology that moved Tech III vessels from the world of scientific theory into reality.',3716,0,1,20,0,1,NULL,400000,1,1147,0),(29997,965,'Emergent Neuroptical Interface Blueprint','',96,0,0,1,0,1,NULL,10000000,1,1191,0),(29998,967,'Neuroprotectant Injector Array','Tech III Component used in the manufacture of advanced hulls and subsystems. ',1186,0,1,5,0,1,NULL,0,0,NULL,0),(29999,410,'Propulsion 1 Blueprint','',96,0,0,1,0,1,NULL,5000000,0,NULL,0),(30000,967,'Temporal Recalibration Unit','Tech III Component used in the manufacture of advanced hulls and subsystems. ',1186,0,1,5,0,1,NULL,0,0,NULL,0),(30001,410,'Temporal Recalibration Unit Blueprint','',96,0,0,1,0,1,NULL,5000000,0,NULL,0),(30002,964,'Fullerene Intercalated Sheets','The manufacture of this component requires the rarest and most valuable technology salvageable from Sleeper drones. These sheets represent some of the most advanced composite materials known to New Eden. When other, more valuable devices are embedded into the structure at the molecular level, the sheets performance enhances tremendously. The end result is a component with an almost endless number of applications in starship design.\n\nUltra-resilient armor plating, defensive nanoassemblers, electronics housing, and even the molecular-level circuitry itself are only a few of the near-countless roles that fullerene intercalated sheets can perform. Although unrivalled in their modularity, the cost of construction remains a barrier on supply, consequently, they remain a component to be used only when absolutely necessary. \n\nScientists and engineers alike claim that a steadier supply of these rare Sleeper pieces would instantly advance starship design ten years. Other experts have made even more interesting claims, stating that the staggering utility of the components suggests a level of technological advancement sufficient for capsule production.',3718,0,1,5,0,1,NULL,400000,1,1147,0),(30003,965,'Fullerene Intercalated Sheets Blueprint','',96,0,0,1,0,1,NULL,10000000,1,1191,0),(30004,884,'Neurovisual Output Analyzer','Tech III Component used in the manufacture of advanced electronic subsystems. ',3716,0,1,5,0,1,NULL,0,1,NULL,0),(30005,410,'Neurovisual Output Analyzer Blueprint','',96,0,0,1,0,1,NULL,5000000,0,NULL,0),(30006,884,'Reconfigured Subspace Calibrator','Tech III Component used in the manufacture of advanced electronic subsystems. ',3716,0,1,5,0,1,NULL,0,1,NULL,0),(30007,410,'Reconfigured Subspace Calibrator Blueprint','',96,0,0,1,0,1,NULL,5000000,0,NULL,0),(30008,964,'Reinforced Metallofullerene Alloys','These ultra-hard alloys are initially created from lanthanum metallofullerenes and heuristic selfassemblers, a combination that makes for an incredibly resilient base material. From there, fulleroferrocene and graphene nanoribbons are integrated into the metals, forming alloys that have unprecedented levels of structural strength. Although they have many uses in the manufacture of armor plating, the distinguishing feature of the alloys is the level of modularity they allow in starship design. A hull section comprised of metallofullerene alloys is able to accommodate a virtually endless array of subsystems around it, no matter how different their shape is.',3721,0,1,10,0,1,NULL,400000,1,1147,0),(30009,965,'Reinforced Metallofullerene Alloys Blueprint','',96,0,0,1,0,1,NULL,10000000,1,1191,0),(30010,884,'Reinforced Metallofullerene Alloys','Tech III Component used in the manufacture of advanced defensive subsystems. ',3720,0,1,5,0,1,NULL,0,1,NULL,0),(30011,410,'Reinforced Metallofullerene Alloys Blueprint','',96,0,0,1,0,1,NULL,5000000,0,NULL,0),(30013,479,'Core Scanner Probe I','This is the first of a new generation of multi-mode scanning probes. Designed to provide an all-in-one reconfigurable scanning package, this compact tool meets the needs of the core scanning market in a single, flexible product.\n\nHowever, size limitations mean that this probe does not include the advanced circuitry needed to scan down ships, drones and structures.',1723,1,1,0.1,0,1,NULL,4236,1,120,0.07),(30014,486,'Core Scanner Probe I Blueprint','',1007,0,0,0.01,0,1,NULL,5000000,1,320,0),(30015,405,'Hardpoint Modifier','',NULL,0,0,0,0,1,NULL,0,0,NULL,0),(30016,967,'Nozzle Reinforcements','A strange piece of equipment recovered from a Sleeper drone. ',3732,0,0,0.01,0,1,NULL,0,0,NULL,0),(30017,967,'Thruster Mounts','A strange piece of equipment recovered from a Sleeper drone. ',3732,0,0,0.01,0,1,NULL,0,0,NULL,0),(30018,966,'Fused Nanomechanical Engines','The beating heart of the Sleeper\'s automated drones, these tiny engines count in the billions. When fully intact, they deliver levels of power efficiency unrivaled by current technology. Unfortunately, whenever a Sleeper drone goes down, these engines are the first to go with them, making it difficult to emulate their functionality without the addition of other components.',3726,0,0,0.01,0,1,NULL,0,1,1148,0),(30019,966,'Powdered C-540 Graphite','This white, dusty substance was extracted from the center of high impact craters in the Sleeper drone\'s armor. When mixed with other materials it forms a stiff resin that can either be used to hold various pieces of hull sheets together or to coat them for additional protection against radiation and heat.',3727,0,0,0.01,0,1,NULL,0,1,1148,0),(30020,967,'Thermoelectric Power Core','Since it has no moving parts, this solid-state power core can operate for extremely long amounts of time without the need for maintenance, offering an unlimited amount of energy regeneration in the process. Although the resilience of the Sleeper design is drastically different from other technology, the same fundamental principles have been used in capacitor production for centuries. ',3727,0,0,0.01,0,1,NULL,0,0,NULL,0),(30021,966,'Modified Fluid Router','The backbones of communication across New Eden, fluid routers play a crucial role in all faster-than-light (FTL) transmissions. The Sleeper drones have been equipped with much the same communications equipment as contemporary starships. The only major difference observable with the Sleeper Fluid Routers is in the way transmissions are translated. The drones must be talking in their own proprietary language.',3723,0,0,0.01,0,1,NULL,0,1,1148,0),(30022,966,'Heuristic Selfassemblers','These advanced nanoassemblers appear to be able to change their molecular structure on the fly, adapting to incoming damage. Without any understanding of how to properly operate them however, they only offer their default formations. Even in such a state, they add a significant amount of resilience to armor plating.',3725,0,0,0.01,0,1,NULL,0,1,1148,0),(30023,967,'Melted Nanoribbons','Most of these tiny circuits have fused together from the heat and force of the Sleeper drone\'s explosion. The detonation of the drone\'s power core must have been immense to have had such an effect on these resilient nanostructures. ',3723,0,0,0.01,0,1,NULL,0,0,NULL,0),(30024,966,'Cartesian Temporal Coordinator','At first glance this coordinator appears to be a common enough piece of equipment, albeit an odd one to be found inside a drone. Designed to plot various points in time across a potentially infinite period, these devices are often used for scientific calculations.\n\nFor some unknown reason, this particular coordinator is configured to synchronize its processing speed in time with the distance travelled between two points. What purpose this serves remains a mystery, but the objects basic functionality can be reconfigured. With the addition of a few other components, it would allow electronics systems to more easily withstand the interference from subspace distortion. ',3722,0,0,0.01,0,1,NULL,0,1,1148,0),(30025,967,'Thermophased Metallofullerenes','A strange piece of equipment recovered from a Sleeper drone. ',3728,0,0,0.01,0,1,NULL,0,0,NULL,0),(30027,967,'Isogen V','Morphite is a highly unorthodox mineral that can only be found in the hard-to-get Mercoxit ore. It is hard to use Morphite as a basic building material, but when it is joined with existing structures it can enhance the performance and durability manifold. This astounding quality makes this the material responsible for ushering in a new age in technology breakthroughs. ',2103,0,0,0.01,0,1,NULL,0,0,NULL,0),(30028,479,'Combat Scanner Probe I','Specifically tailored for the needs of the combat community, this all-in-one package delivers baseline performance for the discerning hunter-killer. Paired with a specialist launcher and analysis suite, the advanced electronics of this probe allows the rapid location of target vessels.',1722,1,1,1,0,1,NULL,15318,1,120,0.07),(30029,486,'Combat Scanner Probe I Blueprint','',1007,0,0,0.01,0,1,NULL,5000000,1,320,0),(30030,479,'Deep Space Scanner Probe I','A more advanced variant of the latest-generation multi-mode probes, intended for deep-space explorers. The expanded sensor suite and instrument package on this model allows greatly increased volumes to be surveyed, at the expense of limiting close-range functionality.',1722,1,1,1,0,1,NULL,17670,1,120,0.07),(30031,486,'Deep Space Scanner Probe I Blueprint','',1007,0,0,0.01,0,1,NULL,5000000,1,320,0),(30033,405,'Slot Modifier','',NULL,0,0,0,0,1,NULL,0,0,NULL,0),(30036,955,'Legion Electronics - Energy Parasitic Complex','During some of the first conflicts with them, Amarr engineers noticed a remarkable feature in Sleeper drone technology: the ability of drones to transfer power between one another without the need for specialized equipment. This technology seemed to be innate to every drone in some capacity, and while the engineers could not reproduce this system in modern space vessels, they were able to adapt the technology into modular Tech III designs. The energy parasitic complex turns the Sleeper tech on its head, changing the energy transfer from a symbiotic function to a vampiric one by providing a boost to energy neutralizer and energy vampire equipment.\n\nSubsystem Skill Bonus: \n10% bonus to energy vampire and energy neutralizer transfer amount per level\n',3626,0,1200000,5,0,1,4,0,1,1118,0.06),(30037,973,'Legion Electronics - Energy Parasitic Complex Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30038,955,'Legion Electronics - Tactical Targeting Network','Many engineers have attempted to reproduce the precision of the Sleeper drones\' weapon systems, but with very few results. The closest reproduction achieved thus far is this targeting network, a complex system of neurovisual interlays, automated trigger response units, and microscanning resolution ordinances. The combination of these processes produces a bonus to scan resolution, easing the targeting of enemies in space, as well as to signature radii, making the ship itself more difficult to target.\n\nSubsystem Skill Bonus: \n15% bonus to scan resolution per level\n',3627,0,1200000,5,0,1,4,0,1,1118,0.06),(30039,973,'Legion Electronics - Tactical Targeting Network Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30040,955,'Legion Electronics - Dissolution Sequencer','This subsystems employs a nano-electromechanical dispersion field to strengthen a vessel\'s sensor systems. Made from billions of advanced molecular-level circuits, the subsystem offers improved protection against hostile ECM.\n\nSubsystem Skill Bonus: 15% bonus to ship sensor strength, 5% bonus to max targeting range per level.\n',3628,0,1200000,5,0,1,4,0,1,1118,0.06),(30041,973,'Legion Electronics - Dissolution Sequencer Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30042,955,'Amarr Electronic Subsystem 4','Electronic Subsystem',3629,0,1200000,5,0,1,4,0,0,NULL,0.06),(30043,973,'Amarr Electronic Subsystem 4 Blueprint','',194,0,0,0.01,0,1,NULL,0,0,NULL,0),(30044,955,'Amarr Electronic Subsystem 5','Electronic Subsystem',3630,0,1200000,5,0,1,4,0,0,NULL,0.06),(30045,973,'Amarr Electronic Subsystem 5 Blueprint','',194,0,0,0.01,0,1,NULL,0,0,NULL,0),(30046,955,'Tengu Electronics - Obfuscation Manifold','This subsystem operates using the same fundamental mechanics as the signal distortion amplifier. When installed into a Tech III vessel, the fullerene-based components resonate with any ECM modules fitted , bolstering their disruptive strength.\n\nSubsystem Skill Bonus: \n10% bonus to ECM target jammer optimal range per level.\n',3601,0,1200000,5,0,1,1,0,1,1119,0.06),(30047,973,'Tengu Electronics - Obfuscation Manifold Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30048,955,'Tengu Electronics - CPU Efficiency Gate','New technologies have resulted in a noticeable increase in CPU efficiency, as better nanotech enables further miniaturization of circuits, the result of which is a marked decrease in system bottlenecking. This CPU efficiency gate capitalizes on that technology, offering a pilot greater CPU output.\n\nSubsystem Skill Bonus: \n5% bonus to CPU per level.\n',3603,0,1200000,5,0,1,1,0,1,1119,0.06),(30049,973,'Tengu Electronics - CPU Efficiency Gate Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30050,955,'Tengu Electronics - Dissolution Sequencer','This subsystems employs a nano-electromechanical dispersion field to strengthen a vessel\'s sensor systems. Made from billions of advanced molecular-level circuits, the subsystem offers improved protection against hostile ECM.\n\nSubsystem Skill Bonus: 15% bonus to ship sensor strength, 5% bonus to targeting range per level.\n',3602,0,1200000,5,0,1,1,0,1,1119,0.06),(30051,973,'Tengu Electronics - Dissolution Sequencer Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30052,955,'Caldari Electronic Subsystem 4','Electronic Subsystem',3604,0,1200000,5,0,1,1,0,0,NULL,0.06),(30053,973,'Caldari Electronic Subsystem 4 Blueprint','',194,0,0,0.01,0,1,NULL,0,0,NULL,0),(30054,955,'Caldari Electronic Subsystem 5','Electronic Subsystem',3605,0,1200000,5,0,1,1,0,0,NULL,0.06),(30055,973,'Caldari Electronic Subsystem 5 Blueprint','',194,0,0,0.01,0,1,NULL,0,0,NULL,0),(30056,955,'Proteus Electronics - Friction Extension Processor','The friction extension processor capitalizes on recent advances made in fullerene-based component development. The system works on a similar design to interdiction spheres by expanding a ship\'s warp interdiction range. The technology behind it has existed in theory for some years, dating back to when engineers first began development of Heavy Interdictors. They noticed an increased efficiency in the electronic disruption of fullerene molecules when combined with the static disruption energies of the spheres. When more fullerene-based materials suddenly became available, it was only a matter of further testing before theory became reality.\n\nSubsystem Skill Bonus: \n10% bonus to warp disruptor and warp scrambler range per level.\n',3651,0,1200000,5,0,1,8,0,1,1120,0.06),(30057,973,'Proteus Electronics - Friction Extension Processor Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30058,955,'Proteus Electronics - CPU Efficiency Gate','New technologies have resulted in a noticeable increase in CPU efficiency, as better nanotech enables further miniaturization of circuits, the result of which is a marked decrease in system bottlenecking. This CPU efficiency gate capitalizes on that technology, offering a pilot greater CPU output.\n\nSubsystem Skill Bonus: \n5% bonus to CPU per level',3653,0,1200000,5,0,1,8,0,1,1120,0.06),(30059,973,'Proteus Electronics - CPU Efficiency Gate Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30060,955,'Proteus Electronics - Dissolution Sequencer','This subsystems employs a nano-electromechanical dispersion field to strengthen a vessel\'s sensor systems. Made from billions of advanced molecular-level circuits, the subsystem offers improved protection against hostile ECM.\n\nSubsystem Skill Bonus: 15% bonus to ship sensor strength, 5% bonus to max targeting range per level.\n',3652,0,1200000,5,0,1,8,0,1,1120,0.06),(30061,973,'Proteus Electronics - Dissolution Sequencer Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30062,955,'Gallente Electronic Subsystem 4','Electronic Subsystem',3654,0,1200000,5,0,1,8,0,0,NULL,0.06),(30063,973,'Gallente Electronic Subsystem 4 Blueprint','',194,0,0,0.01,0,1,NULL,0,0,NULL,0),(30064,955,'Gallente Electronic Subsystem 5','Electronic Subsystem',3655,0,1200000,5,0,1,8,0,0,NULL,0.06),(30065,973,'Gallente Electronic Subsystem 5 Blueprint','',194,0,0,0.01,0,1,NULL,0,0,NULL,0),(30066,955,'Loki Electronics - Immobility Drivers','Even millennia old, the technology employed by Sleeper drones is far from lacking. This is particularly true in the field of interdiction technology, where their capabilities often exceed contemporary systems. Consequently, this aspect of their fearsome arsenal has been the focus of much study and in some rare cases, the starting point for scientific breakthroughs. Minmatar researchers studied the long-range webification systems of the Sleeper drones from the moment they were discovered, quickly reverse engineering a subsystem for their Loki that could replicate the Sleepers own offensive modules. The end result is a noticeable amplification of a stasis webifiers effective range.\n\nSubsystem Skill Bonus: \n30% bonus to stasis webifier range per level\n',3676,0,1200000,5,0,1,2,0,1,1121,0.06),(30067,973,'Loki Electronics - Immobility Drivers Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30068,955,'Loki Electronics - Tactical Targeting Network','Many engineers have attempted to reproduce the precision of the Sleeper drones\' weapon systems, but with very few results. The closest reproduction achieved thus far is this targeting network, a complex system of neurovisual interlays, automated trigger response units, and microscanning resolution ordinances. The combination of these processes produces a bonus to scan resolution, easing the targeting of enemies in space, as well as to signature radii, making the ship itself more difficult to target.\n\nSubsystem Skill Bonus: \n15% bonus to scan resolution per level\n',3677,0,1200000,5,0,1,2,0,1,1121,0.06),(30069,973,'Loki Electronics - Tactical Targeting Network Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30070,955,'Loki Electronics - Dissolution Sequencer','This subsystems employs a nano-electromechanical dispersion field to strengthen a vessel\'s sensor systems. Made from billions of advanced molecular-level circuits, the subsystem offers improved protection against hostile ECM.\n\nSubsystem Skill Bonus: 15% bonus to ship sensor strength, 5% bonus to max targeting range per level.\n',3678,0,1200000,5,0,1,2,0,1,1121,0.06),(30071,973,'Loki Electronics - Dissolution Sequencer Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30072,955,'Minmatar Electronic Subsystem 4','Electronic Subsystem',3679,0,1200000,5,0,1,2,0,0,NULL,0.06),(30073,973,'Minmatar Electronic Subsystem 4 Blueprint','',194,0,0,0.01,0,1,NULL,0,0,NULL,0),(30074,955,'Minmatar Electronic Subsystem 5','Electronic Subsystem',3680,0,1200000,5,0,1,2,0,0,NULL,0.06),(30075,973,'Minmatar Electronic Subsystem 5 Blueprint','',194,0,0,0.01,0,1,NULL,0,0,NULL,0),(30076,957,'Legion Propulsion - Chassis Optimization','This subsystem exploits the latest technological advances afforded by discovery of the ancient Sleeper races own designs. Optimizations made to the chassis allow for vast improvements to be made to a Legions base velocity. Although the various layout optimizations sacrifice other options for propulsion customization, the flow-on effects from an increase in base velocity make it an attractive upgrade for those whose Tech III vessels are in need of an overall speed increase.\n\nSubsystem Skill Bonus: \n5% bonus to max velocity per level.',3646,0,1400000,5,0,1,4,0,1,1134,0.07),(30077,973,'Legion Propulsion - Chassis Optimization Blueprint','',96,0,0,0.01,0,1,NULL,0,1,NULL,0),(30078,957,'Legion Propulsion - Fuel Catalyst','The ancient Sleeper race was known to have mastered various sustainable energy technologies including thermoelectric systems, which they usually built directly into a vessels hull. Capsuleer reverse-engineers took little time to adapt salvaged versions of these Sleeper energy systems into their own modular Tech III vessel pieces.\n\nThanks to widespread demand in the Amarrian transport industry, fuel catalyst systems were one of the first to be developed for the Empire. Making full use of locally generated thermoelectric power, they are able to supplement the fuel needs of an afterburner. This process makes it possible to inject fuel in larger amounts for the same capacitor cost, offering pilots a significant boost to the velocity increase from afterburners. \n\nSubsystem Skill Bonus: \n10% bonus to afterburner speed per level.',3647,0,1400000,5,0,1,4,0,1,1134,0.07),(30079,973,'Legion Propulsion - Fuel Catalyst Blueprint','',96,0,0,0.01,0,1,NULL,0,1,NULL,0),(30080,957,'Legion Propulsion - Wake Limiter','This subsystem limits the wake left behind by a starships microwarpdrive, allowing a pilot to maintain a lowered signature radius while still moving at high speed. The underlying design is based on the same technology used by smaller Sleeper drones and empire-produced Interceptors. Although the engineering processes behind wake limiters have existed for quite some time in the empires, their application in modular subsystems has only become a possibility after fullerene polymers became more widely available.\n\nSubsystem Skill Bonus: 5% reduction in microwarpdrive signature radius penalty per level.\n',3648,0,1400000,5,0,1,4,0,1,1134,0.07),(30081,973,'Legion Propulsion - Wake Limiter Blueprint','',96,0,0,0.01,0,1,NULL,0,1,NULL,0),(30082,957,'Amarr Propulsion Subsystem 4','Propulsion Subsystem',3649,0,1400000,5,0,1,4,0,0,NULL,0.07),(30083,973,'Amarr Propulsion Subsystem 4 Blueprint','',96,0,0,0.01,0,1,NULL,0,0,NULL,0),(30084,957,'Amarr Propulsion Subsystem 5','Propulsion Subsystem',3650,0,1400000,5,0,1,4,0,0,NULL,0.07),(30085,973,'Amarr Propulsion Subsystem 5 Blueprint','',96,0,0,0.01,0,1,NULL,0,0,NULL,0),(30086,957,'Tengu Propulsion - Intercalated Nanofibers','Constructed from hard yet lightweight fullerene polymers, these intercalated fibers boost the agility of a starship without compromising its structural resilience. Even though basic nanofibers have existed for hundreds of years, the integration of various Sleeper-based salvage and other polymers takes the technology to a completely new level of modularity. This has allowed the same centuries-old technology to be ported over to the new Tech III paradigm.\n\nSubsystem Skill Bonus: \n5% increased agility per level.\n',3621,0,1400000,5,0,1,1,0,1,1135,0.07),(30087,973,'Tengu Propulsion - Intercalated Nanofibers Blueprint','',96,0,0,0.01,0,1,NULL,0,1,NULL,0),(30088,957,'Tengu Propulsion - Gravitational Capacitor','This subsystem lowers the capacitor cost of warping and increases actual warp speed. With the influx of fullerene-based polymers and the discovery of Sleeper drone technology, the same fundamental principles once only sparingly employed in advance scout vessels such as Covert Ops and Interceptors could be re-applied to modular Tech III vessels. The Caldari are said to have been the first empire to benefit from reverse-engineering attempts aimed at producing these subsystems, something which the Gallente Federations own scientists flatly deny.\n\nSubsystem Skill Bonus: \n15% bonus to warp speed per level\n15% reduction in capacitor need when initiating warp per level\n',3622,0,1400000,5,0,1,1,0,1,1135,0.07),(30089,973,'Tengu Propulsion - Gravitational Capacitor Blueprint','',96,0,0,0.01,0,1,NULL,0,1,NULL,0),(30090,957,'Tengu Propulsion - Fuel Catalyst ','The ancient Sleeper race was known to have mastered various sustainable energy technologies including thermoelectric systems, which they usually built directly into a vessels hull. Capsuleer reverse-engineers took little time to adapt salvaged versions of these Sleeper energy systems into their own modular Tech III vessel pieces.\n\nThanks to widespread demand in the Caldari transport industry, fuel catalyst systems were one of the first to be developed. Making full use of locally generated thermoelectric power, they are able to supplement the fuel needs of an afterburner. This process makes it possible to inject fuel in larger amounts for the same capacitor cost, offering pilots a significant boost to the velocity increase from afterburners.\n\nSubsystem Skill Bonus: \n10% bonus to afterburner speed per level.\n',3623,0,1400000,5,0,1,1,0,1,1135,0.07),(30091,973,'Tengu Propulsion - Fuel Catalyst Blueprint','',96,0,0,0.01,0,1,NULL,0,1,NULL,0),(30092,957,'Caldari Propulsion Subsystem 4','Propulsion Subsystem',3624,0,1400000,5,0,1,1,0,0,NULL,0.07),(30093,973,'Caldari Propulsion Subsystem 4 Blueprint','',96,0,0,0.01,0,1,NULL,0,0,NULL,0),(30094,957,'Caldari Propulsion Subsystem 5','Propulsion Subsystem',3625,0,1400000,5,0,1,1,0,0,NULL,0.07),(30095,973,'Caldari Propulsion Subsystem 5 Blueprint','',96,0,0,0.01,0,1,NULL,0,0,NULL,0),(30096,957,'Proteus Propulsion - Wake Limiter','This subsystem limits the wake left behind by a starships microwarpdrive, allowing a pilot to maintain a lowered signature radius while still moving at high speed. The underlying design is based on the same technology used by smaller Sleeper drones and empire-produced Interceptors. Although the engineering processes behind wake limiters have existed for quite some time in the empires, their application in modular subsystems has only become a possibility after fullerene polymers became more widely available.\n\nSubsystem Skill Bonus: 5% reduction in microwarpdrive signature radius penalty per level.',3671,0,1400000,5,0,1,8,0,1,1136,0.07),(30097,973,'Proteus Propulsion - Wake Limiter Blueprint','',96,0,0,0.01,0,1,NULL,0,1,NULL,0),(30098,957,'Proteus Propulsion - Localized Injectors','This subsystem uses molecular-level nanotubes to increase the combustive efficiency of afterburners. Fuel is injected locally in a far more effective and controllable manner, thereby reducing the draw on the capacitor system. Although the decrease in capacitor use is relatively modest, even minute enhancements at this level can mean the difference between victory and defeat.\n\nSubsystem Skill Bonus: \n15% reduction in afterburner and microwarpdrive capacitor consumption per level\n',3672,0,1400000,5,0,1,8,0,1,1136,0.07),(30099,973,'Proteus Propulsion - Localized Injectors Blueprint','',96,0,0,0.01,0,1,NULL,0,1,NULL,0),(30100,957,'Proteus Propulsion - Gravitational Capacitor','This subsystem lowers the capacitor cost of warping and increases actual warp speed. With the influx of fullerene-based polymers and the discovery of Sleeper drone technology, the same fundamental principles once only sparingly employed in advance scout vessels such as Covert Ops and Interceptors could be re-applied to modular Tech III vessels. Although the Caldari claim to have been the first to successfully reverse-engineer these subsystems, the Federation argues that they were the first to deliver the breakthrough. Despite the contention, neither party seems keen to publicize the research data necessary to back their respective claims.\n\nSubsystem Skill Bonus: \n15% bonus to warp speed per level\n15% reduction in capacitor need when initiating warp per level\n',3673,0,1400000,5,0,1,8,0,1,1136,0.07),(30101,973,'Proteus Propulsion - Gravitational Capacitor Blueprint','',96,0,0,0.01,0,1,NULL,0,1,NULL,0),(30102,957,'Gallente Propulsion Subsystem 4','Propulsion Subsystem',3674,0,1400000,5,0,1,8,0,0,NULL,0.07),(30103,973,'Gallente Propulsion Subsystem 4 Blueprint','',96,0,0,0.01,0,1,NULL,0,0,NULL,0),(30104,957,'Gallente Propulsion Subsystem 5','Propulsion Subsystem',3675,0,1400000,5,0,1,8,0,0,NULL,0.07),(30105,973,'Gallente Propulsion Subsystem 5 Blueprint','',96,0,0,0.01,0,1,NULL,0,0,NULL,0),(30106,957,'Loki Propulsion - Chassis Optimization ','This subsystem exploits the latest technological advances afforded by discovery of the ancient Sleeper races own designs. Optimizations made to the chassis allow for vast improvements to be made to a Lokis base velocity. Although the various layout optimizations sacrifice other options for propulsion customization, the flow-on effects from an increase in base velocity make it an attractive upgrade for those whose Tech III vessels are in need of an overall speed increase.\n\nSubsystem Skill Bonus: \n5% bonus to max velocity per level.\n',3696,0,1400000,5,0,1,2,0,1,1137,0.07),(30107,973,'Loki Propulsion - Chassis Optimization Blueprint','',96,0,0,0.01,0,1,NULL,0,1,NULL,0),(30108,957,'Loki Propulsion - Intercalated Nanofibers','Constructed from hard yet lightweight fullerene polymers, these intercalated fibers boost the agility of a starship without compromising its structural resilience. Even though basic nanofibers have existed for hundreds of years, the integration of various Sleeper-based salvage and other polymers takes the technology to a completely new level of modularity. This has allowed the same centuries-old technology to be ported over to the new Tech III paradigm.\n\nSubsystem Skill Bonus: \n5% increased agility per level.\n',3697,0,1400000,5,0,1,2,0,1,1137,0.07),(30109,973,'Loki Propulsion - Intercalated Nanofibers Blueprint','',96,0,0,0.01,0,1,NULL,0,1,NULL,0),(30110,957,'Loki Propulsion - Fuel Catalyst','The ancient Sleeper race was known to have mastered various sustainable energy technologies including thermoelectric systems, which they usually built directly into a vessels hull. Capsuleer reverse-engineers took little time to adapt salvaged versions of these Sleeper energy systems into their own modular Tech III vessel pieces.\n\nThanks to widespread demand in many Minmatar industries, fuel catalyst systems were one of the first to be developed. Making full use of locally generated thermoelectric power, they are able to partially meet the fuel needs of an afterburner. This process makes it possible to inject fuel in larger amounts for the same capacitor cost, offering pilots a significant boost to the velocity increase from afterburners. \n\nSubsystem Skill Bonus: \n10% bonus to afterburner speed per level.\n',3698,0,1400000,5,0,1,2,0,1,1137,0.07),(30111,973,'Loki Propulsion - Fuel Catalyst Blueprint','',96,0,0,0.01,0,1,NULL,0,1,NULL,0),(30112,957,'Minmatar Propulsion Subsystem 4','Propulsion Subsystem',3699,0,1400000,5,0,1,2,0,0,NULL,0.07),(30113,973,'Minmatar Propulsion Subsystem 4 Blueprint','',96,0,0,0.01,0,1,NULL,0,0,NULL,0),(30114,957,'Minmatar Propulsion Subsystem 5','Propulsion Subsystem',3700,0,1400000,5,0,1,2,0,0,NULL,0.07),(30115,973,'Minmatar Propulsion Subsystem 5 Blueprint','',96,0,0,0.01,0,1,NULL,0,0,NULL,0),(30117,956,'Legion Offensive - Drone Synthesis Projector','Sleeper drones, while completely devoid of modern shielding technology, are nonetheless sturdy, mainly due to their metallofullerene armor plating and hull composition. When drones are docked into this system, the projection system enhances their damage capabilities, both in absorbing and delivering damage, through the creation of a fullerene-based field around the drones.\n\nSubsystem Skill Bonus: \n10% bonus to medium energy turret capacitor use per level\n10% bonus to drone damage per level\n7.5% bonus to drone hitpoints per level',3641,500,800000,5,0,1,4,0,1,1130,0.06),(30118,956,'Legion Offensive - Convergent Beam Focuser','This subsystem focuses on the power source and lens technologies of laser turrets. Using existing Sleeper technology, the laser lens concentrates more effectively on its target, using less power and causing more damage. The installation of the Neurovisual Output Analyzer enhances the target\'s position, making target tracking tighter and more streamlined.\n\nSubsystem Skill Bonus:\n10% bonus to medium energy turret capacitor use per level\n10% bonus to medium energy turret damage per level\n7.5% bonus to medium energy turret tracking speed per level\n',3642,500,800000,5,0,1,4,0,1,1130,0.06),(30119,956,'Legion Offensive - Liquid Crystal Magnifiers','One of the many gems discovered amidst Sleeper technology was the creation of more efficient liquid crystal lenses. Amarr researchers have engineered these lenses to increase a laser\'s focus for longer stretches, both in distance and in timing, allowing a laser to reach farther targets with more efficiency of energy output. Additionally, the fullerene-infused lenses can generate higher temperatures and stronger, more damaging beams and pulses.\n\nSubsystem Skill Bonus: \n10% bonus to medium energy turret capacitor use per level \n10% bonus to medium energy turret damage per level\n10% bonus to medium energy turret optimal range per level\n',3643,500,800000,5,0,1,4,0,1,1130,0.06),(30120,956,'Amarr Offensive Subsystem 4','Offensive Subsystem',3644,500,800000,5,0,1,4,0,0,NULL,0.06),(30121,956,'Amarr Offensive Subsystem 5','Offensive Subsystem',3645,500,800000,5,0,1,4,0,0,NULL,0.06),(30122,956,'Tengu Offensive - Accelerated Ejection Bay','This missile launcher system was formed not from the missile bays of Sleeper drones, but from the direct-fire turrets and hardpoints salvaged from them instead. Adapting the underlying technology behind the drones\' rapid-firing turrets for their own missile systems, Caldari engineers have managed to revolutionize modular launching mechanisms, improving launch speed and kinetic warhead payloads.\n\nSubsystem Skill Bonus: \n5% bonus to kinetic missile damage per level\n7.5% bonus to Heavy, Heavy Assault and Assault missile launcher rate of fire per level\n10% bonus to heavy missile and heavy assault missile velocity per level\n\n',3616,500,800000,5,0,1,1,0,1,1131,0.06),(30123,956,'Tengu Offensive - Obfuscation Manifold','This subsystem operates using the same fundamental mechanics as the signal distortion amplifier. When installed into a Tech III vessel, the fullerene-based components resonate with any ECM modules fitted , bolstering their disruptive strength.\n\nSubsystem Skill Bonus: \n10% bonus to ECM target jammer strength per level\n5% bonus to Heavy, Heavy Assault and Assault Missile Launcher Rate of Fire per level\n',3617,500,800000,5,0,1,1,0,1,1131,0.06),(30124,956,'Tengu Offensive - Magnetic Infusion Basin','This subsystem serves as a specialized storage bin for a ship\'s hybrid ammo. The basin, however, also serves as a cyclotron, infusing the ammo with magnetic energy immediately before it is injected into the turret. The amplified ammo has an increased range and damage potential.\n\nSubsystem Skill Bonus: \n5% bonus to medium hybrid turret damage per level\n20% bonus to medium hybrid turret optimal range per level',3618,500,800000,5,0,1,1,0,1,1131,0.06),(30125,956,'Caldari Offensive Subsystem 4','Offensive Subsystem',3619,500,800000,5,0,1,1,0,0,NULL,0.06),(30126,956,'Caldari Offensive Subsystem 5','Offensive Subsystem',3620,500,800000,5,0,1,1,0,0,NULL,0.06),(30127,956,'Proteus Offensive - Dissonic Encoding Platform','A unique application of fullerene material can be found in this platform, where vibrations from the metallic plating transfer from turret to hybrid charge. Discharged ammo immersed in this dissonic frequency maintains its shape and velocity pattern once launched towards a target. However, upon impact, the ammo undulates in an unstable fashion, transfering the frequency to its target and thereby causing more damage.\n\nSubsystem Skill Bonus: \n10% bonus to medium hybrid turret damage per level\n10% bonus to medium hybrid turret falloff per level\n7.5% bonus to medium hybrid turret tracking per level',3666,500,800000,5,0,1,8,0,1,1132,0.06),(30128,956,'Proteus Offensive - Hybrid Propulsion Armature','This complex armature is composed of fullerene composites and based upon the understood weapons mechanics of salvaged Sleeper drones. Gallente researchers have fused this technology with the emerging theories on magnetic resonance and microwarp capabilities to power the kinetic energy systems of hybrid turrets. With these mechanics in place, the propulsion armature creates an effective distribution module for hybrid charges, bolstering their damage output and their falloff rate.\n\nSubsystem Skill Bonus: \n10% bonus to medium hybrid turret damage per level \n10% bonus to medium hybrid turret falloff per level\n',3667,500,800000,5,0,1,8,0,1,1132,0.06),(30129,956,'Proteus Offensive - Drone Synthesis Projector','Sleeper drones, while completely devoid of modern shielding technology, are nonetheless sturdy, mainly due to their metallofullerene armor plating and hull composition. Most of these technological applications are for capsuleer vessels, but a few rogue Gallente firms have quietly created this bay for use with contemporary drones. When drones are docked into this system, the projection system enhances their damage capabilities, both in absorbing and delivering damage, through the creation of a fullerene-based field around the drones.\n\nSubsystem Skill Bonus: \n5% bonus to medium hybrid turret damage per level \n10% bonus to drone damage per level\n7.5% bonus to drone hitpoints per level\n',3668,500,800000,5,0,1,8,0,1,1132,0.06),(30130,956,'Gallente Offensive Subsystem 4','Offensive Subsystem',3669,500,800000,5,0,1,8,0,0,NULL,0.06),(30131,956,'Gallente Offensive Subsystem 5','Offensive Subsystem',3670,500,800000,5,0,1,8,0,0,NULL,0.06),(30132,956,'Loki Offensive - Turret Concurrence Registry','Increasing the firing rate of projectile weaponry is no easy task, yet the introduction of Sleeper technology has made this job more achievable. This registry is based on the idea of concurrence, where firing mechanisms can recycle energy among multiple turret emissions. This recycled energy is not only sustainable, but more powerful as well, a marvel considering its relatively normal power output (in comparison with other turret systems). Thus, not only are projectile turrets discharged at a higher rate and with more damage potential, but no extra energy is required.\n\nSubsystem Skill Bonus: \n10% bonus to medium projectile turret damage per level \n10% bonus to medium projectile turret optimal range per level\n7.5% bonus to medium projectile turret tracking per level\n',3691,500,800000,5,0,1,2,0,1,1133,0.06),(30133,956,'Loki Offensive - Projectile Scoping Array','Scoping arrays were mostly out of fashion in recent ship design, but Sleeper technology has brought them somewhat back into vogue. Based upon the remarkable flexibility fullerene-based technology, Sleeper-based scoping arrays allowed projectile weaponry to produce longer-ranged accuracy without reducing the weapon\'s rate-of-fire. While a resurgence of scoping arrays is not expected, this subsystem certainly shows its uses in modern warfare.\n\nSubsystem Skill Bonus: \n7.5% bonus to medium projectile turret rate of fire per level\n10% bonus to medium projectile falloff per level.\n',3692,500,800000,5,0,1,2,0,1,1133,0.06),(30134,956,'Loki Offensive - Hardpoint Efficiency Configuration','Adaptation and innovation go hand-in-hand, and this subsystem is a prime example of both ideas. While researching Sleeper drone weapon systems, a group of Minmatar engineers discovered special similarities to the technology behind all Sleeper weapon types. Distilling the underlying mechanic to its essence produced this hardpoint configuration, which enabled projectile weapons and missile launchers to share power sources and energy supplies (most of which were advanced beyond modern standards). This offers a vast increase to the rate of fire of both weapon types. Attempts to merge this technology to other weapon groups have, as yet, proven unsuccessful.\n\nSubsystem Skill Bonus: \n7.5% bonus to medium projectile turret rate of fire per level\n7.5% bonus to missile launcher rate of fire per level\n',3693,500,800000,5,0,1,2,0,1,1133,0.06),(30135,956,'Minmatar Offensive Subsystem 4','Offensive Subsystem',3694,500,800000,5,0,1,2,0,0,NULL,0.06),(30136,956,'Minmatar Offensive Subsystem 5','Offensive Subsystem',3695,500,800000,5,0,1,2,0,0,NULL,0.06),(30139,958,'Tengu Engineering - Power Core Multiplier','Comprised of countless nanomachines that enhance the energy flow from a ships reactor core, this engineering subsystem offers a pilot the option of increasing the power grid of their vessel. Although the empires mastered energy grid upgrades many centuries ago, the adaptation of old designs to the new Tech III paradigm has been a more recent breakthrough.\n\nSubsystem Skill Bonus: \n5% bonus to power output per level.\n',3611,500,1200000,5,0,1,1,0,1,1123,0.06),(30140,973,'Tengu Engineering - Power Core Multiplier Blueprint','',70,0,0,0.01,0,1,NULL,0,1,NULL,0),(30141,958,'Tengu Engineering - Augmented Capacitor Reservoir','Another example of an old technology re-worked to fit the new Tech III paradigm, augmented capacitor subsystems improve upon the size of a vessels capacitor. Designers of Tech III vessels were initially hampered by the problem of how to design a modular ship that could swap out basic engineering upgrades on a per-need basis. This proved particularly true when it came to increasing a vessels capacitor size without the use of batteries. In the end, the provision of fullerene-based polymers allowed for solutions that had only existed in theory up until that point.\n\nSubsystem Skill Bonus: \n5% bonus to capacitor capacity per level.\n',3612,500,1200000,5,0,1,1,0,1,1123,0.06),(30142,973,'Tengu Engineering - Augmented Capacitor Reservoir Blueprint','',70,0,0,0.01,0,1,NULL,0,1,NULL,0),(30143,958,'Tengu Engineering - Capacitor Regeneration Matrix','Using the same technology that can be found inside the ancient Sleeper races guardian drones, this regeneration matrix greatly improves the recharge rate of a Tech III vessels capacitor. Even though empire-based designs have achieved this effect for centuries, the way in which this system works is markedly different.\n\nRather than the usual tweaking of capacitor fluid formulas, this design simply triples the number of nanotubes inside  something not possible until the recent influx of fullerene polymers from which this subsystem is made. This results in a drastic increase in the speed and efficiency of energy flow throughout a ship. The quicker that the surplus power can be redirected back to the core, the more that it can contribute to the overall recharge rate of the capacitor.\n\nSubsystem Skill Bonus: \n5% reduction in capacitor recharge rate per level.\n',3613,500,1200000,5,0,1,1,0,1,1123,0.06),(30144,973,'Tengu Engineering - Capacitor Regeneration Matrix Blueprint','',70,0,0,0.01,0,1,NULL,0,1,NULL,0),(30145,958,'Caldari Engineering Subsystem 4','Engineering Subsystem',3614,500,1200000,5,0,1,1,0,0,NULL,0.06),(30146,973,'Caldari Engineering Subsystem 4 Blueprint','',70,0,0,0.01,0,1,NULL,0,0,NULL,0),(30147,958,'Caldari Engineering Subsystem 5','Engineering Subsystem',3615,500,1200000,5,0,1,1,0,0,NULL,0.06),(30148,973,'Caldari Engineering Subsystem 5 Blueprint','',70,0,0,0.01,0,1,NULL,0,0,NULL,0),(30149,958,'Proteus Engineering - Power Core Multiplier','Comprised of countless nanomachines that enhance the energy flow from a ships reactor core, this engineering subsystem offers a pilot the option of increasing the power grid of their vessel. Although the empires mastered energy grid upgrades many centuries ago, the adaptation of old designs to the new Tech III paradigm has been a more recent breakthrough.\n\nSubsystem Skill Bonus: \n5% bonus to power output per level.\n'