generation Matrix Blueprint','',70,0,0,0.01,0,1,NULL,0,1,NULL,0),(30175,958,'Amarr Engineering Subsystem 4','Engineering Subsystem',3639,500,1200000,5,0,1,4,0,0,NULL,0.06),(30176,973,'Amarr Engineering Subsystem 4 Blueprint','',70,0,0,0.01,0,1,NULL,0,0,NULL,0),(30177,958,'Amarr Engineering Subsystem 5','Engineering Subsystem',3640,500,1200000,5,0,1,4,0,0,NULL,0.06),(30178,973,'Amarr Engineering Subsystem 5 Blueprint','',70,0,0,0.01,0,1,NULL,0,0,NULL,0),(30182,283,'Serpentis Informant','This is a Serpentis officer. Well, ex-officer. He has agreed to turn himself in to authorities and give them information on the Serpentis in exchange for their protection. Maybe he grew a conscience and decided to give up the life of crime. <p>\n\nHowever, it\'s more likely he made someone bigger than him angry, and the only way to save his own skin was to give himself up. Who says there\'s honor among thieves?',2536,0,80,1,0,1,NULL,0,0,NULL,0),(30184,226,'Arena_Amarr','',3513,0,0,0,0,1,NULL,0,0,NULL,0),(30187,971,'Intact Thruster Sections','Even after millennia of exposure to space, these thruster sections show barely any signs of mechanical wear and appear to be completely functional. The modular design of Sleeper propulsion systems is similar to that of the empires, but deviates in a few interesting areas.\n\nPristine, working examples of Sleeper technology such as this are extremely rare and even more valuable. With the right skills and equipment, they can offer great insights into the scientific pursuits of the ancient race that designed them. ',3738,0,0,10,0,1,NULL,0,1,1149,0),(30188,983,'Sleepless Patroller','An abundance of repair seams in this Sleeper drones armor tell the story of millennia spent on duty, protecting the same unchanging area. The drone moves about with a mechanical indifference to the monotony of its task, executing each new maneuver with a flawless, unthinking precision.',3516,350,19000000,19000000,120,1,NULL,0,0,NULL,0.07),(30189,983,'Sleepless Watchman','A