unthinking precision.',3516,350,19000000,19000000,120,1,NULL,0,0,NULL,0.07),(30200,985,'Awakened Patroller','The design of this Sleeper drone echoes what is believed to be the very earliest Sleeper Starships, suggesting it was perhaps constructed during that period too. Contrasting with its possible age is the unspoiled condition of its armor, suggesting that if it is indeed as ancient as its designers, it has only very recently been put into service. ',3536,150,10900000,109000,120,1,NULL,0,0,NULL,0.07),(30201,985,'Awakened Watchman','The design of this Sleeper drone echoes what is believed to be the very earliest Sleeper Starships, suggesting it was perhaps constructed during that period too. Contrasting with its possible age is the unspoiled condition of its armor, suggesting that if it is indeed as ancient as its designers, it has only very recently been put into service. ',3536,150,10900000,109000,120,1,NULL,0,0,NULL,0.07),(30202,985,'Awakened Escort','The design of this Sleeper drone echoes what is believed to be the very earliest Sleeper Starships, suggesting it was perhaps constructed during that period too. Contrasting with its possible age is the unspoiled condition of its armor, suggesting that if it is indeed as ancient as its designers, it has only very recently been put into service. ',3527,150,10900000,109000,120,1,NULL,0,0,NULL,0.07),(30203,984,'Awakened Defender','The design of this Sleeper drone echoes what is believed to be the very earliest Sleeper Starships, suggesting it was perhaps constructed during that period too. Contrasting with its possible age is the unspoiled condition of its armor, suggesting that if it is indeed as ancient as its designers, it has only very recently been put into service. ',3536,150,10900000,109000,120,1,NULL,0,0,NULL,0.07),(30204,984,'Awakened Upholder','The design of this Sleeper drone echoes what is believed to be the very earliest Sleeper Starships, suggesting it was perhaps constructed during that period too. Con