ntly been activated, perhaps even newly-manufactured . Even though it appears to be a relative newcomer to the swarm, there is little questioning that it bears the same deadly technology as its more elderly and experienced kin.',3528,50,1910000,19100,120,1,NULL,0,0,NULL,0.07),(30215,961,'Emergent Sentinel','The pristine condition of this Sleeper drones armor suggests it has only recently been activated, perhaps even newly-manufactured . Even though it appears to be a relative newcomer to the swarm, there is little questioning that it bears the same deadly technology as its more elderly and experienced kin.',3560,50,1910000,19100,120,1,NULL,0,0,NULL,0.07),(30216,961,'Emergent Keeper','The pristine condition of this Sleeper drones armor suggests it has only recently been activated, perhaps even newly-manufactured . Even though it appears to be a relative newcomer to the swarm, there is little questioning that it bears the same deadly technology as its more elderly and experienced kin.',3528,50,1910000,19100,120,1,NULL,0,0,NULL,0.07),(30217,961,'Emergent Warden','The pristine condition of this Sleeper drones armor suggests it has only recently been activated, perhaps even newly-manufactured . Even though it appears to be a relative newcomer to the swarm, there is little questioning that it bears the same deadly technology as its more elderly and experienced kin.',3528,50,1910000,19100,120,1,NULL,0,0,NULL,0.07),(30220,226,'Arena_DummyObj_Temp','',3515,0,0,0,0,1,NULL,0,0,NULL,0),(30221,500,'Snowball MMVIII','This snowball is bigger than your head. Its shape looks suspiciously like it could fit into a snowball launcher with great ease.',2943,5,100,1,0,100,NULL,0,0,NULL,0.07),(30222,976,'Melted Snowball MMVIII','This snowball used to be bigger than your head. Now it is just a puddle of water. Onoes.',2943,5,100,1,0,100,NULL,0,0,NULL,0.07),(30223,353,'Mega Module','A enhanced version of the standard Adaptive Nano armor plating. Uses advanced magnetic Field generators to strengthen the Nanobot Plating integrity. Penalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.',2066,10,1,25,0,1,NULL,100000,0,NULL,0.07),(30224,163,'Mega Module Blueprint','',1030,0,0,0.01,0,1,NULL,1000000,1,NULL,0),(30227,973,'Legion Defensive - Adaptive Augmenter Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30228,973,'Legion Defensive - Nanobot Injector Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30229,973,'Legion Defensive - Augmented Plating Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30230,973,'Amarr Defensive Subsystem 4 Blueprint','',194,0,0,0.01,0,1,NULL,0,0,NULL,0),(30231,973,'Amarr Defensive Subsystem 5 Blueprint','',194,0,0,0.01,0,1,NULL,0,0,NULL,0),(30232,973,'Tengu Defensive - Adaptive Shielding Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30233,973,'Tengu Defensive - Amplification Node Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30234,973,'Tengu Defensive - Supplemental Screening Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30235,973,'Caldari Defensive Subsystem 4 Blueprint','',194,0,0,0.01,0,1,NULL,0,0,NULL,0),(30236,973,'Caldari Defensive Subsystem 5 Blueprint','',194,0,0,0.01,0,1,NULL,0,0,NULL,0),(30237,973,'Proteus Defensive - Adaptive Augmenter Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30238,973,'Proteus Defensive - Nanobot Injector Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30239,973,'Proteus Defensive - Augmented Plating Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30240,973,'Gallente Defensive Subsystem 4 Blueprint','',194,0,0,0.01,0,1,NULL,0,0,NULL,0),(30241,973,'Gallente Defensive Subsystem 5 Blueprint','',194,0,0,0.01,0,1,NULL,0,0,NULL,0),(30242,973,'Loki Defensive - Adaptive Shielding Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30243,973,'Loki Defensive - Adaptive Augmenter Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30244,973,'Loki Defensive - Amplification Node Blueprint','',194,0,0,0.01,0,1,NULL,0,1,NULL,0),(30245,973,'Minmatar Defensive Subsystem 4 Blueprint','',194,0,0,0.01,0,1,NULL,0,0,NULL,0),(30246,973,'Minmatar Defensive Subsystem 5 Blueprint','',194,0,0,0.01,0,1,NULL,0,0,NULL,0),(30247,967,'Standalone Warfare Processor','A strange piece of equipment recovered from a Sleeper drone. ',3728,0,0,0.01,0,1,NULL,0,0,NULL,0),(30248,966,'Emergent Combat Analyzer','This combat analyzer appears to use the same fundamental programming as standard Empire-issue technology, although it operates at a much higher level of efficiency. These devices are typically employed in fleets where they provide predictive analyses of complex battle scenarios and supplement other combat electronics that handle smaller elements.\n\nCombat analyzers are best employed in tasks such as calculating a fleets success rate, running comparative analyses between fleets and other similarly abstract problem-solving tasks requiring higher levels of heuristic programming. Even though the equipment has been badly damaged, the core functionality remains intact. With a skilled programmer and a talented mechanic, it could be re-integrated into a starship.',3729,0,0,0.01,0,1,NULL,0,1,1148,0),(30249,967,'Nanoassembler Ligaments','Designed in eerily organic ligament-like formations, these nanoassemblers are still fully operational. With the addition of a few other components and some reprogramming, they could be repurposed for use in defensive systems. ',3724,0,0,0.01,0,1,NULL,0,0,NULL,0),(30250,967,'Nanoelectromechanical Sheets','Only a few millimeters thick, these sheets of fullerene alloys are able to store and generate power in small amounts, supplementing the capacitor of a ship and offering local power to nanoassemblers. They work best when integrated into armor plating around power core and repair systems. ',3724,0,0,0.01,0,1,NULL,0,0,NULL,0),(30251,966,'Neurovisual Input Matrix','Used in conjunction with other equipment inside the capsule, neurovisual input matrices serve the vital function of translating external stimuli into visual data. Ship identifier tags, hostile threat indicators and tactical overlay interfaces are all typical examples of N.I.M at work. The Sleeper variants of these matrices are not substantively different from contemporary devices, needing only a few supplemental components and some minor reprogramming before they can operate in much the same way. The only major deviation is in the energy efficiency. The Sleeper device is almost a thousand times less demanding on a ships power core.',3723,0,0,0.01,0,1,NULL,0,1,1148,0),(30252,966,'Thermoelectric Catalysts','These tiny nanomachines have been injected into the thermoelectric power core at the heart of the Sleeper drone. Inside each one is a small array of chemicals and components, all of which play a role in producing the often violent chemical reactions that provide power to the drones. Only the most advanced Sleeper drones are known to have had their power cores enhanced in this way.\n\nEven though they all share the same fundamental role, thousands of minor variations in the machines that have emerged after millennia of use, as they adapted to the minute changes in chemical composition and electrical flux. How exactly they came to do this remains a mystery, but it is clear that the current product is the result of countless iterations. \n\nAlthough salvaged easily enough, they have been built from the ground up to be integrated into other Sleeper technology. Trying to enhance any engineering systems outside of the Sleepers own thermoelectric power cores with the current level of technology would represent an impossible reverse-engineering task.',2889,0,0,0.01,0,1,NULL,0,1,1148,0),(30253,967,'Powdered C-540 Graphite','This white, dusty substance was extracted from the centre of high impact craters in the Sleeper drone\'s armor. When mixed with other materials it forms a stiff resin that can either be used to hold various pieces of hull sheets together or to coat them for additional protection against radiation and heat. ',3730,0,0,0.01,0,1,NULL,0,0,NULL,0),(30254,966,'Electromechanical Hull Sheeting','These ultra-thin nanoplastic sheets are resilient enough to survive the explosion of the Sleeper drones that carry them. The molecular-level circuitry inside them can be encased in layers of protective fullerene alloys that are billions of times their size, allowing electronics systems to be safely embedded just beneath the armor surface.',3730,0,0,0.01,0,1,NULL,0,1,1148,0),(30255,967,'Thermal Diffusion Film','Normally synthesized at great cost, small amounts of this film are also able to be removed from the outer layers of a Sleeper drone\'s armor. When combined with other materials it has the capability to spread thermal damage out across the hull, cooling it quickly, thus minimize the incoming damage from heat-based weaponry.\n',3730,0,0,0.01,0,1,NULL,0,0,NULL,0),(30256,967,'Generic Hull Salvage 4','Interface Circuits are common building blocks of starship subsystems.',3265,0,0,0.01,0,1,NULL,0,0,NULL,0),(30257,967,'Generic Hull Salvage 5','An \"Aphid\" logic circuit. The nickname is derived from the unfortunate acronym of autonomous field programmable holographic signal processor with embedded holographic data storage.',3265,0,0,0.01,0,1,NULL,0,0,NULL,0),(30258,966,'Resonance Calibration Matrix','RCM play an important role in stabilizing a ships alignment prior to, and in the first moments of, interstellar warp. The Sleeper drone RCM system works in an entirely different manner to contemporary Empire-based technology and yet the angles of alignment produced by their final calculations are always identical. Even though their inner workings remain a mystery, the matrices operate in a predictable and reliable enough fashion to form the basis of a new, slightly more efficient jump drive.',3733,0,0,0.01,0,1,NULL,0,1,1148,0),(30259,966,'Melted Nanoribbons','Most of these tiny circuits have fused together from the heat and force of the Sleeper drone\'s explosion. The detonation of the drone\'s power core must have been immense to have had such an effect on these resilient nanostructures.',3724,0,0,0.01,0,1,NULL,0,1,1148,0),(30260,967,'Ruined Scraps 3','A slightly damaged but still seemingly usable capacitor console. Capacitor consoles are a necessary component of starship capacitor units.',3256,0,0,0.01,0,1,NULL,0,0,NULL,0),(30261,967,'Ruined Scraps 4','The Micro Circuit is one of the most common electronics components seen in use.',3265,0,0,0.01,0,1,NULL,0,0,NULL,0),(30262,967,'Intact Coolant Regulator ','A soup of nanite assemblers typically used in armor manufacturing processes.',3251,0,0,0.01,0,1,NULL,0,0,NULL,0),(30263,967,'Intact Particle Emitter ','Your average run-of-the-mill closed loop electrical network with redundant autonomous switchgear.',3265,0,0,0.01,0,1,NULL,0,0,NULL,0),(30264,967,'Intact Field Harmonic Regulator ','Power Conduit runs through ships delivering energy like arteries deliver blood through a body. Large ships can have hundreds of miles of conduit.',3249,0,0,0.01,0,1,NULL,0,0,NULL,0),(30265,967,'Intact Sleeper AI Control Core','An expert system used in the construction of missile launchers. This one has been damaged by fire or an explosion.',3256,0,0,0.01,0,1,NULL,0,0,NULL,0),(30266,967,'Intact Secondary Power Couples ','This Thermonuclear Trigger Unit while smashed still seems to have it\'s nuclei containment field intact and the plasma seems to be near thermal equilibrium. It would be a shame to waste this unit just because of its cosmetic damage.',3262,0,0,0.01,0,1,NULL,0,0,NULL,0),(30267,967,'Intact Plasma Conduit ','Power Conduit runs through ships delivering energy like arteries deliver blood through a body. Large ships can have hundreds of miles of conduit. This conduit is tangled and knotted as it seems to have gone through some sort of catastrophe.',3248,0,0,0.01,0,1,NULL,0,0,NULL,0),(30268,966,'Jump Drive Control Nexus','Barely salvageable from the wreck of a Sleeper drone, this device could have been something much more impressive when it was fully functional. In its current state it is almost unrecognizable, having been scratched, burned and even chemically melted. It looks like it was housed next to the drone\'s power core, which would explain the extreme heat damage it suffered when the drone exploded.\n\nStranger yet, it almost seems as if it was lined with some kind of triggered-release corrosive. The self-destruct mechanism  if thats even what it was  only caused so much damage, and the acid didn\'t burn cleanly through the center of the drive. \n\nEven as a shadow of its former self, it can be combined with other components to form a fully functional warp drive. Being capable of this, even in such a bad state, strongly suggests that the device was capable of other types of more advanced interstellar travel. Why a Sleeper drone was equipped with this level of technology remains a mystery.',2889,0,0,0.01,0,1,NULL,0,1,1148,0),(30269,966,'Defensive Control Node','A rudimentary analysis of this device reveals an amazingly broad potential for the manipulation of nanomachines, allowing the user to reprogram them for numerous roles. The Sleeper defensive systems were so modular that, even though this particular node was designed to coordinate armor-repairing nanoassemblers, it could just as easily be reconfigured for shield defense.',2889,0,0,0.01,0,1,NULL,0,1,1148,0),(30270,966,'Central System Controller','Still fully intact and operational, this device stands as a testament to the ancient Sleeper\'s impressive scientific achievements. Although thousands of years old, the technology inside it is not only comparable to modern electronic designs, but in some cases even exceeds it.\n\nCentral system controllers lie at the heart of a starships electronics systems. They are responsible for coordinating the flow of information between various analyzers and control nodes, monitoring subsystems, and ensuring they receive the appropriate supply of electrical power. Tackling such complex tasks simultaneously (and with near-zero latency) demands immense processing power and faultless, error-free programming. Traditionally, a CSC would comprise a significant portion of the cost in a starships electronics systems, but the fullerene-based Sleeper designs have provided breakthroughs in the efficiency of circuitry and presented new and improved methods for increasing computational accuracy. The end result is a drastically reduced cost for top-of-the-line performance. \n',2889,0,0,0.01,0,1,NULL,0,1,1148,0),(30271,966,'Emergent Combat Intelligence','Although emergent systems are not fully-fledged Artificial Intelligences, they are often so advanced that they can border on sentience. The means by which they are created is also a common source for claims that they are in fact, full-blown AIs. Emergent system development is said to have been an early focal point in Jovian software design, where they hoped to create an atmosphere in which an advanced system could self-assemble its own consciousness and thus emerge as a sentient being. What became of these projects remains unknown, although the Jovians appear to have abandoned these pursuits many millennia ago in favor of something more tangible and containable.\n\nDesigned from the ground up to perform complex, real-time combat calculations such as weapon tracking and heat optimization, this device shows the signatures of an emergent intelligence. Despite this, various hard limitations have been encoded into the device at the most fundamental level, greatly limiting its potential to evolve any further. Even in its current state though, it represents some of the most advanced combat electronics ever built. Although nothing about the software is in itself revolutionary, it is able to tackle highly complex tasks with a frightening level of speed and efficiency.',2889,0,0,0.01,0,1,NULL,0,1,1148,0),(30272,967,'Sleeper Ward Console','The control unit for a starships shield systems.',3256,0,0,0.01,0,1,NULL,0,0,NULL,0),(30273,319,'Abandoned Sleeper Enclave','Imposing in its majesty, this giant dome stands as a testament to the technological might of the ancient Sleeper race. Even millennia old, the innumerable electronics systems within are still comparable to contemporary technology, in some cases even exceeding it. The distinctive hub-like design of this particular structure suggests that it operated as some kind of central data nexus, a shining capital amongst a digital metropolis.\n\nThis Enclave is heavily damaged from thousands of years in the unforgiving solitude of space. The only signs of life within are weak electronic signals.',3517,7850,100000,100000000,10000,1,NULL,0,0,NULL,0),(30274,319,'Eroded Sleeper Thermoelectric Converter','After countless years in space, this structure is showing some signs of age. A brief analysis of the semi-functional technology inside reveals that it operates as some kind of auxiliary power source for other structures. Erosion in one of the armor panels exposes a small internal hangar bay, perhaps used as a docking port to power the Sleeper\'s automated drones.',3518,4738,100000,100000000,10000,1,NULL,0,0,NULL,0),(30275,319,'Exposed Sleeper Interlink Hub','Distinctively Sleeper in design, this structure served as an information hub, linking various data sources with one another. Although countless years in the harsh environments of space have rendered its defenses all but non-existent, the structure continues to relay information back and forth, oblivious to its own vulnerability.',3519,2917,100000,100000000,10000,1,NULL,0,0,NULL,0),(30276,319,'Crippled Sleeper Preservation Conduit','Tiny windows looking out into space offer a glimpse past this structures once-impressive armor plating and through to the strange sights within. Barely visible in the dim light are rows upon rows of small chambers, stretching out endlessly inside the darkened hallways of this mammoth conduit. A myriad of connective wires interlace with giant pipelines, all of them broken or badly damaged. A strange electronic interference emanates from deep inside the facility, suggesting that perhaps not everything inside has fallen into disrepair.',3520,11361,100000,100000000,10000,1,NULL,0,0,NULL,0),(30277,319,'Malfunctioning Sleeper Multiplex Forwarder','The Sleeper Multiplex Forwarder may have been responsible for transferring data between various Sleeper facilities. Hundreds of years in space have taken their toll, however, and brief scans of the structure show only miniscule amounts of electronic activity.',3521,2759,100000,100000000,10000,1,NULL,0,0,NULL,0),(30278,319,'Decrepit Talocan Outpost Core','Centuries of emptiness have left this Talocan outposts central hub in disarray, but the chambers and corridors inside portray a busy (if very spartan) existence. Advanced technology mingles with rustic repairs and patchwork assemblages. Some of the technology is ancient and very rudimentary in design, harkening back to cultures long gone, yet with hints of familiarity. Much of the interior is in shambles, and the outer hull is breached in several areas, leaving the outpost core teetering on the edge of total destruction. ',3522,5794,100000,100000000,10000,1,NULL,0,0,NULL,0),(30279,319,'Collapsed Talocan Observation Dome','Large windows and telescoping turrets peer out into the surrounding darkness. The windows of this dome are cracked and the roof partially collapsed, but the empty eyes of the Talocan observation dome always appears to be staring, despite the absence of its original occupants. ',3523,741,100000,100000000,10000,1,NULL,0,0,NULL,0),(30280,319,'Offline Talocan Reactor Spire','The Spires mechanical infrastructure suggests that it was once used for generating power and harvesting electricity. However, the design resembles a combination of different styles, many of them reminiscent of modern power stations. Despite many attempts, the internal generators won\'t start working, and the spire is now utterly offline, just another mass of debris in space. ',3524,4662,100000,100000000,10000,1,NULL,0,0,NULL,0),(30281,319,'Disjointed Talocan Outpost Hub','Though large in design, this structure is sparsely adorned, with only a few antechambers and docking platforms inside. Speculation among historians suggests that this outpost hub was capable of immediate and easy disconnection from the Talocan outpost in case of attack, but there hasn\'t been a scholarly consensus about this. Most of the docking bays have eroded away, and a few walls are on the verge of collapse, leaving the hub in complete disrepair. ',3525,478,100000,100000000,10000,1,NULL,0,0,NULL,0),(30282,319,'Disjointed Talocan Outpost Conduit','Narrow tubes and electrical wiring fill the outpost conduit. Equal parts electrical artery and linking structure, the interior of this connecting structure is in disrepair and on the verge of complete wreckage. ',3526,1521,100000,100000000,10000,1,NULL,0,0,NULL,0),(30293,226,'Sleeper Preservation Conduit','Tiny windows looking out into space offer a glimpse past this structures impressive armor plating and through to the strange sights within. Barely visible in the dim light are rows upon rows of small chambers, stretching out endlessly inside the darkened hallways of this mammoth conduit. A myriad of connective wires interlace with giant pipelines, feeding into every area of the facility. Although they can be seen coiling up through the foundations, the compounds they are ferrying remain a mystery. <br><br>\n\nA strange electronic interference emanates from deep within, pulsing randomly every few seconds.',3520,11361,100000,100000000,10000,1,NULL,0,0,NULL,0),(30294,226,'Talocan Observation Dome','Large windows and telescoping turrets peer out into the surrounding darkness. The Talocan observation dome always appears to be staring, despite the absence of its original occupants.',3523,741,100000,100000000,10000,1,NULL,0,0,NULL,0),(30295,226,'Talocan Outpost Core','Centuries of emptiness have left this Talocan outposts central hub in disarray, but the chambers and corridors inside portray a busy (if very spartan) existence. Advanced technology mingles with rustic repairs and patchwork assemblages. Some of the technology is ancient and very rudimentary in design, harkening back to cultures long gone, yet with hints of familiarity.',3522,5794,100000,100000000,10000,1,NULL,0,0,NULL,0),(30296,226,'Talocan Outpost Hub','Though large in design, this structure is sparsely adorned, with only a few antechambers and docking platforms inside. Speculation among historians suggests that this outpost hub was capable of immediate and easy disconnection from the Talocan outpost in case of attack, but there hasn\'t been a scholarly consensus about this.',3525,478,100000,100000000,10000,1,NULL,0,0,NULL,0),(30297,226,'Talocan Outpost Conduit','Narrow tubes and electrical wiring fill the Outpost Conduit. Equal parts electrical artery and linking structure, the interior of this connecting structure is worn and in disrepair, but its polyferrous hull keeps the ravages of space and time at bay.',3526,1521,100000,100000000,10000,1,NULL,0,0,NULL,0),(30298,226,'Talocan Reactor Spire','Centuries of emptiness have left this Talocan outposts central hub in disarray, but the chambers and corridors inside portray a busy (if very spartan) existence. Advanced technology mingles with rustic repairs and patchwork assemblages. Some of the technology is ancient and very rudimentary in design, harkening back to cultures long gone, yet with hints of familiarity.',3524,4662,100000,100000000,10000,1,NULL,0,0,NULL,0),(30299,226,'Sleeper Enclave','Imposing in its majesty, this giant dome stands as a testament to the technological might of the ancient Sleeper race. Even millennia old, the innumerable electronics systems within are still comparable to contemporary technology, in some cases even exceeding it. The distinctive hub-like design of this particular structure suggests that it operated as some kind of central data nexus, a shining capital amongst a digital metropolis.\n\nAlthough entirely functional and intact, the only signs of life within are electrical currents and the eerily constant transfers of data.',3517,7850,100000,100000000,10000,1,NULL,0,0,NULL,0),(30300,226,'Sleeper Thermoelectric Converter','Despite countless years in space, this structure appears to be entirely functional. A brief analysis of the technology inside reveals that it operates as some kind of central power source for other Sleeper facilities. Faint seams in the rigid armor suggest it may even house a docking port to power the Sleeper\'s automated drones.',3518,4738,100000,100000000,10000,1,NULL,0,0,NULL,0),(30301,226,'Sleeper Multiplex Forwarder','The Sleeper Multiplex Forwarder was built as a massive router for transferring electronic data between various Sleeper facilities. Although enclosed in super-resilient metal alloys, the size of the data cables suggests that it is capable of transmitting extraordinary amounts of information. ',3521,2759,100000,100000000,10000,1,NULL,0,0,NULL,0),(30302,226,'Sleeper Interlink Hub','Distinctively Sleeper in design, this structure operates as an information hub, linking up various data sources with one another. An extraordinarily resilient superstructure guards the flow of information inside from any disruption.',3519,2917,100000,100000000,10000,1,NULL,0,0,NULL,0),(30303,974,'Fulleroferrocene ','Fulleroferrocene is a rare organometallic compound used to strengthen and supplement other materials. Most commonly, it is used to improve the structural integrity of metal alloys, but research is continuing on its potential applications in nanomechanical devices.',3739,0,0,0.1,0,1,NULL,0,1,1146,0),(30304,974,'PPD Fullerene Fibers','The discovery of these microscopic, tubular structures has helped pave new paths in the construction of advanced starships. Known for their unrivaled strength-to-weight ratio, composite metals made of unique PPD fullerene fibers have become the standard for defensive plating. Atomic-scale, nanomechanical systems used inside repair modules often employ fullerene fibers as well.',3740,0,0,0.5,0,1,NULL,0,1,1146,0),(30305,974,'Fullerene Intercalated Graphite','Originally this material was only used in the construction of advanced semiconductors, a role in which it still performs admirably. In recent years, however, structural engineers have proven that it has even better applications in nano-electromechanical systems. The unique superlubricity  a state of zero or near-zero friction  between mechanical components made of F.I.C significantly limits wear, allowing the tiny devices to operate for exceptionally long periods without the need for maintenance.',3741,0,0,0.8,0,1,NULL,0,1,1146,0),(30306,974,'Methanofullerene','One of the most useful organic semiconductors discovered in recent years, methanofullerene can be blended with other polymers to create incredibly efficient solar cells, offering a near-endless source of power in places that would otherwise be difficult to supply.',3745,0,0,1.5,0,1,NULL,0,1,1146,0),(30307,974,'Lanthanum Metallofullerene','This fullerene-lanthanum compound is made by encasing a single lanthanum atom in a cage of carbon atoms. The incredibly high melting point of lanthanum compounds make them ideal for the construction of offensive hardpoints, where heat dissipation is critical to keeping weapons systems operating effectively.',3746,0,0,2,0,1,NULL,0,1,1146,0),(30308,974,'Scandium Metallofullerene','A fullerene-scandium compound made by encasing a single scandium atom in a cage of carbon atoms. Scandium is a grey-white element that has historically been incredibly hard to find. Scandium-tipped missiles were once valued for their armor-piercing qualities, which allowed them to wreck havoc deep inside starship hulls. The only thing holding the weapons industry back from these and other similar applications has been the low supply of the material.',3744,0,0,2.6,0,1,NULL,0,1,1146,0),(30309,974,'Graphene Nanoribbons','Single-walled nanotubes such as these have been at the forefront of advanced electronics production for centuries. The nanoribbons make for some of the best, and smallest, conductors in the world, offering scientists new ways forward in the miniaturization of electronics systems.',3753,0,0,6,0,1,NULL,0,1,1146,0),(30310,974,'Carbon-86 Epoxy Resin','C-86 epoxy resin is most commonly applied as a thin film to the structures housing propulsion systems. The tremendous flame-retardant properties of material s covered in the resin help prevent heat buildup and minimize onboard fires.',3750,0,0,8,0,1,NULL,0,1,1146,0),(30311,974,'C3-FTM Acid','Difficult to procure and expensive to create, this rare chemical compound plays an important role as a neuroprotective agent for capsule pilots. It is integrated into the life-support systems on board a capsuleers vessel, where it helps limit brain cell death and neurodegeneration.',3751,0,0,10,0,1,NULL,0,1,1146,0),(30312,967,'Nanotori Polymers','Nanotori are carbon nanotubes bent into rings. The final product and its application vary drastically depending on the angle at which the tubes were rolled and the radius of the circle they created. For this reason, nanotori can be found in anything from metal alloys to insulators and semiconductors.',3748,0,0,5,0,1,NULL,0,0,NULL,0),(30313,967,'Nanobud Polymers','A combination of carbon nanotubes and other fullerenes, nanobuds have the unique properties of both materials, making them useful in the construction of advanced electronics as well as ultra-hard metal alloys.',3749,0,0,5,0,1,NULL,0,0,NULL,0),(30314,967,'Fullero-Ferrocene','Fulleroferrocene is a rare organometallic compound used to strengthen and supplement other materials. Most commonly, it is used to improve the structural integrity of metal alloys, but research is continuing on its potential applications in nanomechanical devices.',3750,0,0,5,0,1,NULL,0,0,NULL,0),(30315,967,'Carbon-86 Epoxy Resin','C-86 Epoxy Resin is most commonly applied as a thin film to the structures housing propulsion systems. The tremendous flame-retardant properties of materials covered in the resin help prevent heat buildup and improve internal combustive efficiency.',3751,0,0,5,0,1,NULL,0,0,NULL,0),(30316,967,'Polyfullerene Condensate','This mixture of fullerene condensates is most commonly used to line gas storage tanks on starships. The unique qualities of the liquid provide increased thermal efficiency and reduced the risk of combustive malfunctions.',3752,0,0,5,0,1,NULL,0,0,NULL,0),(30317,967,'PPD Fullerene Fibers','The discovery of these microscopic tubular structures has helped pave new paths in the construction of advanced starships. Known for their unrivalled strength-to-weight ratio, composite metals made of unique PPD fullerene fibers have become the standard for defensive plating. Atomic-scale nanomechanical systems used inside repair modules often employ fullerene fibers as well.',3753,0,0,5,0,1,NULL,0,0,NULL,0),(30318,967,'Plutonium Metallofullerene ','A fullerene-plutonium compound made by encasing a single plutonium atom in a cage of carbon atoms. Scientists originally envisaged this compound as a useful substance for non-applied research, but when the huge explosive potential of loosely-packed plutonium atoms inside a rigid fullerene cage was discovered, what little material there was quickly disappeared into the research labs of weapons manufacturers.',3754,0,0,5,0,1,NULL,0,0,NULL,0),(30319,967,'Polymer 17','',2684,0,0,0,0,1,NULL,0,0,NULL,0),(30320,967,'Polymer 18','',2684,0,0,0,0,1,NULL,0,0,NULL,0),(30321,967,'Polymer 19','',2684,0,0,0,0,1,NULL,0,0,NULL,0),(30322,967,'Polymer 20','',2684,0,0,0,0,1,NULL,0,0,NULL,0),(30324,270,'Defensive Subsystem Technology','Understanding of the technology used to create advanced defensive subsystems.',33,0,0,0.01,0,1,NULL,10000000,1,375,0),(30325,270,'Engineering Subsystem Techn