angerous guardians of their sleeping masters, even after countless years of constant duty. As unpredictable as they are powerful, the towers have been expertly designed to provide lasting vigilance with an unquestioning, mechanical loyalty. The weapons systems on board are frighteningly precise and devastating upon impact.',3533,45,1000,1000,1000,1,NULL,0,0,NULL,0),(30463,988,'Test wormhole','This is the initial wormhole being made for testing and so on',2907,3000,0,0,0,1,NULL,0,0,NULL,0),(30464,964,'Metallofullerene Plating ','Metallofullerene plating is used to protect the connective joins in hull and subsystem structures so that Tech III vessels can be taken apart and put back together endlessly, all without the risk of wear. Mechanical engineers first attempted to create the plating using plutonium metallofullerenes, but it was quickly discovered that even miniscule amounts of them had a sizeable impact on ship mass. When integrated into armor plating in larger amounts, they also risked turning the vessel into a giant warhead, something even less desirable.\n\nA solution was finally found. Tiny amounts of metallofullerenes would be integrated in conjunction with far larger quantities of graphene nanoribbons and then coated in powdered C-540 graphite. This process allowed the material to maintain structural durability whilst keeping mass down. The last and most ingenious addition was to incorporate fulleroferrocene into the metal beneath layers of electromechanical hull sheeting. This had the effect of turning the normally dangerous explosive reactions into kinetic energy, which could then be used to supplement the power supply to local nanoassemblers.',3721,0,1,5,0,1,NULL,400000,1,1147,0),(30465,965,'Metallofullerene Plating Blueprint','',96,0,0,1,0,1,NULL,10000000,1,1191,0),(30466,964,'Electromechanical Interface Nexus','When integrated into a starship with other components, an EMI Nexus is used to facilitate manual control over numerous electromechanical systems which, by default, run in an automated manner according to their programmed roles. Typically, the EMI Nexus acts as a conduit between a capsuleer and their ship, serving as an interface through which they can operate normally automated electromechanical systems, such as a Central System Controller. Other more simple tasks, such as the activation of a ships modules, also frequently rely on these components.',3716,0,1,10,0,1,NULL,400000,1,1147,0),(30467,965,'Electromechanical Interface Nexus Blueprint','',96,0,0,1,0,1,NULL,10000000,1,1191,0),(30468,884,'Optimized Nano-engines','Tech III Component used in the manufacture of advanced engineering subsystems. ',3721,0,1,5,0,1,NULL,0,1,NULL,0),(30469,410,'Optimized Nano-engines Blueprint','',96,0,0,1,0,1,NULL,5000000,0,NULL,0),(30470,964,'Neurovisual Output Analyzer','As a capsuleer, few things are more important in space-flight than the ability to instantly gauge ones surroundings and make decisions accordingly. For this reason, capsules inside starships make frequent use of neurovisual reproductions, emulations that recreate external stimuli using the most low-latency processor available: the human brain. This process relies on digital relays from camera drones and monitoring systems embedded into the hull. After the data is captured, it is then relayed directly into the brain, at which point the external surrounds are recreated almost instantaneously.\n\nThe synthetic translation of external stimuli into neurovisual imagery is incredibly risky, even relative to the standard hazards of pod piloting. Even though capsuleers have an innate resistance to neurobiological damage from these sorts of processes, the near- constant exposure to them has been linked to increased risk of aggressive neurodegenerative diseases. In recent years, engineers have begun to integrate neurovisual output analyzers into a starships electronics systems. These devices monitor the pilots status and, if necessary, take measures to protect against anything from mild headaches to catastrophic neural failure.',3716,0,1,5,0,1,NULL,400000,1,1147,0),(30471,965,'Neurovisual Output Analyzer Blueprint','',96,0,0,1,0,1,NULL,10000000,1,1191,0),(30472,884,'Warfare Computation Core','Tech III Component used in the manufacture of advanced offensive subsystems. ',3719,0,1,5,0,1,NULL,0,1,NULL,0),(30473,410,'Warfare Computation Core Blueprint','',96,0,0,1,0,1,NULL,5000000,0,NULL,0),(30474,964,'Nanowire Composites','Nanowire composites function as connective links between subsystems. Graphene nanoribbons form the base of the components, carrying electrical power between other devices integrated into electromechanical hull sheets. A final coating of thermal diffusion film ensures efficient heat dispersion, allowing a starship captain to overload modules connected to subsystems without risking the entire vessel.',3718,0,1,5,0,1,NULL,400000,1,1147,0),(30475,965,'Nanowire Composites Blueprint','',96,0,0,1,0,1,NULL,10000000,1,1191,0),(30476,964,'Fulleroferrocene Power Conduits','These conduits supply power to minute, molecular-level devices. Extremely strong and yet surprising flexible, they have traditionally been used in rare situations where the normal methods of power supply were rendered impossible. The advent of Tech III starship technology and the influx of fullerene-based materials have seen the conduits take on new and more widespread roles.\n\nThe addition or removal of a single subsystem in a Tech III vessel can drastically change the ships structure, and with it the internal wiring and available power supply routes.  Fulleroferrocene power conduits have become an essential component in the construction of these new vessels for this very reason. The conduits can be remapped through a ship with relative ease, allowing for the near-endless variations of subsystems to be completely interchangeable without posing any problems of how to power them.',3720,0,1,5,0,1,NULL,400000,1,1147,0),(30477,965,'Fulleroferrocene Power Conduits Blueprint','',96,0,0,1,0,1,NULL,10000000,1,1191,0),(30478,964,'Reconfigured Subspace Calibrator','Subspace calibrators perform the crucial role of tuning in on subspace frequencies. Being able to accurately pinpoint a destination on the other side of a wormhole is vital to interstellar travel, as it allows pilots to traverse wormholes safe in the knowledge that they wont accidentally arrive out the other side at the centre of a sun.\n\nThis particular calibrator was produced from a combination of fullerene polymers and salvaged Sleeper technology. The unique grouping enables some drastic reconfigurations to the basic design. The end result is a vastly increased efficiency in calculation time. Due to the modular design of Tech III vessels, tuning into subspace frequencies must be done individually for each subsystem. The development of this particular component has been an important time-saver in an area where mere seconds can mean life or death.',3717,0,1,10,0,1,NULL,400000,1,1147,0),(30479,965,'Reconfigured Subspace Calibrator Blueprint','',96,0,0,1,0,1,NULL,10000000,1,1191,0),(30480,884,'Thruster Drive Cores','Tech III Component used in the manufacture of advanced propulsion subsystems. ',3717,0,1,5,0,1,NULL,0,1,NULL,0),(30481,410,'Thruster Drive Cores Blueprint','',96,0,0,1,0,1,NULL,5000000,0,NULL,0),(30482,884,'Warp Initiation Calibrator','Tech III Component used in the manufacture of advanced propulsion subsystems. ',3717,0,1,5,0,1,NULL,0,1,NULL,0),(30483,410,'Warp Initiation Calibrator Blueprint','',96,0,0,1,0,1,NULL,5000000,0,NULL,0),(30484,186,'Sleeper Small Basic Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',3125,14,10000,27500,27500,1,NULL,0,0,NULL,0),(30485,186,'Sleeper Small Intermediate Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',3125,14,10000,27500,27500,1,NULL,0,0,NULL,0),(30486,479,'Sisters Combat Scanner Probe I','Specifically tailored for the needs of the combat community, this all-in-one package delivers baseline performance for the discerning hunter-killer. Paired with a specialist launcher and analysis suite, the advanced electronics of this probe allows the rapid location of target vessels.',1722,1,1,1,0,1,NULL,15318,1,NULL,0.07),(30487,486,'Sisters Combat Scanner Probe I Blueprint','',1007,0,0,0.01,0,1,NULL,5000000,1,NULL,0),(30488,479,'Sisters Core Scanner Probe I','This is the first of a new generation of multi-mode scanning probes. Designed to provide an all-in-one reconfigurable scanning package, this compact tool meets the needs of the core scanning market in a single, flexible product.\n\nHowever, size limitations mean that this probe does not include the advanced circuitry needed to scan down ships, drones and structures.',1723,1,1,0.1,0,1,NULL,4236,1,NULL,0.07),(30489,486,'Sisters Core Scanner Probe I Blueprint','',1007,0,0,0.01,0,1,NULL,5000000,1,NULL,0),(30490,479,'Sisters Deep Space Scanner Probe I','A more advanced variant of the latest-generation multi-mode probes, intended for deep-space explorers. The expanded sensor suite and instrument package on this model allows greatly increased volumes to be surveyed, at the expense of limiting close-range functionality.',1722,1,1,1,0,1,NULL,17670,1,NULL,0.07),(30491,486,'Sisters Deep Space Scanner Probe I Blueprint','',1007,0,0,0.01,0,1,NULL,5000000,1,NULL,0),(30492,186,'Sleeper Medium Basic Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',3121,14,10000,27500,27500,1,NULL,0,0,NULL,0),(30493,186,'Sleeper Medium Intermediate Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',3121,14,10000,27500,27500,1,NULL,0,0,NULL,0),(30494,186,'Sleeper Large Basic Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',3117,14,10000,27500,27500,1,NULL,0,0,NULL,0),(30495,186,'Sleeper Large Intermediate Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',3117,14,10000,27500,27500,1,NULL,0,0,NULL,0),(30496,186,'Sleeper Large Advanced Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',3117,14,10000,27500,27500,1,NULL,0,0,NULL,0),(30497,526,'Reinforced Metal Scraps','This mechanical hardware has obviously outlived its use, and is now ready to be recycled. Many station maintenance departments use the material gained from recycling these scraps to manufacture steel plates which replace worn out existing plates in the station hull. Most station managers consider this a cost-effective approach, rather than to send out a costly mining expedition for the ore, although these scraps rarely are enough to satisfy demand.\n\nThis commodity is not affected by the scrap metal processing skill any more than any other recyclable item.',2529,0,10000,5,0,1,NULL,5000,1,NULL,0),(30498,882,'Hybrid Reaction 17','',2665,0,0,1,0,1,NULL,0,0,NULL,0),(30499,882,'Hybrid Reaction 18','',2665,0,0,1,0,1,NULL,0,0,NULL,0),(30500,882,'Hybrid Reaction 19','',2665,0,0,1,0,1,NULL,0,0,NULL,0),(30501,882,'Hybrid Reaction 20','',2665,0,0,1,0,1,NULL,0,0,NULL,0),(30502,226,'Talocan Polestar','The central piece of this Talocan station is the Polestar, the nerve center of the complex and the heart of Talocan survival. Though dilapidated and unusable, the Polestars outer hull holds many propulsion jets and mini-generators, implying its use as a self-sufficient structure with independent capabilities. From the burn marks around the propulsion thrusters, this Polestar has been jettisoned many times as a necessary structure for a migrant culture.',3561,8818,100000,100000000,10000,1,NULL,0,0,NULL,0),(30503,226,'Talocan Coupling Array','The long capsules in the coupling array offer no hints as to their purpose. Archaeologists conjecture that the Array contained escape vessels, food bins, fuel resources or equipment for punishment. Some theories purport that all of the above are true.',3570,4859,100000,100000000,10000,1,NULL,0,0,NULL,0),(30504,226,'Talocan Static Gate','This standing structure shares many similar aspects with modern acceleration gates. Whispers among Talocan lore-keepers tell of the Talocans firm grasp of astronautical engineering, and this gate may offer some insight into this ancient races knowledge.',3572,3886,100000,100000000,10000,1,NULL,0,0,NULL,0),(30505,226,'Talocan Exchange Depot','Amidst the ruins of this Talocan outpost, the exchange depot looms, its presence foreboding. Judging from the wreckage inside, the depot was either used for imprisonment or cultural exchange, eerily, there seems to be very little difference between the two. Whatever its purpose, this structure is rather prevalent among the outposts, displaying its importance in Talocan society.',3573,6322,100000,100000000,10000,1,NULL,0,0,NULL,0),(30506,226,'Talocan Extraction Silo','This towering structure contains all the basic elements of a regular silo: cavernous storage areas, thick walls, extensive ventilation, etc. Based on the scans of this silo, however, the silos previous contents are unknown. The residue from inside reveals nothing known in modern times, or even odd genetic combinations. Whatever its contents, the silo emits an unfamiliar  and uneasy  presence.',3574,11048,100000,100000000,10000,1,NULL,0,0,NULL,0),(30507,319,'Worn Talocan Static Gate','This standing structure shares many similar aspects with modern acceleration gates. Whispers among Talocan lore-keepers tell of the Talocans firm grasp of astronautical engineering. This gate may offer some insight into this ancient races knowledge, if only it could be fully repaired. Eons in space have worn the static gate completely down.',3572,3886,100000,100000000,10000,1,NULL,0,0,NULL,0),(30508,319,'Inverted Talocan Exchange Depot','Amidst the ruins of this Talocan outpost, the exchange depot looms, its presence foreboding. Judging from the wreckage inside, the depot was either used for imprisonment or cultural exchange, eerily, there seems to be very little difference between the two. Whatever its purpose, this structure is rather prevalent among the outposts, displaying its importance in Talocan society.',3573,6322,100000,100000000,10000,1,NULL,0,0,NULL,0),(30509,319,'Disrupted Talocan Polestar','The central piece of this Talocan station is the Polestar, the nerve center of the complex and the heart of Talocan survival. Though dilapidated and unusable, the Polestars outer hull is breached in many parts. Its propulsion jets and mini-generators are destroyed and decaying. From the burn marks around the propulsion thrusters, this Polestar has been jettisoned many times as a necessary structure for a migrant culture, but in this condition the Polestars current location will remain its last. ',3561,8818,100000,100000000,10000,1,NULL,0,0,NULL,0),(30510,319,'Broken Talocan Coupling Array','The long capsules in the coupling array offer no hints as to their purpose. Archaeologists conjecture that the Array contained escape vessels, food bins, fuel resources or equipment for punishment. Some theories purport that all of the above are true. Cracked and worn, the coupling array won\'t function as any of these, as its fragile frame is completely broken inside and out. ',3570,4859,100000,100000000,10000,1,NULL,0,0,NULL,0),(30511,319,'Hollow Talocan Extraction Silo','This towering structure contains all the basic elements of a regular silo: cavernous storage areas, thick walls, extensive ventilation, etc. Based on the scans of this silo, however, the silos previous contents are unknown. The residue from inside reveals nothing known in modern times, or even odd genetic combinations. Whatever its contents, the silo emits an unfamiliar  and uneasy  presence.',3574,11048,100000,100000000,10000,1,NULL,0,0,NULL,0),(30512,319,'Weakened Sleeper Drone Hangar','Clearly built to serve the needs of the Sleepers automated defense drones, this ominous structure functions as one of their central docking points. The hangars defensive capabilities have degraded over the millennia, leaving a thin outer shell that offers only token resistance to attack.',3585,3394,100000,100000000,10000,1,NULL,0,0,NULL,0),(30513,226,'Sleeper Drone Hangar','Clearly built to serve the needs of the Sleepers automated defense drones, this ominous structure functions as one of their central docking points. Despite its age, the facility shows few signs of decay, suggesting that it is perhaps maintained by its residents.',3585,3394,100000,100000000,10000,1,NULL,0,0,NULL,0),(30514,226,'Talocan Wreckage','This appears to be the much-mangled remains of a Talocan vessel. It\'s too damaged to recover anything useful from',3581,3394,100000,100000000,10000,1,NULL,0,0,NULL,0),(30515,226,'Unidentified Wreckage','There\'s no telling what this used to be, now though it\'s definitely scrap',3582,1544,100000,100000000,10000,1,NULL,0,0,NULL,0),(30516,306,'Malfunctioning Sleeper Databank','This databank has clearly been the site of a serious impact, but it remains online. You may be able to extract something with your codebreaker.',3705,858,10000,27500,2700,1,NULL,0,0,NULL,0),(30517,306,'Ejected Sleeper Databank','Ejected Sleeper Databank: This modular structure was long ago subjected to some sort of emergency ejection procedure, but you can detect an intact databank concealed under its heavy plating. You may be able to extract something with your codebreaker.',3704,858,10000,27500,2700,1,NULL,0,0,NULL,0),(30518,306,'Deformed Sleeper Databank','Deformed Sleeper Databank: This section of hull plating once shielded an auxiliary databank on its obverse. The databank has been exposed to space for some time now, but you may still be able to extract something with your codebreaker.',3707,858,10000,27500,2700,1,NULL,0,0,NULL,0),(30519,306,'Obsolete Sleeper Databank','Obsolete Sleeper Databank: This could once have been an airlock. Or an essential component of a ventilation system. Or some kind of stasis pod. Whatever it was, the only thing of value that remains is the databank you can detect concealed within.',3706,858,10000,27500,2700,1,NULL,0,0,NULL,0),(30520,306,'Broken Sleeper Databank','This object was severed from some larger structure in the distant past, perhaps as the result of an asteroid strike. Fortunately, a once-redundant power source has provided just enough energy to keep its databank operable. You may be able to extract something with your codebreaker.',3705,858,10000,27500,2700,1,NULL,0,0,NULL,0),(30521,306,'Spavined Sleeper Databank','This hull plate still has an unobstructed access point for the databank it holds. You may be able to extract something with your codebreaker.',3704,858,10000,27500,2700,1,NULL,0,0,NULL,0),(30522,306,'Forgotten Sleeper Artifact','Your analyzer is picking up something of interest in this piece of twisted wreckage, though you cant for the life of you see what it is.',3707,314,10000,27500,2700,1,NULL,0,0,NULL,0),(30523,306,'Lost Sleeper Artifact','You suspect this battered hunk of metal may conceal some kind of relic.',3706,314,10000,27500,2700,1,NULL,0,0,NULL,0),(30524,306,'Abandoned Sleeper Artifact','This might once have been an important piece of an engine, but now youre not getting anything out of it without the help of an analyzer.',3705,314,10000,27500,2700,1,NULL,0,0,NULL,0),(30525,306,'Sleeper Artifact','You think there might be something concealed here that an analyzer could discover.',3704,314,10000,27500,2700,1,NULL,0,0,NULL,0),(30526,306,'Decrepit Sleeper Artifact','This mangled sheet of hull plating contains something of interest to your analyzer.',3707,314,10000,27500,2700,1,NULL,0,0,NULL,0),(30527,306,'Forlorn Sleeper Artifact','Analysis could yield something valuable.',3706,314,