 Just one of these items holds countless nanoassemblers inside, offering a comprehensive view of the finer details in the Sleeper\'s defensive systems.\n\nPristine, working examples of Sleeper technology such as this are extremely rare and even more valuable. With the right skills and equipment, they can offer great insights into the scientific pursuits of the ancient race that designed them. ',3734,0,0,10,0,1,NULL,0,1,1149,0),(30615,993,'Malfunctioning Armor Nanobot','Recovered from amongst the debris of a Sleeper facility, this ancient device is locked into a slow decline. Just one of these items holds countless nanoassemblers inside, offering a comprehensive view of the finer details in the Sleeper\'s defensive systems. Unfortunately, a great deal of the assemblers inside this one have fused together, causing a terminal chain reaction inside the device.\n\nEven though it is badly damaged, a skilled scientist could still possibly extract enough information to try and reverse engineer it. ',3734,0,0,10,0,1,NULL,0,1,1149,0),(30616,998,'2 Wrecked Shield Relic 2','',1045,0,0,10,0,1,NULL,0,0,NULL,0),(30617,998,'2 Malfunctional Shield Relic 2','',1045,0,0,10,0,1,NULL,0,0,NULL,0),(30618,993,'Wrecked Armor Nanobot','Recovered from amongst the debris of a Sleeper facility, this ancient device is almost entirely shut down. Just one of these items would normally hold countless nanoassemblers inside, offering a comprehensive view of the finer details in the Sleeper\'s defensive systems. Unfortunately, all of the assemblers inside this one have fused together, causing a terminal chain reaction inside the device.\n\nEven though it is only a shell of what it once used to be, with a bit of guesswork and luck, a skilled scientist might still be able to extract enough information to try and reverse engineer it. ',3734,0,0,10,0,1,NULL,0,1,1149,0),(30619,998,'3 Malfunctional Shield Relic 3','',1045,0,0,10,0,1,NULL,0,0,NULL,0),(30620,998,'1 Wrecked Shield Relic 1','',1045,0,0,10,0,1,N