is anyone else. Close enough.\n',2537,0,130,3,0,1,NULL,1000,1,NULL,0),(30717,24,'Frigate Ticket','This ticket gives its bearer 24 hours access to all variations of ship class \"frigate\" within combat simulators.',NULL,0,0,0,0,1,NULL,0,1,NULL,0),(30718,24,'Destroyer Ticket','This ticket gives its bearer 24 hours access to all variations of ship class \"destroyer\" within combat simulators. ',NULL,0,0,0,0,1,NULL,0,1,NULL,0),(30719,283,'Kritsan Parthus','Parthus is an Amarr pirate. Quiet in person, he\'s known both as a wild gambler and a man who can cover his bets. His success in outfitting and executing illegal missions is similar: he takes a lot of risks, but thinks practically and can generally repay his debts.',2536,0,90,1,0,1,NULL,0,0,NULL,0),(30720,306,'Parthus Malfunctioning Capsule','This capsule contains the Amarrian pirate Kritsan Parthus. The internal warp drive of the pod appear to be heavily damaged from the explosion of his ship, leaving him stranded.',73,2,10000,1200,1400,1,NULL,0,0,NULL,0),(30721,24,'Battleship Ticket','This ticket gives its bearer 24 hours access to all variations of ship class \"battleship\" within combat simulators.',NULL,0,0,0,0,1,NULL,0,1,NULL,0),(30722,24,'Cruiser Ticket','This ticket gives its bearer 24 hours access to all variations of ship class \"cruiser\" within combat simulators.',NULL,0,0,0,0,1,NULL,0,1,NULL,0),(30723,24,'Battlecruiser Ticket','This ticket gives its bearer 24 hours access to all variations of ship class \"battlecruiser\" within combat simulators.',NULL,0,0,0,0,1,NULL,0,1,NULL,0),(30725,678,'Civilian Gallente Cruiser Celestis','The Celestis cruiser is a versatile ship which can be employed in a myriad of roles, making it handy for small corporations with a limited number of ships. True to Gallente style the Celestis is especially deadly in close quarters combat due to its advanced targeting systems.\n\nThis ship poses no immediate threat.\n',319,150,11300000,113000,235,1,8,0,0,NULL,0.07),(30726,678,'Civilian Gallente Cruiser Exequror','The Exequror is a heavy cargo cruiser capable of defending itself against raiding frigates, but lacks prowess in heavier combat situations. It is mainly used in relatively peaceful areas where bulk and strength is needed without too much investment involved.\n\nThis ship poses no immediate threat.',320,150,11300000,113000,235,1,8,0,0,NULL,0.07),(30727,678,'Civilian Gallente Cruiser Thorax','The Thorax-class cruiser is the latest combat ship commissioned by the Federation. While the Thorax is a very effective ship at any range, typical of modern Gallente design philosophy it is most effective when working at extreme close range where its blasters and hordes of combat drones tear through even the toughest of enemies.\n\nThis ship poses no immediate threat.\n',63,150,11300000,113000,235,1,8,0,0,NULL,0.07),(30728,678,'Civilian Gallente Cruiser Vexor','The Vexor is a strong combat ship that is also geared to operate in a variety of other roles. The Vexor is especially useful for surveying in potentially hostile sectors as it can stay on duty for a very long time before having to return to base. Furthermore, it is well capable of defending itself against even concentrated attacks.\n\nThis ship poses no immediate threat.\n',62,150,11300000,113000,235,1,8,0,0,NULL,0.07),(30729,673,'Civilian Caldari Cruiser Blackbird','The Blackbird is a small high-tech cruiser newly employed by the Caldari Navy. Commonly seen in fleet battles or acting as wingman, it is not intended for head-on slugfests, but rather delicate tactical situations.\n\nThis ship poses no immediate threat.',311,150,9600000,96000,450,1,1,0,0,NULL,0),(30730,673,'Civilian Caldari Cruiser Caracal','The Caracal is a powerful vessel that specializes in missile deployment. It has excellent shield defenses, but poor armor plating. Its missile arsenal, when fully stocked, is capable of making a piece-meal of almost anyone.\n\nThis ship poses no immediate threat.',42,150,9600000,96000,450,1,1,0,0,NULL,0),(30731,673,'Civilian Caldari Cruiser Moa','The Moa was designed as an all-out combat ship, and its heavy armament allows the Moa to tackle almost anything that floats in space. In contrast to its nemesis the Thorax, the Moa is most effective at long range where its railguns and missile batteries can rain death upon foes.\n\nThis ship poses no immediate threat.',49,150,9600000,96000,450,1,1,0,0,NULL,0),(30732,673,'Civilian Caldari Cruiser Osprey','The Osprey offers excellent versatility and power for its low price. Designed from the top down as a cheap but complete cruiser, the Osprey utilizes the best the Caldari have to offer in state-of-the-art armor alloys, sensor technology and weaponry - all mass manufactured to ensure low price. In the constant struggle to stay ahead of the Gallente, new technology has been implemented in the field of mining laser calibration. A notable improvement in ore yields has been made, especially in the hands of a well trained pilot.\n\nThis ship poses no immediate threat.',41,150,9600000,96000,450,1,1,0,0,NULL,0),(30733,668,'Civilian Amarr Cruiser Arbitrator','The Arbitrator is unusual for Amarr ships in that it\'s primarily a drone carrier. While it is not the best carrier around, it has superior armor that gives it greater durability than most ships in its class.\n\nThis ship poses no immediate threat.',298,150,12000000,120000,450,1,4,0,0,NULL,0),(30734,668,'Civilian Amarr Cruiser Augoror','The Augoror-class cruiser is one of the old warhorses of the Amarr Empire, having seen action in both the Jovian War and the Minmatar Rebellion. It is mainly used by the Amarrians for escort and scouting duties where frigates are deemed too weak. Like most Amarrian vessels, the Augoror depends first and foremost on its resilience and heavy armor to escape unscathed from unfriendly encounters.\n\nThis ship poses no immediate threat.',58,150,12000000,120000,450,1,4,0,0,NULL,0),(30735,668,'Civilian Amarr Cruiser Maller','Quite possibly the toughest cruiser in the galaxy, the Maller is a common sight in Amarrian Imperial Navy operations. It is mainly used for military duty, although a few can be found in the private sector acting as escort ships for very important dispatches.\n\nThis ship poses no immediate threat.',57,150,12000000,120000,450,1,4,0,0,NULL,0),(30736,668,'Civilian Amarr Cruiser Omen','The Omen is a stereotypical example of the Amarrian School of thinking when it comes to ship design: thick armor and hard hitting lasers. Advancements in heat dissipation allow the Omen to fire its lasers faster than other ships without this technology.\n\nThis ship poses no immediate threat.',1065,150,12000000,120000,450,1,4,0,0,NULL,0),(30737,666,'Independent Harbinger','Right from its very appearance on a battlefield, the Harbinger proclaims its status as a massive weapon, a laser burning through the heart of the ungodly. Everything about it exhibits this focused intent, from the lights on its nose and wings that root out the infidels, to the large number of turreted high slots that serve to destroy them. Should any heathens be left alive after the Harbinger\'s initial assault, its drones will take care of them.\n\nThe markings on this ship reveal no obvious connection to the Empire.',3133,198,13500000,130000,350,1,4,0,0,NULL,0.07),(30738,666,'Independent Prophecy','The Prophecy is built on an ancient Amarrian warship design dating back to the earliest days of starship combat. Originally intended as a full-fledged battleship, it was determined after mixed fleet engagements with early prototypes that the Prophecy would be more effective as a slightly smaller, more mobile form of artillery support.\n\nThe markings on this ship reveal no obvious connection to the Empire.',2385,198,13500000,130000,350,1,4,0,0,NULL,0.07),(30739,705,'Civilian Minmatar Cruiser Bellicose','Being a highly versatile class of Minmatar ships, the Bellicose has been used as a combat juggernaut as well as a support ship for wings of frigates. While not quite in the league of newer navy cruisers, the Bellicose is still a very solid ship for most purposes, especially in terms of long range combat.\n\nThis ship poses no immediate threat.',303,150,9900000,99000,120,1,2,0,0,NULL,0.07),(30740,705,'Civilian Minmatar Cruiser Rupture','The Rupture is slow for a Minmatar ship, but it more than makes up for it in power. The Rupture has superior firepower and is used by the Minmatar Republic both to defend space stations and other stationary objects and as part of massive attack formations.\n\nThis ship poses no immediate threat.',302,150,9900000,99000,120,1,2,0,0,NULL,0.07),(30741,705,'Civilian Minmatar Cruiser Scythe','The Scythe-class cruiser is the oldest Minmatar ship still in use. It has seen many battles and is an integrated part in Minmatar tales and heritage. Recent firmware upgrades \"borrowed\" from the Caldari have vastly increased the efficiency of its mining output.\n\nThis ship poses no immediate threat.',304,150,9900000,99000,120,1,2,0,0,NULL,0.07),(30742,705,'Civilian Minmatar Cruiser Stabber','The Stabber is the mainstay of the Minmatar fleet. It is light and extremely fast, yet surprisingly powerful, with a wide variety of weapons. It is one of few Minmatar vessels that have reached popularity outside Minmatar space.\n\nThis ship poses no immediate threat.',47,150,9900000,99000,120,1,2,0,0,NULL,0.07),(30743,595,'Society of Conscious Thought Cruiser','The Society of Conscious Thought applies its cruiser when anticipating hostilities or when carrying precious cargo. Despite their objections to violence, they rather be deadly than dead.',1231,150,10900000,109000,120,1,2,0,0,NULL,0.07),(30744,880,'Neural Network Analyzer','Even millennium old, this bulky piece of equipment shows barely any sign of age. The explosion of the Sleeper drone ferrying it around doesnt seem to have affected it in any way, either. This device was clearly built to last.\n\nA cursory analysis of the software systems within reveals that it operates as some kind of monitoring device. The specialized design suggests it was used to process vast amounts of basic data and identify anomalies.\n\nGiven its age and unique design, there would likely be very few who could make sense of the programming. Those who do recognize the value of such a component, however, would likely be willing to part with a significant sum of ISK to own it. ',3755,0,1,0.1,0,1,NULL,50000,1,1109,0),(30745,880,'Sleeper Data Library','Found amongst the debris of an incapacitated Sleeper drone, this large device appears to be a data archive of some sort. Although the information within remains a complete mystery, it is immediately apparent that it stretches far back into time.\n\nSmall data fragments preceding each file appear to function as time-stamps. If this is indeed what they are, then this Data Library could offer a snapshot of the universe stretching back millennia.\n\nAlthough it is obviously of great value in and of itself, those who have some basic understanding of interpreting the data would undoubtedly pay the most for it, should an opportunistic salvager wish to part with such a rare piece of technology. ',3755,0,1,0.1,0,1,NULL,200000,1,1109,0),(30746,880,'Ancient Coordinates Database','Recovered from the wrecked hull of a Sleeper drone, this database stands as a testament to the lasting power of their ancient technology. Not only has it managed to survive for millennia completely intact, but it has come through the violence of its bearers destruction without even a scratch.\n\nA brief analysis of the technology inside reveals that the database may in fact still be fully functional. The format and layout of the information within suggests it is a list of three-dimensional coordinates, charting a path to some distant place. \n\nAlthough this device could hold incredibly valuable information, there would only be a handful of people in the entire cluster that could make any sense of it. Finding a buyer may not be that easy. ',3755,0,1,0.1,0,1,NULL,1500000,1,1109,0),(30747,880,'Sleeper Drone AI Nexus','Rescued from the ruined hull of a Sleeper drone, this AI Nexus represents the digital soul of these strange creations. Although the technology behind the Sleeper AI is for the most part recognizable, this device offers some insight into the few mysterious aspects that are not.\n\nAs coveted as this component must be, only the foremost drone technicians in all of New Eden would be able to possibly find some use in it. There is little doubt however that the promise such a thing holds would ensure they paid a tidy sum. ',3755,0,1,0.1,0,1,NULL,5000000,1,1109,0),(30752,997,'Intact Hull Section','Found drifting amongst the ruins of a Sleeper compound, these large sections of a Sleeper vessel represent a significant archaeological discovery. Not only is the hull itself an incredibly rare find, but the excellent condition it is in makes this a particularly useful case study for the Sleepers ship construction methods.\n\nPristine, working examples of Sleeper technology such as this are extremely rare and even more valuable. With the right skills and equipment, they can offer great insights into the scientific pursuits of the ancient race that designed them. ',3766,0,0,100,0,1,NULL,0,1,1149,0),(30753,997,'Malfunctioning Hull Section','Found drifting amongst the ruins of a Sleeper compound, these large sections of a Sleeper vessel represent a significant archaeological discovery. The hull itself is an incredibly rare find, tainted only be the condition it is in. Although it was clearly built to survive the stress of space, the countless years of environmental exposure have still taken a heavy toll, stripping from it a great deal of the original functionality.\n\nEven despite the damage, it would still make a respectable case study for the Sleepers vessel construction methods. A skilled scientist could still possibly extract enough information to try and reverse engineer it. ',3766,0,0,100,0,1,NULL,0,1,1149,0),(30754,997,'Wrecked Hull Section','Mistakenly identified by the analyzers as a derelict structure, these ancient Sleeper hull fragments are almost entirely destroyed. Whether slow erosion or some more rapid and violent event devastated the technology remains unclear. It is simply too badly damaged to make an educated guess.\n\nThere isnt much of a chance that anything useful could be reverse engineered from such badly ruined fragments, but there is little doubt that those few lucky researchers who successfully managed it would uncover the secrets to Sleeper hull designs. For many, that opportunity alone would be worth the gamble. ',3766,0,0,100,0,1,NULL,0,1,1149,0),(30755,314,'Strange Datacore','This item, clearly salvaged from one of the wrecked ships, is recognizable as a datacore, but has a foreign interface that doesn\'t quite look like it came from any empire you\'re familiar with.',3233,0,0.75,0.1,0,1,NULL,0,1,NULL,0),(30756,314,'Red','This is the corpse of a man wearing a red shirt. It looks like he was a pretty tough guy just a few hours ago.',2855,0,80,1,0,1,NULL,0,1,NULL,0),(30757,283,'Nebben Centrien, Janitor','Nebben Centrien is in top physical condition, with sharp eyes and a shrewd expression.',2536,0,100,3,0,1,NULL,0,1,NULL,0),(30758,306,'Centrien\'s Shuttle','This vessel is just enough to keep its occupant alive. Looks like the station crew didn\'t want Nebben Centrien fighting back.',2043,47,1450000,16120,145,1,NULL,0,0,NULL,0),(30759,283,'Chef Aubrei Azil','Aubrei Azil is a talented space-faring chef and ship\'s cook.',2536,0,100,3,0,1,NULL,0,1,NULL,0),(30760,306,'Azil\'s Transport','This tiny craft is badly damaged. All propulsion units have been completely disabled.',2135,47,1450000,16120,145,1,1,0,0,NULL,0),(30761,283,'Doctor Luija Elban','Dr. Elban is an extremely competent ship\'s doctor who has recently been having a run of rather bad luck.',2537,0,70,1,0,1,NULL,0,1,NULL,0),(30762,952,'Dead Drop','Dr. Elban\'s kidnappers are expecting you to put a lot of money into this can.',16,14,10000,27500,2700,1,NULL,0,0,NULL,0),(30763,665,'Civilian Amarr Frigate Crucifier','The Crucifier was first designed as an explorer/scout, but the current version employs the electronic equipment originally intended for scientific studies for more offensive purposes. The Crucifier\'s electronic and computer systems take up a large portion of the internal space leaving limited room for cargo or traditional weaponry.\n\nThis ship poses no immediate threat.',1066,50,2820000,24398,235,1,4,0,0,NULL,0.07),(30764,665,'Civilian Amarr Frigate Executioner','The Executioner is another newly commissioned ship of the Amarr Imperial Navy. The Executioner was designed specially to counter the small, fast raider frigates of the Minmatar Republic, thus it is different from most Amarr ships in favoring speed over defenses. With the Executioner, the Amarrians have expanded their tactical capabilities on the battlefield.\n\nThis ship poses no immediate threat.',54,50,2820000,24398,235,1,4,0,0,NULL,0.07),(30765,665,'Civilian Amarr Frigate Inquisitor','The Inquisitor is another example of how the Amarr Imperial Navy has modeled their design to counter specific tactics employed by the other empires. The Inquisitor is a fairly standard Amarr ship in most respects, having good defenses and lacking mobility. It is more Caldari-like than most Amarr ships, however, since its arsenal mostly consists of missile bays.\n\nThis ship poses no immediate threat.',55,50,2820000,24398,235,1,4,0,0,NULL,0.07),(30766,665,'Civilian Amarr Frigate Punisher','The Amarr Imperial Navy has been upgrading many of its ships in recent years and adding new ones. The Punisher is one of the most recent ones and considered by many to be the best Amarr frigate in existence. As witnessed by its heavy armaments, the Punisher is mainly intended for large-scale military operations, acting in coordination with larger military vessels, but it is more than powerful enough for solo operations.\n\nThis ship poses no immediate threat.',300,50,2820000,24398,235,1,4,0,0,NULL,0.07),(30768,314,'A Lot of Money','This is a lot of money.',21,0,10,3,0,1,NULL,0,1,NULL,0),(30769,671,'Civilian Caldari Frigate Condor','The Condor is fast and agile. It has limited cargo space so it\'s not very suitable for trading or mining. It is best used as an assault vessel in a hit-and-run type of operations.\n\nThis ship poses no immediate threat.',39,50,1612000,16120,80,1,1,0,0,NULL,0),(30770,671,'Civilian Caldari Frigate Griffin','The Griffin is much used by the Caldari Navy as a support vessel in combat squadrons, using its impressive array of electronic gadgetry to disrupt the operation of target ships, making them easy prey for traditional combat vessels.\n\nThis ship poses no immediate threat.',40,50,1612000,16120,80,1,1,0,0,NULL,0),(30771,671,'Civilian Caldari Frigate Heron','The Heron has good computer and electronic systems, giving it the option of participating in electronic warfare. But it has relatively poor defenses and limited weaponry, so it\'s more commonly used for scouting and exploration.\n\nThis ship poses no immediate threat.',316,50,1612000,16120,80,1,1,0,0,NULL,0),(30772,671,'Civilian Caldari Frigate Kestrel','The Kestrel is a heavy missile boat with a fairly large cargo space and one of the most sophisticated sensor arrays around. Interestingly enough, it has been used by both the Caldari Navy and several wealthy trade corporations as a cargo-hauling vessel. It is one of few trading vessels with good punching power, making it ideal for solo trade-runs in dangerous areas.\n\nThis ship poses no immediate threat.',313,50,1612000,16120,80,1,1,0,0,NULL,0),(30773,671,'Civilian Caldari Frigate Merlin','The Merlin is the most powerful all-out combat frigate of the Caldari. It is highly valued for its versatility in using both missiles and turrets, while its defenses are exceptionally strong for a Caldari vessel.\n\nThis ship poses no immediate threat.',314,50,1612000,16120,80,1,1,0,0,NULL,0),(30774,283,'Engineer Tahaki Karin','Tahaki Karin is a youngish woman of middling height and build, dressed practically in a mechanic\'s coveralls. Her hands are rough and heavily callused, and she carries some scars that look like they were caused by shrapnel. Her voice is brisk, carrying a clear expectation that her orders will be followed. She looks like she\'s seen a lot recently, and none of it\'s been pleasant.',2537,0,70,1,0,1,NULL,0,1,NULL,0),(30775,306,'The Heartbreak','Engineer Tahaki Karin signed on with this ship not long ago, and now it\'s destroyed. She\'s been having a tough time lately.',3384,47,1450000,16120,145,1,NULL,0,0,NULL,0),(30776,314,'Mizara\'s Doll','This doll is old and well-worn. It still smells faintly of brown sugar.',2992,0,2,1,0,1,NULL,0,1,NULL,0),(30777,952,'Mizara Family Hovel','Even among the remnants of this rundown mining colony, the Mizara family\'s hovel looks particularly impoverished.',2515,379,10000,27500,2700,1,NULL,0,0,NULL,0),(30778,314,'Mysterious Statuette','This ancient, faintly engraved statuette looks like just the kind of thing Canius was after.',2041,0,2,1,0,1,NULL,0,1,NULL,0),(30779,306,'Ancient Tomb Dig Site','Both conservative Amarr and the fanatical Blood Raiders have left this tomb alone out of respect for the honored dead. You think you could get a good pot out of it.',1266,314,10000,27500,2700,1,NULL,0,0,NULL,0),(30780,314,'Strange Coded Document','This document would look like gibberish if it weren\'t for Dagan\'s signature at the bottom. Perhaps Canius can decipher it.',1192,0,0.75,0.1,0,1,NULL,0,1,NULL,0),(30781,306,'Corrupted Drone','This corrupted drone looks safe to approach.',1226,47,1450000,16120,145,1,NULL,0,0,NULL,0),(30782,314,'Corrupted Drone Components','These components were gathered from obviously malfunctioning drones.',1436,0,2,1,0,1,NULL,0,1,NULL,0),(30783,952,'Colonial Supply Depot','The \"Medical Supply Hold\" is down to a few bandages and cobwebs.',2515,379,10000,27500,2700,1,NULL,0,0,NULL,0),(30784,314,'Dr. Castille\'s Data Core (Property of CreoDron)','This data core contains Dr. Aspasia Castille\'s notes on the corrupted drone problem, but it\'s heavily encrypted.',3232,0,0.75,0.1,0,1,NULL,0,1,NULL,0),(30785,306,'Destroyed Ship','It doesn\'t really matter whose ship this was, now. What matters is that Dr. Castille\'s data may be still be inside.',3115,14,10000,27500,2700,1,NULL,0,0,NULL,0),(30786,226,'Storage Warehouse','These huge spacebound facilities are used to stock anything from ammunitions to agricultural supplies.',2706,727,0,0,0,1,NULL,0,0,NULL,0),(30788,270,'Propulsion Subsystem Technology','Understanding of the technology used to create advanced propulsion subsystems.',33,0,0,0.01,0,1,NULL,10000000,1,375,0),(30789,226,'LCO Starbase Auxiliary Power Array','These arrays provide considerable added power output, allowing for an increased number of deployable structures in the starbase\'s field of operation.',2374,459,0,0,0,1,NULL,0,0,NULL,0),(30790,674,'Civilian Caldari Battleship Scorpion','The first Scorpion-class battleship was launched only a couple of years ago, and those that have been built are considered to be prototypes. Little is known of its capabilities, but what has been garnered suggests that the Scorpion is crammed to the brink with sophisticated hi-tech equipment that few can match.\n\nThis ship poses no immediate threat.',50,350,22000000,1080000,235,1,1,0,0,NULL,0.07),(30791,674,'Civilian Caldari Battleship Rokh','Having long suffered the lack of an adequate hybrid platform, the Caldari State\'s capsule pilots found themselves rejoicing as the Rokh\'s design specs were released. A fleet vessel if ever there was one, this far-reaching and durable beast is expected to see a great deal of service on battlefields near and far.\n\nThis ship poses no immediate threat.',3170,350,22000000,1080000,235,1,1,0,0,NULL,0.07),(30792,674,'Civilian Caldari Battleship Raven','The Raven is the powerhouse of the Caldari Navy. With its myriad launcher slots and powerful shields, few ships can rival it in strength or majesty.\n\nThis ship poses no immediate threat.',43,350,22000000,1080000,235,1,1,0,0,NULL,0.07),(30793,952,'Storage Warehouse Container','These huge spacebound facilities are used to stock anything from ammunitions to agricultural supplies.',2706,727,10000,27500,2700,1,NULL,0,0,NULL,0),(30794,314,'Farming Supplies','This huge freight container is loaded with all sorts of agricultural equipment. Almost anything a farm could need has been packed away inside, from seeds and plant samples to tractors and ploughs.',1174,0,50000,150,0,1,NULL,0,1,NULL,0),(30796,226,'Talocan Observation Dome','Large windows and telescoping turrets peer out into the surrounding darkness. The Talocan observation dome always appears to be staring, despite the absence of its original occupants.',3703,731,100000,100000000,10000,1,NULL,0,0,NULL,0),(30797,226,'Talocan Outpost Hub','Though large in design, this structure is sparsely adorned, with only a few antechambers and docking platforms inside. Speculation among historians suggests that this outpost hub was capable of immediate and easy disconnection from the Talocan outpost in case of attack, but there hasn\'t been a scholarly consensus about this.',3534,508,100000,100000000,10000,1,NULL,0,0,NULL,0),(30798,226,'Talocan Outpost Conduit','Narrow tubes and electrical wiring fill the outpost conduit. Equal parts electrical artery and linking structure, the interior of this connecting structure is in disrepair, but its polyferrous hull keeps the ravages of space and time at bay.',3702,1522,100000,100000000,10000,1,NULL,0,0,NULL,0),(30799,226,'Debris - Broken Drive Unit Part 1','This massive hulk of debris seems to have once been a part of the outer hull of a battleship or station.',3704,314,0,0,0,1,NULL,0,0,NULL,0),(30800,226,'Debris - Broken Drive Unit Part 2','This damaged hunk of machinery could once have been a part of a powerplant or relay station.',3705,418,0,0,0,1,NULL,0,0,NULL,0),(30801,226,'Debris - Power Feed','This space debris appears to have served as an external power conduit system on a gigantic vessel.',3707,613,0,0,0,1,NULL,0,0,NULL,0),(30802,226,'Debris - Crumpled Metal','This floating debris appears to have once been a part of an outer hull or armor, ripped apart by an explosion or asteroid impact.',3706,613,0,0,0,1,NULL,0,0,NULL,0),(30804,283,'Lieutenant Kirus','Irai Kirus is a lowly smuggler known to operate in both Amarr and Minmatar space. Interrogating him will likely reveal the name and location of his superior.',2536,0,100,1,0,1,NULL,0,1,NULL,0),(30805,952,'Wolf Burgan\'s Hideout','According to Serpentis intelligence, this outpost is the hiding spot for Wolf Burgan. According to your intelligence, this is where Wolf Burgan loaded an unhealthy amount of explosives.',1712,918,10000,27500,2700,1,NULL,0,0,NULL,0),(30806,319,'Disjointed Talocan Outpost Hub','Though large in design, this structure is sparsely adorned, with only a few antechambers and docking platforms inside. Speculation among historians suggests that this outpost hub was capable of immediate and easy disconnection from the Talocan outpost in case of attack, but there hasn\'t been a scholarly consensus about this. Most of the docking bays have eroded away, and a few walls are on the verge of collapse, leaving the hub in complete disrepair. ',3701,3394,100000,100000000,10000,1,NULL,0,0,NULL,0),(30807,319,'Disjointed Talocan Outpost Conduit','Narrow tubes and electrical wiring fill the outpost conduit. Equal parts electrical artery and linking structure, the interior of this connecting structure is in disrepair and on the verge of complete wreckage. ',3702,1522,100000,100000000,10000,1,NULL,0,0,NULL,0),(30808,319,'Collapsed Talocan Observation Dome','Large windows and telescoping turrets peer out into the surrounding darkness. The windows of this dome are cracked and the roof partially collapsed, but the empty eyes of the Talocan observation dome always appears to be staring, despite the absence of its original occupants. ',3703,731,100000,100000000,10000,1,NULL,0,0,NULL,0),(30809,314,'Wolf Burgans Body Double','This slab of biomass was once a blank slate waiting to be turned into a functioning clone for some capsuleer. With the help of an engineered virus and the sample you provided, the slab is now a DNA-perfect replication of Wolf Burgan. Sure, it only looks like him if you squint really hard, but that is what explosions are for.',398,0,80,1,0,1,NULL,0,1,NULL,0),(30810,314,'Wolf Burgan\'s DNA','The genetic material of Wolf Burgan, taken from a local law enforcement agency. Mercenary life has one major drawback: For every client, theres a victimanother mercenary available to make you their target.',2302,0,80,1,0,1,NULL,0,1,NULL,0),(30811,314,'Drone Tracking Data','An analysis of this data may help to uncover the mysteries of that evasive rogue drone.',2225,0,80,1,0,1,NULL,0,1,NULL,0),(30812,283,'Corin Risia','Corin Risia is a Scope reporter held captive by Mordus Legion. He has information for you  at a price, of course.',2536,0,70,1,0,1,NULL,0,1,NULL,0),(30813,306,'Wrecked Ship','The remains of a once mighty exploration vessel, now reduced to scarred metal and blackened fragments.',1021,4023,10000,27500,2700,1,NULL,0,0,NULL,0),(30814,283,'FR Personnel','Peaceful emissaries of comfort and salvation, the Food Relief personnel are not a threat to anybody. But try telling that to a swarm of rogue drones.',2891,0,70,1,0,1,NULL,0,1,NULL,0),(30815,306,'Habitation Module w/FR Personnel','A defenseless storage facility housing Food Relief workers. Inside the station are loads of supplies and food, as well as personnel workers and a few volunteers.',2515,379,10000,27500,2700,1,NULL,0,0,NULL,0),(30816,314,'Medical Supplies','Does what it says on the tin.',28,0,10,3,0,1,NULL,0,1,NULL,0),(30818,665,'Izia Tabar','Izia Tabar has been wanted by CONCORD for many years, having been charged with countless kidnappings and assaults. He has always managed to evade their raiding parties by maintaining a large security detachment wherever he goes.',300,50,2860000,28600,235,1,4,0,0,NULL,0.07),(30819,817,'Mysterious Drone','The mysterious drone that began this whole affair. Sensors show that the drone is comprised of an carbonaceous alloy not used by any of the empires. It continuously gives off a signal that on audio sounds like a mournful whale song with the chattering of insects.',3536,150,10900000,109000,120,1,NULL,0,0,NULL,0.07),(30820,952,'Generic Cargo Container','',16,14,10000,27500,2700,1,NULL,0,0,NULL,0),(30821,517,'Adani Yusev\'s Raven','A Raven piloted by an agent.',43,250,0,0,0,1,1,0,0,NULL,0),(30822,186,'Amarr Advanced Cruiser Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',3119,14,10000,27500,27500,1,NULL,0,0,NULL,0),(30823,186,'Caldari Advanced Cruiser Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',3120,14,10000,27500,27500,1,NULL,0,0,NULL,0),(30824,186,'Gallente Advanced Cruiser Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',3121,14,10000,27500,27500,1,NULL,0,0,NULL,0),(30825,186,'Minmatar Advanced Cruiser Wreck','The remains of a destroyed ship. Perhaps with the proper equipment something of value could be salvaged from it. ',3122,14,10000,27500,27500,1,NULL,0,0,NULL,0),(30826,526,'Altered Identity Records','These identity records will overwrite the original data in the system.',2038,0,50,1,0,1,NULL,0,1,NULL,0),(30827,283,'Dagan','Dagan lies imprisoned within his pod. Distorted through the glass, you can see impressive, chiseled features contorted in impotent rage. He knows he is at your mercy, and has every reason to fear the \"mercy\" of a capsule pilot.',2546,0,100,1,0,1,NULL,0,1,NULL,0),(30830,517,'Brus Colterne\'s Megathron','A Megathron piloted by an agent.',64,250,0,0,0,1,8,0,0,NULL,0),(30831,988,'Wormhole K162','An unstable wormhole, deep in space. Wormholes of this kind usually collapse after a few days, and can lead to anywhere.',3715,3000,0,0,0,1,NULL,0,0,NULL,0),(30832,538,'Analyzer II','An archaeology system used to analyze and search ancient ruins. ',2857,500,0,5,0,1,NULL,33264,1,714,0.07),(30833,917,'Analyzer II Blueprint','',84,0,0,0.01,0,1,NULL,332640,1,NULL,0),(30834,538,'Codebreaker II','A Hacking system used to override electronic security systems. ',2856,500,0,5,0,1,NULL,33264,1,714,0.07),(30835,917,'Codebreaker II Blueprint','',84,0,0,0.01,0,1,NULL,332640,1,NULL,0),(30836,538,'Salvager II','A specialized scanner used to detect salvagable items in ship wrecks.',3240,500,0,5,0,1,NULL,33264,1,714,0.07),(30837,917,'Salvager II Blueprint','',84,0,0,0.01,0,1,NULL,332640,1,NULL,0),(30838,517,'Kitar Ang\'s Tempest','A Tempest piloted by an agent.',48,250,0,0,0,1,2,0,0,NULL,0),(30839,60,'Civilian Damage Control','Utilizes a combination of containment field emitters and redundancy systems to prevent critical system damage.\n\nGrants a bonus to resistance for shield, armor and hull.\n\nOnly one Damage Control can be activated at a given time.',1034,0,5000,5,0,1,NULL,3464,1,NULL,0.07),(30840,140,'Civilian Damage Control Blueprint','',1034,0,0,0.01,0,1,NULL,50000,1,NULL,0),(30841,517,'Lear Evanus\' Apocalypse','An Apocalypse piloted by an agent.',296,400,0,0,0,1,4,0,0,NULL,0),(30842,31,'Interbus Shuttle','Interbus commissioned Duvolle Laboratories to design them an upgraded shuttlecraft in YC 106. The result was this vessel, which combines compact size with a surprisingly large cargo hold - ideal for the multipurpose transportation that Interbus specializes in.\n\nThe ship remained a closely-guarded Interbus asset for many years, but in YC111 it was made available to select capsuleer pilots as part of an outreach programme intended to rai