nomena may cause strange effects on your ship systems.',1217,1,1,20,0,250,NULL,3068504,1,NULL,0),(30887,517,'Tevis Jak\'s Iteron Mark III','An Iteron piloted by an agent.',326,283,0,0,0,1,8,0,0,NULL,0),(30889,7,'Planet (Shattered)','',202,10000,1e+35,1,0,1,NULL,0,0,NULL,0),(30894,226,'LCO Armageddon','An Armageddon-class battleship.',297,250,0,0,0,1,4,0,0,NULL,0),(30895,226,'LCO Raven','A Raven-class battleship.',43,250,0,0,0,1,1,0,0,NULL,0),(30896,226,'LCO Tempest','A Tempest-class battleship.',48,250,0,0,0,1,2,0,0,NULL,0),(30897,226,'LCO Dominix','A Dominix-class battleship.',318,250,105000000,1010000,600,1,8,0,0,NULL,0),(30898,226,'LCO Wreathe','A Wreathe-class industrial.',310,207,0,0,0,1,2,0,0,NULL,0),(30899,952,'Cargo Wreathe','A Wreathe-class industrial awaiting cargo.',310,207,0,0,500,1,2,0,0,NULL,0),(30900,226,'LCO Drone Structure I','This gigantic superstructure was built by the effort of thousands of rogue drones. While the structure appears to be incomplete, its intended shape remains a mystery to the clueless carbon-based lifeforms.',2407,50752,100000,100000000,10000,1,NULL,0,0,NULL,0),(30901,226,'Sleeper Engineering Station','This is a Sleeper engineering station',3567,7684,100000,100000000,10000,1,NULL,0,0,NULL,0),(30902,226,'Talocan Embarkment Destroyer','This Talocan ship wreckage drifts in space with surprising grace and efficiency. Even completely offline and abandoned, the embarkment destroyer appears to have been created for just this function, or at least for survival across vast stretches of unknown space for extended periods of time. Despite its incapacitated status, the wreckage looks sturdy enough to be rebuilt, perhaps its appearance is merely a ruse, a trap set long ago by a dead civilization. Regardless, caution is recommended.',3531,171,100000,100000000,10000,1,NULL,0,0,NULL,0),(30903,226,'Talocan Disruption Tower','The Talocan disruption tower is the most mysterious of the Talocan structures. Although certainly a part of the Talocan station, its hinges and propulsion systems imply ready removal from stations, but the peaks and points are unlike any current weapon grouping or turret structure. The tower appears as more of a mechanical syringe than a defense turret, but that may be just speculation. Regardless of the theories, the disruption tower is an unsettling relic of the Talocans.',3569,6879,100000,100000000,10000,1,NULL,0,0,NULL,0),(30904,226,'Talocan Engineering Station','This is a Talocan engineering station',3568,6582,100000,100000000,10000,1,NULL,0,0,NULL,0),(30905,226,'Sleeper linkage structure','This is a Sleeper linkage structure',3534,508,100000,100000000,10000,1,NULL,0,0,NULL,0),(30906,526,'Letter of Recommendation','<i>For the eyes of Militia recruitment officers\n\n<p>Sir,\n<br>I do hereby certify and vouchsafe that the bearer of this document is a newly-certified capsuleer of good character and firm dispotion, whom I do rightly judge is a fine and worthy candidate for enrolement into our most esteemed and successful Militia organization.\n\n<p>Further, I have verified that, at time of issuance, the bearer does meet the criteria for Fast Track recruitment, namely that:\n<ul>\n<li>The pilot\'s sign-in account is less than thirty (30) days old\n<li>The pilot\'s standings with our faction are not lower than zero (0)\n<li>The pilot\'s standings with our faction are below the standard nought-point-five (0.5) threshold for recruitment\n</ul>\n\nPlease verify that these details are correct at time of your recipt of this document. If everything is in order then I formally request that you enrol the bearer into the Militia without hesitation or delay, that they might further serve the just righeout cause of our people.</i>',2908,0,0.5,0.1,0,1,NULL,0,1,NULL,0),(30907,314,'Smuggler\'s Warning About Sister Alitura','Good news from Kirus. Remember that Sisters of EVE agent, Alitura, who nearly caught our trail? The boss called in some favors and got her reassigned to Arnon IX in Genesis. The good Sister Alitura may be resourceful, but she\'d need a capsuleer with clearance to all four empires to be any threat, and we know how much the Sisters love capsuleers. ',1192,0,1,1,0,1,NULL,0,1,NULL,0),(30908,715,'Gue Mouey\'s Vindicator','This station is being used as a Syndicate trade hub. It was recently erected as the Syndicates answer to the growing demand for drugs and weapons in this constellation. It also acts as a neutral bargaining ground between Caldari vendors from Kois City and the pirate elements.',1257,28083,0,0,0,1,8,0,0,NULL,0);
